('http://nomisma.org/id/antoninianus', 'Antoninianus', 'The antoninianus (not a contemporary Roman term) was a coin used during the Roman Empire thought to have been valued at 2 denarii. It was initially silver, but was slowly debased to bronze. It is not known what it was called in antiquity.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/argenteus', 'Argenteus', 'The argenteus was a silver coin produced by the Roman Empire from the time of Diocletian\'s coinage reform in AD 294 to ca. AD 310. It was of similar weight and fineness as the denarius of the time of Nero. The coin was produced at a theoretical weight of 1/96th of a Roman pound (about 3 grams), as indicated by the Roman numeral XCVI on the coin\'s reverse.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/arrowhead', 'Arrowhead', 'An ancient denomination of uncretain value in the shape of an Arrowhead', 'http://nomisma.org/ontology#Denomination'),
