('http://nomisma.org/id/aureus', 'Aureus', 'Roman-period gold coin.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/aureus2_ric', 'Aureus²', 'The smaller of two gold denominations minted under Trebonianus Gallus and Volusian.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/aureus3_ric', 'Aureus³', 'Smallest gold denomination specific to Trebonianus Gallus and Volusian.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/aureus1_ric', 'Aureus¹', 'The larger of two gold denominations minted under Trebonianus Gallus and Volusian.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/bes', 'Bes', 'The bes was an Ancient Roman bronze coin produced during the Roman Republic. Valued at two-thirds of an as (8 unciae), it was only produced in 126 BC by C. Cassius in combination with the dodrans, another very rare denomination which was valued at three-fourths of an as.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/biunx', 'Biunx', 'An ancient denomination with the value of 2 onkiai', 'http://nomisma.org/ontology#Denomination'),
