('http://nomisma.org/id/guldiner', 'Guldiner', 'The Guldiner or Guldengroschen was a silver denomination equivalent in value to the golden gulden or florin. It was first minted in Tyrol in 1486, and similar huge silver coins were issued by other authorities (elector of Saxony, dukes of Schlick) soon afterwards. The growing popularity of the Guldengroschen from Joachimsthal (Jáchimov) issued by the Grafen von Schlick as of 1519 introduced the name Joachimstaler (Joachimsthaler) or simply Taler (Thaler) for these huge silver coins, which became much more popular from the mid-16th century onward.', 'http://nomisma.org/ontology#Denomination'),
