('http://nomisma.org/id/solidus_20_siliquae', 'Solidus (20 Siliquae)', 'A Byzantine denomination of a reduced, lightweight solidus of 20 siliquae or carats issued in the 6th and 7th centuries AD. Lit.: Ph. Grierson, Catalogue of the Byzantine coins in the Dumbarton Oaks Collection and in the Whittemore Collection II-2 (1968) pp. 11-17.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/solidus_22_siliquae', 'Solidus (22 Siliquae)', 'A Byzantine denomination of a reduced, lightweight solidus of 22 siliquae or carats issued in the 6th and 7th centuries AD. - Not to be mixed up with the Nomisma Tetateron of 22 siliquae or carats, which was introduced by Nicephrous II (reigned 963-969). Lit.: Ph. Grierson, Catalogue of the Byzantine coins in the Dumbarton Oaks Collection and in the Whittemore Collection II-2 (1968) pp. 11-17.', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/solidus_23_siliquae', 'Solidus (23 Siliquae)', 'A Byzantine denomination of a reduced, lightweight solidus of 23 siliquae or carats issued in the 6th and 7th centuries AD. Lit.: Ph. Grierson, Catalogue of the Byzantine coins in the Dumbarton Oaks Collection and in the Whittemore Collection II-2 (1968) pp. 11-17.', 'http://nomisma.org/ontology#Denomination'),
