('http://nomisma.org/id/trihemidrachm', 'Trihemidrachm', 'An ancient denomination with the value of 1 1/2 drachms', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/trihemiobol', 'Trihemiobol', 'An ancient denomination with the value of 1 1/2 obols', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/three-eighths-obol', 'Trihemitetartemorion', 'An ancient denomination with the value of 3/8 obol', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/triobol', 'Triobol', 'An ancient denomination with the value of 3 obols', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/3-shekel', 'Triple shekel', 'An ancient denomination with the value of 3 shekels', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/3-siglos', 'Triple siglos', 'An ancient denomination with the value of 3 sigloi', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/tristater', 'Tristater', 'An ancient denomination with the value of 3 staters', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/threequarter-obol', 'Tritartemorion', 'An ancient denomination with the value of 3/4 obol', 'http://nomisma.org/ontology#Denomination');
INSERT INTO `coins` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/third-stater', 'Trite', 'An ancient denomination with the value of 1/3 stater', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/uncia', 'Uncia', 'An ancient denomination with the value of 1 uncia', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/unit', 'Unit', 'An ancient denomination with the value of 1 unit', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/victoriatus', 'Victoriatus', 'An ancient denomination of uncertain value that derives its name from the reverse type', 'http://nomisma.org/ontology#Denomination'),
('http://nomisma.org/id/zuz', 'Zuz', 'A Zuz (Hebrew-זוז; plural zuzzim Hebrew-זוזים) was an ancient Jewish silver coin struck during the Bar Kochba revolt, as well as a Jewish name for the various types of non-Jewish small silver coinage, used before and after the period of the revolt. The name was used from the Greek era of drachmas, through the Roman era of Denarius, and then as the quarter denomination of Bar Kochba coinage. The Jewish insurrectionists\' zuz were overstruck on Roman Imperial denarii or Roman provincial drachmas of Vespasian, Titus, Domitian, Trajan and Hadrian. Four Zuz, denarii or drachmas make a Shekel, a Sela or a Tetradrachm.', 'http://nomisma.org/ontology#Denomination');
INSERT INTO `coin_collection` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/uni_konstanz', ' The Digital Coin Cabinet of University of Konstanz', 'Since 2009 the University of Konstanz houses a small collection of ancient coins, all donated by private sponsors. The focus lies on coins from late antiquity, but some of the ca. 150 objects derive from the early and higher Roman Empire as well. The collection is used for teaching purposes in particular.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/ans', 'American Numismatic Society', 'The American Numismatic Society, located in New York City, is a museum and research institute devoted to the study of coins from all periods and cultures.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/archaeological_museum_wwu', 'Archäologisches Museum der Westfälischen Wilhelms-Universität', 'The coin collection of the Archaelogical Museum of Münster University consists of more than 5,500 objects covering all historical periods in antiquity: Greek coins (of the archaic, classical and hellenistic periods), coins of the Roman Republic and empire, Civic and provincial coins of the Imperial period, and Byzantine ones.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/ashmolean', 'Ashmolean Museum', 'The Ashmolean is the University of Oxford’s museum of art and archaeology, founded in 1683. The Numismatic collections are kept in the Heberden Coin Room, which houses a systematic and comprehensive collection of some three hundred thousand coins and medals with particular strengths in the fields of Greek, Roman, Celtic, Byzantine, Medieval, Islamic, Indian, and Chinese coinages. It also holds collections of paper money, tokens, jetons, and commemorative and art medals.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/rutgers', 'Badian Collection, Rutgers University', 'Since 2001, the Special Collections and Archives department of the Rutgers University Libraries has been the home to a significant Roman numismatic collection, the Ernst Badian Collection of Roman Republican Coins. This collection was created by the late Professor Ernst Badian (d. 2011), who donated it to Rutgers. The collection is composed at this time of more than 1200 coins, documenting the emergence of coinage and a money economy in Rome and developments down through the late Republic (280 to 31 B. C. E.). The collection begins with examples of cast bronze coinage, used in the earliest stages of monetization.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/bnf', 'Bibliothèque nationale de France', 'The Bibliothèque nationale de France is the National Library of France, located in Paris. It is the national repository of all that is published in France. It holds one of the most significant numismatic collections.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/bm', 'British Museum', 'The British Museum is a museum in London dedicated to human history and culture.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/ucd', 'Classical Museum, University College Dublin', 'The UCD Classical Museum is based in Dublin and holds a small teaching and research collection of Classical antiquities.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/hau_museum_braunschweig', 'Coin Cabinet, Herzog Anton Ulrich-Museum', 'The Herzog Anton Ulrich-Museum (Braunschweig, State of Lower Saxony, Germany) holds a collection of about 30.000 coins and medals, ranging from antiquity to the modern era. The collection was founded by the dukes of the house Brunswick-Wolfenbüttel with a focus on ancient coins as well as coins and medals of the Guelphs (particularly outstanding is the collection of Northern and Central German bracteates). In the 19th and 20th centuries the collection was expanded by the acquisition of important collections and treasure troves. Paul Jonas Meier bought a substantial collection of French and German Art Nouveau plaques and medals for the museum in the first quarter of the 20th century. Over the centuries, the coin cabinet came about to harbor a universal collection of German, European and non-European coins, among them ca 2.000 Greek and 2.500 Roman coins.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/rub_bochum', 'Coin Collection of Ruhr-Universität Bochum', 'The Numismatic Collection of History Institute of the Faculty of History of the Ruhr-University Bochum consists of more than 3,400 objects covering the whole of Antiquity, from the Archaic Age of Greece to the Byzantine period. In addition, it includes a small Late Mediaeval hoard, which was discovered in Querenburg in 1966 in the course of the construction of the University.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-tuebingen', 'Coin Collection of the Institute of Classical Archaeology at the University of Tübingen', 'With over 20,000 objects, the coin collection of the Institute of Classical Archaeology at the University of Tübingen is among the largest university collections of ancient coins in Germany; it is also one of the oldest, its history spanning more than 220 years. Today, the collection contains c. 8,000 Greek, 7,000 Roman, 2,000 Modern coins, and more than 3,000 medals and various other numismatic objects. The collection is made up by three major bequests: Tux (1798), von Schäffer (1888), and Hommel (1975). As such, it mirrors the history of coin collecting from the late Baroque period to the twentieth century. The most prestigious items of the collection are on permanent display at the Museum of the University of Tübingen MUT Alte Kulturen.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni_eichstaett', 'Coin Collection of the Professorship for Ancient History at the University of Eichstaett-Ingolstadt', 'The coin collection of the chair of ancient history at the Catholic University of Eichstaett-Ingolstadt was founded in the mid-eighties. \nSince its establishment, the collection has been gradually expanded and missing pieces have been acquired, so that there are now 353 coins in total, that cover the range from classical Greece up to late antiquity and byzantine times.\n\nThe collection contains mostly roman coins, although there are both Greek and Hellenistic coins, as well as mintages from the periphery of the Roman Empire, like Parthian and Celtic coins. The focus lies on Roman Imperial coinage, which make up the largest part of the collection, and is framed by smaller assemblages from Roman Republican times and late antiquity.\n\nBecause of the lack of a proper edition, since 2013, the Eichstaett coin collection became a big part of everyday teaching at the university and contributed to various student- and research-projects, that helped systematise, edit and even exhibit several of these coins.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/goethe_uni_frankfurt_arch_wiss', 'Coin Collections of the Goethe University, Frankfurt am Main', 'The coin collections of the Goethe University are located in the Institute for Archaeological Sciences, and reside partly in the Antiquities Collection of Abteilung I (Classical Archaology) and partly in the collections of Abteilung II (Archaeology and History of the Roman Provinces and the Archaeology of Coins, Money and the Economy in the Ancient World).\n\nThe Antiquities Collection of the Goethe University, based at the Classical Archaeology Department of the Institute for Archaeological Sciences includes around 250 ancient coins alongside a rich collection of ancient vases, glass, lamps, terracottas and other objects. Roman coins form the focus of the coin collection, supplemented by a small number of Greek, Jewish, medieval and modern coins. The coins are regularly used in teaching as study objects, especially for iconographic questions, but also for numismatic identification exercises.\n\nThe largest part of the numismatic collections of Department II of the Institute for Archaeological Sciences at the Goethe University Frankfurt pertains to around 30,000 plaster cast of ancient coins, encompassing all periods of antiquity. The casts were originally made as research tools for scholars such as Konrad Kraft, Richard Delbrueck and Susanne Grunauer-von Hoerschelmann. A particular strength of the plaster cast collection is lies in the Roman Provincial Coinage. The department also owns two collections of original coins: a teaching collection of around 75 pieces, and a special collection of roman coins with countermarks, encompassing around 300 pieces.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/archaeological_museum_mlu_halle', 'Coin collection of the Archaeological Museum of the Martin-Luther-Universität Halle-Wittenberg', 'In 1841, the United Friedrichs-University Halle-Wittenberg decided to set up an archaeological University collection. However, this project could not be implemented until 1849. In this year the first quite small archaeological gallery was opened as the first public art collection in Halle. The core of this museum was the \"Münzkabinett\" formed by Johann Heinrich Schulze (1687-1744), which already provided access to original coins for lectures and exercises on ancient numismatics during his life-time. By doing this Schulze became a founder of numismatic teaching at University. This core collection, the \"Numophylacium Schulzianum\", can thus be linked to the development of the European Enlightenment in the 18th century in Halle, and it still is preserved here today. Almost half of today’s inventory of c. 5.000 coins (a total of c. 1.400 Greek, some Byzantine, and Oriental coins, the remaining two thirds are Roman) originates from Schulze’s collection.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/fau_erlangen', 'Coin collections of the Friedrich-Alexander-Universität Erlangen-Nürnberg (FAU)', 'The Friedrich-Alexander-University Erlangen-Nürnberg (FAU) owns roughly 30.000 coins and medals, ranging from Greek and Roman specimens to modern currencies. These originate from various sources, such as the collections of Gerlach, Heerdegen, Luthart, Pick, Sinugowitz, Varnhagen, Voit von Salzburg, Will, Zucker, as well as the items of the “Ilse und Ulrich Zwicker Stiftung”. The Will collection, consisting of about 12.000 pieces, and the Zwicker foundation with its approx. 11.000 objects, make roughly two thirds of the whole lot. The eldest collection was composed by Friedrich Voit von Salzburg between 1845 and 1858. The most recent accession, the objects of the “Ilse und Ulrich Zwicker Stiftung”, took place at the beginning of this century. The chronological and regional emphasis of the coins differs by each collection with a particular focus on antiquity, from the Greek and Romans until the end of the Byzantine times.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/kunstmuseum_moritzburg', 'Cultural Foundation of Saxony-Anhalt - Moritzburg Art Museum Halle (Saale)', 'The Moritzburg Art Museum Halle (Saale) was founded 1885 and is located in the Moritzburg, a castle of the early 16th century. The spectacular extension (opened in 2008) in the once ruined west and north wings becomes visible only at second glance and particularly in the exhibition rooms themselves. The art museum of the federal state of Saxony-Anhalt shows works from its own collections, predominantly from the Middle Ages to the baroque period, classical modernism, which forms the main focus, and the contemporary period. The collections of paintings ans sculptures, graphics an fotography, arts and crafts design and of the state coin collection include around 250,000 objects. The foundations of the numismatic collection are, in addition to acquisitions of contemporary medals made after 1900, above all the foundations of district court counsel Buchholz and merchant Heynemann made in 1910 and 1923. In 1950, the „State Coin Collection of Saxony-Anhalt“ was founded programmatically with these stocks, which at that time also the care of the local coin hoards and the scientific advice for the museums of the country was transferred. The Cabinet now has a collection of about 120,000 coins, medals and banknotes. The main topics are the medieval and modern coinage of the Central German countrys, the modern German medal art and the paper money of the 20th century. The universal collection includes objects from antiquity to the present from all continents and cultures.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/institute_numismatics_vienna', 'Department of Numismatics and Monetary History at the University of Vienna', 'The Department of Numismatics and Monetary History at the University of Vienna is the only autonomous university department of this orientation in Europe. At the same time, it is the only place where it is possible to study the subject of numismatics and monetary history in its full methodological and technical variety, covering all eras from antiquity to the modern period. Due to its expertise on coins, medals, monetary symbols and monetary equivalents covering all periods and cultures, as well as the associated political, economic, social and cultural questions, the field of numismatics and monetary history is firmly established in numerous key research areas of the Faculty. Furthermore, it significantly contributes to the basic research profile of the University of Vienna, especially in the fields of classical studies and medieval research. The range of courses extends from extension curricula for students in bachelor’s programmes to a doctoral programme in numismatics. The Department offers around 30 hours of numismatic teaching per week, and provides various networking opportunities, as well as useful complimentary courses for almost all degree programmes.\n\n \n\nThrough its extensive study collection, specialised library, catalogue collection and the “Numismatische Zentralkartei” (NZK, numismatic central catalogue) – including around 1.5 million coins documented in photographs - the Department offers working opportunities that are unique in the world and that international academics regularly make use of. The Department has an extensive national and international network with all institutions working in the field of numismatics – not least through its graduates. In many ways, the Department’s influence extends beyond the University and academia. The Department regularly offers summer schools that are targeted at international early stage researchers.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/heidelberg_zaw', 'Digitales Münzkabinett der Universität Heidelberg', 'The Seminar für Alte Geschichte und Epigraphik of Heidelberg University together with the Institut Klassische Archäologie holds a collection of more than 4,000 Greek and Roman coins. The collection dates back to Georg Friedrich Kreutzer (1771-1858) and grew with later purchases and donations. From the beginning, the collection was conceived to be used for teaching purposes, highlighting the history of coinage from its origins in ancient Greece down to Late Antiquity.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/egyptian_national_library', 'Egyptian National Library and Archives', 'The Egyptian National Library and Archives in Cairo is the largest library in Egypt.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/fitzwilliam', 'Fitzwilliam Museum', 'The Fitzwilliam Museum is the art and antiquities museum of the University of Cambridge, located on Trumpington Street opposite Fitzwilliam Street in central Cambridge, England.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/furman_university', 'Furman University Ancient Coins', 'Ancient Roman coins from the Richard Prior coin collection in the Furman University Special Collections and Archives.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/harvard', 'Harvard Art Museums', 'The Harvard Art Museums is part of Harvard University and comprise three museums: the Fogg Museum (established in 1895), the Busch-Reisinger Museum (established in 1903), and the Arthur M. Sackler Museum (established in 1985) and four research centers: the Archaeological Exploration of Sardis (founded in 1958), the Center for the Technical Study of Modern Art (founded in 2002), the Harvard Art Museums Archives, and the Straus Center for Conservation and Technical Studies (founded in 1928). The three museums that comprise the Harvard Art Museums were initially integrated into a single institution under the name Harvard University Art Museums in 1983. University was dropped from the institutional name in 2008.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/leeds_university_library', 'Leeds University Library', 'The University of Leeds coin collection, held in the University Library Special Collections in the Brotherton Library, consists of approximately 20,000 coins. While particularly strong in Roman coins, the collection also includes: Greek, East Asian, Medieval, and Modern examples.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/wuerzburg_university_museum', 'Martin von Wagner Museum der Universität Würzburg', 'The Coin cabinet in the Martin von Wagner Museum (Würzburg University Museum). The Julius-Maximilians-University of Würzburg (JMU) holds about 1.200 coins, medals and para-numismatic objects from the 7th BCE to modern times with a focus on Greek and Roman coins. Due to the near complete destruction in World War II the coin cabinet in the Martin von Wagner Museum (MvW) is mainly build by donations after 1945 and by a few selected acquisitions. The most important of those donations is the Coll. H. Wellhöfer – c. 400 classical Greek coins with an emphasis on iconography and aesthetics.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/metmuseum', 'Metropolitan Museum of Art', 'The Metropolitan Museum of Art, colloquially \"the Met\", is located in New York City and is the largest art museum in the United States, and is among the most visited art museums in the world.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mall', 'Museu Arqueològic de Llíria', 'The Archaeological Museum of Lliria, containing pre-Roman through Medieval artifacts of region, was founded in 1997.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mpv', 'Museu de Prehistòria de València', 'The Prehistory Museum of Valencia is a museum of the city of Valencia (Spain) that exposes archaeological materials covering from Paleolithic to the Visigoths period.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mfa_boston', 'Museum of Fine Arts, Boston', 'The Museum of Fine Arts in Boston, Massachusetts, is the fifth largest museum in the United States. It contains more than 450,000 works of art, making it one of the most comprehensive collections in the Americas.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mk_berlin', 'Münzkabinett Berlin', 'The Münzkabinett of the Staatliche Museen zu Berlin is one of the largest Numismatic Collections in the world. The area covered by its holdings reaches from the beginning of coinage in the 7th century B.C. to 21st century Euros, its geographical scope from Finland to South Africa, from Berlin to Buenos Aires. In addition to more than 500,000 items (coins, medals, notes, tokens) the Cabinet also holds sealings, dies, and historical minting tools. The Numismatic Collection equally is maintaining its exhibitions duties and, being an archive of money, its role as a centre of numismatic research and study.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mk_wien', 'Münzkabinett Wien', 'The Münzkabinett of the Kunsthistorisches Museum Wien (Vienna in Austria) owns over half a million objects which make it one of the largest collections of its kind, and it can be traced back until the 16th century. It holds coins, medals and banknotes, but also coin dies, bonds and primitive money. Not only does the collection house unique rarities and priceless treasures, its abundance and completeness make it an essential tool for fundamental research in Numismatics and History.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/hhu-dusseldorf', 'Münzkabinett der Heinrich-Heine-Universität Düsseldorf', 'The Heinrich-Heine-Universität Düsseldorf (capital of the National State of North Rhine-Westfalia) holds one of the biggest and most comprehensive numismatic collections of ancient coins and medallions at University level in Germany. The core of the collection is represented by some 8,000 coins supplemented by considerable holdings of casts of coins from Asia minor of the Hellenistic (Greek) and Roman Imperial periods.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mk_goettingen', 'Münzkabinett der Universität Göttingen', 'The Coin Cabinet of Göttingen University was founded in 1763. Today, it comprises about 5,900 Greek, 9,600 Roman, 1,000 Byzantine, 4,000 Oriental, 2,100 Medieval and 15,600 Modern Coins, as well as about 1,700 medals, plaques and tokens, as well as 100 lead marks.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/univ_freiburg', 'Münzsammlung des Seminars für Alte Geschichte der Albert-Ludwigs-Universität', 'The Seminar of Ancient History holds more than 12,000 coins of the Roman Imperial period and Late Antiquity. Their majority originates from a collection which Herbert Nesselhaus, the former Professor of Ancient History, was able to purchase in 1961 from the Archbishopric of Freiburg. The collection had found a temporary home there some twenty years earlier: Between 1900 and 1926 the Geheimer Oberbaurat Heinrich Wefels from Erlangen built a collection of c. 14,000 coins, which he had acquired at various auctions. About 10,300 are coins of Roman emperors and an additional 2,400 represent provincial issues. Wefels focussed on the Imperial period, but did add both earlier and later coinages, too. About 950 Byzantine coins, 360 Roman Republican ones, 220 Greek issues, and 22 Celic coins bear witness to these secondary areas of interest. Although the Seminar für Alte Geschichte is not any longer able to purchase additional coins, its collection was augmented through generous donations by Herbert A. Cahn, Otto Feld and Gerold Walser. Today the collection is complemented by a scientific numismatic library, which again originates in the collector Heinrich Wefels.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-marburg', 'Numismatic Collection of the Archaeological Seminar of the Philipps-Universität Marburg', 'The collection of coins of the Archaeological Seminary of the Philipps-University Marburg comprises about 1,000 Greek and Roman coins. It is part of the Antikensammlung, which was founded in 1878 by Ludwig von Sybel (1846-1929), Professor of Classical Archeology. A special enrichment to the collection is the donation from 2017 by Hans-Werner Ritter of nearly 300 well-preserved coins from all eras and regions of Ancient Antiquity.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-augsburg', 'Numismatic Collection of the Professorship for Ancient History at the University of Augsburg', 'The Collection - built from 1978 onwards - features more than 2,000 ancient coins, Roman and Jewish, which are also being used for university teaching.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-passau', 'Numismatic Collection of the Professorship for Ancient History at the University of Passau', 'The Numismatic Collection of the Professorship for Ancient History at the University of Passau contains 377 coins, covering nearly the whole of ancient Numismatic History, from the Archaic Age of Greece to Late Antiquity and the Byzantine Age, with a focus on the coins of the Roman emperors. The beginning of the collection is connected with Prof. Dr. H. Wolff, who was holder of the chair for Ancient History from 1980 to 2006. His successor, Prof. Dr. O. Stoll (since 2007), was able to purchase and acquire additional coins, so that the collection reached its contemporary content in 2015. The Professorship is – due to missing financial aid by the university – not able to purchase additional coins.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/stadtmuseum_oldenburg', 'Oldenburg Municipal Museum', 'The Oldenburg Municipal Museum originates from the private collection of Theodor Francksen (1875-1914), an art lover and patron of the OIdenburg Municipal Museum. The Musuem represents his collections in three historical villas and space for special exhibitions. The Museum gives insights in art and cultural history from the 17th to the 20th century and possesses a collection of antiques. It also contains a collection of coins and medals, which focuses mainly on modern times, but includes few roman coins, too.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/mk_munich', 'State Coin Collection of Munich', 'The Staatliche Münzsammlung München is the central numismatic collection of Bavaria. It is located in the Munich residence and houses more than 300,000 coins, banknotes, money notes and medals from antiquity to today.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/landesmuseum-vorgeschichte_halle', 'State Museum of Prehistory Halle', 'The State Museum of Prehistory in Halle is a part of the archaeological conservation service in Saxony-Anhalt and numbers amongst the most eminent archaeological museums in central Europe. The archaeological collection is one of the oldest, most extensive and most important collections in Germany. The finds are composed of legacies of pre-historic and early-historical people of all kinds and from all times: tools, jewelry, weapons, leftovers of food, building materials and skeletal remains. There are also numerous scientific samples, comparative material and replicas. The extensive collection of more than 15 million finds includes numerous pieces of worldwide renown, such as the Nebra Sky Disc, which was included in the UNESCO documentary heritage \"Memory of the World\" in 2013. In addition, the collection includes an extensive, steadily growing collection of coins with currently about 25.000 pieces. Most of the coins are finds from archaeological excavations and prospecting in Saxony-Anhalt. The focus is therefore on coins of the Central German States from the Middle Ages to modern times. Furthermore several hundred Roman and some Celtic coins are in stock.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni_rostock', 'The Academic Coin Cabinet of the Archaeological Collection of Rostock University', 'The Academic Coin Cabinet of the University of Rostock was founded in the year 1794, at the instigation of the outstanding orientalist Oluf Gerhard Tychsen (1734–1815) and the Grand Duke of Mecklenburg-Schwerin, Friedrich Franz II. Thanks to the legacy built by Tychsen, complemented with numerous later acquisitions, Baron Erhard von Nettelbladt (1792–1663), responsible for the Cabinet as the librarian of the University, was able to enlarge the collection from 6’500 to no less than 27’000 entries. Several inventory settlements and many losses caused by World War II resulted in the dissolution of the Coin Cabinet in 1944. Consequently, the section containing the Ancient, Byzantine and Oriental coins, as well as a number of modern coins, were assigned to the corpus of the Archaeological Collection of Rostock University.\nThe Archaeological Collection of Rostock University has its seat at the Heinrich-Schliemann-Institute for Ancient Studies. It can be described as a typical academic research and study collection, mostly used for academic teaching. Moreover, there are permanent exhibition rooms, opened to the public once per week. Apart from the coins, the collection contains archaeological objects of the Egyptian, Greek and Roman periods, as well as a number of plaster casts of Greek and Roman sculptures. In 2008 the collection was significantly increased, as the inventory of the Collection of Antiquities of Greifswald University was added, which by that time was given over as a permanent loan.\nTo date, the collection of coins consists of c. 4’000 Ancient and Byzantine, c. 800 Oriental and c. 4’500 modern coins and medals. In addition, there is a small but rather important collection of fish glue casts taken in the time of Tychsen from a number of Islamic coins. A small part of the coin collection is integrated into the permanent collection open to the public. The coins kept in the deposit are mainly used for academic teaching. They offer the opportunity to learn and practice the methods of numismatics by using original objects. Furthermore, the coins are regularly used in the context of workshops held by the working group ‘School & Museum’.\nUp to date, only the Roman and Byzantine coins have been investigated scientifically. These coins were published by Silke Burmeister in 1999. Since 2019 we are adding, to begin with, the data of c. 900 Greek and Roman coins to the NUMiD database. More will follow.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/britishmuseum.org', 'The British Museum.', '', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni_mainz', 'The Digital Coin Cabinet of  Mainz University', 'In the Coin Collection of Johannes Gutenberg-University, there are collections of two institutions: The department of Ancient History and the Bischöfliches Dom- und Diözesanmuseum Mainz (episcopal museum). It consists of more than 1,000 coins, covering nearly the entire spectrum of ancient numismatics, from Archaic Greek to Late Antiquity and a few examples from the Byzantine period. The particular focus of the Mainz Coin Collection is on the 2nd to 4th century AD. All the coins are also in use for university teaching.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-kiel', 'The Digital Coin Cabinet of Kiel University', 'The Coin collection of Kiel University is kept by two institutions:\nThe Antikensammlung of the University of Kiel holds a collection of circa 1,100 Greek and Roman coins, housed in the Kunsthalle zu Kiel. The collection for the most part originates from donations of the Danish king Christian VIII Friedrich (1786–1848) as well as acquisitions by Peter Wilhelm Forchhammer (1801–1894), professor of Classical Archaeology in Kiel, later supplemented by further purchases and donations. Roman Imperial coinage constitutes the vast majority of the collection, that was conceived to be used for teaching purposes and today is occasionally incorporated into the seminars of Classical Archaeology in Kiel.\nOnly a few years ago, the Institute of Classical Studies at Kiel University (Department of Ancient History) started to compile a small numismatic collection. Currently, it comprises nearly 80 ancient (mainly Roman) coins.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni-mannheim', 'The Digital Coin Cabinet of Mannheim University', 'The Coin Collection of the Chair for Ancient History at Mannheim University goes back to donations by the late Prof Dr Elfriede Höhn and Prof Dr Heinrich Chantraine. The collection consists of 126 ancient, predominantly Roman coins. Thanks to the special interest of Prof Höhn, the collection has a strong emphasis on portraits of imperial women.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uva', 'The Fralin Museum of Art', 'The Fralin Museum of Art of the University of Virginia', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/thuringia_museum', 'Thuringian Museum for Pre- and Early History', 'The Museum of Prehistoric and Early History of Thuringia in Weimar unites a museum with a 1000 m² exhibition space and the Thuringian Provincial Office for the Preservation of Monuments and Archeology under one roof. The collection includes approximately 12,000 coins, mostly archaeological finds from Thuringia. Among them there are 50 Celtic and 500 Roman coins, as well as more than 11,000 coins from the Middle Ages and modern times. These numismatic objects are now being recorded step by step in the project \"Cooperative analysis and usage of object data of numismatic collections\" (KENOM <http://www.kenom.de/>.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/uni_graz', 'University of Graz', 'The Institute of Ancient History and Classical Antiquities at the University of Graz houses a collection of nearly 4000 antique coins.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/vmfa', 'Virginia Museum of Fine Arts', 'The Virginia Museum of Fine Arts is a public art museum located in Richmond, Virginia.', 'http://nomisma.org/ontology#Collection'),
('http://nomisma.org/id/yale', 'Yale', 'The numismatic collection of Yale University. It is currently part of the Yale Art Galleries, though previously it was housed in the library. Yale University Art Gallery P.O. Box 208271 New Haven, CT 06520-8271', 'http://nomisma.org/ontology#Collection');
INSERT INTO `coin_material` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/al', 'Aluminum', 'Aluminum is a chemical element in the boron group with symbol Al and atomic number 13.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/billon', 'Billon', 'Billon is any copper alloy with only a small amount of precious metal mixed in.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/bone', 'Bone', 'A bone is a rigid organ that constitutes part of the vertebral skeleton.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/brass', 'Brass', 'Brass is an alloy made of copper and zinc; the proportions of zinc and copper can be varied to create a range of brasses with varying properties.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/ae', 'Bronze', '\'AE\' is the numismatic abbreviation for bronze or any copper alloy.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/clay', 'Clay', 'Clay is a fine-grained natural rock or soil material that combines one or more clay minerals with traces of metal oxides and organic matter.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/cu', 'Copper', '\'CU\' is the numismatic abbreviation for unalloyed (or nearly so) copper.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/cupro-nickel', 'Cupro-nickel', 'An alloy of copper and nickel.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/el', 'Electrum', '\'EL\' is the numismatic abbreviation for Electrum, the alloy of gold and silver.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/enamel', 'Enamel', 'A material made by fusing powdered glass to a substrate by firing, usually between 750 and 850 °C (1,380 and 1,560 °F).', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/fiber', 'Fiber', 'A composite of materials, often organic.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/glass', 'Glass', 'Glass is an amorphous solid (non-crystalline) material that exhibits a glass transition, which is the reversible transition in amorphous materials (or in amorphous regions within semicrystalline materials) from a hard and relatively brittle state into a molten or rubber-like state.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/av', 'Gold', '\'AV\' is the numismatic abbreviation for gold.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/fe', 'Iron', '\'FE\' is the abbreviation for iron objects.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/ivory', 'Ivory', 'Ivory is a hard, white material from the tusks (traditionally elephant\'s) and teeth of animals, that can be used in art or manufacturing.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/pb', 'Lead', '\'PB\' is the numismatic abbreviation for lead.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/marble', 'Marble', 'Marble is a metamorphic rock that may be foliated or non-foliated, composed of recrystallized carbonate minerals, most commonly calcite or dolomite.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/ni', 'Nickel', 'Nickel is a common physical component of coinage.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/orichalcum', 'Orichalcum', 'In numismatics, \'orichalcum\' is used for the copper-zinc alloy (brass) used to produce Roman imperial Sestertii and Dupondii.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/palombino_marble', 'Palombino Marble', 'A type of white marble.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/paper', 'Paper', 'Paper is a thin material produced by pressing together moist fibers, typically cellulose pulp derived from wood, rags or grasses, and drying them into flexible sheets.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/pewter', 'Pewter', 'Pewter is a malleable metal alloy, traditionally 85–99% tin, with the remainder consisting of copper, antimony, bismuth and sometimes, less commonly today, lead. Silver is also sometimes used.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/potin', 'Potin', 'In numismatics, \'potin\' is usually any alloy of copper with a high tin content, incorrectly used to indicate the material of debased Roman imperial bronzes struck the 3rd century AD and later.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/ar', 'Silver', '\'AR\' is the numismatic abbreviation for silver.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/steel', 'Steel', 'Steel is an alloy of iron and carbon that is widely used in construction and other applications because of its hardness and tensile strength.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/terracotta', 'Terracotta', 'A clay-based unglazed or glazed ceramic, where the fired body is porous.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/sn', 'Tin', 'Tin is a common material component of coins.', 'http://nomisma.org/ontology#Material'),
('http://nomisma.org/id/zn', 'Zinc', 'Zinc is a common material component of coinage.', 'http://nomisma.org/ontology#Material');
INSERT INTO `coin_mint` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/antioch_persian_gulf_sco', '\"Antioch on the Persian Gulf\"', '\"Antioch on the Persian Gulf\" is the name given by Otto Mørkholm to an uncertain eastern mint. He identified this mint as the Seleucid refoundation of Alexandria on the Erythrean Sea (the later Charax Spasinou), but it is unclear that this attribution is correct. The attribution was retained in parentheses in Seleucid Coins, Part 2. The coins of this mint seem to have exclusively Susian provenances.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/rose_mint_sco', '\"Rose\" Mint', '\"Rose\" Mint, perhaps Edessa', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/sardes_sco', '\"Sardes\"', '\"Sardes\" (a Phrygian Mint, probably Laodicea on the Lycus)', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/DI_wreath_sco', '\"Wreath Mint\"', '\"Wreath\" Mint\" (Formerly the Delta-iota Mint), probably Damascus', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/campani', '\'Campani\'', 'The mint at an uncertain location used by the Campanian mercenaries of Dionysius I in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/kasolaba', '\'Kasolaba\'', 'Mint at an uncertain location in Caria, tentatively identified as Kasolaba by K. Konuk, ‘Kasolaba, a New Mint in Karia?’ in S. Drougou, D. Eugenidou, and Ch Β Κritzas (eds), Κερμάτια Φιλίας : τιμητικός τόμος για τον Ιωάννη Τουράτσογλου 2009, pp. 177-83', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/aluntium', '(H)aluntium', 'The mint at the ancient site of (H)aluntium in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/aachen', 'Aachen', 'The mint(s) at the City of Aachen, North Rhine-Westphalia (German: Nordrhein-Westfalen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/aarau', 'Aarau', 'The mint of Aarau, capital of the Swiss Canton Aargau. It produced coins for the Canton Aargau from 1807 until 1819. Later Aargau coins were produced by the mint of Bern.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/abacaenum', 'Abacaenum', 'The ancient mint of Abacaenum in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/abariltur', 'Abariltur', 'The mint at the ancient site of Abariltur in Hispania.', 'http://nomisma.org/ontology#Mint'),
