('http://nomisma.org/id/acharaca', 'Acharaca', 'Coins have been tentatively attributed to the mint Acharaca in Lydia, but the attribution seems unlikely. Seen HN, 1st ed., p. 547.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/achilleion', 'Achilleion', 'The mint formerly attributed to the ancient site of Achilleion in Troas. It now seems unlikely that coinage was produced there. See Ellis-Evans, REA 119 (2017), pp. 25-47.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/achulla', 'Achulla', 'The mint at the ancient site of Achulla in Byzacene.', 'http://nomisma.org/ontology#Mint'),
