('http://nomisma.org/id/acrasus', 'Acrasus', 'The mint at the ancient site of Acrasus in Lydia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/acre', 'Acre', 'Acre (/ˈɑːkər/ or /ˈeɪkər/, Hebrew: עַכּוֹ, ʻAkko, most commonly spelled as Akko; Arabic: عكّا‎, ʻAkkā, Ancient Greek,Akre, Ἄκρη) is a city in the northern coastal plain region of northern Israel at the northern extremity of Haifa Bay. The city occupies an important location, as it sits on the coast of the Mediterranean, traditionally linking the waterways and commercial activity with the Levant.[2] Acre is one of the oldest continuously inhabited sites in the world.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/adada', 'Adada', 'The mint at the ancient site of Adada in Pisidia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/adana', 'Adana', 'The mint at the ancient site of Adana in Cilicia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/aden', 'Aden', 'Aden (UK /ˈeɪdən/ ay-duhn, US /ˈɑːdɛn/ ah-den; Arabic: عدن‎ ʻAdin/ʻAdan  Yemeni pronunciation: [ˈʕæden, ˈʕædæn]) is a seaport city in Yemen, located by the eastern approach to the Red Sea (the Gulf of Aden), some 170 kilometres (110 mi) east of Bab-el-Mandeb. Aden\'s ancient, natural harbour lies in the crater of a dormant volcano which now forms a peninsula, joined to the mainland by a low isthmus.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/adharbayjan_umayyad', 'Adharbayjan (Umayyad)', 'Ardabil  pronunciation (help·info) (Persian اردبیل, also Romanized as Ardabīl and Ardebīl[1]) is a historical city in north-western Iran. The name Ardabil comes from the Zoroastrian name of \"Artawila\", which means a holy place.[2] Ardabil is the center of Ardabil Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/adraa', 'Adraa', 'The mint at the ancient site of Adraa in Arabia.', 'http://nomisma.org/ontology#Mint'),
