('http://nomisma.org/id/aghranatah', 'Aghranatah', 'Granada (/ɡrəˈnɑːdə/, Spanish: [ɡɾaˈnaða])[1] is a city and the capital of the province of Granada, in the autonomous community of Andalusia, Spain. Granada is located at the foot of the Sierra Nevada mountains, at the confluence of four rivers, the Beiro, the Darro, the Genil and the Monachil.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/agra', 'Agra', 'Agra (Listeni/ˈɑːɡrə/; Āgrā) is a city on the banks of the river Yamuna in the northern state of Uttar Pradesh, India.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/agrigentum', 'Agrigentum', 'The mint at the ancient site of Agrigentum in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/agrippia-caesarea_phanagoria', 'Agrippia Caesarea (Phanagoria)', 'The mint at the ancient site of Agrippia Caesarea (Phanagoria) in Bosporus.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/agyrium', 'Agyrium', 'The mint at the ancient site of Agyrium in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ahmadabad', 'Ahmadabad', 'Ahmedabad also known as Amdavad (i/ˈɑːmɨdəbɑːd/', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ahwaz', 'Ahwaz', 'Ahvaz (Persian: اهواز Ahvāz‎) is a city in the south of Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ai_khanoum', 'Ai Khanoum', 'The mint at the ancient site of Ai Khanoum in Bactria, possibly to be identified with Alexandria on the Oxus.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/aipora', 'Aipora', 'The mint at the ancient site of Aipora in Hispania Ulterior.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-abbasiyah', 'Al-Abbasiyah', 'earfly Abbasid site in North Africa', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mu\'izziyah_al-qahirah', 'Al-Mu\'izziyah al-Qahirah', 'Located near the Nile Delta, it was founded in AD 969. Nicknamed \"the city of a thousand minarets\" for its preponderance of Islamic architecture, Cairo has long been a center of the region\'s political and cultural life. Cairo was founded by Jawhar al-Siqilli \"The Sicilian\",among the Fatimid dynasty in the 10th century CE, but the land composing the present-day city was the site of national capitals whose remnants remain visible in parts ofOld Cairo. Cairo is also associated with Ancient Egypt as it is close to the ancient cities of Memphis, Giza andFustat which are near the Great Sphinx and the pyramids of Giza.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alabanda', 'Alabanda', 'The mint at the ancient site of Alabanda in Caria.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alaesa', 'Alaesa', 'The mint at the ancient site of Alaesa in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alassa', 'Alassa', 'The mint at the ancient site of Alassa in Crete', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alaun', 'Alaun', 'The mint at the ancient site of Alaun in Hispania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alba', 'Alba', 'The mint at the ancient site of Alba in Hispania', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alba_fucens', 'Alba Fucens', 'The mint at the ancient site of Alba Fucens in Latium.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alea', 'Alea', 'The mint at the ancient site of Alea in Arcadia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alexandreia_troas', 'Alexandreia Troas', 'The mint at the ancient site of Alexandreia in Troas.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/alexandreia_ad_issum', 'Alexandreia ad Issum', 'The mint at the ancient site of Alexandreia in Cilicia.', 'http://nomisma.org/ontology#Mint'),
