('http://nomisma.org/id/altdorf', 'Altdorf', 'The mint of Altdorf, capital of the canton of Uri, Switzerland. After issuing their first coins in Bellinzona, the cantons of Uri, Schwyz and Unterwalden opened a new mint in Altdorf in 1548. The last coins from Altdorf, now in the name of Uri only, were minted in 1641. In 1720 and 1736, Uri issued a considerable amount of gold coins, which marked the end of autonomous minting für the canton of Uri bevor the Helvetic Republic. 19th century coins of Uri have been produced in the mint of Bern.', 'http://nomisma.org/ontology#Mint'),
