('http://nomisma.org/id/antiocheia_margiana', 'Antioch of Margiana', 'Antiochia in Margiana (also Merv) was a major oasis-city in Central Asia, on the historical Silk Road, located near today\'s Mary in Turkmenistan. Several cities have existed on this site, which is significant for the interchange of culture and politics at a site of major strategic value.', 'http://nomisma.org/ontology#Mint'),
