('http://nomisma.org/id/bardasir', 'Bardasir', 'Bardsir (Persian: بردسير‎, also Romanized as Bardsīr and Bardesīr; also known as Deh-e Now-e Mashīz, Mashīz,Mshiz, and Qal‘eh-ye Mashīz) is a city in and the capital of Bardsir County, Kerman Province, Iran.', 'http://nomisma.org/ontology#Mint'),
