('http://nomisma.org/id/basel', 'Basel', 'The mint(s) in Basel in northwestern Switzerland on the river Rhine. Two issues are known from Merowingian times, continuous minting begins unter Louis the Child. First a royal Carolingian and then Burgundian mint, later in the hands of the Prince-Bishopric of Basel, it eventually became a municipal mint. An (additional) imperial mint, established 1429, issued gold coins (gulden) in Basel until 1509. Under the Helvetic Republic, Basel was one of the three central mints.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/basti', 'Basti', 'The mint at the ancient site of Basti in Hispania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bayana', 'Bayana', 'Bayana is a historical town in Bharatpur district of Rajasthan in India.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bayreuth', 'Bayreuth', 'The mint(s) at the City of Bayreuth in Franconia (German: Franken), National State of Bavaria (German: Freistaat Bayern), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bazar', 'Bazar', 'Unknown location - a camp Ilkhanid mint Diler, I, p. 226', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/belaiskom', 'Belaiskom', 'The mint at the ancient site of Belaiskom in Hispania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/belgrade', 'Belgrade', 'Belgrade (/ˈbɛlɡreɪd/; Serbian: Београд/Beograd; [beǒɡrad] ( listen); names in other languages) is the capital and largest city of Serbia. It is located at the confluence of the Sava and Danube rivers, where the Pannonian Plain meets the Balkans.[5] Its name translates to White city. The city has a population of 1.23 million, while over 1.65 million people live in its metro area (which encompass administrative limits of City of Belgrade).[1]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/belikio', 'Belikio', 'The mint at the ancient site of Belikio in Hispania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bellinzona', 'Bellinzona', 'The mint of Bellinzona, a city of the canton of Ticino, Switzerland. The mint was established in 1503 for the joint coinage of Uri, Schwyz and Unterwalden. Bellinzona ceased to issue coins after the mint of Uri, Schwyz and Unterwalden has been moved to Altdorf in the Canton of Uri in 1548.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/beneventum', 'Beneventum', 'The mint at the ancient site of Beneventum in Italy', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/benidorm', 'Benidorm', 'Benidorm (/ˈbɛnɪdɔrm/, Valencian: [beniˈðɔɾm], Spanish: [beniˈðor]) is a coastal town in Alicante, Spain, on theWestern Mediterranean.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bentian', 'Bentian', 'The mint at the ancient site of Bentian in Hispania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/berge', 'Berge', 'Berge or Berga was a Greek town of ancient Macedonia, in what is now the Serres regional unit in northern Greece. The town was located inland from the mouth of the Strymon, in the region of Bisaltia, north-west of Amphipolis, and was founded by Thasians as a dependent colony and emporion sometime in the 5th century BCE. Later sources call it a polis, but according to Strabo it was a village of the Bisaltae and Ptolemy writes that it was in the territory of the Odomanti.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/berlin', 'Berlin', 'The mint(s) at the City of Berlin. Berlin is the capital of Germany, and one of the 16 states of Germany. It merged with its sister town, the medieval and early modern City of Cölln, which is known as early as 1237 (7 years earlier than Berlin) finally in 1710.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/bern', 'Bern', 'The mint(s) in Bern, now capital of Switzerland.\nIts first issues were uniface pfennigs from c. 1225 for the municipality of Bern. Today, the mint of Bern (Swissmint) is the only official mint of Switzerland.', 'http://nomisma.org/ontology#Mint'),
