('http://nomisma.org/id/bishapur', 'Bishapur', 'Bishapur (Middle Persian: Bay-Šāpūr; Persian: بیشاپور‎, Bishâpûr) was an ancient city in Iran on the ancient road between Persis and Elam. The road linked the Sassanid capitals Estakhr (very close to Persepolis) and Ctesiphon. It is located south of modern Faliyan in the Kazerun County of Pars Province, Iran.', 'http://nomisma.org/ontology#Mint'),
