('http://nomisma.org/id/bukhara', 'Bukhara', 'Bukhara (Uzbek: Buxoro; Russian: Бухара; Persian: بخارا‎), is the capital of the Bukhara Province (viloyat) of Uzbekistan. Bukhara is a city-museum, with about 140 architectural monuments. The region around Bukhara has been inhabited for at least five millennia, and the city has existed for half that time. Located on the Silk Road, the city has long been a center of trade, scholarship, culture, and religion. The historic center of Bukhara, which contains numerous mosques and madrassas, has been listed by UNESCO as a World Heritage Site.', 'http://nomisma.org/ontology#Mint'),
