('http://nomisma.org/id/caesareia_maritima', 'Caesareia Maritima', 'Caesarea Maritima (Greek: Παράλιος Καισάρεια Parálios Kaisáreia), also known as Caesarea Palestinae, was an ancient city in the Sharon Plain on the coast of the Mediterranean. The city and harbour were built under Herod the Great during c. 22–10 or 9 BCE near the site of a former Phoenician naval station known as Stratonos pyrgos (Στράτωνος πύργος, \"Straton\'s Tower\"), probably named after the 4th century BCE king of Sidon, Strato I. It later became the provincial capital of Roman Judea, Roman Syria Palaestina and Byzantine Palaestina Prima provinces.', 'http://nomisma.org/ontology#Mint'),
