('http://nomisma.org/id/ceuta', 'Ceuta', 'Ceuta (Spanish pronunciation: [ˈθeuta]; Arabic: سبتة‎, Sibtah) is an 18.5-square-kilometre (7.1 sq mi)autonomous city of Spain and an exclave located on the north coast of Africa, sharing a western border withMorocco. Separated from the Iberian peninsula by the Strait of Gibraltar, Ceuta lies along the boundary between the Mediterranean Sea and the Atlantic Ocean. Ceuta, along with the Spanish exclave Melilla, is one of two permanently inhabited Spanish territories in mainland Africa. It was part of Cádiz province until 14 March 1995, when the city\'s Statute of Autonomy was passed.', 'http://nomisma.org/ontology#Mint'),
