('http://nomisma.org/id/damighan', 'Damighan', 'Damghan (Persian: دامغان‎, also Romanized as Dāmghān) is a city in, and capital of, Damghan County, Semnan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/daniyah', 'Daniyah', 'Dénia (Valencian pronunciation: [ˈdenia], Spanish: Denia) is a city in the province of Alicante, Spain, on the Costa Blanca halfway between Alicante and Valencia, the judicial seat of the comarca of Marina Alta. As of 2012, it had a population of 44,455.[1]', 'http://nomisma.org/ontology#Mint'),
