('http://nomisma.org/id/dar_al-marz_rasht', 'Dar al-Marz Rasht', 'Rasht (Persian: رَشْتْ or Raŝt‎ , Gilaki: Rèsht, also Romanized as Resht and Rast, and often spelt Recht in French and older German manuscripts) is the capital city of Gilan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/dar_al-mulk_tabaristan', 'Dar al-Mulk Tabaristan', 'Tabaristan, also known as Tapuria, was the name of the former historic region in the southern coasts of Caspian Sea roughly in the location of the northern and southern slopes of Elburz range in Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/dar_al-salam_baghdad', 'Dar al-Salam, Baghdad', 'Dar al-Salam means House or Abode of Peace and refers to Baghdad.', 'http://nomisma.org/ontology#Mint'),
