INSERT INTO `coin_mint` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/darbend', 'Darbend', 'Al-Bab (Arabic: الباب‎ / ALA-LC: al-Bāb) is a Syrian city administratively belonging to the Aleppo Governorate. Al-Bab is located northeast of Aleppo and has an area of 30 km². Al-Bab has an altitude of 471 meters. According to theCentral Bureau of Statistics (CBS), it had a population of 63,069 in 2004.[1] The majority of the city\'s population isSunni Muslim.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/dardanus', 'Dardanus', 'The mint at the ancient site of Dardanus in Troas.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/darmstadt', 'Darmstadt', 'The mint(s) at the city of Darmstadt, National State of Hesse (German: Hessen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/darulhilafet_aliye', 'Darulhilafet Aliye', 'Constantinople (Greek: Κωνσταντινούπολις Konstantinoúpolis or Κωνσταντινούπολη Konstantinoúpoli; Latin:Constantinopolis; Ottoman Turkish: قسطنطینية, Kostantiniyye; modern Turkish: Istanbul) was the capital city of theRoman and Byzantine (330–1204 and 1261–1453), the Latin (1204–1261), and the Ottoman (1453–1922)empires. It was reinaugurated in 324 AD[1] at ancient Byzantium, as the new capital of the Roman Empire by Emperor Constantine the Great, after whom it was named, and dedicated on 11 May 330.[1] In the 12th century,[2] the city was the largest and wealthiest European city[3] and it was instrumental in the advancement ofChristianity during Roman and Byzantine times. After the loss of its territory, the Eastern Roman (Byzantine) Empire was reduced to just its capital city and its environs, eventually falling to the Ottomans in 1453. Following the Muslim conquest, the former bastion of Christianity in the east, Constantinople, was turned into the Islamic capital of the Ottoman Empire, under which it prospered and flourished again. After the founding of the modernRepublic of Turkey —the successor state of the Ottoman Empire— the city was renamed Istanbul in 1923.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/dascyleium', 'Dascyleium', 'The mint at the ancient site of Dascyleium in Mysia', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/dastawa', 'Dastawa', 'south of Qazvin', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/delhi', 'Delhi', 'Delhi (/ˈdɛli/, Hindustani pronunciation: [d̪ɪlliː] Dilli), officially the National Capital Territory of Delhi, is the capital territory of India.[3] It has a population of about 11 million and a metropolitan population of about 16.3 million, making it the second most populous city and second most populous urban agglomeration in India.[2][4] Such is the nature of urban expansion in Delhi that its growth has expanded beyond the NCT to incorporate towns in neighbouring states and at its largest extent can count a population of about 25 million residents as of 2014.[5]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/delos', 'Delos', 'The mint at the ancient site of Delos on Delos, Cylcades.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/delphi', 'Delphi', 'The mint at the ancient site of Delphi in Phocis.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/delemont', 'Delémont', 'The mint of Delémont, the capital of the Swiss canton of Jura. Active from c.1596 to 1621, it issued coins for the prince-bishopric of Basel.\n', 'http://nomisma.org/ontology#Mint'),
