('http://nomisma.org/id/dura-europus', 'Dura-Europus', 'Dura-Europos, also spelled Dura-Europus, was a Hellenistic, Parthian and Roman border city built on an escarpment 90 metres (300 feet) above the right bank of the Euphrates river. It is located near the village of Salhiyé, in today\'s Syria. In 113 BC, Parthians conquered the city, and held it, with one brief Roman intermission (114 AD), until 165 AD. Under Parthian rule, it became an important provincial administrative center. The Romans decisively captured Dura-Europos in 165 AD and greatly enlarged it as their easternmost stronghold in Mesopotamia, until it was captured by Sassanians after a siege in 256-7 AD. Its population was deported, and after it was abandoned, it was covered by sand and mud and disappeared from sight.', 'http://nomisma.org/ontology#Mint'),
