('http://nomisma.org/id/edirne', 'Edirne', 'Edirne (Turkish pronunciation: [eˈdiɾne], Bulgarian: Одрин), is a city in the Turkish region of East Thrace, close to its borders with Greece and Bulgaria. Edirne served as the third capital city of the Ottoman Empire from 1363 to 1453,[3]before Constantinople (present-day Istanbul) became the empire\'s fourth and final capital. At present, Edirne is the capital of Edirne Province in Turkish Thrace. The city\'s estimated population in 2010 was 138,793, up from 119,298 in 2000.', 'http://nomisma.org/ontology#Mint'),
