('http://nomisma.org/id/filastin', 'Filastin', 'Ramla (Hebrew: רַמְלָה, Ramla; Arabic: الرملة‎, ar-Ramlah) (also Ramlah,[2] Ramle, Remle and sometimes Rama) is a city in central Israel. The city is predominantly Jewish with a significant Arab minority. Ramla was founded circa 705–715 CE by the Umayyad governor and future caliph Sulayman ibn Abd al-Malik. Ramla lies along the route of the Via Maris, connecting old Cairo (Fustat) with Damascus, at its intersection with the road connecting the port of Jaffa with Jerusalem.[3]', 'http://nomisma.org/ontology#Mint'),
