('http://nomisma.org/id/gamla_galilaea', 'Gamla', 'Mint at the ancient site of Gamla, alt. sp. Gamala (Hebrew: גַּמְלָא, lit. The Camel), an ancient Jewish city on the Golan Heights. It is believed to have been founded as a Seleucid fort during the Syrian Wars which was turned into a city under Hasmonean rule in 81 BCE. During the Great Revolt, it became an important stronghold for rebels and because of this Gamla is a symbol for the modern state of Israel and an important historical and archaeological site.', 'http://nomisma.org/ontology#Mint'),
