('http://nomisma.org/id/garhgaon', 'Garhgaon', 'Gargaon (Pron:/gɑ:ˈgɑ̃ʊ/) was the capital of the Ahom kingdom for many years. It was built by the Ahom kingSuklenmung (Gargoyaan Rojaa) in 1540. It lies 13 km east of present-day Sivasagar town. The palace structures were made of wood and stones. In 1747 Pramatta Singha, son of Rudra Singha, constructed the brick wall of about 5 km in length surrounding the Gargaon Palace and the masonry gate leading to it.', 'http://nomisma.org/ontology#Mint'),
