('http://nomisma.org/id/geneva', 'Geneva', 'The mint(s) in Geneva, the capital of the Republic and Canton of Geneva. Starting in Merowingian and Carolingian times, Geneva was the mint for the Prince-Bishopric of Geneva, the County of Geneva, the Republic and the Canton of Geneva. The duchy of Savoy issued coins in their mint at Cornavin, then just outside of Geneva, now in the centre of the city.', 'http://nomisma.org/ontology#Mint'),
