('http://nomisma.org/id/ghaza', 'Ghaza', 'Gaza (/ˈɡɑːzə/;[4] Arabic: غزة‎ Ġazzah, IPA: [ˈɣazza]; Hebrew: עזה‎ Azzah; Ancient Greek: Γάζα), also referred to asGaza City, is a Palestinian city in the Gaza Strip, with a population of 515,556, making it the largest city in the State of Palestine. Inhabited since at least the 15th century BC,[5] Gaza has been dominated by several different peoples and empires throughout its history. The Philistines made it a part of their pentapolis after the Ancient Egyptians had ruled it for nearly 350 years.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ghazna', 'Ghazna', 'Ghaznī (Pashto: غزني‎, Persian: غزنی‎) or Ghaznai (غزنی), also historically known as Ghaznīn (غزنين) or Ghazna(غزنه), is a city in Afghanistan with a population of over 150,000 people. It is located in the central-east part of the country. Situated on a plateau at 7,280 feet (2,219 m) above sea level, the city serves as the capital ofGhazni Province. It is linked by a highway with Kandahar to the southwest, Kabul to the northeast, and Gardezand Khost to the east. The foundation stone of Ghazni Airport was laid in April 2012 which now serves Ghazni and other nearby eastern Afghan provinces.[2]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/gittelde', 'Gittelde', 'The mint(s) at the village of Gittelde, now part of the municipality of Bad Grund (Harz), Lower Saxony (German: Niedersachsen), Germany. Gittelde was founded in the 10th century, and awarded market and mint rights in AD 965.', 'http://nomisma.org/ontology#Mint'),
