('http://nomisma.org/id/ishbiliyah', 'Ishbiliyah', 'Seville (/səˈvɪl/, Spanish: Sevilla [seˈβiʎa] ( listen), locally: [seˈβiʝa]) is the capital and largest city of the autonomous community of Andalusia and the province of Seville, Spain. It is situated on the plain of the River Guadalquivir. The inhabitants of the city are known as sevillanos (feminine form: sevillanas) or hispalenses, after the Roman name of the city, Hispalis. Seville has a municipal population of about 703,000 as of 2011, and a metropolitan population of about 1.5 million, making it the fourth-largest city in Spain and the 30th most populous municipality in the European Union. Its Old Town, the third largest in Europe with an area of 4 square kilometres (2 sq mi), contains three UNESCO World Heritage Sites: the Alcázar palace complex, the Cathedral and the General Archive of the Indies. The Seville harbour, located about 80 kilometres (50 miles) from the Atlantic Ocean, is the only river port in Spain. Seville is also the hottest major metropolitan area in Europe, with summer average high temperatures of above 35 °C.', 'http://nomisma.org/ontology#Mint'),
