('http://nomisma.org/id/islambol', 'Islambol', 'Constantinople (Greek: Κωνσταντινούπολις Konstantinoúpolis or Κωνσταντινούπολη Konstantinoúpoli; Latin:Constantinopolis; Ottoman Turkish: قسطنطینية, Kostantiniyye; modern Turkish: Istanbul) was the capital city of theRoman and Byzantine (330–1204 and 1261–1453), the Latin (1204–1261), and the Ottoman (1453–1922)empires. It was reinaugurated in 324 AD[1] at ancient Byzantium, as the new capital of the Roman Empire by Emperor Constantine the Great, after whom it was named, and dedicated on 11 May 330.[1] In the 12th century,[2] the city was the largest and wealthiest European city[3] and it was instrumental in the advancement ofChristianity during Roman and Byzantine times. After the loss of its territory, the Eastern Roman (Byzantine) Empire was reduced to just its capital city and its environs, eventually falling to the Ottomans in 1453. Following the Muslim conquest, the former bastion of Christianity in the east, Constantinople, was turned into the Islamic capital of the Ottoman Empire, under which it prospered and flourished again. After the founding of the modernRepublic of Turkey —the successor state of the Ottoman Empire— the city was renamed Istanbul in 1923.', 'http://nomisma.org/ontology#Mint'),
