('http://nomisma.org/id/izmir', 'Izmir', 'İzmir is a large metropolis in the western extremity of Anatolia and the third most populous city in Turkey, after Istanbul and Ankara.[1][2] İzmir\'s metropolitan area extends along the outlying waters of the Gulf of İzmir and inland to the north across Gediz River\'s delta, to the east along an alluvial plain created by several small streams and to a slightly more rugged terrain in the south. The ancient city was known as Smyrna (Greek: Σμύρνη Smyrni), and the city was generally referred to as Smyrna in English, until the Turkish Postal Service Law of 28 March 1930 made \"İzmir\" the internationally recognized name.', 'http://nomisma.org/ontology#Mint'),
