('http://nomisma.org/id/kabul', 'Kabul', 'Kābul (Pashto: کابل Kābəl, Persian: کابل Kābol), is the capital of the Islamic Republic of Afghanistan also thelargest city of Afghanistan, located in the eastern section of Afghanistan. According to a 2012 estimate, the population of the city was around 3,289,000,[2] which includes all the major ethnic groups.[3] It is the 64th largest[4] and the 5th fastest growing city in the world.[5]', 'http://nomisma.org/ontology#Mint'),
