('http://nomisma.org/id/karit', 'Karit', 'Crete (Greek: Κρήτη, Kríti [\'kriti]; Ancient Greek: Κρήτη, Krḗtē) is the largest and most populous of the Greek islands, and the fifth-largest island in the Mediterranean Sea, after Sicily, Sardinia, Cyprus, and Corsica. Crete and a number of surrounding islands and islets constitute the region of Crete (Greek: Περιφέρεια Κρήτης), one of the 13 top-level administrative units of Greece. The capital and the largest city is Heraklion. As of 2011, the region had a population of 623,065.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/kashan', 'Kashan', 'Kashan (Persian: کاشان‎, also Romanized as Kashan; also known as Kachan) is a city in and the capital of Kashan County, in the province of Isfahan, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/kashghar', 'Kashghar', 'Kashgar (known in Chinese as Kashi) is an oasis city with an approximate population of 350,000. It is the westernmost city in China, located near the border with Tajikistan and Kyrgyzstan. Kashgar has a rich history of over 2,000 years and served as a trading post and strategically important city on the Silk Road between China, the Middle East, and Europe.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/kayfa', 'Kayfa', 'Hasankeyf (Kurmanji Kurdish: Heskîf, Arabic: حصن كيفا‎, Greek: Κιφας, Latin: Cepha, from Syriac: ܚܨܢ ܟܐܦܐ Ḥéṣn Kayfa) is an ancient town and district located along the Tigris River in the Batman Province in southeastern Turkey. It was declared a natural conservation area by Turkey in 1981. Predominantly Armenian and Arab before, a steady and significant Kurdish immigration from surrounding villages in the last 20–30 years - combined with the effects of the Armenian and Assyrian Genocide - has shifted the ethnic balance. Kurdish people form the majority of the city centre today.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/kazirun', 'Kazirun', 'Kazerun (Persian: كازرون‎, also Romanized as Kāzerūn, Kāzarūn, and Kazeroun; also known as Kasrun) is a city in and the capital of Kazerun County, Fars Province, Iran.', 'http://nomisma.org/ontology#Mint'),
