('http://nomisma.org/id/khilat', 'Khilat', 'Ahlat (Armenian: Խլաթ, Khlat; Ottoman Turkish: اخلاط), is a historic town and district in Turkey\'s Bitlis Province inEastern Anatolia Region. From 1929-1936, it had been included as a district of Van Province. The town of Ahlat is situated on the northwestern shore of Lake Van. Its current mayor is Abdulalim Mümtaz Çoban (AKP).', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/khoqand', 'Khoqand', 'The Khanate of Kokand (Uzbek: Qo\'qon Xonligi) was a Turkic state in Central Asia that existed from 1709–1876 within the territory of modern Kyrgyzstan, eastern Uzbekistan and Tajikistan, and southeastern Kazakhstan. The name of the city and the khanate may also be spelled as Khoqand in modern scholarly literature', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/khoy', 'Khoy', 'Khoy (Persian: خوی‎; also Romanized as Khoi, Khvoy, Khowy, Khuy, and Xoy), (Azerbaijani: Xoy); (Armenian: Խոյ) is a city in and the capital of Khoy County, West Azerbaijan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
