('http://nomisma.org/id/lahur', 'Lahur', 'Lahore (/ləˈhɔər/; Western Punjabi: لہور ALA-LC: Lahor Punjabi pronunciation: [ləhoːr]; Urdu: لاہور‎ ALA-LC: Lāhor IPA: [lɑːhoːr]) is the capital city of the Pakistani province of Punjab, the second largest metropolitan area in the country and an important historical center in South Asia. With a rich history dating back over a millennium, Lahore is a main cultural center of Punjab region and Pakistan. It is referred to as the \"Mughal City of Gardens\" due to the historic presence of gardens in and around the city dating back to the Mughal period.', 'http://nomisma.org/ontology#Mint'),
