('http://nomisma.org/id/lorsch', 'Lorsch', 'The mint(s) at the city of Lorsch, also the site of Kloster Lorsch (Lorsch Abbey) founded in 764, National State of Hesse (German: Hessen), Germany.', 'http://nomisma.org/ontology#Mint'),
