('http://nomisma.org/id/lu\'lu\'ah', 'Lu\'lu\'ah', 'Hasangazi (formerly Lu\'lu\'a, Lulu, or Lüle) is a village of the district Ulukışla in the Central Anatolia region ofTurkey. Located 16 km east of Ulukışla and 70 km south of Nigde, the village has a population of 887.[1]', 'http://nomisma.org/ontology#Mint'),
