('http://nomisma.org/id/lucerne', 'Lucerne', 'The mint of Lucerne, a city in central Switzerland. The building of the first mint begun in 1420. The Lucerne mint issued coins for the municipality of Lucerne from 1422 onwards. In the 19th century, the Lucerne mint iussed coins for both the canton of Lucerne as well as the canton of Ticino.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lucus_augusti', 'Lucus Augusti', 'The mint at the ancient site of Lucus Augusti (Spain)', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lugdunum', 'Lugdunum', 'The mint at the ancient site of Lugdunum in Gaul.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lur-i_kuchek', 'Lur-i Kuchek/Aleshtar', 'Aleshtar (Persian: الشتر‎, also Romanized as Alashtar and Alishtār; also known as Qal‘eh ‘Alishtār and Qal‘eh Moz̧affari) is a city in and capital of Selseleh County, Lorestan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lusi-achaean_league', 'Lusi', 'The mint at the ancient site of Lusi in Arcadia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/libya', 'Lybia', 'Stub for the ancient region of Lybia in Africa.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lycoa-achaean_league', 'Lycoa', 'The mint at the ancient site of Lycoa in Arcadia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/lydae', 'Lydae', 'The ancient site of Lydae on Caria. A mint was attributed this site by Head on the basis of coins that belong, in fact, to Cnidus. There was probably no mint at Lydae.  See R. H. J. Ashton, \"The Late Classical/Early Hellenistic Drachms of Knidos”, RN 154 (1999), pp. 63-94, Appendix 2.', 'http://nomisma.org/ontology#Mint'),
