('http://nomisma.org/id/ma\'dan', 'Ma\'dan', 'Kapan (Armenian: Կապան), known as Ghapan (Armenian: Ղափան) during the Soviet period, is a town in southeast Armenia and the capital of the Syunik Province.', 'http://nomisma.org/ontology#Mint');
INSERT INTO `coin_mint` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/ma\'dan_al-shash', 'Ma\'dan al-Shash', 'Tashkent (/ˌtæʃˈkɛnt/; Uzbek: Toshkent, Тошкент [tɒʃˈkent]; Russian: Ташкент, [tɐʂˈkʲɛnt]; literally \"Stone City\") is the capital and largest city of Uzbekistan. The officially registered population of the city in 2012 was about 2,309,300.[1]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ma\'din_bajunays', 'Ma\'din Bajunays', 'Province north of Lake Van', 'http://nomisma.org/ontology#Mint'),
