('http://nomisma.org/id/madinat', 'Madinat', 'an incomplete mint title and could be anywhere', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_abrashahr', 'Madinat Abrashahr', 'Abarshahr is another name for Nishapur mint', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_amul', 'Madinat Amul', 'Amol (Persian: آمل‎ – [ɒˈmol]); also Romanized as Āmol and Amul) is a city in and the administrative center of Amol County, Mazandaran Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_arzarum', 'Madinat Arzarum', 'Erzurum (Armenian: Կարին Karin),[1] is a city in eastern Turkey. It is the largest city in and the eponymous capital ofErzurum Province. The city is situated 1757 meters (5766 feet) above sea level. Erzurum had a population of 361,235 in the 2000 census, increasing to 367,250 by 2010.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_balkh', 'Madinat Balkh', 'Balkh (/bɑːlx/; Persian/Pashto: بلخ Balkh; Bactrian: βαχλο ẞaxlə) was an ancient city and centre of Buddhism, Sufism and Zoroastrianism in what is now northern Afghanistan.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_bukhara', 'Madinat Bukhara', 'Bukhara (Uzbek: Buxoro; Russian: Бухара; Persian: بخارا‎), is the capital of the Bukhara Province (viloyat) of Uzbekistan. Bukhara is a city-museum, with about 140 architectural monuments. The region around Bukhara has been inhabited for at least five millennia, and the city has existed for half that time. Located on the Silk Road, the city has long been a center of trade, scholarship, culture, and religion. The historic center of Bukhara, which contains numerous mosques and madrassas, has been listed by UNESCO as a World Heritage Site.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_hamadhan', 'Madinat Hamadhan', 'Hamedān (Persian: همدان‎, Hamedān) (Old Persian: Haŋgmetana, Ecbatana) is the capital city of Hamedan Province of Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_harat', 'Madinat Harat', 'Herat (Persian: هرات‎, also Romanized as Herāt; also, Burd Herat (Persian: بورد هِرات‎), also Romanized as Būrd Harāt and Būrd Herāt; also, Harāt Khowreh and Herāt-i-Khurreh; formerly, Tājābād and Tājābād-e Harāt)[1] is a city and capital of Khatam County, Yazd Province, Iran. At the 2006 census, its population was 10,795, in 2,751 families.[2]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_isbahan', 'Madinat Isbahan', 'Isfahan is the capital of Isfahan Province in Iran, located about 340 kilometres (211 miles) south of Tehran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_jayy', 'Madinat Jayy', 'Isfahan is the capital of Isfahan Province in Iran, located about 340 kilometres (211 miles) south of Tehran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_naysabur', 'Madinat Naysabur', 'Nishapur or Nishabur ( Persian: نیشابور‎, also Romanized as Nīshāpūr, Nīshābūr, and Neyshābūr from Middle Persian: New-Shabuhr, meaning \"New City of Shapur\", \"Fair Shapur\", or \"Perfect built of Shapur\") is a city in the Razavi Khorasan Province, capital of the Nishapur County and former capital of Khorasan, in northeastern Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_nisibin', 'Madinat Nisibin', 'Nusaybin (pronounced [nuˈsajbin]; Akkadian: Naṣibina;[3] Classical Greek: Νίσιβις, Nisibis; Arabic: نصيبين‎, Syriac:ܢܨܝܒܝܢ, Niṣībīn; Armenian: Մծբին, Mtsbin; Kurdish: Nisêbîn) is a city in Mardin Province, Turkey. The population of the city is 83,832[4] as of 2009. The population is largely of ethnic Kurdish descent.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_quniyah', 'Madinat Quniyah', 'Konya (Turkish pronunciation: [ˈkon.ja]; Greek: Ικόνιον Ikónion, Latin: Iconium) is a city in the Central Anatolia Regionof Turkey. It is the seventh most populous city in Turkey. As of 2011, the Konya Metropolitan Municipality had a population close to 1.1 million. Konya is an economically and industrially developed city.[2][3][4] It is the capital ofKonya Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_sabtah', 'Madinat Sabtah', 'Ceuta (Spanish pronunciation: [ˈθeuta]; Arabic: سبتة‎, Sibtah) is an 18.5-square-kilometre (7.1 sq mi)autonomous city of Spain and an exclave located on the north coast of Africa, sharing a western border withMorocco. Separated from the Iberian peninsula by the Strait of Gibraltar, Ceuta lies along the boundary between the Mediterranean Sea and the Atlantic Ocean. Ceuta, along with the Spanish exclave Melilla, is one of two permanently inhabited Spanish territories in mainland Africa. It was part of Cádiz province until 14 March 1995, when the city\'s Statute of Autonomy was passed.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_samarqand', 'Madinat Samarqand', 'Samarkand (Tajik: Samarqand Самарқанд; Persian: سمرقند‎ Cyrillic/Russian: Самарканд from Sogdian: \"Stone Fort\" or \"Rock Town\"), alternatively Samarqand or Samarcand, traditionally was the second-largest city inUzbekistan and the capital of Samarqand Province. It is now the nation\'s third largest, after fast-growingNamangan in the Ferghana Valley.[1] The city is most noted for its central position on the Silk Road betweenChina and the West, and for being an Islamic centre for scholarly study. In the 14th century it became the capital of the empire of Timur (Tamerlane) and is the site of his mausoleum (the Gur-e Amir). The Bibi-Khanym Mosque(a modern replica) remains one of the city\'s most notable landmarks. The Registan was the ancient center of the city. The city has carefully preserved the traditions of ancient crafts: embroidery, gold embroidery, silk weaving, engraving on copper, ceramics, carving and painting on wood.[2]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_sijilmasah', 'Madinat Sijilmasah', 'Sijilmasa (also Sijilmassa, Sidjilmasa, Sidjilmassa and Sigilmassa) was a medieval Moroccan city and trade entrepôt at the northern edge of the Sahara Desert in Morocco.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_siqilliyah', 'Madinat Siqilliyah', 'Palermo is a city in Insular Italy, the capital of both the autonomous region of Sicily and the Province of Palermo.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_siwas', 'Madinat Siwas', 'Sivas (Armenian: Սեբաստիա;Kurdish: Sêwas;Latin: Sebastia, Sebastea, Sebasteia, Sebaste) is a Turkish city in central Turkey and the seat of Sivas Province. According to a 2011 estimate, its urban population is 425,297.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_sultaniyah', 'Madinat Sultaniyah', 'Madinat Soltaniyeh (Persian: سلطانيه‎, also Romanized as Solţānīyeh, Solţāneyyeh, Sultaniye, and Sultānīyeh; also known as Sa‘īdīyeh) is a city in and capital of Soltaniyeh District of Abhar County, Zanjan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_tabriz', 'Madinat Tabriz', 'Tabriz (Persian: ‎تبریز, Azerbaijani: تبریز ,Tәbriz ) is the most populated city in the northwest of Iran, one of the historical capitals of Iran, and the present capital of East Azerbaijan Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_tilmisan', 'Madinat Tilmisan', 'Tlemcen (Arabic: تلمسان‎ Tilimsān) is a city in northwestern Algeria, and the capital of the province of the same name. The city has developed leather, carpet, and textile industries, which it ships to the port of Rashgun for export. It had a population of 140,158 at the 2008 census, while the province had 949,135 inhabitants.[1]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_zaranj', 'Madinat Zaranj', 'Zaranj or Zarang (Persian/Pashto/Balochi: زرنج) is a city in southwestern Afghanistan, near the border with Iran, which has a population of approximately 49,851 people as of 2004.[1] It is the capital of Nimruz province and is linked by highways with Lashkar Gah to the east, Farah to the north and the Iranian city of Zabol to the west. Zaranj serves as the border crossing between Afghanistan and Iran, which is of significant importance to the trade-route betweenCentral Asia and South Asia with the Middle East.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_al-salam', 'Madinat al-Salam', 'Madinat al-Salam or the city of peace is the original core of Baghdad, built by the Abbasid Caliph al-Mansur in AD 762–767 as the official residence of the Abbasid court.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/madinat_al-zahra', 'Madinat al-Zahra', 'Al-Zahra (Arabic: الزهراء‎) is a Palestinian municipality in the Gaza Governorate, south of Gaza, in the central Gaza Strip. It\'s the home of the University of Palestine, and Ummah Open University. In 2009, it had a population of 3,085. There were 837 housing units and 237 other buildings in the town.[1]', 'http://nomisma.org/ontology#Mint'),
