('http://nomisma.org/id/makkah', 'Makkah', 'Makkah (/ˈmɛkə/; Arabic: مكة‎, Makkah), also transliterated as Mecca (/ˈmækə/), is a city in the Hejaz, and is the destination of the hajj (\"pilgrimage\") period held in the twelfth Muslim lunar month of Dhu al-Hijjah.', 'http://nomisma.org/ontology#Mint'),
