('http://nomisma.org/id/mardin', 'Mardin', 'Mardin (Kurdish: Mêrdîn, Syriac: ܡܶܪܕܺܝܢ, Arabic/Ottoman Turkish: ماردين Mārdīn, Armenian: Մարդին) is a city in southeastern Turkey. The capital of Mardin Province, it is known for the Artuqid (Artıklı or Artuklu in Turkish) architecture of its old city, and for its strategic location on a rocky hill near the Tigris River that rises steeply over the flat plains.[4]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/marisa', 'Marisa', 'Tel Maresha is the tell (archaeological mound) of the biblical Iron Age city of Maresha, and of the subsequent, post-586 BCE Idumean city known by its Hellenized name Marisa.', 'http://nomisma.org/ontology#Mint'),
