('http://nomisma.org/id/marrakesh', 'Marrakush', 'Marrakesh or Marrakech (/məˈrækɛʃ/ or /ˌmærəˈkɛʃ/;[2] Berber: Meṛṛakec, ⵎⴻⵕⵕⴰⴽⴻⵛ; Arabic: مراكش‎) is a major city in the northwest African nation of Morocco. It is the fourth largest city in the country after Casablanca, Rabat andFes, and is the capital of the mid-southwestern region of Marrakesh-Tensift-El Haouz. Located to the north of the foothills of the snow-capped Atlas Mountains, by road Marrakesh is located 580 km (360 mi) southwest of Tangier, 327 km (203 mi) southwest of the Moroccan capital of Rabat, 239 km (149 mi) south of Casablanca, and 246 km (153 mi) northeast of Agadir.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/marsberg', 'Marsberg', 'The mint(s) at the city of Marsberg, North Rhine-Westphalia (German: Nordrhein-Westfalen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/marw', 'Marw', 'Merv (Turkmen: Merw, Persian: مرو‎ Marw), formerly Achaemenid Satrapy of Margiana, and later Alexandria(Ἀλεξάνδρεια) and Antiochia in Margiana (Greek: Ἀντιόχεια τῆς Μαργιανῆς), was a major oasis-city in Central Asia, on the historical Silk Road, located near today\'s Mary in Turkmenistan.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/mashhad', 'Mashhad', 'Mashhad (Persian: مشهد‎) is the capital of Razavi Khorasan Province. It is located in the northeast of the country, close to the borders of Turkmenistan and Afghanistan.', 'http://nomisma.org/ontology#Mint'),
