('http://nomisma.org/id/misr', 'Misr', 'Located near the Nile Delta, it was founded in AD 969. Nicknamed \"the city of a thousand minarets\" for its preponderance of Islamic architecture, Cairo has long been a center of the region\'s political and cultural life. Cairo was founded by Jawhar al-Siqilli \"The Sicilian\",among the Fatimid dynasty in the 10th century CE, but the land composing the present-day city was the site of national capitals whose remnants remain visible in parts ofOld Cairo. Cairo is also associated with Ancient Egypt as it is close to the ancient cities of Memphis, Giza andFustat which are near the Great Sphinx and the pyramids of Giza.', 'http://nomisma.org/ontology#Mint'),
