('http://nomisma.org/id/nisibin', 'Nisibin', 'Nusaybin (pronounced [nuˈsajbin]; Akkadian: Naṣibina;[3] Classical Greek: Νίσιβις, Nisibis; Arabic: نصيبين‎, Syriac:ܢܨܝܒܝܢ, Niṣībīn; Armenian: Մծբին, Mtsbin; Kurdish: Nisêbîn) is a city in Mardin Province, Turkey. The population of the city is 83,832[4] as of 2009. The population is largely of ethnic Kurdish descent.', 'http://nomisma.org/ontology#Mint'),
