('http://nomisma.org/id/palestine', 'Palestine', 'Palestine (Arabic: فلسطين‎ Filasṭīn, Falasṭīn, Filisṭīn; Greek: Παλαιστίνη, Palaistinē; Latin: Palaestina; Hebrew: פלשתינהPalestina) is a geographic region in Western Asia between the Mediterranean Sea and the Jordan River. It is sometimes considered to include adjoining territories. The name was used by Ancient Greek writers, and was later used for the Roman province Syria Palaestina, the Byzantine Palaestina Prima and the Umayyad and Abbasid province of Jund Filastin. The region is also known as the Land of Israel (Hebrew: ארץ־ישראל Eretz-Yisra\'el), the Holy Land or Promised Land, and historically has been known as the Southern portion of wider regional designations such as Canaan, Syria, as-Sham and the Levant.', 'http://nomisma.org/ontology#Mint'),
