('http://nomisma.org/id/qarqisiyah', 'Qarqisiyah', 'Al-Busayrah (Arabic: البصيرة‎) is a town in eastern Syria, administratively part of the Deir ez-Zor Governorate. The town is located, at the confluence of the Euphrates and Khabur Rivers, southeast of Deir ez-Zor.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qasr_al-salam', 'Qasr al-Salam', 'Based upon the research of Professor S. Heidemann, it was located 20 km. southeast of Baghdad and the name of a location in modern Baghdad.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qastmuniyah', 'Qastmuniyah', 'Constantinople (Greek: Κωνσταντινούπολις Konstantinoúpolis or Κωνσταντινούπολη Konstantinoúpoli; Latin:Constantinopolis; Ottoman Turkish: قسطنطینية, Kostantiniyye; modern Turkish: Istanbul) was the capital city of theRoman and Byzantine (330–1204 and 1261–1453), the Latin (1204–1261), and the Ottoman (1453–1922)empires. It was reinaugurated in 324 AD[1] at ancient Byzantium, as the new capital of the Roman Empire by Emperor Constantine the Great, after whom it was named, and dedicated on 11 May 330.[1] In the 12th century,[2] the city was the largest and wealthiest European city[3] and it was instrumental in the advancement ofChristianity during Roman and Byzantine times. After the loss of its territory, the Eastern Roman (Byzantine) Empire was reduced to just its capital city and its environs, eventually falling to the Ottomans in 1453. Following the Muslim conquest, the former bastion of Christianity in the east, Constantinople, was turned into the Islamic capital of the Ottoman Empire, under which it prospered and flourished again. After the founding of the modernRepublic of Turkey —the successor state of the Ottoman Empire— the city was renamed Istanbul in 1923.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qaysariyah', 'Qaysariyah', 'Kayseri (pronounced [ˈkajseɾi]) is a large and industrialized city in Central Anatolia, Turkey. It is the seat of Kayseri Province', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qazwin', 'Qazwin', 'Qazwin (/kæzˈviːn/; Persian: قزوین‎, ), also Romanized as Qazvīn, Caspin, Qazwin, or Ghazvin) is the capital of the Province of Qazvin in Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qinnasrin', 'Qinnasrin', 'Qinnasrin (Arabic: قنسرين‎, Syriac: ܩܢܫܪܝܢ, Qinnašrīn, also rendered Qinshren, Qinnashrin, Qenneshren; Latin: Chalcis ad Belum), was a historical town in northern Syria. The town was situated 25 km south west of Aleppo.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/quedlinburg', 'Quedlinburg', 'The mint(s) at the city of Quedlinburg, National State of Saxony-Anhalt (German: Sachsen-Anhalt), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qumis', 'Qumis', 'A small province which stretches along the foot of the Great Alburz chain of mouintains. Klat, p. 17.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qumm', 'Qumm', 'Qumm (Persian: قم‎ [Qom]), also known as Qum or Ghom; lies 125 kilometres (78 mi) by road southwest of Tehran and is the capital of Qom Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/quniyah', 'Quniyah', 'Konya (Turkish pronunciation: [ˈkon.ja]; Greek: Ικόνιον Ikónion, Latin: Iconium) is a city in the Central Anatolia Regionof Turkey. It is the seventh most populous city in Turkey. As of 2011, the Konya Metropolitan Municipality had a population close to 1.1 million. Konya is an economically and industrially developed city.[2][3][4] It is the capital ofKonya Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/qustantiniyah', 'Qustantiniyah', 'Constantinople (Greek: Κωνσταντινούπολις Konstantinoúpolis or Κωνσταντινούπολη Konstantinoúpoli; Latin:Constantinopolis; Ottoman Turkish: قسطنطینية, Kostantiniyye; modern Turkish: Istanbul) was the capital city of theRoman and Byzantine (330–1204 and 1261–1453), the Latin (1204–1261), and the Ottoman (1453–1922)empires. It was reinaugurated in 324 AD[1] at ancient Byzantium, as the new capital of the Roman Empire by Emperor Constantine the Great, after whom it was named, and dedicated on 11 May 330.[1] In the 12th century,[2] the city was the largest and wealthiest European city[3] and it was instrumental in the advancement ofChristianity during Roman and Byzantine times. After the loss of its territory, the Eastern Roman (Byzantine) Empire was reduced to just its capital city and its environs, eventually falling to the Ottomans in 1453. Following the Muslim conquest, the former bastion of Christianity in the east, Constantinople, was turned into the Islamic capital of the Ottoman Empire, under which it prospered and flourished again. After the founding of the modernRepublic of Turkey —the successor state of the Ottoman Empire— the city was renamed Istanbul in 1923.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ra\'s_al-ayn', 'Ra\'s al-ayn', 'Ras al-Ayn (Arabic: رأس العين‎ Ras al-Ayn, Kurdish: Serê Kanîyê, Classical Syriac: ܪܝܫ ܥܝܢܐ Rēš Aynā) is a Syrian city administratively belonging to Al-Hasakah Governorate.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/rabat', 'Rabat', 'Rabat (Arabic: الرباط, ar-Ribaaṭ, literally \"Fortified Place\"; Berber: ⴻⵔⵔⴱⴰⵟ, Errbaṭ; Moroccan Arabic: ارّباط,Errbaṭ) is the capital and fourth largest city of Morocco with an urban population of approximately 620,000 (2004)[2] and a metropolitan population of over 1.2 million. It is also the capital of the Rabat-Salé-Zemmour-Zaeradministrative region.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/rabbath-moba', 'Rabbath-Moba', 'The mint at the ancient site of Rabbath-Moba in Arabia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/rahway_new_jersey', 'Rahway', 'The mint in the city of Rahway, New Jersey.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ramhurmuz', 'Ramhurmuz', 'Ramhormoz (Lurish: روومز – Rümez; Persian: رامهرمز; also Romanized as Rāmhormoz and Rām Hormuz; also known as Rāmuz) is the capital city of Ramhormoz County, Khuzestan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/raphanea', 'Raphanea', 'The mint at the ancient site of Raphanea in Seleucis and Pieria.', 'http://nomisma.org/ontology#Mint'),
