('http://nomisma.org/id/Rauracum', 'Rauracum', 'The temporary mint in spring 361 AD at Rauracum, the fortified late roman settlement near the port of former colonia Augusta Raurica, today Kaiseraugst in the Canton of Basel-Landschaft. A very rare solidus of Iulianus II (VIRTVS EXERC GALL) with RAV in ex. is identified as issue from Rauracum.', 'http://nomisma.org/ontology#Mint'),
