('http://nomisma.org/id/rayy', 'Rayy', 'Rey or Ray [Pronunciation: rā] (Persian: شهر ری‎, Shahr-e-Ray, \"City of Ray\"), also known as Rhages (/ˈreɪdʒəz/;Greek: Ῥάγαι, Rhagai; Latin: Rhagae or Rhaganae) and formerly as Arsacia, is the capital of Rey County, Tehran Province, Iran, and is the oldest existing city in the province.', 'http://nomisma.org/ontology#Mint'),
