('http://nomisma.org/id/reichenau', 'Reichenau', 'Reichenau is a village in the municipality of Tamins in the Canton of Graubünden, Switzerland, where the two Rhine tributaries Vorderrhein and Hinterrhein meet, forming the Alpine Rhine.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/rekem', 'Rekem (Reckheim)', 'The min(s) at the municipality of Rekem, now part of Lanaken, Limburg province, Belgium. It used to be the capital of the County (German: Grafschaft) of Reckheim, which historically formed a part of the Lower Rhenish–Westphalian Circle (German: Niederrheinisch-Westfälischer Reichskreis) of the Holy Roman Empire. It was designated a Herrschaft (French: Seigneurie) up to 1620 before being elavated to a County.', 'http://nomisma.org/ontology#Mint'),
