('http://nomisma.org/id/samarqand', 'Samarqand', 'Samarkand (Tajik: Samarqand Самарқанд; Persian: سمرقند‎ Cyrillic/Russian: Самарканд from Sogdian: \"Stone Fort\" or \"Rock Town\"), alternatively Samarqand or Samarcand, traditionally was the second-largest city inUzbekistan and the capital of Samarqand Province. It is now the nation\'s third largest, after fast-growing Namangan in the Ferghana Valley. The city is most noted for its central position on the Silk Road betweenChina and the West, and for being an Islamic centre for scholarly study. In the 14th century it became the capital of the empire of Timur (Tamerlane) and is the site of his mausoleum (the Gur-e Amir). The Bibi-Khanym Mosque(a modern replica) remains one of the city\'s most notable landmarks. The Registan was the ancient center of the city. The city has carefully preserved the traditions of ancient crafts: embroidery, gold embroidery, silk weaving, engraving on copper, ceramics, carving and painting on wood.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/samarra', 'Samarra', 'Surra man ra\'a or Sāmarrā (Arabic: سامَرّاء‎) is a city in Iraq. It stands on the east bank of the Tigris River in the Salah ad-Din Governorate, 125 kilometers (78 mi) north of Baghdad.', 'http://nomisma.org/ontology#Mint'),
