('http://nomisma.org/id/saraqustah', 'Saraqustah', 'Zaragoza (/ˌzærəˈɡoʊzə/, /ˌsærəˈɡoʊsə/ or /ˌθærəˈɡoʊθə/, Spanish: [θaɾaˈɣoθa]), also called Saragossa(/ˌsærəˈɡɒsə/)[1] in English,[2] is the capital city of the Zaragoza province and of the autonomous community ofAragon, Spain. It lies by the Ebro river and its tributaries, the Huerva and the Gállego, roughly in the center of both Aragon and the Ebro basin.', 'http://nomisma.org/ontology#Mint'),
