('http://nomisma.org/id/shirwan', 'Shirwan', 'Shirvan (from Persian: شروان‎ > Azerbaijani: Şirvan;), also spelled as Sharvān, Shirwan, Shervan, Sherwan and Šervān, is a historical region in the eastern Caucasus, known by this name in both Islamic and modern times.', 'http://nomisma.org/ontology#Mint'),
