('http://nomisma.org/id/sijistan', 'Sijistan', 'Sīstān (Persian/Baloch/Pashto: سیستان), also known as Scythia, Sijistān (Arabic: سجستان‎), and Sākāstān(Persian/Baloch/Pashto: ساكاستان; literally \"land of the Saka or Scythians\"), is a historical region in present-day eastern Iran (Sistan and Baluchestan Province), southern Afghanistan (Nimruz, Kandahar, and Zabul Province), and the Nok Kundi region of Balochistan (western Pakistan). At times, the Saka territory encompassed areas as far east as Minnagara on the Indus River, in southwestern Sindh province of present-day Pakistan. Sistan was a part of the region of ancient Ariana.', 'http://nomisma.org/ontology#Mint'),
