('http://nomisma.org/id/sinjar', 'Sinjar', 'Sinjar (Arabic: سنجار‎, Sinjar; Latin: Singara), also known as Shingal (Sorani Kurdish: شەنگال, Şengal; Classical Syriac: ܫܝܓܳܪ, Shiggor) and formerly Sanjár,[1] is a town in Sinjar District, Nineveh Province, Iraq near Mount Sinjar. It is close to the border with Syrian Kurdistan. Its population in 2013 was estimated at 88,023.[2] The town is mainly inhabited by Yazidis with Arab and Assyrian minorities.', 'http://nomisma.org/ontology#Mint'),
