('http://nomisma.org/id/st_gallen', 'St. Gallen', 'St. Gallen or traditionally St Gall, in German sometimes Sankt Gallen is a Swiss town and the capital of the canton of St. Gallen. It evolved from the hermitage of Saint Gall, founded in the 7th century.', 'http://nomisma.org/ontology#Mint'),
