('http://nomisma.org/id/sur', 'Sur', 'Tyre (Arabic: صور, Ṣūr; Phoenician: ???, Ṣur; Hebrew: צוֹר, Tzor; Tiberian Hebrew צר, Ṣōr; Akkadian: ??Ṣurru; Greek: Τύρος, Týros; Turkish: Sur; Latin: Tyrus), sometimes romanized as Sour, is a city in the South Governorate of Lebanon. There were approximately 117,000 inhabitants in 2003.[1] However, the government of Lebanon has released only rough estimates of population numbers since 1932, so an accurate statistical accounting is not possible.[2] Tyre juts out from the coast of the Mediterranean and is located about 80 km (50 mi) south of Beirut. The name of the city means \"rock\"[3] after the rocky formation on which the town was originally built. The adjective for Tyre is Tyrian, and the inhabitants are Tyrians.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/sur_al-ma\'muniyah', 'Sur al-Ma\'muniyah', 'Tyre (Arabic: صور, Ṣūr; Phoenician: ???, Ṣur; Hebrew: צוֹר, Tzor; Tiberian Hebrew צר, Ṣōr; Akkadian: ??Ṣurru; Greek: Τύρος, Týros; Turkish: Sur; Latin: Tyrus), sometimes romanized as Sour, is a city in the South Governorate of Lebanon. There were approximately 117,000 inhabitants in 2003.[1] However, the government of Lebanon has released only rough estimates of population numbers since 1932, so an accurate statistical accounting is not possible.[2] Tyre juts out from the coast of the Mediterranean and is located about 80 km (50 mi) south of Beirut. The name of the city means \"rock\"[3] after the rocky formation on which the town was originally built. The adjective for Tyre is Tyrian, and the inhabitants are Tyrians.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/sur_man_ra\'a', 'Sur man ra\'a', 'Surra man ra\'a or Sāmarrā (Arabic: سامَرّاء‎) is a city in Iraq. It stands on the east bank of the Tigris River in the Salah ad-Din Governorate, 125 kilometers (78 mi) north of Baghdad.', 'http://nomisma.org/ontology#Mint'),
