('http://nomisma.org/id/tabariyah', 'Tabariyah', 'Tiberias (/taɪˈbɪəriəs/; Hebrew: טְבֶרְיָה, Tveria, Tiveria About this sound (audio) (help·info); Arabic: طبرية‎, Ṭabariyyah; Greek: Τιβεριάς Tiberiás, Modern Greek: Τιβεριάδα Tiveriáda) is an Israeli city on the western shore of the Sea of Galilee (also called the Kinneret), Lower Galilee, Israel. Established in 20 CE, it was named in honour of the emperor Tiberius.[2]', 'http://nomisma.org/ontology#Mint'),
