('http://nomisma.org/id/tarabulus_libya', 'Tarabulus, Libya', 'Tripoli (Arabic: طرابلس‎, Ṭarābulus; Berber: Ṭrables) is the de jure capital city and the largest city of Libya. Tripoli, with its metropolitan area, has a population of about 1.1 million people.[2] The city is located in the northwestern part of Libya on the edge of the desert, on a point of rocky land projecting into the Mediterranean and forming a bay.', 'http://nomisma.org/ontology#Mint'),
