('http://nomisma.org/id/taraz', 'Taraz', 'Taraz (Kazakh: Тараз) is a city and the administrative center of Jambyl Region in Kazakhstan, located on the Talas (Taraz) River in the south of the country near the border with Kyrgyzstan. It had a population of 330,100 (1999 Census), up 9% from 1989, making it one of the fastest-growing cities in the country, after Astana and Türkistan.', 'http://nomisma.org/ontology#Mint'),
