('http://nomisma.org/id/tiflis', 'Tiflis', 'Tbilisi (Georgian: თბილისი [tʰb̥ilisi] ( listen)), formerly known as Tiflis, is the capital and the largest city of Georgia, lying on the banks of the Mtkvari River with a population of roughly 1.5 million inhabitants. Founded in the 5th century by the monarch of Georgia\'s ancient precursor Kingdom of Iberia, Tbilisi has since served, with intermissions, as the Georgian capital. Formerly, the city had also served as the seat of the Imperial administration of the Caucasus during the Russian rule from 1801 to 1917, the capital of the short-lived Transcaucasian Democratic Federative Republic in 1918, of the Democratic Republic of Georgia from 1918 to 1921, of the Georgian Soviet Socialist Republic from 1921 to 1991, and the Transcaucasian Socialist Federative Soviet Republic from 1922 to 1936.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/tigranocerta', 'Tigranocerta', 'The mint at the ancient site of Tigranocerta in Armenia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/tilimsan', 'Tilimsan', 'Tlemcen (Arabic: تلمسان‎ Tilimsān) is a city in northwestern Algeria, and the capital of the province of the same name. The city has developed leather, carpet, and textile industries, which it ships to the port of Rashgun for export. It had a population of 140,158 at the 2008 census, while the province had 949,135 inhabitants.[1]', 'http://nomisma.org/ontology#Mint'),
