('http://nomisma.org/id/tunis', 'Tunis', 'Tunis (Arabic: تونس‎ Tūnis, pronounced [ˈtuːnis]; Amazigh: Tunes, ⵜⵓⵏⴻⵙ) is the capital of Tunisia. It is Tunisia\'s largest city, the greater metropolitan area holding some 2,700,000 inhabitants.', 'http://nomisma.org/ontology#Mint'),
