('http://nomisma.org/id/umm_durman', 'Umm Durman', 'Omdurman (standard Arabic Umm Durmān أم درمان) is the largest city in Sudan and Khartoum State, lying on the western banks of the River Nile, opposite the capital, Khartoum. Omdurman has a population of 2,395,159 (2008) and is the national centre of commerce. With Khartoum and Khartoum North or Bahri, it forms the cultural and industrial heart of the nation.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/umm_al-qurrah', 'Umm al-Qurrah', 'Mecca (/ˈmɛkə/; Arabic: مكة‎, Makkah), also transliterated as Makkah (/ˈmækə/), is a city in the Hejaz, and is the destination of the hajj (\"pilgrimage\") period held in the twelfth Muslim lunar month of Dhu al-Hijjah.', 'http://nomisma.org/ontology#Mint'),
