('http://nomisma.org/id/uncertain_cappadocia_a', 'Uncertain Cappadocian Royal mint A', 'Mint A at an uncertain location in Cappadocia, employed for the royal coinage of the Cappadocian kings. Identified in O. Mørkholm, ‘The Coinage of Ariarathes VI and Ariarathes VII of Cappadocia’, Schweizerische Numismatische Rundschau, 57 (1978), pp. 144-63 and O. Mørkholm, ‘A Further Comment on the Coinages of Ariarathes VIII and Ariarathes IX’, Quaderni Ticinesi 4 (1975), pp. 109-138. Mørkholm suggests that it may be Eusebeia-Mazaca.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/uncertain_cappadocia_b', 'Uncertain Cappadocian Royal mint B', 'Mint B at an uncertain location in Cappadocia, employed for the royal coinage of the Cappadocian kings. Identified in O. Mørkholm, ‘The Coinage of Ariarathes VI and Ariarathes VII of Cappadocia’, Schweizerische Numismatische Rundschau, 57 (1978), pp. 144-63 and O. Mørkholm, ‘A Further Comment on the Coinages of Ariarathes VIII and Ariarathes IX’, Quaderni Ticinesi 4 (1975), pp. 109-138. Mørkholm suggests that it may be Eusebeia-Tyana.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/uncertain_cappadocia_c', 'Uncertain Cappadocian Royal mint C', 'Mint C at an uncertain location in Cappadocia, employed for the royal coinage of the Cappadocian kings. Identified in O. Mørkholm, ‘The Coinage of Ariarathes VI and Ariarathes VII of Cappadocia’, Schweizerische Numismatische Rundschau, 57 (1978), pp. 144-63 and O. Mørkholm, ‘A Further Comment on the Coinages of Ariarathes VIII and Ariarathes IX’, Quaderni Ticinesi 4 (1975), pp. 109-138. Mørkholm suggests that it may be Ariaratheia or Comana.', 'http://nomisma.org/ontology#Mint'),
