('http://nomisma.org/id/volubilis', 'Volubilis', 'The mint at the ancient site of Volubilis in Mauretania', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/vulci', 'Vulci', 'The mint at the ancient site of Vulci in Etruria.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/walilah', 'Walilah', 'Volubilis (Arabic: وليلي‎ Walīlī) is a partly excavated Roman city in Morocco situated near Meknes between Fes andRabat. Built in a fertile agricultural area, it was developed from the 3rd century BC onwards as a Phoenician (and later Carthaginian) settlement. It grew rapidly under Roman rule from the 1st century AD onwards and expanded to cover about 40 hectares (100 acres) with a 2.6 km (1.6 mi) circuit of walls. The city gained a number of major public buildings in the 2nd century, including a basilica, temple and triumphal arch. Its prosperity, which was derived principally from olive growing, prompted the construction of many fine town-houses with large mosaic floors.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wasit', 'Wasit', 'Wasit (Arabic,واسط) is a place in Wasit Governorate, south east of Kut in eastern Iraq.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wedrei', 'Wedrei', 'Mint of Wedrei in Lycia, probably to be identified with the later city and mint of Rhodiapolis. See F. Kolb and W. Tietz, Chiron 31 (2001), 392ff.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/weimar', 'Weimar', 'The mint(s) at the city of Weimar, Thuringia (German: Thüringen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/werl', 'Werl', 'The mint(s) at the City of Werl, North Rhine-Westphalia (German: Nordrhein-Westfalen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/west_friesland', 'West Friesland', 'West Friesland (also West Frisia; Dutch: West-Friesland; West Frisian: West-Fryslân) is a contemporary region in the northwestern Netherlands, in the province of North Holland.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/west_point', 'West Point', 'The US federal mint at West Point.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wetzlar', 'Wetzlar', 'The mint(s) at the city of Wetzlar, National State of Hesse (German: Hessen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wittenberge', 'Wittenberge', 'The mint(s) at the city of Wittenberge, National State of Brandenburg, Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wolfenbuettel', 'Wolfenbüttel', 'The mint(s) at the City of Wolfenbüttel, National State of Lower Saxony (German: Niedersachsen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/worms', 'Worms', 'The mint(s) at the City of Worms, National State of Rhineland-Palatinate (German: Rheinland-Pfalz), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/woerth_am_main', 'Wörth am Main', 'The mint(s) at the city of Wörth am Main in Franconia (German: Franken), National State of Bavaria (German: Freistaat Bayern), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/wuerzburg', 'Würzburg', 'The mint(s) at the City of Würzburg, region of Franconia (German: Franken), National State of Bavaria (German: Freistaat Bayern), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/xanten', 'Xanten', 'The mint(s) at the City of Xanten, North Rhine-Westphalia (German: Nordrhein-Westfalen), Germany. Nearby are the sites of the Roman legionary camp of Castra Vetera and the Roman Colonia Ulpia Traiana.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/xanthus', 'Xanthus', 'The mint at the ancient site of Xanthus in Lycia. The mint is known in Lycian as Arñna.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/yazd', 'Yazd', 'Yazd (Persian: یزد‎ ) is the capital of Yazd Province, Iran, and a centre of Zoroastrian culture', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zacynthus', 'Zacynthus', 'The mint at the ancient site of Zacynthus on Zacynthus, off Elis.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zagaba', 'Zagaba', 'Mint of Zagaba in Lycia, probably to be located at Avşar Tepesi. See F. Kolb and W. Tietz, Chiron 31 (2001), 347ff.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zancle', 'Zancle', 'The mint at the ancient site of Zancle/Zankle in Sicily.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zanjibar', 'Zanjibar', 'Zanzibar (/ˈzænzɨbɑr/) is the semi-autonomous part of Tanzania in East Africa. The capital is Zanzibar City, located on the island of Unguja. Its historic centre is Stone Town, which is a World Heritage Site.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zaragossa', 'Zaragossa', 'Zaragoza (/ˌzærəˈɡoʊzə/, /ˌsærəˈɡoʊsə/ or /ˌθærəˈɡoʊθə/, Spanish: [θaɾaˈɣoθa]), also called Saragossa(/ˌsærəˈɡɒsə/)[1] in English,[2] is the capital city of the Zaragoza province and of the autonomous community ofAragon, Spain. It lies by the Ebro river and its tributaries, the Huerva and the Gállego, roughly in the center of both Aragon and the Ebro basin.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zarai', 'Zarai', 'The mint at the ancient site of Zarai in Numidia', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zaranj', 'Zaranj', 'Zaranj is the capital of Sijistan.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zautha', 'Zautha', 'The mint at the ancient site of Zautha in Mesopotamia', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zela', 'Zela', 'The mint at the ancient site of Zela in Pontus.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zeleia', 'Zeleia', 'The mint at the ancient site of Zeleia in Troas.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zellerfeld', 'Zellerfeld', 'The mint(s) at the Bergstadt Zellerfeld, in 1924 merged with Clausthal to create the City of Clausthal-Zellerfeld, National State of Lower Saxony (German: Niedersachsen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zephyrium', 'Zephyrium', 'The mint at the ancient site of Zephyrium in Cilicia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zeugma', 'Zeugma', 'The mint at the ancient site of Zeugma in Commagene.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zilis', 'Zilis', 'The mint at the ancient site of Zilis in Mauretania.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ziz', 'Ziz', 'The ancient Carthaginian mint at the later site of Panormus (modern Palermo) in Sicily', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zofingen', 'Zofingen', 'Zofingen is a city in the canton of Aargau in Switzerland. It is the capital of the district of Zofingen. Zofingen is a walled city and home of an ancient monastic settlement.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zone', 'Zone', 'The mint at the ancient site of Zone in Thrace', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zons', 'Zons', 'The mint(s) at the city of Zons, North Rhine-Westphalia (German: Nordrhein-Westfalen), Germany.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zug', 'Zug', 'Zug is the capital of the canton of Zug in Switzerland. The name Zug originates from fishing vocabulary; in the Middle Ages it referred to the right to pull up fishing nets and hence to the right to fish.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/zurich', 'Zürich', 'The mint(s) of Zürich, the largest city in Switzerland and the capital of the canton of Zürich. Coins were issued in the name of Louis the Child, the Burgundian and German kings, the Swabian dukes  the Fraumünster abbey, as well as for the municipality of Zurich and the canton of Zurich.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-andalus', 'al-Andalus', 'Córdoba (/ˈkɔrdəbə/, Spanish: [ˈkoɾðoβa]),[1] also called Cordova (/ˈkɔrdəvə/) in English,[2] is a city in Andalusia, southern Spain, and the capital of the province of Córdoba.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-andalus_malaga', 'al-Andalus (Malaga)', 'Malaga is a city in Andalusia.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-bab', 'al-Bab', 'Al-Bab (Arabic: الباب‎ / ALA-LC: al-Bāb) is a Syrian city administratively belonging to the Aleppo Governorate. Al-Bab is located northeast of Aleppo and has an area of 30 km².', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-basrah', 'al-Basrah', 'Basra, also written Basrah (Arabic: البصرة‎; BGN: Al Başrah), is the capital of Basra Governorate, located on theShatt al-Arab river in southern Iraq between Kuwait and Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-biyar', 'al-Biyar', 'Biyar Jumand هس in the area of Qumus', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-furat', 'al-Furat', 'In the district of Shadh Bahman in Iraq, but its exact location unknown. Klat, 16.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-fustat', 'al-Fustat', 'Fustat (also Fostat, Al Fustat, Misr al-Fustat and Fustat-Misr, and in Arabic: الفسطاط‎, al-Fusţāţ), was the first capital of Egypt under Muslim rule. It was built by the Muslim general \'Amr ibn al-\'As immediately after the Muslim conquest of Egypt in AD 641.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-haruniyah', 'al-Haruniyah', 'Harunabad (Persian: هارون اباد‎, also Romanized as Hārūnābād) is a village in Sofalgaran Rural District, Lalejin District, Bahar County, Hamadan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-iraq_baghdad', 'al-Iraq (Baghdad)', 'Baghdad (Arabic: بغداد‎ Baġdād, Kurdish بەغدا, Bexda) is the capital of the Republic of Iraq, as well as the coterminous Baghdad Province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-iskandariyah', 'al-Iskandariyah', 'Alexandria (/ˌælɪɡˈzændrɪə/ or /ˌælɪɡˈzɑːndrɪə/;[1] اسكندرية, pronounced [eskendeˈrejjæ] in Egyptian Arabic)[see other names] is the second largest city and the second largest metropolitan area in Egypt after Greater Cairo by size and population, extending about 32 km (20 mi) along the coast of the Mediterranean Sea in the north central part of the country. It is also the largest city lying directly on the Mediterranean coast.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-jazirah_ummayad', 'al-Jazirah (Ummayad)', 'A province in upper Iraq between the Tighris and the Euphrates. Klat, p. 14.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-jisr', 'al-Jisr', 'a bridge & could be anywhere. Klat, p. 14', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-kufa', 'al-Kufa', 'Kufa (Arabic: الكوفة‎ al-Kūfah) is a city in Iraq, about 170 kilometres (110 mi) south of Baghdad, and 10 kilometres (6.2 mi) northeast of Najaf. It is located on the banks of the Euphrates River.', 'http://nomisma.org/ontology#Mint');
INSERT INTO `coin_mint` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/al-lafr', 'al-Lafr', 'Stub for this mint', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-madinat_al-mutawakkiliyah', 'al-Madinat al-Mutawakkiliyah', 'al-Madinat al-Mutawakkiliyah is just north of Sammara and was built by the Abbasids.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-maghrib_abbasid', 'al-Maghrib (Abbasid)', 'A mint located in Cairo', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mahdiyah', 'al-Mahdiyah', 'Mahdia (Arabic: المهدية‎ al-Mahdiya), is a Tunisian coastal city, south of Monastir and southeast of Sousse.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-manadhir', 'al-Manadhir', 'The name of two districts, with tehir chief-towns, named Greater Manadhir & lIttle Manadhir in Khuzistan, Iran', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mansuriyah', 'al-Mansuriyah', 'Al-Mansuriya[a] or Mansuriyya (Arabic: المنصوريه ‎), near Kairouan, Tunisia, was the capital of the Fatimid Caliphateduring the rules of the Ismaili Shia Muslim Imams al-Mansur Billah (r. 946–953) and al-Mu\'izz li-Din Allah (r. 953–975).', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mariyah', 'al-Mariyah', 'Dénia (Valencian pronunciation: [ˈdenia], Spanish: Denia) is a city in the province of Alicante, Spain, on the Costa Blanca halfway between Alicante and Valencia, the judicial seat of the comarca of Marina Alta. As of 2012, it had a population of 44,455.[1]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mawsil', 'al-Mawsil', 'al-Mawsil or Mosul (/moʊˈsuːl/; Arabic: الموصل‎ al-Mawṣil; Kurdish: مووسڵ Mûsil; North Mesopotamian Arabic: el-Mōṣul;Ottoman Turkish: موصل Musul; Syriac: ܢܝܢܘܐ Nînwe,Turkish: Musul), is a city in northern Iraq.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mubarakah', 'al-Mubarakah', 'Balkh (/bɑːlx/; Persian/Pashto: بلخ Balkh; Bactrian: βαχλο ẞaxlə) was an ancient city and centre of Buddhism, Sufism and Zoroastrianism in what is now northern Afghanistan.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mubarakah_abbasid', 'al-Mubarakah (Abbasid)', 'some place in North Africa', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-muhammadiyah', 'al-Muhammadiyah', 'Rey or Ray [Pronunciation: rā] (Persian: شهر ری‎, Shahr-e-Ray, \"City of Ray\"), also known as Rhages (/ˈreɪdʒəz/;Greek: Ῥάγαι, Rhagai; Latin: Rhagae or Rhaganae) and formerly as Arsacia, is the capital of Rey County, Tehran Province, Iran, and is the oldest existing city in the province.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-mukalla', 'al-Mukalla', 'Al Mukalla (Arabic: المكلا‎ Al Mukallā) is a main sea port and the capital city of the Hadhramaut coastal region in Yemen in the southern part of Arabia on the Gulf of Aden close to the Arabian Sea. It is located 480 km (300 mi) east of Aden and is the most important port in the Governorate of Hadramaut, the largest governorate in Yemen.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-qahirah', 'al-Qahirah', 'Located near the Nile Delta, it was founded in AD 969. Nicknamed \"the city of a thousand minarets\" for its preponderance of Islamic architecture, Cairo has long been a center of the region\'s political and cultural life. Cairo was founded by Jawhar al-Siqilli \"The Sicilian\",among the Fatimid dynasty in the 10th century CE, but the land composing the present-day city was the site of national capitals whose remnants remain visible in parts ofOld Cairo. Cairo is also associated with Ancient Egypt as it is close to the ancient cities of Memphis, Giza andFustat which are near the Great Sphinx and the pyramids of Giza.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-qahirah_al-mahrusah', 'al-Qahirah al-Mahrusah', 'Located near the Nile Delta, it was founded in AD 969. Nicknamed \"the city of a thousand minarets\" for its preponderance of Islamic architecture, Cairo has long been a center of the region\'s political and cultural life. Cairo was founded by Jawhar al-Siqilli \"The Sicilian\",among the Fatimid dynasty in the 10th century CE, but the land composing the present-day city was the site of national capitals whose remnants remain visible in parts ofOld Cairo. Cairo is also associated with Ancient Egypt as it is close to the ancient cities of Memphis, Giza andFustat which are near the Great Sphinx and the pyramids of Giza.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-qayrawan', 'al-Qayrawan', 'Kairouan (Arabic: القيروان‎ Al Qairawān), also known as Kirwan or al-Qayrawan, is the capital of the Kairouan Governorate in Tunisia. It is a UNESCO World Heritage site. The city was founded by the Arabs around 670.[1] In the period of Caliph Mu\'awiya (reigned 661-680), it became an important centre for Sunni Islamic scholarship andQuranic learning,[2] and thus attracting a large number of Muslims from various parts of the world, next only to Meccaand Medina. The holy Mosque of Uqba is situated in the city.[3][4]', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-quds', 'al-Quds', 'Jerusalem (/dʒəˈruːsələm/; Hebrew: יְרוּשָׁלַיִם About this sound Yerushaláyim; Arabic: القُدس‎ ) is one of the oldest cities in the world. It is considered holy to the three major Abrahamic religions—Judaism, Christianity and Islam.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-rafiqah', 'al-Rafiqah', 'Ar-Raqqah (Arabic: الرقة‎ ar-Raqqah), also called Rakka and Raqqa, is a city in Syria located on the north bank of the Euphrates River, about 160 kilometres (99 miles) east of Aleppo. It is located 40 kilometres (25 miles) east of the Tabqa Dam, Syria\'s largest dam. The city was the capital of the Abbasid Caliphate between 796 and 809 under the reign of Caliph Harun al-Rashid. With a population of 220,488 based on the 2004 official census, ar-Raqqah was the sixth largest city in Syria.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-ramlah', 'al-Ramlah', 'Ramla (Hebrew: רַמְלָה, Ramla; Arabic: الرملة‎, ar-Ramlah) is a city in central Israel. Ramla was founded circa 705–715 CE by the Umayyad governor and future caliph Sulayman ibn Abd al-Malik.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-samiyah', 'al-Samiyah', 'Al-Samiya was in the Shatt al-Arab area of lower Iraq.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-shash', 'al-Shash', 'Tashkent (/ˌtæʃˈkɛnt/; Uzbek: Toshkent, Тошкент [tɒʃˈkent]; Russian: Ташкент, [tɐʂˈkʲɛnt]; literally \"Stone City\") is the capital of Uzbekistan.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-sus', 'al-Sus', 'Shush (Persian: شوش‎; also Romanized as Shūsh, Shoosh, and by name of the ancient nearby city: Sūsa) is a city in and the capital of Shush County, Khuzestan Province, Iran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-taymarah', 'al-Taymarah', 'Isfahan is the capital of Isfahan Province in Iran, located about 340 kilometres (211 miles) south of Tehran.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-urdunn', 'al-Urdunn', 'Amman (English pronunciation: /ɑːˈmɑːn/; Arabic: عمّان‎ ʿAmmān), is the capital and most populous city of Jordan. It is the country\'s political, cultural and commercial centre and one of the oldest continuously inhabited cities in the world.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/al-yamamah', 'al-Yamamah', 'Al-Yamamah (Arabic: اليمامة al-Yamāma‎) is an ancient district lying to the east of the plateau of Najd in modern-day Saudi Arabia, or sometimes more specifically, the now-extinct ancient village of Jaww Al-Yamamah, near Al-Kharj, after which the rest of the region was named.', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/burhanpur', 'burhanpur', 'Burhanpur is situated on the southwestern border of Madhya Pradesh near the banks of Tapti River (also called as Tapi River).', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/DEL_sco', 'ΔEΛ Mint', 'Delta-Epsilon-Lambda Mint, Associated with Antioch', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/DI_sco', 'ΔI Mint', 'Delta-iota Mint, in Southern or Eastern Syria', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/DH_sco', 'ΔΗ Mint', 'Delta-Eta Mint, in Syria or Phoenicia', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/ER_sco', 'ΕΡ Mint', 'Epsilon-Rho Mint, in Cilicia west of Tarsus', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/XAR_sco', 'ΞAP Mint', 'Xi-alpha-rho Mint, in Northern Media or Hyrcania', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/PA_sco', 'ΠA Mint', 'Pi-Alpha Mint, in Northern Mesoptamia', 'http://nomisma.org/ontology#Mint'),
('http://nomisma.org/id/SZ_sco', 'ΣZ Mint', 'Sigma-Zeta Mint, perhaps in Cilicia Pedias', 'http://nomisma.org/ontology#Mint');
INSERT INTO `coin_numismatic_term` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/axis', 'Axis', 'The relationship between the orientation obverse and reverse of a coin. Often expressed as hours of the clock or degrees in a circle.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/city', 'City', 'Term used to describe a civic entity in the name on which coinage is struck, or assumed to be struck.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/closing_date', 'Closing date', 'The closing date of a hoard.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/coin_wear', 'Coin wear', 'Wear of a coin, caused by its use. Obverse and reverse are treated separately. The degree of wear is classified into five categories as defined by \"Abnutzung und Korrosion: Bestimmmungstafeln zur Bearbeitung von Fundmünzen = Usure et corrosion. (1995). Lausanne.\" (OCLC 174260520): W1 - not or barely worn; W2 - slightly worn; W3 worn; W4 - heavily worn; W5 - heavily or totally worn (plain). The wear of stronlgy corroded coins (C3-C5) usually can\'t be attributed to a specific degree of wear. There is also an additional category for coins that cannot be classified: W0 (undetermined).', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/collection', 'Collection', 'General term meaning the objects held by an institution or individual. Or the holding entity itself.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/currency', 'Currency', 'A system of money (monetary units) in common use, issued by a state, city, or any other legal authority, consisting of various subunits and multiples (denominations).', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/date_found', 'Date found', 'The date on which something was found.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/denomination', 'Denomination', 'Term indicating the value of a coin. Examples: tetradrachm, chalkous, denarius.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/diameter', 'Diameter', 'The diameter of a coin. Unless otherwise indicated, millimeters are the default measurement.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/ethnic', 'Ethnic', 'Generally, a tribal or ethnic name appearing on a coin. Distinct from personal authority as indicated by the presence of ruler\'s name.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/field_of_numismatics', 'Field of Numismatics', 'Any widely recognized area of study within the discipline of numismatics.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/findspot', 'Findspot', '', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/nomisma_region', 'Geographic region', 'A geographic region defined in Nomisma without explicit reference to an external authority.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/head_1911_region', 'Head 1911 Region', 'A geographic region defined in Head 1911.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/height', 'Height', 'The vertical extent of an object. This term is intended for use in the description of paper money. For irregular coins, nm:diameter_minimum and nm:diameter_maximum are available.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/imperatorial_issue', 'Imperatorial issue', 'Term used to describe the category of Roman Republican coinage struck in the name of Imperatores, rather than appointed moneyers.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/indiction', 'Indiction', 'A dating system of 15 year periods used in the Late Roman and Byzantine periods.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/koinon', 'Koinon', 'Term used to describe a commonality in whose name a coinage may be issued, such as the \'Koinon of the Macedonians\'', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/legend', 'Legend', 'The writing found on the obverse or reverse of a coin.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/manufacture', 'Manufacture', 'The technique of manufacture. For example, struck or cast.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/material', 'Material', 'The physical material from which an object is made.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/diameter_maximum', 'Maximum diameter', 'The maximum diameter of an irregular round object, such as a coin. To be used in preference to nm:height and nm:width, which apply to paper money.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/diameter_minimum', 'Minimum diameter', 'The minimum diameter of an irregular round object, such as a coin. To be used in preference to nm:height and nm:width, which apply to paper money.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/mint', 'Mint', 'Generic term for a place of manufacture of a coin or for the issuing city.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/numismatic_end_date', 'Numismatic End Date', 'The date at which an entity ceased to issue coins or to be responsible for the issuance of coins.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/numismatic_start_date', 'Numismatic Start Date', 'The date at which an entity began to issue or be responsible for the issuance of coins.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/object_type', 'Object type', 'The numismatic type of an object. Ex. \'coin\'.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/obverse', 'Obverse', 'The reverse of a coin. Opposite of \'reverse\'.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/reference_work', 'Reference work', 'Any well-known reference work in numismatics.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/reverse', 'Reverse', 'The reverse of a coin. Opposite of \'obverse\'.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/royal_issue', 'Royal issue', 'Term used to describe the category of coinage issued by kings, queens and other royal persons', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/thickness', 'Thickness', 'The thickness of an object.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/tribal_issue', 'Tribal issue', 'Term used to describe a category of coinage struck in the name of \'tribe\' or other ethnic group.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/type_series', 'Type series', 'A list with items describing individual numismatic types.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/type_series_item', 'Type series item', 'An item within a type series describing an individual coin type.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/undertype', 'Undertype', 'In a restruck coin, \'undertype\' refers to the aspects of the original striking.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/monogram', 'Unspecified monogram', '', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/weight', 'Weight', 'The weight of an object.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/weight_standard', 'Weight Standard', 'A named system of standardized weights to which a series of coins is produced.', 'http://nomisma.org/ontology#NumismaticTerm'),
('http://nomisma.org/id/width', 'Width', 'The width of an object. This term is intended for use in the description of paper money. For irregular coins, nm:diameter_minimum and nm:diameter_maximum are available.', 'http://nomisma.org/ontology#NumismaticTerm');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/titus_aurelius_fulvus_antoninus', ' Titus Aurelius Fulvus Antoninus', 'Twin brother of the later emperor Commodus. Son of Marcus Aurelius and Faustina the Younger.\nLit.: PIR² A 1512.', 'http://xmlns.com/foaf/0.1/Person'),
