('http://nomisma.org/id/a_maroneia', 'A(…)', 'An individual who issued coins at the ancient city of Maroneia, 495-448 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 124.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a-_paphus', 'A- of Paphos', 'Fifith century king of Paphos in Cyprus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_allienvs_pro_cos_rrc', 'A. Allienus', 'Roman Republican Moneyer, c. 47 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_cae_rrc', 'A. Caecilius', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_caecilius_kapiton_adramyteum', 'A. Caecilius Kapiton', 'Strategos in Adramyteum (Mysia). His name is attested on coins issued under Hadrianus. See J. Stauber, Die Bucht von Adramytteion. Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 213 nos. 127 and 130; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 592 s. v. Kapiton; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 241 s. v. Kapiton (no. 38).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_hirtivs_pr_rrc', 'A. Hirtius', 'Roman Republican Moneyer, c. 46 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_licinivs_nerva_iii_vir_rrc', 'A. Licinius Nerva', 'Roman Republican Moneyer, c. 47 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_licinius_nerva_silianus', 'A. Licinius Nerva Silianus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_manli_q_f_ser_rrc', 'A. Manlius', 'Roman Republican Moneyer, c. 118 - 107 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_manli_a_f_q_rrc', 'A. Manlius', 'Roman Republican Moneyer, c. 80 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_plavtivs_aed_cvr_rrc', 'A. Plautius', 'Roman Republican Moneyer, c. 55 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_pompeius_vopiscus_pirp660', 'A. Pompeius Vopiscus', 'Reading of first Name (A. or L.) is uncertain. Legatus Augusti pro praetore in Thrace under Antoninus Pius in AD 157/158. His name appears on coins e.g. of Bizye, Hadrianopolis, Philippopolis, Plotinopolis, and Pautalia. There and in Bizye always with title of Hegemon. Lit.: Y. Youroukova, Die Münzprägung von Bizye (1981) 10. 52; B. E. Thomasson, Laterculi Praesidum I (1984) 165 no. 27; ibid. I Addenda (2011) 22:027; PIR² P 660.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_post_a_f_s_n_albin_rrc', 'A. Postumius Albinus', 'Roman Republican Moneyer, c. 81 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_albinvs_s_f_rrc', 'A. Postumius Albinus', 'Roman Republican Moneyer, c. late 90s BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a_spvri_rrc', 'A. Spuri[us]', 'Roman Republican Moneyer, c. 139 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/a(-)oros_colophon', 'A[…]oros', 'Magistrate attested on the Alexander coinage of Colophon, c. 180 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1870.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ab_abdera', 'Ab...', 'Moneyer attested on the coinage of Abdera in Thrace, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abal_hagar', 'Abal of Hagar', 'Abal of Hagar issued coins in the Eastern Arabia in the 2nd century, attested by the find of IGCH 1804 in Susa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aban_arabia', 'Aban- of Arabia', 'A king or prince of Arabia attested by IGCH 1765, a hoard found in eastern Arabia (modern Bahrain).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abaqa', 'Abaqa', 'Abaqa Khan, also Abaga (Mongolian: Abaga Khaan, \"paternal uncle\"; Mongolian Cyrillic: Аваг хаан), or Abagha Khan, was the second Mongol ruler (Il-khan) of the Persian Ilkhanate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abarbasi_elymais', 'Abarbasi of Elymais', 'Abarbasi, client-king under Parthia (c.160–c.170).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abbas_hilmi', 'Abbas Hilmi', 'Abbas II Hilmi Bey (also known as ‘Abbās Ḥilmī Pasha) (Arabic: عباس حلمي باشا‎) was the last Khedive ( Ottoman viceroy) of Egypt and Sudan, ruling from 8 January 1892 to 19 December 1914.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_allah', 'Abd Allah', 'An official whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_allah_ibn_muhammad_al-khalifah', 'Abd Allah ibn Muhammad al-Khalifah', 'Abdullah Ibn-Mohammed or Abdullah al-Taashi or Abdullah al-Taaisha, also known as \"The Khalifa\" (Arabic: c. عبدالله بن سيد محمد خليفة‎) was a Sudanese Ansar General and ruler who was one of the principal followers of Muhammad Ahmad.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_allah_ibn_rashid', 'Abd Allah ibn Rashid', 'An official whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_sasan_sinope', 'Abd Sasan of Sinope', 'A Persian satrap issuing coins from Sinope in Paphlagonia, ‘Abd Sasan‘ (or ‘Abd Sisin’) written in Aramaic; probably identical with Sysinas, son of Datames (satrap of Cappodocia and later Paphlagonia), 362-353 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-\'aziz_b_al-hasan', 'Abd al-\'Aziz b. al-Hasan', 'Abdelaziz of Morocco (Arabic: عبد العزيز الرابع‎), also known as Mulai Abd al-Aziz IV, served as the Sultan of Morocco from 1894 at the age of sixteen until he was deposed in 1908. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-malik_i_ibn_nuh_i', 'Abd al-Malik I ibn Nuh I', 'Abd al-Malik I was emir of the Sāmānids (954–961).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-malik_ibn_yazid', 'Abd al-Malik ibn Yazid', 'Abū ʿAwn ʿAbd al-Malik ibn Yazīd al-Khurasānī (fl. 747–784/5) was an early supporter of the Abbasids from Jurjan, who participated in the campaigns of the Abbasid Revolution and served as governor of Egypt and Khurasan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rahman_i', 'Abd al-Rahman I', 'Abd al-Rahman I, or, his full name by patronymic record, Abd al-Rahman ibn Mu\'awiya ibn Hisham ibn Abd al-Malik ibn Marwan was the founder of a Muslim dynasty that ruled the greater part of Iberiafor nearly three centuries.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rahman_ii', 'Abd al-Rahman II', 'Abd ar-Rahman II (Arabic: عبد الرحمن الثاني‎) was Umayyad Emir of Córdoba in the Al-Andalus (Moorish Iberia) from 822 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rahman_ibn_hisham', 'Abd al-Rahman ibn Hisham', 'Moulay Abd al-Rahman ibn Hisham (Arabic: عبد الرحمان‎) was the sultan of Morocco from 1822 to 1859. He was a member of the Alaouite/Alawi/Filali dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rahman_ibn_yazid', 'Abd al-Rahman ibn Yazid', 'Abd al-Rahman ibn Yazid (141-152/759-769) is an Abbasid official in Egypt whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd-hadad_hierapolis', 'Abd-Hadad of Hierapolis', 'A Syrian priest-dynast ca. 330 BC, attested on coinage from Hierapolis featuring the goddess Atargatis on the obverse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdashtart_i_sidon', 'Abdashtart I, King of Sidon', 'Abdashtart I (in Greek, Straton I), the son of Baalshillem II, ruled the Phoenician city-state of Sidon from 365 to 352 BC, having been associated in power by his father since the 380s.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdashtart_ii_sidon', 'Abdashtart II, King of Sidon', 'Abdashtart II, known by a Hellenized name, Straton II, was a client-king from Sidon of the Achaemenid Empire from 345-332 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdissares_sophene', 'Abdissares of Sophene', 'Abdissares ruled the kingdom of Sophene after the assassination of his father, Xerxes in 212 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdulhamid_i', 'Abdul Hamid I', 'Abdülhamid I, Abdul Hamid I or Abd Al-Hamid I (Ottoman Turkish: عبد الحميد اول, `Abdü’l-Ḥamīd-i evvel; Turkish: Birinci Abdülhamit) was the 27th Sultan of the Ottoman Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rahman_iii_al-nasir_li-din_allah', 'Abdul Rahman III', 'Abd-ar-Rahman III ( 11 January 889/91] – 15 October 961) was the Emir and Caliph of Córdoba (912–961) of the Ummayad dynasty in al-Andalus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdulhamid_ii', 'Abdulhamid II', 'Abdul Hamid II (Ottoman Turkish: عبد الحميد ثانی, `Abdü’l-Ḥamīd-i sânî; Turkish: İkinci Abdülhamit; 22 September 1842 – 10 February 1918) was the 34th Sultan of the Ottoman Empire and the last Sultan to exert effectiveautocratic control over the fracturing state.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdulmecid', 'Abdulmecid', 'Abdülmecid I (Ottoman Turkish: عبد المجيد اول ‘Abdü’l-Mecīd-i evvel) was the 31st Sultan of the Ottoman Empire and succeeded his father Mahmud II on 2 July 1839.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abdulaziz', 'Abdülaziz', 'Abdülaziz of the Ottoman Empire or Abdülaziz I (Ottoman Turkish: عبد العزيز / `Abdü’l-`Azīz, Turkish: I. Abdülaziz) was the 32nd Sultan of the Ottoman Empire and reigned between 25 June 1861 and 30 May 1876.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abercromby_sir_ralph', 'Abercromby, Sir Ralph (d.1801)', 'Sir Ralph Abercromby KB (sometimes spelt Abercrombie) (7 October 1734 – 28 March 1801) was a Scottish soldier and politician. He rose to the rank of lieutenant-general in the British Army, was noted for his services during the Napoleonic Wars, and served as Commander-in-Chief, Ireland.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abgarus_viii_osroene', 'Abgarus VIII of Osroene', 'Abgar VIII of Edessa, also known as Abgar the Great or Abgar bar Ma\'nu, was an Arab king of Osroene from 177-212 CE. Abgar the Great was most remembered for his alleged conversion to Christianity in about 200 CE and the declaration of Christianity as the official religion of the city at that time.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abiel_brt_bgln_arabia', 'Abiel daughter of Baglan', 'Abiel daughter of Baglan issued coins in Eastern Arabia in the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abiel_brt_lbs_arabia', 'Abiel daughter of Labīš', 'Abiel daughter of Labīš issued coins in Eastern Arabia in the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abiel_brt_msms_arabia', 'Abiel daughter of Ma\'šamaš', 'Abiel daughter of Ma\'šamaš issued coins in Eastern Arabia in the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abiel_brt_nsyl_arabia', 'Abiel daughter of Našīl', 'Abiel daughter of Našīl issued coins in Eastern Arabia in the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abinergaos_i_characene', 'Abinergaos I of Characene', 'Abinergaos I, also known as Abinerglus, was the king of Characene during the second decade of the Christian era.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abinergaos_ii_characene', 'Abinergaos II of Characene', 'Abinergaos II was a ruler of Characene, an ancient kingdom located at the head of the Persian Gulf in modern Iraq. He reigned around 170 AD and like most Characene rulers he is known only from his coins, on which the spelling of his name varies.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abinergaos_iii_characene', 'Abinergaos III of Characene', 'Abinergaos III of Characene, who succeeded Maga, was the final king of Characene before its dissolution by the Sasanian Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abraham_altermann_stuttgart', 'Abraham Altermann', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1568 to ? and 1578 to 1592. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_\'iqal_al-aghlab', 'Abu \'Iqal al-Aghlab', 'He was the fourth Aghlabid emir in Ifirqiyq. He ruled from 837 to 840 .', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_abd_allah_muhammad_i_al-mustansir', 'Abu Abd Allah Muhammad I al-Mustansir', 'Muhammad I al-Mustansir (Abu Abd Allah Muhammad al-Mustansir ibn Yahya) was the second ruler of the Hafsid dynasty in Ifriqiya and the first to claim the title of Khalif.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_abd_allah_muhammad_ii', 'Abu Abd Allah Muhammad II', 'Abu \'l-Gharaniq Muhammad II ibn Ahmad (Arabic: أبو الغرانيق محمد الثاني بن أحمد‎) (died 875) was the eighth Emir of the Aghlabids in Ifriqiya (864–874).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_ali_al-hasan_ibn_marwan', 'Abu Ali al-Hasan ibn Marwan', 'Abu Ali al-Hasan ibn Marwan (380-387/990-997) was the second ruler of the Marwanids, (990–1085), which was an Arab or Kurdish dynasty in the Diyar Bakr region of Upper Mesopotamia and Armenia, centered on the city of Amid (Diyarbakır).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_bakr_ibn_\'umar', 'Abu Bakr ibn \'Umar', 'Abu Bakr ibn Umar ibn Ibrahim ibn Turgut, sometimes suffixed al-Sanhaji or al-Lamtuni  ( Arabic: أبو بكر بن عمر‎) was a chieftain of the Lamtuna Berbers of the western Sahara, and commander of the Almoravidsfrom 1056 until his death in 1087.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_hafs_\'umar_al-murtada', 'Abu Hafs \'Umar al-Murtada', 'Abu Hafs Umar al-Murtada (Arabic: أبو حفص المرتضى عمر بن أبي إبراهيم اسحاق بن يوسف بن عبد المؤمن‎) was an Almohad caliph who reigned over part of Morocco from 1248 until his death in 1266.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_ibrahim_ahmad', 'Abu Ibrahim Ahmad', 'He was the sixth Aghlabid emir in Ifirqiyq. He ruled from 856 to 853.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_ishaq_ibrahim_ii', 'Abu Ishaq Ibrahim II', 'Abu Ishaq Ibrahim II ibn Ahmad (Arabic: أبو اسحاق ابراهيم الثاني‎) was the ninth Aghlabid emir of Ifriqiya. He ruled from 875 until his abdication in 902.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_ishaq_jamal_al-din_ibn_mahmud_shah', 'Abu Ishaq Jamal al-Din ibn Mahmud Shah', 'The last ruler of a short lived empire in Fars in the 14th century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_muhammad_abd_allah_ii', 'Abu Muhammad Abd Allah II', 'The Zayyanids (Arabic: زيانيون‎, Ziyānyūn) or Abd al-Wadids (Arabic: بنو عبد الواد‎, Bānu ʿabd āl-Wād) are a Berber Zenata dynasty that ruled the Kingdom of Tlemcen. Abd Allah II was one of their last rulers before it came under Ottoman control.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_muhammad_abd_al-mu\'min', 'Abu Muhammad Abd al-Mu\'min', 'Abd al-Mu\'min (1094–1163) also known as Abdelmoumen El Goumi (Arabic: ‏عبد المؤمن بن علي ʿAbd al-Muʾmin bin ʿAlī or عبد المومن الــكـومي ʿAbd al-Mūmin al-Kūmī/al-Gūmī‎, Berber: Ɛebd Elmumen Uɛli Agumi) was a ZenataBerber prominent member of the Almohad movement.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_sa\'id_qansuh', 'Abu Sa\'id Qansuh', 'Abu Sa\'id Qansuh (904-905/1498-1500) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_said', 'Abu Said', 'Abu Sa\'id Bahadur Khan) (Persian; Urdu; Arabic: ابو سعید بہادر خان ) also spelled Abusaid Bahador Khan, Abu Sayed Behauder (Mongolian: ᠪᠦᠰᠠᠢ ᠪᠠᠬᠠᠲᠦᠷ ᠬᠠᠨ᠂ Busayid Baghatur Khan), was the ninth ruler of the Ilkhanate state in Iran (1316–1335).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_ya\'qub_yusuf_i', 'Abu Ya\'qub Yusuf I', 'Abu Ya`qub Yusuf or Yusuf I (Arabic: أبو يعقوب يوسف‎ Abū Ya‘qūb Yūsuf) was the second Almohad Amir or caliph. He reigned from 1163 until 1184 in Marrakech.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_yahya_abu_bakr_ibn_abd_al-haqq_i', 'Abu Yahya Abu Bakr ibn Abd al-Haqq I', 'Abu Yahya ibn Abd al-Haqq (died 1258?) was a Marinid ruler.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_yusuf_ya\'qub', 'Abu Yusuf Ya\'qub', 'Abū Yūsuf Ya‘qūb al-Manṣūr (Arabic: ابو يوسف يعقوب المنصور‎) also known as Moulay Yacoub, was the third Almohad Caliph.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-\'abbas_abd_allah', 'Abu al-\'Abbas Abd Allah', 'Ziyadat Allah I (Arabic: زيادة الله الأول‎) was the third Aghlabid Emir in Ifriqiya from 817 until his death in 838.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-\'abbas_muhammad', 'Abu al-\'Abbas Muhammad', 'Muhammad I Abu \'l-Abbas was the fifth emir of the Aghlabids in Ifriqiya (ruled 841–856).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-hasan_ali', 'Abu al-Hasan Ali', 'Abu al-Hasan Ali (392-394/1002-1104) was a Hamdanid serving as a Fatimid governor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-hasan_ali_ibn_\'uthman_ii', 'Abu al-Hasan Ali ibn \'Uthman II', 'Abu Al-Hasan \'Ali ibn \'Othman (Arabic: أبو الحسن علي بن عثمان‎) was a sultan of the Marinid dynasty who reigned in Morocco between 1331 and 1348.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-jird', 'Abu al-Jird', 'An official whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-ma\'ali_sharif', 'Abu al-Ma\'ali Sharif', 'Abu al-Ma\'ali Sharif (392-394/1002-1104) was a Hamdanid serving as a Fatimid governor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-musafir_al-fath_ibn_muhammad_al-afshin', 'Abu al-Musafir al-Fath ibn Muhammad al-Afshin', 'Abu\'l-Musafir al-Fath was the last Sajid amir of Azerbaijan (928–929).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-nasr_tumanbay', 'Abu al-Nasr Tumanbay', 'Al-Ashraf Tuman bay better known as Tuman bay II succeeded as Sultan of Egypt during the final period of Mamluk rule in Egypt prior to its conquest by the Ottoman Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-qasim_ibn_al-ikhshid_unujar', 'Abu al-Qasim ibn al-Ikhshid Unujar', 'Abu\'l-Qasim Unujur ibn al-Ikhshid (Arabic: أبو القاسم أنوجور بن الإخشيد‎) was the second ruler of the Ikhshidid dynasty, which ruled Egypt, Syria and the Hejaz under the suzerainty of the Abbasid Caliphate but de facto autonomous. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_al-sa\'adat_muhammad', 'Abu al-Sa\'adat Muhammad', 'Abu al-Sa\'adat Muhammad (901-904/1496-1498) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abyatha_himyarites', 'Abyatha of Arabia', 'Abyatha was a king in Arabia Felix attested to a coin published by Barclay Head in 1880 (Num. Chron., 1880, Pl. XV. 3). It is likely Himyarite in origin.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abyatha_hagar', 'Abyatha of Hagar', 'Abyatha of Hagar issued coins in Eastern Arabia in the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aces_bosporus', 'Aces of Bosporus', 'Aces or Akas was a ruler in the Kingdom of the Cimmerian Bosporus, but is not listed among its kings. There is at least one attested type, similar to Paerisades, from the second century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/achaeus', 'Achaeus', 'Achaeus was a Seleucid general under Seleucus III and Antiochus III. He reclaimed much of western Asia Minor for Antiochus III in 223 BC before proclaiming himself king in 220 BC. He was besieged in Sardes before he was captured and executed by Antiochus III in late 214 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/achaios_athens', 'Achaios', 'First magistrate attested in Athens in 128/127 BC [issue 37]. Later attested as third magistrate in Athens in 116/115 BC [issue 49]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 421-428 and nos. 619, 621-623 / issues 37 and 49 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 and 116/115 BC); Prosopographia Attica 2790; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 84 s. v. Achaios, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 398 s. v. Achaios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/achilleides_priene', 'Achilleides', 'An individual who issued coins at the ancient city of Priene c. 150-125 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 398.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/acrosas_scythia', 'Acrosas', 'King of the Scythians, c. 195-190 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adaeus_thrace', 'Adaeus of Macedon', 'Adaeus was a king in Thraco-Macedonia ca. 250-200 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adam_nikolaus_riedner_nuremberg', 'Adam Nikolaus Riedner', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1794 to 1801/02. His initial is R. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adei_athens', 'Adeimantos', 'First magistrate attested in Athens in 147/146 BC. From Ikaria. Agonothetes of the Panathenaic games in the 140s BC, Epimeletes in Delos in 140/139 (Habicht 1991, p. 7): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 121-128 / issue 18 (p. 547); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 7 (147/146 BC); Prosopographia Attica 193; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 9 s. v. Adeimantos, no. 9 (listed under Athens); H. B. Mattingly, NC 157, 1997, p. 258; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 285 s. v. Adeimantos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adherbal_numidia', 'Adherbal', 'Adherbal (Punic: ??????, ʿDRBʾL), son of Micipsa and grandson of Masinissa, was a king of Numidia between 118 and 112 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adobogiona_ii_paphlagonia', 'Adobogiona the Younger', 'Adobogiona (fl. c. 70 BC – c. 30 BC) was an illegitimate daughter of king Mithridates VI of Pontus. Her mother was the Galatian princess Adobogiona the Elder. After the death of her father, Adobogiona married the noble Castor Saecondarius, tetrach of all Galatians from 41/40 to 37/36 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adramelek_byblus', 'Adramelek, King of Byblus', 'Adramelek was a king of the city-state of Byblus (Byblos), between 400-330 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/adud_al-dawlah_abu_shuja', 'Adud al-Dawlah Abu Shuja\' [Fanna Khusraw]', 'Fana Khusraw (Persian: فنا خسرو‎), better known by his laqab of ʿAḍud al-Dawla (Arabic: عضد الدولة‎, \"Pillar of the [Abbasid] Dynasty\") was an emir of the Buyid dynasty, ruling wide parts of modern Iran and Iraq from 949 to 983', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_ariadne', 'Aelia Ariadne', 'Wife of the Roman emperor Zeno.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_eudocia', 'Aelia Eudocia', 'The wife of the Roman emperor Theodosius II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_eudoxia', 'Aelia Eudoxia', 'The wife of the Roman emperor Arcadius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_flacilla', 'Aelia Flacilla', 'The wife of the Roman emperor Theodosius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_pulcheria', 'Aelia Pulcheria', 'Daughter of the Roman emperor Arcadius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sophia_wife_of_justin_ii', 'Aelia Sophia', 'The wife of the Byzantine emperor Justin II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelia_verina', 'Aelia Verina', 'Wife of the Roman emperor Leo I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelis_scythia', 'Aelis of Scythia', 'King of Scythia, c. 188-180 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al_rrc', 'Aelius', 'Roman Republican Moneyer, c. 211 - 208 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ael_comf_neikias_adramyteum', 'Aelius Comf... Neikias', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Elagabalus, always including his title. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 229 f. no. 222; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 704 s. v. Neikias; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 335 s. v. Nikias no. 68; D. Calomino, RPC VI temp. nos. 4124-4125 supposes \"Ail. Kom. Ph. (son of?) Nikias\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelius_neikomedes_cyzicus', 'Aelius Neikomedes', 'Strategos in Cyzicus/Mysia in AD 241 to 244. His name appears (with his title of Strategos) on coins issued under Gordian III (those with the portrait of his wife Tranquillina on the obverse). Lit.: RPC VII,1 pp. 107, 112 no. 33 (AD 241-244); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 705 (AD 241-244); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 337 s. v. Nikomedes (no. 53) (AD 238-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aelius_onesiphoros_cyzicus', 'Aelius Onesiphoros', 'Archon in Cyzicus/Mysia c. AD 211-217. His name and office appear on coins issued under Caracalla (during his reign as Augustus). The portraits of Caracalla point to a start date around AD 211, an emission as early as e.g. AD 198 can be excluded. For the coins see SNG von Aulock nos. 7378-7379; SNG Hunterian Museum no. 1217; SNG France Mysie nos. 778-780. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 730 s. v. Onesiphoros (AD 198-217); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 347 s. v. Onesiphoros (nos. 29 and probably 30) (AD 211-217).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aemilian', 'Aemilian', 'Marcus Aemilius Aemilianus Augustus (c. 207/213 – 253), also known as Aemilian, was Roman Emperor for three months in AD 253.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aemilius_iustus_pira356', 'Aemilius Iustus', 'Legatus augusti pro praetore provinciae Thraciae during the end of Commodus\' reign. His name and title appear on coin of Hadrianopolis in Thrace. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 167 no. 35; ibid. I Addenda (2011) 22:035; PIR² A 356.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aeropus_ii_macedon', 'Aeropus I of Macedon', 'Aeropus II of Macedon (Greek: Ἀέροπος Βʹ ὁ Μακεδών), king of Macedon, son of Perdiccas II was guardian of his nephew Orestes, the son of Aeropus\'s brother Archelaus I, reigned nearly five years from 399 BC. The first four years of this time he reigned jointly with Orestes, and the remainder alone. He was succeeded by Orestes\' brother Archelaus II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aesillas_macedonia', 'Aesillas', 'Known only from coins, Aesillas seems to have been a Roman serving as quaestor in the province of Macedonia around 90 BC or a lttle later.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ag_hesperos_adramyteum', 'Ag... Hesperos', 'Strategos in Adramyteum (Mysia). His name appears ons coins issued under Philippus Arabs. See J. Stauber, Die Bucht von Adramytteion. Inschriften Griechischer Städte aus Kleinasien 51 (1996) pp. 190, 215 no. 141; p. 236 nos. 264-265; p. 237 nos. 267-268; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 494 s. v. Hesperos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 172 s. v. Hesperos (no. 14).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agatharchos_rhodes', 'Agatharchos', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2525', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agatha_athens', 'Agatha…', 'Third Magistrate attested on the New Style Coinage of Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 400-401 / issue 34 (p. 547); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 278.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathippos_athens', 'Agathippos', 'Second Magistrate attested on the New Style Coinage of Athens in 97/96 BC. Knight in 106/105 BC (Mattingly 1997, pp. 258-259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 879-928 / issue 66 (p. 547); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (99/98 BC); Prosopographia Attica 38; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 2 s. v. Agathippos, no. 3; H. B. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 279 (97/96 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathocleia_bactria', 'Agathocleia of Bactria', 'Agathocleia Theotropos was an Indo-Greek queen who ruled in parts of northern India in the 2nd-century BC as regent for her son Strato I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathocles_bactria', 'Agathocles of Bactria', 'Agathocles Dikaios was a Greco-Bactrian/ Indo-Greek king, who reigned between around 190 and 180 BC. He might have been a son of Demetrius and one of his sub-kings in charge of the Paropamisade between Bactria and India.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathocles_syracuse', 'Agathocles of Syracuse', 'Agathocles (Greek: Ἀγαθοκλῆς, Agathoklḗs; 361–289 BC) was a Greek tyrant of Syracuse (317–289 BC) and self-styled king of Sicily (304–289 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathocles_thrace', 'Agathocles, Son of Lysimachus', 'Agathocles (Greek: Ἀγαθοκλῆς; between 320–310s – 284 BC) was a Greek prince of Macedonian and Thessalian descent. He was the son of Lysimachus and his first wife, Nicaea a daughter of Antipater, the regent of Alexander the Great\'s Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathokles_byzantium', 'Agathokles', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 145, n. 1233.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agathokle_athens', 'Agathokles', 'Second magistrate attested in Athens during the first two month of 110/109 BC. From Trikorynthos. Maybe a relative of the first magistrate Euboulides, probably his father. Both are attested for only two months, the reason for their sudden disappearance is unknown (Habicht 1991, pp. 9-10): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 710-713 / issue 55 (p. 547); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9-10 (110/109 BC); Prosopographia Attica 75; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 4 s. v. Agathokles, no. 132; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 279.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agemachos_rhodes', 'Agemachos', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2525A', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agrippa', 'Agrippa', 'Marcus Vipsanius Agrippa (c. 23 October or November 64/63 BC – 12 BC) was a Roman statesman and general.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agrippina_i', 'Agrippina the Elder', 'Vipsania Agrippina, most commonly known as Agrippina Major or Agrippina the Elder (14 BC – 17 October 33), was was the wife of the general and statesman Germanicus. She was granddaughter of Augustus, mother of Caligula, second cousin of Claudius and grandmother of Nero.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/agrippina_ii', 'Agrippina the Younger', 'Julia Agrippina, most commonly referred to as Agrippina Minor or Agrippina the Younger, and after 50 known as Julia Augusta Agrippina (7 November 15 or 6 November 16 – 19/23 March 59) was a Roman Empress. She was a great-granddaughter of Augustus, great-niece and adoptive granddaughter of Tiberius, sister of Caligula, niece and fourth wife of Claudius, and mother of Nero.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad', 'Ahmad', 'Ahmed Tekuder (Mongolian: Tögöldör/Төгөлдөр, meaning “perfect”), also known as Sultan Ahmad (reigned 1282–1284), was the sultan of the Persia-based Ilkhanate, son of Hulegu and brother of Abaqa. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_mamluks', 'Ahmad', 'An official whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_ii_ibn_ismail', 'Ahmad II ibn Ismail', 'bu Ibrahim Ismail ibn Ahmad (Persian: ابو ابراهیم اسماعیل بن احمد سامانی‎), better known as Isma\'il ibn Ahmad, was the Samanid amir of Transoxiana (892–907) and Khorasan (900–907).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_shah', 'Ahmad Shah', 'Ahmad Shāh Qājār (Persian: احمَد شاه قاجار‎) (21 January 1898 – 21 February 1930) was Shah of Iran (Persia) from 16 July 1909, to 31 October 1925, and the last ruling member of the Qajar dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_ibn_hilal', 'Ahmad ibn Hilal', 'Ahmad ibn Hilal (290-312/903-925) was an Abbasid governor of the area of modern Oman who placed his name on the coinage.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_ibn_salim_al-kasadi', 'Ahmad ibn Salim al-Kasadi', 'Ahmad ibn Salim al-Kasadi was the first ruler of the al-Kasadi Imarate', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_ibn_tulun', 'Ahmad ibn Tulun', 'Ahmad ibn Ṭūlūn (September 835 – March 884) was the founder of the Tulunid dynasty that ruled Egypt between 868 and 905 AD. Originally sent by the Abbasid caliph as governor to Egypt, ibn Ṭūlūn established himself as an independent ruler.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmad_al-muzaffar_shihab_al-din_abu_al-sa\'adat', 'Ahmad, al-Muzaffar Shihab al-Din Abu al-Sa\'adat', 'Ahmad, al-Muzaffar Shihab al-Din Abu al-Sa\'adat (824/1421) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmed_i', 'Ahmed I', 'Ahmed I (Ottoman Turkish: احمد اول Aḥmed-i evvel; Turkish: I. Ahmed) was the Sultan of the Ottoman Empire from 1603 until his death in 1617.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmed_ii', 'Ahmed II', 'Ahmed II (Ottoman Turkish: احمد ثانى Aḥmed-i sānī) was the Sultan of the Ottoman Empire from 1691 to 1695.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ahmed_iii', 'Ahmed III', 'Ahmed III (Ottoman Turkish: احمد ثالث Aḥmed-i sālis) was Sultan of the Ottoman Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aianti_athens', 'Aiantides', 'Third magistrate attested in Athens in 133/132 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 376-377 / issue 32 (p. 548); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 13 s. v. Aiantides, no. 1; H. B. Mattingly, NC 157, 1997, p. 258; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 292 s. v. Aiantides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aianti_priene', 'Aianti…', 'An individual who issued coins at the ancient city of Priene c. 330-300 BC. Regling completed: Aiantides. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 292.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aigaleus_abdera', 'Aigaleus', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ainetor_rhodes', 'Ainetor', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 2518-2519', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ais(-)_callatis', 'Ais(…)', 'Magistrate attested on the Alexander coinage of Callatis, c. 250-225 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 946', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aischines_ii_athens', 'Aischines', 'Second magistrate attested in Athens in 74/73 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1231 / her issue 89 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (74/73 BC, his issue 91); Prosopographia Attica 336; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 15 s. v. Aischines, no. 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 300 s. v. Aischines.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aischi_athens', 'Aischines', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 569-571, 573 / issue 46 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); Prosopographia Attica 335; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 15 s. v. Aischines, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 300 s. v. Aischines.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aischines_i_athens', 'Aischines', 'Third magistrate attested in Athens in 132/131 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 569-571, 573 / issue 33 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 BC); Prosopographia Attica 336; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 15 s. v. Aischines, no. 17; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 300 s. v. Aischines.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aisi(-)_callatis', 'Aisi(…)', 'Magistrate attested on the Alexander coinage of Callatis, c. 250-225 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 945', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/akbar', 'Akbar', 'Abu\'l-Fath Jalal ud-din Muhammad Akbar, known popularly as Akbar (IPA: [əkbər], literally \"the great\") also known as Akbar the Great or Akbar I,was Mughal Emperor from 1556 until his death in 1605.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ake_lycia', 'Ake...', 'Dynast in the ancient region of Lycia from approximately 460–440 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M234', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/akrisios_priene', 'Akrisios', 'An individual who issued coins at the ancient city of Priene around 150 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 303.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aktor_cyme', 'Aktor', 'Magistrate attested on the Alexander coinage of Cyme, c.188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1636', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al_fa\'iz_bi-nasr_allah', 'Al Fa\'iz bi-Nasr Allah', 'Abu\'l-Qasim Isa ibn az-Zafir (Arabic: أبو القاسم عيسى بن الظافر‎), better known by his regnal name al-Fa\'iz bi-Nasr Allah (الفائز بنصر الله), was the thirteenth and penultimate Caliph of the Fatimid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al_zafir_bi-amr_allah', 'Al Zafir bi-Amr Allah', 'Abu Muhammad az-Zafir bi-amr Allah Isma\'il ibn al-Hafiz (Arabic: أبو محمد الظافر بأمر الله إسماعيل بن الحافظ‎), was a Fatimid caliph from 1149 to 1154, in Cairo.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-baba_mamluks', 'Al-Baba', 'An official whose name appears on glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-salih_najm_al-din_ayyub', 'Al-Salih Najm al-Din Ayyub', 'Al-Malik as-Salih Najm al-Din Ayyub (Arabic: الملك الصالح نجم الدين ايوب‎) (Nickname: Abu al-Futuh أبو الفتوح ), also known as al-Malik al-Salih was the KurdishAyyubid ruler of Egypt from 1240 to 1249.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ala\'_al-din_ali_ii', 'Ala\' al-Din Ali II', 'Ala\' al-Din Ali II (778-783/1376-1381) was a Mamluk sultan during the Bahri period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ala\'_al-din_kay_qubad_i', 'Ala\' al-Din Kay Qubad I', 'Kayqubad I (Persian: علاء الدين كيقباد بن كيكاوس‎, \'Alā ad-Dīn Kayqubād bin Kaykāvūs; Turkish: I. Alâeddin Keykûbad) was the Seljuq Sultan of Rûm who reigned from 1220 to 1237.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ala\'_al-din_kay_qubad_ii', 'Ala\' al-Din Kay Qubad II', 'Kayqubad II (Old Anatolian Turkish: كَیقُباد, Persian: علاء الدين كيقباد بن كيخسرو‎, ʿAlāʾ ad-Dīn Kayqubād bin Kaykhusraw) was the youngest of the three sons of the Seljuq Sultan of Rûm Kaykhusraw II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ala\'_al-din_muhammad_ibn_takish', 'Ala\' al-Din Muhammad ibn Takish', 'Ala\' al-Din Muhammad ibn Takish (596-617/1200-1220) was a ruler of the Anushtigin branch of the Khwarazmian Shahs.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/albrecht_bossweil_stuttgart', 'Albrecht Bossweil', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany 1555 - ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/albrecht_scholderer_stuttgart', 'Albrecht Scholderer', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1501 to 1513. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 41', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/albrecht_vayh_stuttgart', 'Albrecht Vayh', 'Mint administrator in Stuttgart, Baden-Wuerttemberg, Germany from 1622 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander', 'Alexander', 'The Byzantine emperor Alexander.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_baudistel_stuttgart', 'Alexander Baudistel', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1595 to ?. Died in 1598. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_i_balas', 'Alexander I Balas', 'Alexander I Theopator Euergetes (\"Divinely-fathered Benefactor\"), nicknamed Balas (\"Lord\"), was the twelfth king of the Seleucid Empire, ruling from 152 to 145 BC. Alexander I was a supposed son of Antiochus IV supported by Attalus II of Pergamum and Ptolemy VI of Egypt as a rival claimant to the Seleucid throne against Demetrius I. In 152 BC, Alexander I arrived at Ptolemais (Ake) and established his base there. He controled Apamea by 152/1 BC and in 150 BC defeated and killed Demetrius I. Shortly thereafter, Alexander I married Cleopatra Thea, the daughter of Ptolemy VI in order to seal an alliance with her father. Things began to fall apart in 148 and 147 BC, when Susa and Media were lost to Parthian and local kings and Demetrius II arrived in Syria to avenge his father, Demetrius I. Unfortunately, Alexander I had alienated his father-in-law by plotting against him, and therefore Ptolemy VI supported Demetrius II. Alexander I was forced to flee to Cilicia, where he raised an army to wage war against Demetrius II and Ptolemy VI. When he returned to Syria in 145 BC he was defeated in battle by Ptolemy VI. Alexander I escaped and attempted to find safety among the Arabs, but was assassinated instead.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_i_epirus', 'Alexander I of Epirus', 'Alexander I of Epirus (Ancient Greek: Ἀλέξανδρος Α\'; c. 371 BC), also known as Alexander Molossus (Ἀλέξανδρος ὁ Μολοσσός), was a king of Epirus (343/2–331 BC) of the Aeacid dynasty. As the son of Neoptolemus I and brother of Olympias, Alexander I was an uncle of Alexander the Great. He was also an uncle of Pyrrhus of Epirus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_i_macedon', 'Alexander I of Macedon', 'Alexander I of Macedon, known with the title Philhellene was the ruler of the ancient Greek kingdom of Macedon from c. 498 BC until his death in 454 BC. He was succeeded by his eldest son, Alcetas II.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/alexander_ii_zabinas', 'Alexander II Zabinas', 'Alexander II Zabinas (Greek Ἀλέξανδρoς Zαβίνας), ruler of the Greek Seleucid kingdom, was a counter-king who emerged in the chaos following the Seleucidian loss of Mesopotamia to the Parthians. Zabinas was a false Seleucid who claimed to be an adoptive son of Antiochus VII Sidetes, but in fact seems to have been the son of an Egyptian merchant named Protarchus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_ii_macedon', 'Alexander II of Macedon', 'Alexander II of Macedon was king of the ancient Greek kingdom of Macedon in 371–369 BC, following the death of his father Amyntas III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_iii', 'Alexander III of Macedon', 'Alexander III of the Macedonian dynasty. Also known as Alexander the Great.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_iv_macedon', 'Alexander IV of Macedon', 'Alexander IV, erroneously called sometimes in modern times Aegus, was the son of Alexander the Great (Alexander III of Macedon) and Princess Roxana of Bactria.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_jannaeus', 'Alexander Jannaeus', 'Alexander Jannaeus (also known as Alexander Jannai/Yannai; Hebrew: אלכסנדר ינאי) was king of Judea from 103 BC to 76 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_v_macedon', 'Alexander V of Macedon', 'Alexander V of Macedon was the third and youngest son of Cassander and Thessalonica of Macedon, who was a half-sister of Alexander the Great. He ruled as King of Macedon along with his brother Antipater from 297 to 294 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_ii_judaea', 'Alexander of Judaea', 'Alexander (Gr. Ἀλέξανδρος, died 48 or 47 BC), or Alexander Maccabeus, was the eldest son of Aristobulus II, king of Judaea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexander_pherae', 'Alexander of Pherae', 'Alexander (Ancient Greek: Ἀλέξανδρος) was tagus or despot of Pherae in Thessaly, and ruled from 369 to c. 356 BC. Following the assassination of the tyrant Jason of Pherae, in 370 BC, his brother Polydorus ruled for a year, but he was then poisoned by another brother, Alexander. Alexander governed tyrannically and was constantly seeking to control Thessaly and the kingdom of Macedonia. He also engaged in piratical raids on Attica. Alexander was murdered by the brothers of his wife, Thebe, as it was said that she lived in fear of her husband and hated Alexander\'s cruel and brutal character.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexan_ii_athens', 'Alexandros', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 701-704 / issue 54 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 488; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 18 s. v. Alexandros, no. 23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 305 s. v. Alexandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexan_i_athens', 'Alexandros', 'Third magistrate attested in Athens in 121/120 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 503, 508 / issue 43 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 BC); Prosopographia Attica 485; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 18 s. v. Alexandros, no. 22; H. B. Mattingly, NC 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 305 s. v. Alexandrios (121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexa_athens', 'Alexa…', 'Third magistrate attested in Athens in 135/134 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 353-355, 358 / issue 30 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (135/134 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 18 s. v. Alexandros, no. 15; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 305 s. v. Alexa-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aleximachos_abdera', 'Aleximachos', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_i', 'Alexios I Komnenos', 'The Byzantine emperor Alexios I Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_i_trapezunt', 'Alexios I of Trebizond', 'The emperor of Trebizond Alexios I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_ii', 'Alexios II Komnenos', 'The Byzantine emperor Alexios II Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_ii_trapezunt', 'Alexios II of Trebizond', 'The emperor of Trebizond Alexios II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_iii', 'Alexios III Angelos', 'The Byzantine emperor Alexios III Angelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_iii_trapezunt', 'Alexios III of Trebizond', 'The emperor of Trebizond Alexios III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_iv', 'Alexios IV Angelos', 'The Byzantine emperor Alexios IV Angelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_iv_trapezunt', 'Alexios IV of Trebizond', 'The emperor of Trebizond Alexios IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexius_v', 'Alexios V Doukas', 'The Byzantine emperor Alexios V Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alex_athens', 'Alex…', 'Third magistrate attested in Athens in 108/107 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 729-732, 735-736 / issue 57 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (108/107 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 305 s. v. Alex-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ali_beg_ibn_husayn', 'Ali Beg ibn Husayn', 'Ali III Bey ibn al-Husayn (1817–1902[1]) (Arabic: علي باي بن حسين‎, ʿAlī Bāy bin Ḥusayn) was the ruler of Tunisia from 1882 until June 1902.[2] He was the first ruler under the French protectorate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ali_al-shuwaykh', 'Ali al-Shuwaykh', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ali_b_husayn', 'Ali b. Husayn', 'Ali bin Hussein, GBE (Arabic: علي بن الحسين بن علي الهاشمي‎, ‘Alī ibn al-Ḥusayn ibn ‘Alī al-Hāshimī) was King of Hejaz and Grand Sharif of Mecca from October 1924 until December 1925.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ali_ibn_yusuf', 'Ali ibn Yusuf', 'Ali ibn Yusuf (Arabic: علي بن يوسف‎) was the 5th Almoravid king he reigned 1106–1143.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ali_ibn_al-ikhshid', 'Ali ibn al-Ikhshid', 'Abu\'l-Hasan Ali ibn al-Ikhshid (Arabic: أبو الحسن علي بن الإخشيد‎) was the third ruler of the autonomous Ikhshidid dynasty, which ruled Egypt, Syria and the Hejaz.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alketes_ii_athens', 'Alketes', 'First magistrate attested in Athens in 72/71 BC. From Perithoidai. Belongs probably to the same familiy as the second magistrate Euagion, he might be his son: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1234-1235 / her issue 91 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 14 (72/71 BC, his issue 93); Prosopographia Attica 585; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 22 s. v. Alketes, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 309 s. v. Alketes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alketes_i_athens', 'Alketes', 'Second magistrate attested in Athens in 125/124 BC: Obviously from Perithoidai as his colleague Polemon (Habicht 1991, pp. 8 and 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 461-474 / issue 40 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 8 and 14 (125/124 BC); Prosopographia Attica 581; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 22 s. v. Alketes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 309 s. v. Alketes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alkidam_athens', 'Alkidamos', 'Second magistrate attested in Athens in 113/112 BC. From Euonymon. Brother of Eumareides (first magistrate), died probably during his magistracy (C. Habicht, AM 97, 1982, p. 181). Attested as knight in Delphi in 128/127 BC (Habicht 1991, p. 9; H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 669-675, 685 / issue 52 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9 (113/112 BC); Prosopographia Attica 606; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 23 s. v. Alkidamos, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 310 s. v. Alkidamos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alkimachos_chios', 'Alkimachos', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2417', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alkippos_athens', 'Alkippos', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 585-586, 589-590, 595 / issue 47 (p. 549); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 634; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 23 s. v. Alkippos, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 311 s. v. Alkippos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/allectus', 'Allectus', 'The Roman emperor Allectus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alp_arslan', 'Alp Arslan', 'Alp Arslan (Turkish: Alp Arslan; Persian: آلپ ارسلان; full name: Diya ad-Dunya wa ad-Din Adud ad-Dawlah Abu Shuja Muhammad Alp Arslan ibn Dawud) was the second Sultan of the Seljuk Empire and great-grandson of Seljuk.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alphe_modestos_cyzicus', 'Alphe... Modestos', 'Alphe(nos) Modestos, Strategos in Cyzicus/Mysia during the reign of Septimius Severus. His name appears in most cases as ΑΛΦ…, seldom as ΑΛΦΗ… ΜΟΔΕCΤΟC: SNG Righetti no. 700). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 312 s. v. Alphe- and p. 693 s. v. Modestos (AD 193-211); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 320 s. v. Modestos (no. 16) (AD 193-211).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alyattes_lydia', 'Alyattes of Lydia', 'Alyattes (Greek Ἀλυάττης Aluáttēs, perobably from Lydian Walwates; reigned c. 610–560 BC), sometimes described as Alyattes I, was the fourth king of the Mermnad dynasty in Lydia, the son of Sadyattes and grandson of Ardys. He was succeeded by his son Croesus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amm_lycia', 'Am...', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 27-8', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/am_lycia', 'Am...', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 4', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amadocus_i_odrysian_thrace', 'Amadocus I of Thrace', 'Amadocus I (Ancient Greek: Ἀμάδοκος) was a Thracian king of the Odrysae from 410 BC until the beginning of 4th century.[1] He was a friend of the Athenian statesman Alcibiades, and is mentioned at the time of the Battle of Aegospotami in 405.[2] During his reign he experienced attacks from the Triballians and lost many of his territories.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amatocus_ii', 'Amadocus II of Thrace', 'Amadocus (Greek: Ἀμάδoκoς; lived 4th century BC) was a ruler in Thrace, who inherited in conjunction with Berisades and Cersobleptes the dominions of Cotys, on the death of the latter in 358 BC. Amadocus was probably a son of Cotys and a brother of the other two princes, though this is not stated by Demosthenes. The area controlled by Amadocus was west of the river Hebrus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amadocus_ii', 'Amadocus II of Thrace', 'King of Thrace.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aman_allah_khan', 'Aman Allah Khan', 'Amanullah Khan (Pashto: أمان الله خان, Dari: أمان الله خان, June 1892 – 25 April 1960) was the Sovereign of the Kingdom of Afghanistan from 1919 to 1929, first as Emir and after 1926 as Malik (King).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amandus', 'Amandus', 'Usurper in Gaul in AD 285.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amartite_lycia', 'Amartite', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 16-18', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amdan_bayan_yuhaqbid_himyar', 'Amdan Bayan Yuhaqbid of Himyar', 'Ruler of the Himyarite kingdom in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amdan_bayyin_yuhaqbid_himyarites', 'Amdan Bayyin Yuhaqbid of Arabia', 'Amdan Bayyin Yuhaqbid was a Himyarite king ca. AD 100-120.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ami_deneria_geneva', 'Ami Dénéria', 'Ami Dénéria is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amir_abd_al-qadir_ibn_muhy_al-din_al-hasani', 'Amir Abd al-Qadir ibn Muhy al-Din al-Hasani', 'Abdelkader ibn Muhieddine, (Arabic: عبد القادر ابن محيي الدين‎ ʿAbd al-Qādir ibn Muḥyiddīn), known as the Emir Abdelkader or Abdelkader El Djezairi, was an Algerian religious and military leader who led a struggle against the French colonial invasion in the mid-19th century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ammonios_athens', 'Ammonios', 'First magistrate attested in Athens in 118/117 BC. Belongs most probably to the same family as Ammo[nios], first magistrate in 150/149 (issue 15) and 148/147 (issue 17), he might be his son (Thompson 1961, p. 58 with note 2 and p. 550): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 577, 580-595 / issue 47; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 719; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 25 s. v. Ammonios, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 314 s. v. Ammonios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ammo_athens', 'Ammonios', 'First magistrate attested in Athens in 150/149 BC [issue 15]. Again attested as first magistrate in 148/147 BC [issue 17]. AMMO[nios] most probably is a relative of Ammonios, the first magistrate of 118/117 (issue 47), maybe his father (cf. Thompson 1961, p. 58 with note 2 and p. 550). Councillor in 140/139 BC (H. B. Mattingly, NC 157, 1997, p. 258): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 94-101, and nos. 111-120 / issues 15 and 17 (pp. 549 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (150/149 and 148/147 BC); Prosopographia Attica 718; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 25 s. v. Ammonios, no. 9; H. B. Mattingly, NC 157, 1997, p. 258; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 314 s. v. Ammomios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amogh_india', 'Amogh', 'Amogh was a king of the Kuninda Kingdom in northern India, during the late 2nd century B.C. to 1st century B.C. His silver coinage followed the silver standard of the Indo-Greek coins, suggesting the existence of commercial exchanges with these neighbors.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amphias_athens', 'Amphias', 'First magistrate attested in Athens in 81/80 BC. From Aphidnai. Belongs to the same family as his colleague Oinophilos (second magistrate), he is probably his son: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1187-1195 / her issue 82 (p. 550); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 (81/80 BC, his issue 84); Prosopographia Attica 754; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 27 s. v. Amphias, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 315 s. v. Amphias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amphikrates_athens', 'Amphikrates', 'First magistrate attested in Athens in 101/100 BC. From Perithoidai. Brother of his colleague Epistratos (second magistrate), both are sons of Epistratos (who is one the the third magistrates in 136/135 BC [issue 29]): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 833-835, 837, 840-853 / issue 64, stemma on p. 550; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19 (101/100 BC); Prosopographia Attica 774; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 27 s. v. Amphikrates, no. 9; H. B. Mattingly, NC 157, 1997, p. 259; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 315 s. v. Amphikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amphikrati_athens', 'Amphikrati…', 'Third magistrate attested in Athens in 134/133 BC [issue 31]. Maybe the same person attested again as third magistrate in 130/129 v. Chr [issue 35]. ΑΜΦΙΚΡΑΤΙ [issue 31] and ΑΜΦΙΚ [issue 35] might be Amphikrates (following Thompson, Habicht, Leschhorn) or Amphikratides (following PA, LGPM). Probably he belongs to the same family as Amphikrates and Epistratos (the two annual magistrates in 101/100 BC). Following Thompson 1961, p. 550 he would be their uncle: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 362-363, 369, and nos. 409-411 / issues 31 and 35, stemma p. 550; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19 (134/133 and 130/129 BC); Prosopographia Attica 770; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 27 s. v. Amphikratides, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 315 s. v. Amphikrates (sic!).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amynander_athamanes', 'Amynander of Athamania', 'Amynander (Greek: Ἀμύνανδρος, Amynandros, in Polybios also Amynas) was king of the Athamanes in south Epirus, following his predecessor Theodorus of Athamania. He was a brother-in-law of the Illyrian king Scerdilaidas and first appears in history as a mediator between Philip V of Macedon and the Aetolians.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amynoma_athens', 'Amynomachos', 'Third magistrate attested in Athens in 104/103 BC. Belongs to the same family as Amynomachos, ephebe of 102/101 BC (Habicht 1991, p. 22): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 801-805 / issue 61 (p. 550); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 22 (104/103 BC); Prosopographia Attica 738; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 26 s. v. Amynomachos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 314 s. v. Amynomachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_priene', 'Amyntas', 'An individual who issued coins at the ancient city of Priene c. 320-290 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 314.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_i_macedon', 'Amyntas I of Macedon', 'Amyntas I was king of the ancient Macedonian kingdom of Macedon (540 – 512 / 511 BC) and then a vassal of Darius I from 512/511 to his death 498 BC, at the time of Achaemenid Macedonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_ii_macedon', 'Amyntas II of Macedon', 'Amyntas II or Amyntas the Little, was the king of Macedonia for a short time, circa 393 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_iii_macedon', 'Amyntas III of Macedon', 'Amyntas III (died 370 BC) was king of the ancient Greek kingdom of Macedon in 393 BC, and again from 392 to 370 BC. He was the son of Arrhidaeus and grandson of Amyntas, one of the sons of Alexander I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_bactria', 'Amyntas of Bactria', 'Amyntas Nikator was an Indo-Greek king. His coins have been found both in eastern Punjab and Afghanistan, indicating that he ruled a considerable territory.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amyntas_galatia', 'Amyntas of Galatia', 'Amyntas (Ancient Greek: Ἀμύντας), Tetrarch of the Trocmi was a King of Galatia and of several adjacent countries between 36 and 25 BC, mentioned by Strabo as contemporary with himself. He was the son of Brogitarus, king of Galatia, and Adobogiona, daughter of king Deiotarus Philoromaeus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/amythion_abydus', 'Amythion', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Amythion (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 314 s. v. ΑΜΥΘΙΩΝ.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/an_perinthus', 'An(…)', 'An individual who issued coins at the ancient city of Perinthus, after 280 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 94, n. 21.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anastasius_ii', 'Anastasios II', 'The Byzantine emperor Anastasios II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anastasius', 'Anastasius I', 'The Byzantine emperor Anastasius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxagoras_abydus', 'Anaxagoras', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Anaxagoras (34); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 317 s. v. ΑΝΑΞΑΓΟΡΑΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxandrides_abydus', 'Anaxandrides', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Anaxandrides (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 317 s. v. ΑΝΑΞΑΝΔΡΙΔΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxenor_abdera', 'Anaxenor', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxidikos_i_abdera', 'Anaxidikos (I)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxidikos_ii_abdera', 'Anaxidikos (II)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxikles_abydus', 'Anaxikles', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Anaxikles (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 318 s. v. ΑΝΑΞΙΚΛΗΣ.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxilas_priene', 'Anaxilas', 'An individual who issued coins at the ancient city of Priene c. 190-170 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 318.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxileos_abydus', 'Anaxileos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Anaxileos (5); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 318 s. v. ΑΝΑΞΙΛΕΩΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxipolis_i_abdera', 'Anaxipolis (I)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxipolis_ii_abdera', 'Anaxipolis (II)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxipolis_iii_abdera', 'Anaxipolis (III)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anaxipolis_iv_abdera', 'Anaxipolis (IV)', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andragoras_parthia', 'Andragoras the Parthian', 'Andragoras the Parthian seems to have been a satrap of Alexander from 331 BC in the area of Parthia (Justin, xii. 4). According to Justin, he was selected among the noble Persians, and is at the origin of the Parthian dynasty. There is a possibility that this Andragoras never existed and is only mentioned by Justin by mistake, since in other classical sources Phrataphernes is usually mentioned as the satrap of Parthia until the time of Philip. He may also have been confused with the 3rd century satrap of Parthia Andragoras.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andragoras_persia', 'Andragoras the Persian', 'Andragoras was an Iranian satrap of the Seleucid provinces of Parthia and Hyrcania under the Seleucid rulers Antiochus I Soter and Antiochus II Theos. He later revolted against his overlords, ruling independently from 245 BC till his death in 238 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andreas_athens', 'Andreas', 'First magistrate attested in Athens in 104/103 BC [issue 61]. Later attested as third magistrate in 94/93 BC [issue 71]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 795, 797-798, 800-811 and nos. 1047-1048 / issues 61 and 71 (pp. 550-551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5-6 (104/103 and 94/93 BC); Prosopographia Attica 832; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 29 s. v. Andreas, nos. 2 and no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 320 s. v. Andreas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andreas_allgewwe_stuttgart', 'Andreas Allgewer', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1609 to 1610. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andreas_huebner_stuttgart', 'Andreas Hübner', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1604/05 to ? and in Christophstal before 1622. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109, 122', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andreas_reichel_stuttgart', 'Andreas Reichel', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1609/10 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andriscus_macedon', 'Andriscus of Macedon', 'Andriscus, also often referenced as Pseudo-Philip, was the last King of Macedon (r. 149–148 BC). A pretender, who claimed to be the son of Perseus of Macedon, he was a fuller from Adramyttium in Aeolis in western Anatolia. His reign lasted just one year and was toppled by the Roman Republic during the Fourth Macedonian War.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_ducas', 'Andronikos Doukas', 'The Byzantine emperor Andronikos Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_i', 'Andronikos I Komnenos', 'The Byzantine emperor Andronikos I Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_trapezunt', 'Andronikos I of Trebizond', 'The emperor of Trebizond Andronikos I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_ii', 'Andronikos II Palaiologos', 'The Byzantine emperor Andronikos II Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_ii_trapezunt', 'Andronikos II of Trebizond', 'The emperor of Trebizond Andronikos II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_iii', 'Andronikos III Palaiologos', 'The Byzantine emperor Andronikos III Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_iii_trapezunt', 'Andronikos III of Trebizond', 'The emperor of Trebizond Andronikos III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/andronicus_iv', 'Andronikos IV Palaiologos', 'The Byzantine emperor Andronikos IV Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/androsthenes_abydus', 'Androsthenes', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Androsthenes (6); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 321 s. v. ΑΝΔΡΟΣΘΕΝΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/annia_faustina', 'Anna Faustina', 'Third wife of the Emperor Elagabalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anna_comnena', 'Anna Komnene', 'The daughter of the Byzantine emperor Alexios I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anna_of_savoy', 'Anna of Savoy', 'The wife of the Byzantine emperor Andronikos III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anna_komnena_trapezunt', 'Anna of Trebizond', 'The empress of Trebizond Anna.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/annius_verus', 'Annius Verus', 'Marcus Annius Verus Caesar (after May 162 – 10 September 169) was a son of Marcus Aurelius and Faustina the Younger. In AD 166 he was made his father\'s first heir. On 10 September 169, he died of natural causes in Rome.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anonymous', 'Anonymous', 'An unnamed issuer or authority responsible for the creation of coinage.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anstett_ulrich_mueller_stuttgart', 'Anstett Ulrich Müller', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1677. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), pp. 210, 232', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ant_herodianos_adramyteum', 'Ant... Herodianos', 'Grammateus and strategos in Adramyteum (Mysia). His name appears on coins issued in Severan times, c. 193-217 AD. Probably it is the same person who holds both offices. See H. von Fritze, Die antiken Münzen Mysiens, I. Adramytion bis Kisthene (1913) p. 46 no. 138 (strategos); J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 224 no. 195 (grammateus); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 540 s. v. Herodianos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 206 s. v. Herodianos (no. 2).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antan_perinthus', 'Antan(…)', 'An individual who issued coins at the ancient city of Perinthus, after 280 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 94, n. 20.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anth_maroneia', 'Anth(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anthemius', 'Anthemius', 'The Roman emperor Anthemius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anti_ii_abdera', 'Anti(…) (II)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anti_i_abdera', 'Anti...', 'Moneyer attested on the coinage of Abdera in Thrace, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiadasaenus', 'Antiadas', 'An individual who issued coins at the ancient city of Aenus, 453/452-451/450 BC. See J. May, Ainos. Its History and Coinage 474-341 B.C. (London, 1950), p. 66, n. 85-91.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antialcidas_bactria', 'Antialcidas of Bactria', 'Antialcidas Nikephoros was an Indo-Greek king of the Indo-Greek Kingdom, who reigned from his capital at Taxila. Bopearachchi has suggested that he ruled from ca. 115 to 95 BCE in the western parts of the Indo-Greek realms, whereas R. C. Senior places him around 130 to 120 BCE and also in eastern Punjab (which seems better supported by coin findings).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigonos_abydus', 'Antigonos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Antigonos (29); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 326 s. v. ΑΝΤΙΓΟΝΟΣ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigono_athens', 'Antigonos', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 453-456, 460 / issue 39 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 1007; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 34 s. v. Antigonos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 326 s. v. Antigonos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigonus_i_macedon', 'Antigonus I Monophthalmus', 'Antigonus I Monophthalmus (382–301 BC), son of Philip from Elimeia, was a Macedonian nobleman, general, satrap and king. During the first half of his life he served under Philip II; after Philip\'s death in 336 BC, he served his son Alexander.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigonus_ii', 'Antigonus II Gonatas', 'Antigonus II Gonatas (Ancient Greek: Ἀντίγονος B΄ Γονατᾶς) (319 BC – 239 BC) was a powerful ruler who firmly established the Antigonid dynasty in Macedonia and acquired fame for his victory over the Gauls who had invaded the Balkans.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigonus_mattathias_judaea', 'Antigonus II Mattathias', 'Antigonus II Mattathias, also known as Antigonus the Hasmonean (died 37 BCE) was the last Hasmonean king of Judea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antigonus_iii', 'Antigonus III Doson', 'Antigonus III Doson was king of Macedon from 229 BC to 221 BC. He was a member of the Antigonid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antikrates_athens', 'Antikrates', 'Second magistrate attested in Athens in 77/76 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1227 / her issue 86 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (77/76 BC, his issue 88); Prosopographia Attica 1077; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 35 s. v. Antikrates, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 327 s. v. Antikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiloch_athens', 'Antilochos', 'Third magistrate attested in Athens in 132/131 BC [issue 33]. Probably it is the same person attested again as third magistrate in 131/130 BC [issue 34]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 389-390, 394, and nos. 396-397 / issue 33 and 34, commentary on p. 551; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 and 131/130 BC); Prosopographia Attica 1095 and 1094; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 36 s. v. Antilochos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 327 s. v. Antilochos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antimachus_i_bactria', 'Antimachus I Theos of Bactria', 'Anthimachus I Theos was one of the Greco-Bactrian kings, generally dated from around 185 BC to 170 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antimachus_ii_bactria', 'Antimachus II of Bactria', 'Antimachus II Nikephoros was an Indo-Greek king. He ruled a vast territory from the Hindu-Kush to the Punjab around 170 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochos_athens', 'Antiochos', 'Attested as first magistrate in 131/130 BC [issue 34]. Previously attested as third magistrate in 134/133 BC [issue 31]. Athenian citizen, no Seleukid king or prince (Habicht 1997, p. 7): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 367-368 and nos. 396-403 / issues 31 and 34, commentary on p. 551; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 and 131/130 BC); Prosopographia Attica 1155 and 1160; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 37 s. v. Antiochos, no. 111; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 328 s. v. Antiochos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_hierax', 'Antiochus Hierax', 'Antiochus Hierax (\"the Hawk\") was the younger brother of Seleucus II who was appointed viceroy of Asia Minor during the Third Syrian War (246-241 BC) between Seleucus II and Ptolemy III. In c. 242 BC Hierax proclaimed himself king and began the War of the Brothers (c. 241-236 BC) against Seleucus II. Hierax ultimately lost his kingdom and escaped to Thrace, where he was killed by Galatians in 227 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_i', 'Antiochus I Soter', 'Antiochus I Soter (Greek: Αντίοχος Α\' Σωτήρ, i.e. Antiochus the Savior, unknown - 261 BC), was a king of the Hellenistic Seleucid Empire. He reigned in 281 BC – 261 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_i_commagene', 'Antiochus I of Commagene', 'Antiochus I Theos Dikaios Epiphanes Philorhomaios Philhellen (Armenian: Անտիոքոս Երվանդունի, Ancient Greek: Ἀντίοχος ὁ Θεὸς Δίκαιος Ἐπιφανὴς Φιλορωμαῖος Φιλέλλην, meaning Antiochos, the just, eminent god, friend of Romans and friend of Greeks, c. 86 BC – 38 BC, ruled 70 BC – 38 BC) was an Armenian king from the Kingdom of Commagene and the most famous king of that kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_ii', 'Antiochus II Theos', 'Antiochus II Theos (\"the God\") was the third king of the Seleucid Empire, ruling from 261 to 246 BC. He succeeded his father Antiochus I Soter in the winter of 262–61 BC. He was the younger son of Antiochus I and princess Stratonice, the daughter of Demetrius Poliorcetes. He successfully fought against Ptolemy II in the Second Syrian War (260–253 BC), expanding his territory in Asia Minor and Thrace.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_iii_commagene', 'Antiochus III of Commagene', 'Antiochus III Epiphanes was the ruler of the Kingdom of Commagene from 12 BC to 17 AD. He was the son and successor of King Mithridates III of Commagene and Iotapa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_iii', 'Antiochus III the Great', 'Antiochus III the Great (Ancient Greek: Ἀντίoχoς Μέγας; c. 241 – 187 BC, ruled 222 – 187 BC) was a Seleucid Greek king and the 6th ruler of the Seleucid Empire. He ruled over Greater Syria and western Asia towards the end of the 3rd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_iv', 'Antiochus IV Epiphanes', 'Antiochus IV Epiphanes (play /ænˈtaɪ.əkəs ɛˈpɪfəniːz/; Ancient Greek: Ἀντίοχος Ἐπιφανής, \'God Manifest\'; c. 215 BC – 164 BC) ruled the Seleucid Empire from 175 BC until his death in 164 BC. He was a son of King Antiochus III the Great. His original name was Mithridates; he assumed the name Antiochus after he ascended the throne.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_iv_commagene', 'Antiochus IV of Commagene', 'Gaius Julius Antiochus IV Epiphanes (Ancient Greek: Γάιος Ἰούλιος Ἀντίοχος ὀ Ἐπιφανής, before 17 AD – after 72 AD), the last king of Commagene, reigned between 38–72 as a client king to the Roman Empire. The epithet \"Epiphanes\" means \"the Glorious\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_ix', 'Antiochus IX Cyzicenus', 'Antiochus IX Eusebes Philopator (\"Pious, Father-loving\"), nicknamed Cyzicenus (\"the Cyzicene\" after Cyzicus, a city in Asia Minor where he had been raised), was the seventeenth king of the Seleucid Empire, ruling between 114/3 and 95 BC. Although he managed to expel his half-brother, the reigning Antiochus VIII, in 114/3 BC, Antiochus IX gradually lost ground over the years that followed until he retained only a handful of cities in Cilicia, Phoenicia, and Coele Syria in 109 BC. When Antiochus VIII was assassinated in 96 BC, Antiochus IX siezed his former territory. In 95 BC, Seleucus VI, an avenging son of Antiochus VIII, invaded Syria and killed him.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_v', 'Antiochus V Eupator', 'Antiochus V Eupator (\"Nobly-fathered\") was the tenth king of the Seleucid Empire who ruled from 164 to 162 BC. Upon the death of Antiochus IV, his nine-year-old son, Antiochus V, was proclaimed king by the regent Lysias. In 164 BC, a struggle over the regency developed after the dying Antiochus IV named Philip, one of his Friends, as the regent for Antiochus V. Although Philip managed to take Antioch, he was killed by Lysias before he could take possession of the boy king. War almost broke out between Rome and Antiochus V in 162 BC, when a Roman legate charged with destroying the Seleucid fleet and its elephant corps was murdered. The situation was defused later tht year by the arrival of Demetrius I, a son of Seleucus IV, who captured Antiochus V and Lysias and ordered their deaths.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_vi', 'Antiochus VI Dionysus', 'Antiochus VI Dionysus was the thirteenth king of the Seleucid Empire, reigning from 144 to c. 142 BC. This young son of Alexander I was proclaimed king by the Seleucid general Diodotus (Tryphon) in opposition to Demetrius II in 144 BC. His center of power was initially at Chalcis by Belus, but soon took control of Apamea. With the support of the disaffected military forces around that city, Antiochus VI and Tryphon forced Demetrius out of Antioch in 143 BC. The influence of Antiochus VI expanded further into Cilicia, Coele Syria, and Phoenicia in c. 142 BC, before he suddenly died under mysterious circumstances and Diodotus assumed the kingship in his own name.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_vii', 'Antiochus VII Euergetes', 'Antiochus VII Euergetes (\"the Benefactor\"), nicknamed Sidetes (\"the Sidetan\" after Side, a city in Asia Minor where he had once resided), was the king of the Seleucid Empire, reigning from 138 to 129 BC. After repressing the usurper Tryphon at the beginning of his reign, Antiochus VII consolidated his authority in Syria and Coele Syria before embarking on a grand campaign to restore the eastern territories of the empire that had fallen to the Arsacid Parthians. The king reclaimed Mesopotamia, Babylonia, and Media, but was ambushed and killed with the bulk of his army during a Parthian-supported uprising in Media in the winter of 130–129 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_viii', 'Antiochus VIII Grypus', 'Antiochus VIII Epiphanes (\"God Manifest\"), nicknamed Grypus (\"Hook-nosed\"), was the sixteenth king of the Seleucid Empire, ruling between 121/0 and 97/6 BC. The stability of the early years of his sole reign was shattered in 114/3 BC by the arrival of his half-brother, Antiochus IX, and the conflict that followed. Much territory and many cities frequently changed hands between the two until 109 BC, when Antiochus VIII had again regained much of his former possessions, leaving Antiochus IX only scattered cities. Antiochus VIII was assassinated by Heracleon, his war minister, in 96 BC, but his killer was no match for Antiochus IX, who briefly became sole ruler of the diminished Seleucid state.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_x', 'Antiochus X Eusebes Philopator', 'Antiochus X Eusebes Philopator (\"Pious, Father-loving\") was the nineteenth king of the Seleucid Empire, reigning from c. 94 BC probably until c. 88 BC. Proclaiming himself king at Aradus, Antiochus X avenged his father, Antiochus IX, by driving Seleucus IV out of Syria in 94 BC. Antiochus X was almost immediately challenged by Seleucus\' brother, Antiochus XI, but defeated him near Antioch. The subsequent history of his reign is obscure.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_xi', 'Antiochus XI Epiphanes Philadelphus', 'Antiochus XI Epiphanes Philadelphus (\"God Manifest, Brother-loving\") was twentieth king of the Seleucid Empire, reigning in Syria only for part of 94/3 BC. He was the son of Antiochus VIII and Tryphaena and brother of Seleucus VI, Demetrius III, and Philip I. After the death of Seleucus VI (94 BC), Antiochus XI and Philip I jointly proclaimed themselves kings and destroyed Mopsus in revenge. In 94/3 BC, Antiochus XI marched against Antiochus X in Antioch but suffered defeat in battle. He managed to escape capture, but drowned while trying to cross the Orontes River.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/antiochus_xii', 'Antiochus XII Dionysus', 'Antiochus XII Dionysus Epiphanes Philopator Callinicus (\"Dionysus Manifest, Father-loving, Nobly-victorious\") was the twenty-second king of the Seleucid Empire, reigning from 87/6 to 83/2 BC. A brother of Seleucus VI, Demetrius III, Antiochus XI, and Philip I, Antiochus XII succeeded Demetrius III at Damascus after Demetrius III was carried off by the Parthians. He made no attempt to expand his power into northern Syria, but concentrated his energies on wars against the Nabataen Arabs and the Jewish priest-king, Alexander Jannaeus. Antiochus XII was killed while campaigning against the Nabataeans in 83/2 BC and his army left to die of hunger in the desert wasteland around the Dead Sea. Aretas III, the Nabataean king, was subsequently invited to rule Damascus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_xiii', 'Antiochus XIII Asiaticus', 'Antiochus XIII Philadelphus (\"Brother-loving\"), nicknamed Asiaticus (\"the Asiatic,\" referring to his sojourn in Asia Minor during the Armenian occupation of Syria) was the twenty-third and last king of the Seleucid Empire. He ruled a state that was little more than Antioch and its environs first from 69/8 to 67 BC and again briefly in 65/4 BC. Antiochus XIII was installed on the throne by the Roman general L. Licinius Lucullus after the withdrawal of Tigranes II of Armenia from Syria. By 67 BC, however, the king faced a popular revolt and was captured by the Emesan dynast Sampsiceramus. He was replaced as king by Philip II, a son of Philip I, but seems to have returned to power in 65/4 BC. He was deposed by Popmpey, who made Syria a Roman province.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiochus_son_of_seleucus_iv', 'Antiochus, Son of Seleucus IV', 'Antiochus, the son of Seleucus IV, was the eighth king of the Seleucid Empire, ruling briefly under the regency of his mother, Laodice IV, in the autumn of 175 BC. When his uncle, Antiochus IV, arrived in Syria in October/November of 175 BC he adopted the boy king and associated him in his own rule. This state of affairs survived only a few years until 170 BC, when Antiochus IV ordered the execution of his nephew.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antipatros_adramyteum', 'Antipatros', 'Magistrate in Adramyteum (Mysia). His name apperas on coins issued under Trebonianus Gallus, Valerianus I., and Gallienus. During the reign of Gallus sometimes the title strategos is added. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190, 238 nos. 271-272, 277-278; RPC IX nos. 535-537; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 328 s. v. Antipatros; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 38 s. v. Antipatros (no. 60).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antipatros_byzantium', 'Antipatros', 'Moneyer attested on the coinage of Byzantium in Thrace, c. 300-220/19 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 56 note 2; p. 73; p. 136, nos. 1026-1042.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiphanes_athens', 'Antiphanes', 'Third magistrate attested in Athens in 119/118 BC [issue 46]. Again attested as third magistrate in 115/114 BC [issue 50]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 552-554, 556-557, 578 and nos. 629-633, 645 / issues 46 and 50 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 and 115/114 BC); Prosopographia Attica 1217; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 39 s. v. Antiphanes, no. 23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 329 s. v. Antiphanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antiphon_chios', 'Antiphon', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 2415-2416', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antisthe_athens', 'Antisthenes', 'Third magistrate attested in Athens in 110/109 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 715-717, 722 / issue 55 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); Prosopographia Attica 1187; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 38 s. v. Antisthenes, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 329 s. v. Antisthenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/Anton_verscheyt_deutz', 'Anton Verscheyt', 'Warden in the Deutz Mint of the Archbishopric Cologne during 1488 to 1490. Between 1 March 1488 and 6 October 1488, some 6,980 mark in gulden were struck; the approximately 490,000 pieces have completely disappeared. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 256.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antonia_minor', 'Antonia Minor', 'Antonia Minor, also known as Antonia the Younger or simply Antonia (31 January 36 BC - September/October AD 37) was the daughter of Mark Antony and Octavia Minor. She was a niece of Augustus, sister-in-law of the Emperor Tiberius, grandmother of Caligula and Agrippina the Younger, mother of the Emperor Claudius, and both great-grandmother and great-aunt of the Emperor Nero.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antonia_tryphaena_pontus', 'Antonia Tryphaena', 'Antonia Tryphaena also known as Tryphaena of Thrace or Tryphaena (her name in Greek: η Άντωνία Τρύφαινα or Τρυφαίνη, 10 BC – 55) was a Roman Client Queen of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antoninus_pius', 'Antoninus Pius', 'Roman emperor from 11 July 138 to 7 March 161', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pisanello', 'Antonio Pisano (Pisanello)', 'An Italian painter and medalist, famous as being one of the first artists embracing the art of the medal.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/antonius_felix', 'Antonius Felix', 'Marcus Antonius Felix (Felix in Greek: ο Φηλιξ, born between 5/10-?) was the Roman procurator of Iudaea Province 52-58, in succession to Ventidius Cumanus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anwar_sadat', 'Anwar Sadat', 'Muhammad Anwar El Sadat (Arabic: محمد أنور السادات‎ Muḥammad Anwar as-Sādāt) was the third President of Egypt, serving from 15 October 1970 until his assassination by fundamentalist army officers on 6 October 1981.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/anzaze_elymais', 'Anzaze of Elymais', 'Anzaze was a queen of the Elymais. She appears on coins together with king Kamnaskires III (about 82/81 BC to 75. BC following dates on the coins). They perhaps ruled together as on the coins she is called βασιλίσσης (the Genitive case of queen - βασίλισσα [basílissa]). Furthermore it was not common on Ancient coins that king and queens appear together, again supporting her special status.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apelles_maroneia', 'Apelles', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apellikon_ii_athens', 'Apellikon', 'First magistrate attested in Athens in 60/59 BC. From Oion. Maybe the same person as Apellikon, the first magistrate in 88/87 BC [Thompson issue 75] (PA 1343, Thompson 1961, p. 551, LGPN p. 41); but with good reasons Habicht distinguishes two persons, Apellikon, the elder (p. 11 f.) and Apellikon, the younger (p. 17): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1263 / her issue 103 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (60/59 BC, his issue 105); Prosopographia Attica 1343; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 41 s. v. Apellikon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 334 s. v. Apellikon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apellikon_i_athens', 'Apellikon', 'First magistrate attested in Athens in 88/87 BC [Thompson issue 75]. Originally from Ionian Teos, then Athenian citizen. Possibly the same person as Apellikon, the first magistrate in 60/59 BC [Thompson issue 103] (PA 1343, Thompson 1961, p. 551, LGPN p. 41); but with good reasons Habicht distinguishes two persons, Apellikon, the elder (pp. 11-12) and Apellikon, the younger (p. 17): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1130-1142 / issue 75 (p. 551); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (88/87 BC), issue 77; Prosopographia Attica 1343; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 41 s. v. Apellikon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 334 s. v. Apellikon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aphphianos_adramyteum', 'Aphphianos', 'Strategos in Adramyteeum (Mysia). His name appears on coins issued under Augustus. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 212 no. 118; RPC Suppl. I, no. 2332B; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 398 s. v. Aphphianos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 93 s. v. Aphphianos (no. 6).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aphrodisi_athens', 'Aphrodisi…', 'First magistrate attested in Athens in 122/121 BC [issue 42]. Again attested as first magistrate in 120/119 BC [issue 45]. Probably from Piraeus as his colleague Apolexi[s], second magistrate of issue 42, both names are common here (cf. detailed Habicht 1991, p. 18): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 494-507 and nos. 543-555 / issues 42 and 45 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 8 and 18 (123/122 and 120/119 BC); Prosopographia Attica 2778; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 82 s. v. Aphrodisios, no. 8; H. B. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 398 s. v. Aphrod(e)isios (122/121 BC [issue 42]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apodacus_characene', 'Apodacus of Characene', 'Apodakos was a king of Characene, a kingdom presumably vassal of the Parthian Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apol_ii_athens', 'Apol...', 'Third magistrate attested in Athens in 102/101 BC [issue 63]. Again attested as third magistrate in 96/95 BC [issue 69]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 432-835, 838 and nos. 990-1004 / issues 63 and 69 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5-6 (102/101 and 96/95 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 335 s. v. Apol-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apol_i_athens', 'Apol...', 'Third magistrate attested in Athens in 124/123 BC. See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 531, 533-534 / issue 44 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); H. Mattingly, NC 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 335 s. v. Apol- (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apolexis_athens', 'Apolexis', 'First magistrate attested in Athens in 54/53 BC. From Piraeus. Belongs to the same family as his colleague Lysandros (second magistrate), maybe his brother (Thompson 1961, 552) or a father-son-relationship (?): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1272 / issue 109 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (54/53 BC, last issue 111); Prosopographia Attica 1363; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 42 s. v. Apolexis, no. 24 and 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 336 s. v. Apolexis.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apolexi_athens', 'Apolexis', 'Second magistrate attested in Athens in 122/121 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 494-507 / issue 42 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 8 and 18 (123/122 BC); Prosopographia Attica 1354; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 42 s. v. Apolexis, no. 5; H. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 336 s. v. Apolexis (Datierung auf 122/121 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apolla(-)_mesembria', 'Apolla(…)', 'Magistrate attested on the Alexander coinage of Mesembria, c. 125-65 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1120', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollas_abdera', 'Apollas', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodoros_ii_priene', 'Apollodoros', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 339.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodoros_i_priene', 'Apollodoros', 'An individual who issued coins at the ancient city of Priene c. 270-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 339.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodo_ii_athens', 'Apollodoros', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 691-694 / issue 53 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); Prosopographia Attica 1387; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 42 s. v. Apollodoros, no. 59; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 338 s. v. Apollodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodo_i_athens', 'Apollodoros', 'Third magistrate attested in Athens in 128/127 BC [issue 37] and again in 125/124 BC [issue 40]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 425-427 and nos. 465-466, 469-470 / issues 37 and 40 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 1386; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 42 s. v. Apollodoros, no. 58; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 338 s. v. Apollodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodotus_i_bactria', 'Apollodotus I of Bactria', 'Apollodotus I Soter was an Indo-Greek king between 180 BCE and 160 BCE or between 174 and 165 BCE', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollodotus_ii_bactria', 'Apollodotus II of Bactria', 'Apollodotus II was an Indo-Greek king who ruled in the western and eastern parts of Punjab ca. 80-65 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonides_cyzicus', 'Apollonides', 'Strategos in Cyzicus/Mysia, c. AD 253-260. His name appears on coins issued during the joint reign of Valerian I and Gallienus, both with his title as Strategos and without. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 341 s. v. Apollonides (AD 253-260); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 48 s. v. Apollonides (no. 199) (AD 253-260).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonides_athens', 'Apollonides', 'Third magistrate attested in Athens in 114/113 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 658, 660-662 / issue 51 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (114/113 BC); Prosopographia Attica 1486; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 45 s. v. Apollonides, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 341 s. v. Apollonides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonid_athens', 'Apollonides', 'Third magistrate attested in Athens in 133/132 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 378, 381-382 / issue 32 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132 BC); Prosopographia Attica 1485; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 45 s. v. Apollonides, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 341 s. v. Apollonides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonides_i_abydus', 'Apollonides (I)', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Apollonides (242); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 341 s. v. ΑΠΟΛΛΩΝΙΔΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonides_ii_abydus', 'Apollonides (II)', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Apollonides (243); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 341 s. v. ΑΠΟΛΛΩΝΙΔΑΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonios_abydus', 'Apollonios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Apollonios (1304); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 342 s. v. ΑΠΟΛΛΩΝΙΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonios_i_athens', 'Apollonios', 'Second magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 697-709 and no. 685 (drachm) / issue 54 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 1507; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 45 s. v. Apollonios, no. 29; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 342 s. v. Apollonios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonios_cyzicus', 'Apollonios', 'Strategos in Cyzicus/Mysia during the reign of Gallienus. His name appears on coins in combination with his title as Strategos, see SNG von Aulock no. 1288. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 343 s. v. Apollonios (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollonios_ii_athens', 'Apollonios', 'Third magistrate attested in Athens in 93/92 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1055-1057 issue 72 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (93/92 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 45 s. v. Apollonios, no. 48; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 342 s. v. Apollonios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apolloni_athens', 'Apolloni…', 'Third magistrate attested in Athens in 116/115 BC [issue 49]. Again attested as third magistrate in 109/108 BC [issue 56]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 619, 621 and nos. 729-731 / issues 49 and 56 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 and 109/108 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 340 s. v. Apolloni-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollon_athens', 'Apollon…', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 585-587, 589 / issue 47 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 340 s. v. Apollon-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollophanes_abydus', 'Apollophanes', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Apollophanes (96); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 339 s. v. ΑΠΟΛΛΟΦΑΝΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollopha_athens', 'Apollophanes', 'Third magistrate attested in Athens in 117/116 BC [issue 48]. Again attested as third magistrate in 116/115 BC [issue 49]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 597-601 , 610 and nos. 611-615 , 626 / issues 48 and 49 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 and 116/115 BC); Prosopographia Attica 1464; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 44 s. v. Apollophanes, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 339 s. v. Apollophanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollophanes_bactria', 'Apollophanes of Bactria', 'Apollophanes Soter (reigned c. 35 – 25 B.C.) was an Indo-Greek king in the area of eastern and central Punjab in modern India and Pakistan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollo_priene', 'Apollo…', 'An individual who issued coins at the ancient city of Priene c. 250-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 340.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apollo_athens', 'Apollo…', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 408, 411 / issue 35 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 340 s. v. Apollo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apol(-)_priene', 'Apol…', 'Magistrate attested on the Alexander coinage of Priene, c. 210-200 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2240; K. Regling, Die Münzen von Priene (Berlin 1927) p. 38. 157 no. 32.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/appius_Claudius_Martialis_pirc931', 'Appius Claudius Martialis', 'Legatus Augusti pro praetore provinciae Thracia from AD 166 to 169. Inscriptions name him also with title of Presbeutes. On coins as Hegemon (Serdika, Anchialus, Marcianopolis). Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 166 no. 29 (dates AD 161-163); ibid. Addenda I (2011) no. 22:029 (dates AD 166-169.); PIR² C 931.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ap_cl_rrc', 'Appius Claudius Pulcher', 'Roman Republican Moneyer, c. 111 - 110 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/apronius', 'Apronius', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ap_athens', 'Ap…', 'Third magistrate attested in Athens in 99/98 BC [issue 66]. Again attested as third magistrate in 94/93 BC [issue 71]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 879, 883-885, 888, 891-892, 894-900, 904, 909-912, 914-919, 921-922, 924-925 and nos. 1038-1043 / issues 66 and 71, commentary on p. 551; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 f. (99/98 and 94/93 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 332 s. v. Ap-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aquilia_severa', 'Aquilia Severa', 'Wife of Elagabalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/erbbina_lycia', 'Arbinas', 'Dynast in the ancient region of Lycia from approximately 410–390 BC. See O. Mørkholm and J. Zahle, ‘The Coinage of the Lycian Dynasts Kheriga, Kherêi and Erbbina. A Numismatic and Archaeological Study’, Acta Archaeologica 47 (1976), pp. 47-90', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arcadius', 'Arcadius', 'The Roman emperor Arcadius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arch_abdera', 'Arch-', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archagores_abdera', 'Archagores', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archebius_bactria', 'Archebius of Bactria', 'Archebius Dikaios Nikephoros was an Indo-Greek king who ruled in the area of Taxila ca. 90-80 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archelaos_abdera', 'Archelaos', 'An individual who issued coins at the ancient city of Abdera, 375/373-365/360 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archelaus_i_macedon', 'Archelaus I of Macedon', 'Archelaus I was a king of the ancient Greek kingdom of Macedon from 413 to 399 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archelaus_ii_macedon', 'Archelaus II of Macedon', 'Archelaus II of Macedon succeeded his uncle Aeropus II and reigned one year. Although according to the Chronicon he reigned four years. He died while out hunting, either by accident or assassination.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archelaus_cappadocia', 'Archelaus of Cappadocia', 'Archelaus (Greek: Ἀρχέλαος; fl. 1st century BC and 1st century, died 17 AD) was a Roman client prince and the last king of Cappadocia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archembrotos_maroneia', 'Archembrotos', 'An individual who issued coins at the ancient city of Maroneia, 480-450 BC. See S. Psoma, The coins of Maroneia and the classical city at Molyvoti. A contribution to the history of Aegean Thrace (Athens, 2008), p. 164. 166. (Cf. also E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 122 who dates 495-448 BC.)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archepolis_magnesia_ad_maeandrum', 'Archepolis', 'Archeptolis, also Archepolis, was a Governor of Magnesia on the Maeander in Ionia for the Achaemenid Empire circa 459 BCE to possibly around 412 BCE,[1] and a son and successor of the former Athenian general Themistocles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archestratos_abydus', 'Archestratos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Archestratοs (17); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 371 s. v. ΑΡΧΕΣΤΡΑΤΟΣ.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arches_athens', 'Arches…', 'Third magistrate attested in Athens in 134/133 BC [issue 31]. Maybe the same person as Arche..., one of the third magistrates of issue 29: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 364, 371-372, 375 / issue 31, commentary on p. 555; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 371 s. v. Arches-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arche_athens', 'Arche…', 'Third magistrate attested in Athens in 136/135 BC [issue 29]. Maybe the same person as Arches..., one of the third magistrates of issue 31: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 333, 336, 344 / issue 29, commentary on p. 555; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 370 s. v. Arche-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archias_athens', 'Archias', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 633, 635, 637-639 / issue 50 (p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 2450; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 70 s. v. Archias, no. 20; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 371 s. v. Archias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/archip_athens', 'Archippos', 'Third magistrate attested in Athens in 121/120 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 518, 521 / issue 43 (p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 BC); Prosopographia Attica 2547; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 72 s. v. Archippos, no. 18; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 373 s. v. Archip- (121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/architimos_ii_athens', 'Architimos', 'First magistrate attested in Athens in 62/61 BC [Thompson issue 101]. From Sphettos. Son of Architimos, the first magistrate in 83/82 BC (Habicht 1991, pp. 12-13 and 16): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1255-1258 / her issue 101 (who understands Architimos [1] and [2] as one person); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6, 12-13 and 16 (62/61 BC, his issue 103); Prosopographia Attica 2567; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 72 s. v. Architimos, no. 1 and 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 373 s. v. Architimos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/architimos_i_athens', 'Architimos', 'First magistrate attested in Athens in 83/82 BC [Thompson issue 80]. From Sphettos. Father of Architimos, the first magistrate in 62/61 BC (Habicht 1991, pp. 12-13 and 16): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1173-178, 1169 (p. 373) / her issue 80 (who understands Architimos [1] and [2] as one person: see p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 12-13 (83/82 BC, his issue 82); Prosopographia Attica 2567; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 72 s. v. Architimos, no. 1 (under Athens in general, no specific deme); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 373 s. v. Architimos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ardashir_i_persis', 'Ardashir I of Persis', 'Ardashir I Frataraka ruler of of Persis', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ardashir_ii_persis', 'Ardashir II of Persis', 'Ardashir II ruler of Persis under Parthia in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ardashir_iii_mithra_persis', 'Ardashir III Mitrhra of Persis', 'Ardashir III Mitrhra ruler of Persis under Parthia in the late 1st to early 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ardashir_iv_persis', 'Ardashir IV of Persis', 'Ardashir IV ruler of Persis under Parthia in the late 2nd to early 3rd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arestos_athens', 'Arestos', 'Third magistrate attested in Athens in 123/122 BC. Most probably from Marathon. Paedotribe in 117/116 BC (Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 487-490, 492-493 issue 41 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (124/123 BC); Prosopographia Attica 1604; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 50 s. v. Arestos, no. 1; H. B. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 349 s. v. Arestos (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aretas_ii_nabataea', 'Aretas II of Nabataea', 'Aretas II (Arabic: حارثة‎ Ḥārthah; Greek: Αρέτας Arétās) was the King of the Nabateans. Succeeding Rabbel I, his reign began in 103 BCE and he ruled until 96 BCE. Aretas II was a contemporary of the Hasmonean king Alexander Jannaeus, whose expansionist policies were a direct threat to the Nabatean Kingdom. During the siege of Gaza by Jannaeus in 99, the besieged Gazans requested help from \"Aretas, King of the Arabs\", but he did not come to their aid and the city was destroyed. Aretas is credited with beginning Nabatean minting.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aretas_iii', 'Aretas III', 'Aretas III was King of Nabataea from 87-62 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aretas_iv', 'Aretas IV', 'Aretas IV Philopatris was the King of the Nabataeans from roughly 9 BC to AD 40.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/areus_i_lacedaimon', 'Areus I of Sparta', 'Areus I (Greek: Ἀρεύς Α΄) (died 265 BC) was Agiad King of Sparta from 309 to 265 BC, who died in battle near Corinth during the Chremonidean War. He was the grandson of Cleomenes II and was succeeded by his son Acrotatus II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/are_priene', 'Are…', 'An individual who issued coins at the ancient city of Priene c. AD 193-211. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 349.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/argeios_chios', 'Argeios', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2430', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/argeios_athens', 'Argeios', 'Third magistrate attested in Athens in 88/87 BC. Archon in 98/97 and general (strategos) for Piraeus c. 100 BC (Habicht 1991, p. 22): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1140-1142 / her issue 75 (p. 552); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 22 (88/87 BC, his issue 77); Prosopographia Attica 1581; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 49 s. v. Argeios, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 348 s. v. Argeios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arghun', 'Arghun', 'Arghun Khan aka Argon (Mongolian Cyrillic: Аргун хан) was the fourth ruler of the Mongol empire\'s Ilkhanate, from 1284 to 1291.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ari-_cyprus', 'Ari-, Cyprus', 'King of uncertain name beginning Ari- who produced coins at an uncertain mint in Cyrpus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arianthes_abydus', 'Arianthes', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Arianthes (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 350 s. v. ΑΡΙΑΝΘΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariaramnes_cappadocia', 'Ariaramnes of Cappadocia', 'Ariaramnes ( ruled 280 BC – 262 or 230), was a ruler and king of Cappadocia, who succeeded his father Ariarathes II. He was probably the first to obtain the independence of Cappadocia from the Seleucid Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariara_athens', 'Ariarathes', 'Second magistrate attested in Athens in 121/120 BC. Probably from Sypalettos (the name is only attested here). No Cappadocian king, but Athenian citizen. Dedicated a statue of the philosopher Karneades on the Athenan agora (IG II 2. ed. 3781): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 503, 508-523, 506 (drachm), 507 (hemidrachm) / issue 43 (pp. 552-553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 8 (122/121 BC); Prosopographia Attica 1608; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 50 s. v. Ariarathes, no. 3; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 350 s. v. Ariarathes (121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_i_cappadocia', 'Ariarathes I of Cappadocia', 'Ariarathes I (Aramaic: Ariorath or Ariourat; Ancient Greek: Ἀριαράθης, romanized: Ariaráthēs; 405/4 BC – 322 BC) was the last Achaemenid Persian governor (satrap) of the province (satrapy) of Northern Cappadocia, serving from the 340s BC to 331 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_ii_cappadocia', 'Ariarathes II of Cappadocia', 'Ariarathes II (Ancient Greek: Ἀριαράθης, Ariaráthēs; ruled 301–280 BC), satrap and king of Cappadocia, son of Holophernes, fled into Armenia after the death of his uncle and adopted father Ariarathes I, ruler of Cappadocia. After the death of Eumenes he recovered Cappadocia with the assistance of Ardoates, the Armenian king, and killed Amyntas, the Macedonian satrap, in 301 BC, but was forced to accept Seleucid suzerainty. He was succeeded by Ariamnes, the eldest of his three sons.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_iii_cappadocia', 'Ariarathes III of Cappadocia', 'Ariarathes III (Ancient Greek: Ἀριαράθης, Ariaráthēs; reigned 262 or 255 – 220 BC), son of Ariamnes, ruler of Cappadocia, and grandson of Ariarathes II, married Stratonice, a daughter of Antiochus II, king of Syria and wife Laodice I, and obtained a share in the government during the lifetime of his father. About 250 BC he was the first ruler of Cappadocia to proclaim himself king (basileus). It is known that he sided with Antiochus Hierax in his war against Seleucus II Callinicus[citation needed]. Ariarathes is also said to have expanded his kingdom adding Cataonia to his dominions. By his marriage he was the father of Ariarathes IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_iv_cappadocia', 'Ariarathes IV of Cappadocia', 'Ariarathes IV, surnamed Eusebes, \"the Pious\", (Ancient Greek: Ἀριαράθης Εὐσεϐής, Ariaráthēs Eusebḗs), was the king of Cappadocia in 220–163 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_ix', 'Ariarathes IX', 'Ariarathes IX Eusebes Philopator (\"Pious, Father-loving\"), the nine-year-old son of Mithradates VI of Pontus, was placed on the throne of Cappadocia in c. 100 BC to serve as his father\'s puppet. He was deeply unpopular with the Cappadocians and was soon driven out by Ariarathes VIII. The superior forces of Mithradates VI restored Ariarathes IX to power in c. 95 BC, only to have him immediately deposed by the Romans. He was restored several times between 95 and 85 BC in opposition to the Roman-supported Ariobarzanes I. Mithradates VI removed Ariarathes IX from the Cappadocian throne in 85 BC under the peace terms that ended the First Mithradatic War (89-85 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_v_cappadocia', 'Ariarathes V of Cappadocia', 'Ariarathes V Eusebes Philopator (Ancient Greek: Ἀριαράθης Ε΄ Εὐσεβής Φιλοπάτωρ, Ariaráthēs Eusebḗs Philopátōr; reigned 163–130 BC) was a son of the preceding king Ariarathes IV of Cappadocia and queen Antiochis. He was distinguished by his contemporaries for his excellence of his character and his cultivation of philosophy and the liberal arts and is considered by some historians to have been the greatest of the kings of Cappadocia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_vi', 'Ariarathes VI', 'Ariarathes VI Epiphanes Philopator (\"God Manifest, Father-loving\") ruled the kingdom of Cappadocia between c. 130 and 116 BC. He was the youngest of the six sons of Ariarates V and Nysa and the only one to survive the plotting of his murderous mother. He swept to power during a popular uprising that overthrew Nysa, but he was a weak ruler and became a virtual puppet of Mithradates V of Pontus. As he grew older, he was increasingly disinclined to accept Pontic interference in the affairs of his kingdom. He was subsequently assassinated in 116 BC by a Cappadocian noble at the instigation of Mithradates VI of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_vii', 'Ariarathes VII', 'Ariarathes VII Philometor (\"Mother-loving\") ruled the kingdom of Cappadocia from c. 116 to 100 BC. This young son of Ariarathes VI reigned with his mother, Laodice, as regent--a situation that led to instability. In c. 105 BC, Nicomedes III of Bithynia invaded Cappadocia and married Laodice in an attempt to gain the regency over Ariarathes VII. He and Laodice were driven out by Mithradates VI of Pontus, who placed Ariarathes VII on the throne as sole ruler of Cappadocia. However, like his father, Ariarathes VII came to resent Pontic influence. He riased an army against Mithradates VI, but was assassinated when he accepted and invitation to a conference with the Pontic king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_viii', 'Ariarathes VIII', 'Ariarathes VIII Eusebes Epiphanes (\"Pious, God Manifest\") claimed the kingship in Cappadocia between c. 100 and 95 BC. This son of Ariarathes VI was invited by the Cappadocians to overthrow the deeply unpopular Ariarathes IX. He raised an army to press his claims to the throne, but was ultimately defeated in battle by Ariarathes IX\'s father, Mithradates VI of Pontus. Ariarathes VIII then fled Cappadocia and died in exile shortly thereafter.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariarathes_x_cappadocia', 'Ariarathes X of Cappadocia', 'Ariarathes X, surnamed Eusebes Philadelphos, \"Pious, brother-loving\" (Ancient Greek: Ἀριαράθης Εὐσεβής Φιλάδελφος, Ariaráthēs Eusebḗs Philádelphos), was the king of Cappadocia from c. 42 BC to 36 BC. He was of Persian and Greek ancestry. His father was King Ariobarzanes II of Cappadocia and his mother was Queen Athenais. He became king after his brother Ariobarzanes III Philoromaios was killed.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariobarzanes_i', 'Ariobarzanes I', 'Ariobarzanes I Philoromaios (\"Friend of the Romans\") alternated with Ariarathes IX as ruler of Cappadocia between 95 and 85 BC. He was usually deposed by Tigranes II of Armenia as an ally of Mithradates VI of Pontus only to be restored by Roman generals. Between 83 and 67 BC he was also driven out of Cappadocia by the Armenian and Pontic kings. Ariobarzanes I was restored by the Romans for the last time in 66 BC. Three years later he abdicated in favor of his son, Ariobarzanes II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariobarzanes_ii_cappadocia', 'Ariobarzanes II of Cappadocia', 'Ariobarzanes II, surnamed Philopator, \"father-loving\", (Ancient Greek: Ἀριοβαρζάνης Φιλοπάτωρ, Ariobarzánēs Philopátōr), was the king of Cappadocia from c. 63 BC or 62 BC to c. 51 BC. He was the son of King Ariobarzanes I of Cappadocia and his wife Queen Athenais Philostorgos I, while his sister was Isias Philostorgos, who married King Antiochus I Theos of Commagene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariobarzanes_iii_cappadocia', 'Ariobarzanes III of Cappadocia', 'Ariobarzanes III, surnamed Eusebes Philorhomaios, \"Pious and Friend of the Romans\" (Ancient Greek: Ἀριοβαρζάνης Εὐσεβής Φιλορώμαιος, Ariobarzánēs Eusebḗs Philorōmaíos), was the king of Kingdom of Cappadocia from ca. 51 BC until 42 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arist_byzantium', 'Arist...', 'An individual who issued coins at the ancient city of Byzantium, c. 235-200 BC. See W. Stancomb, Some Countermarked and Overstruck Hellenistic Coins from the Region of the Thracian Bosporus, NC 167 (2007), 25-32, pp. 29-30', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristagoras_abdera', 'Aristagoras', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristai_athens', 'Aristaichmos', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 559-563, 579 (drachm) / issue 46 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 51 s. v. Aristaichmos, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 353 s. v. Aristaichmos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristar_athens', 'Aristarchos', 'Third magistrate attested in Athens in 122/121 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 498, 501 / issue 42 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (123/122 BC); Prosopographia Attica 1654; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 51 s. v. Atistarchos, no. 14; H. B. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 354 s. v. Aristarchos (122/121 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristarchus_colchis', 'Aristarchus of Colchis', 'Aristarchus (Greek: Ἀρίσταρχος, Aristarkhos) was a ruler of Colchis as a client of Rome from 63 BC to c. 50 BC. He was installed by the Roman general Pompey as part of his settlement of Asia during the Mithridatic Wars. Aristarchus is principally known from the works of the 1st-century historian Appian as well as the coinage issued in his name.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristeas_athens', 'Aristeas', 'Second magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 686-696 / issue 53 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); Prosopographia Attica 1672; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 52 s. v. Aristeas, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 354 s. v. Aristeas.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/ariste_athens', 'Ariste…', 'Third magistrate attested in Athens in 135/134 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 355 / issue 30 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (135/134 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 354 s. v. Ariste-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristion_athens', 'Aristion', 'First magistrate attested in Athens in 98/97 BC [Thompson issue 68]. Later attested as second magistrate in 87/86 BC [Thompson issue 76] together with king Mithradates VI of Pontus. Tyrant of Athens in 88-86 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 959-961, 963-989 and nos. 1143-1146 / issues 68 and 76 (pp. 553-554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 12 (97/96 BC [issue 68]; the company with Pontic king Mithradates VI Eupator as first magistrate was the main argument in favour of a low chronology of the New-Style-issues); Prosopographia Attica 1737; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 53 s. v. Aristion, no. 22; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 356 s. v. Aristion (98/97 BC [issue 68]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristoboulos_rhodes', 'Aristoboulos', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 2516- 2516A', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristobulus_chalcis', 'Aristobulus of Chalcis', 'Aristobulus of Chalcis was a son of Herod of Chalcis and his first wife Mariamne. Herod of Chalcis, ruler of Chalcis in Iturea, was a grandson of Herod the Great through his father, Aristobulus IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristodemos_chios', 'Aristodemos', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2434', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristodemos_athens', 'Aristodemos', 'Third magistrate attested in Athens in 115/114 BC [issue 50]. Again attested as third magistrate in 111/110 BC [issue 54]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 635, 637-640, and nos. 701-702 / issues 50 and 54 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 1801; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 55 s. v. Aristodemos, no. 21; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 358 s. v. Aristodemos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristodikos_chios', 'Aristodikos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2410', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristokles_abydus', 'Aristokles', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Aristokles (35); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 358 s. v. ΑΡΙΣΤΟΚΛΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristok_ii_athens', 'Aristok…', 'Third magistrate attested in Athens in 101/100 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 833, 835, 841-843, 848-851, 853 / issue 64 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (101/100 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 358 s. v. Aristok-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristok_i_athens', 'Aristok…', 'Third magistrate attested in Athens in 136/135 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 339-340, 342, 344-346 / issue 29 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 358 s. v. Aristok-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristoles_maroneia', 'Aristoleos', 'An individual who issued coins at the ancient city of Maroneia, 365-330s BC. See S. Psoma, The coins of Maroneia and the classical city at Molyvoti. A contribution to the history of Aegean Thrace (Athens, 2008), p.173. (Cf. also E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45 who dates 386/385-348/347 BC and writes Aristoles). W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 360.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ariston_athens', 'Ariston', 'Third magistrate attested in Athens in 109/108 BC [issue 56]. Again attested as third magistrate in 107/106 BC [issue 58]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 721, 726 and nos. 751-754, 757 / issues 56 and 58 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (109/108 and 107/106 BC); Prosopographia Attica 2141; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 62 s. v. Ariston, no. 29; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 362 s. v. Ariston.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristonous_athens', 'Aristonous', 'Third magistrate attested in Athens in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1132-1137 / her issue 75 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (88/87 BC, his issue 77); Prosopographia Attica 2037; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 59 s. v. Aristonous, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 361 s. v. Aristonous.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristoph_athens', 'Aristoph...', 'Magistrate in Athens 136/135 BC. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 29; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristos_athens', 'Aristos', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 616-617, 619 / issue 49 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); Prosopographia Attica 2049; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 60 s. v. Aristos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 361 s. v. Aristos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristoteiches_chios', 'Aristoteiches', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 2407 and 2409', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristoteles_athens', 'Aristoteles', 'Second magistrate attested in Athens in 60/59 BC. From Oion: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1263 / her issue 103 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (60/59 BC, his issue 105); Prosopographia Attica 2067; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 60 s. v. Aristoteles, no. 36; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 361 s. v. Aristoteles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristotimus_elis', 'Aristotimus of Elis', 'Aristotimus was a tyrant of the ancient Greek city of Elis. He was installed by the Macedonian king Antigonus II Gonatas in 272 BC and ruled only a few months during which he committed many outrageous crimes, driving 800 citizens into exile. He was killed by Hellanicus, Cylon and other conspirators who were subsequently honoured by the Aetolians with a statue erected at Olympia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristo_iv_athens', 'Aristo…', 'Third magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 603-608 / issue 48 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 357 s. v. Aristo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristo_athens', 'Aristo…', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 566-571 / issue 46 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 362 s. v. Aristo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristo_iii_athens', 'Aristo…', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 475-477, 479-480 / issue 41 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 357 s. v. Aristo- (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aristo_ii_athens', 'Aristo…', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 400 / issue 34 (p. 554); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 357 s. v. Aristo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arist_ii_athens', 'Arist…', 'Third magistrate attested in Athens in 101/100 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 848-851, 853 / issue 64 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (101/100 BC); Prosopographia Attica 1673; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 352 s. v. Arist-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arist_i_athens', 'Arist…', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 409, 411 / issue 35 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 352 s. v. Arist-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aris_iv_athens', 'Aris…', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 830-834, 837, 839 / issue 63 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 351 s. v. Ais-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aris_iii_athens', 'Aris…', 'Third magistrate attested in Athens in 113/112 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 676-677 / issue 52 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 351 s. v. Aris-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aris_ii_athens', 'Aris…', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 554, 556-561, 578 (drachm) / issue 46 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 351 s. v. Aris-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aris_i_athens', 'Aris…', 'Third magistrate attested in Athens in 125/124 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 469-471, 473 / issue 40 (p. 553); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 351 s. v. Aris-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arkathias_i_sophene', 'Arkathias I of Sophene', 'Arkathias I was King of Sophene in the first half of the 2nd century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/armoxenos_athens', 'Armoxenos', 'Third magistrate attested in Athens in 96/95 BC [Thompson issue 69]. Afterwards he is attested as second magistrate three times, every time in company with Xenokles as first magistrate), so in 95/94 BC [Thompson issue 70], in 92/91 BC [Thompson issue 73], and in 90/89 BC [Thompson issue 73]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1010-1012, 1014 (drachm), nos. 1013-1014, 1016-1031, nos. 1064, 1066-1109, and nos. 1110-1124 / issues 69, 70 and 73 (p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 22 (who splits Thompson\'s issue 73 in two seperate issues 73 and 75 and dates the issues 96/95, 95/94, 92/91 and 90/89 BC [issues 69, 70, 73 and 75]); Prosopographia Attica 2237; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 64 s. v. Armoxenos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 364 s. v. Armoxenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arnt_von_hamant_colonia_claudia_ara_agrippinensium', 'Arnt von Hamant', 'Mint Warden in Cologne (City), Germany from 1511 to 1514. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arogos_abydus', 'Arogos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Arogos (6); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 373 s. v. ΑΡΩΓΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aropos_athens', 'Aropos', 'First magistrate attested in Athens in 96/95 BC. His identity (and belonging to a deme) is not clear: he might either be son of Glaukos from Piraeus or son of Leon from Azenia (Habicht 1991, p. 18): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 990-1015 / issue 69 (p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 11 and 18 (96/95 BC); Prosopographia Attica 2243; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 64 s. v. Aropos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 364 s. v. Aropos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsaces_i_parthia', 'Arsaces I of Partha', 'Arsaces I was the first king of Parthia, as well as the founder and eponym of the Arsacid dynasty of Parthia, ruling from 247 BC to 217 BC. The leader of the Parni, one of the three tribes of the Dahae confederacy, Arsaces founded his dynasty in the mid-3rd century BC when he conquered the satrapy of Parthia (today\'s eastern Turkmenistan) from Andragoras, who had rebelled against the Seleucid Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsaces_ii_parthia', 'Arsaces II of Partha', 'Arsaces II was the Arsacid king of Parthia from 217 BC to 191 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsames_sophene', 'Arsames of Sophene', 'Arsames II was the King of Sophene, who offered asylum to Antiochus Hierax.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsinoe_i', 'Arsinoe I of Egypt', 'Arsinoe I (305 BC – after c. 248 BC) was Queen of Egypt by marriage to Ptolemy II Philadelphus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsinoe_ii', 'Arsinoe II', 'Arsinoë II (316 BC – unknown date between July 270 and 260 BC) was a Ptolemaic Queen and co-regent of Ancient Egypt. She was Queen of Thrace, Asia Minor and Macedonia by marriage to King Lysimachus, and queen and co-ruler of Egypt with her brother-husband Ptolemy II Philadelphus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arsinoe_iii', 'Arsinoe III of Egypt', 'Arsinoe III Philopator was Queen of Egypt in 220 – 204 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabanus_i_parthia', 'Artabanus I of Partha', 'Artabanus I, incorrectly known in older scholarship as Artabanus II, was king of the Parthian Empire, ruling briefly from c. 127 to 124/3 BC. His short reign ended abruptly when he died during a battle against the Yuezhi in the east. He was succeeded by his son Mithridates II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabanus_ii_parthia', 'Artabanus II of Partha', 'Artabanus II, incorrectly known in older scholarship as Artabanus III, was the King of Kings of the Arsacid Empire from 12 to 38/41', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabanus_iii_parthia', 'Artabanus III of Partha', 'Artabanus III (Parthian: Ardawān), incorrectly known in older scholarship as Artabanus IV, was a Parthian prince who competed against his brother Pacorus II (r. 78–110) for the Parthian crown from 79/80 to 81.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabanus_iv_parthia', 'Artabanus IV of Partha', 'Artabanus IV, also known as Ardavan IV, incorrectly known in older scholarship as Artabanus V, was the last ruler of Parthian Empire from c. 213 to 224.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabasdos', 'Artabasdos', 'The Byzantine emperor Artabasdos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artabazos_characene', 'Artabazos of Characene', 'Artabazos I of Characene was a king of Characene, a vassal state of the Parthians. His short reign lasted only from 49/48-48/47 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artavasdes_i_armenia', 'Artavasdes I of Armenia', 'Artavasdes I of Armenia reigned as King of Armenia from 159 BC to 115 BC. He was the son of Artaxias I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artavasdes_i_media_atropotene', 'Artavasdes I of Media Atropatene', 'Artavasdes I of Media Atropatene (before or about 59 BC -about 20 BC) was a Prince who served as a King of Media Atropatene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artavasdes_ii_armenia', 'Artavasdes II of Armenia', 'Artavasdes II was a King of the Kingdom of Armenia from 55 BC until 34 BC and a member of the Artaxiad Dynasty. He was a son of king Tigranes the Great of Armenia and Cleopatra of Pontus, his maternal grandfather was king Mithridates VI of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artavasdes_iii_armenia', 'Artavasdes III of Armenia', 'Artavasdes III of Armenia was appointed king by Augustus upon the deposition of Tigranes IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artavasdes_iv_armenia', 'Artavasdes IV of Armenia', 'Artavasdes IV of Armenia; also known as Artavasdes II of Atropatene; Artavasdes II of Media Atropatene and Armenia Major; Artavasdes II and Artavasdes (20 BC – 6 AD[4]) was an Iranian prince who served as King of Media Atropatene. During his reign of Media Atropatene, Artavasdes also served as a Roman Client King of Armenia Major.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxerxes_i_persia', 'Artaxerxes I of Persia', 'Artaxerxes I (Old Persian: ?????? Artaxšaça,\"whose rule (xšaça < *xšaϑram) is through arta (\"truth\"); Hebrew: אַרְתַּחְשַׁשְׂתָּא, Modern: ʾArtaḥšásta, Tiberian: ʾArtaḥšasetāʾ; Ancient Greek: Ἀρταξέρξης, romanized: Artaxérxēs) was the sixth King of Kings of the Achaemenid Empire, from 465-424 BC. He was the third son of Xerxes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxerxes_ii_persia', 'Artaxerxes II of Persia', 'Artaxerxes II Mnemon (Old Persian: ??????, meaning \"whose reign is through truth\") was the King of Kings (Xšâyathiya Xšâyathiyânâm) of Persia from 404 BC until his death in 358 BC. He was a son of Darius II and Parysatis.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxerxes_iii_persia', 'Artaxerxes III of Persia', 'Ochus (Greek: Ôchos, Babylonian: Ú-ma-kuš), better known by his dynastic name of Artaxerxes III (Old Persian: ?????? Artaxšaçā) was King of Kings of the Achaemenid Empire from 358 to 338 BC. He was the son and successor of Artaxerxes II (r. 404 – 358 BC) and his mother was Stateira.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxerxes_iv_persia', 'Artaxerxes IV of Persia', 'Arses (Old Persian: Aršaka), also known by his regnal name of Artaxerxes IV (?????? Artaxšaçā), was the twelfth Achaemenid king of Persia from 338 BC to 336 BC. He is known as Arses in Greek sources and that seems to have been his real name, but the Xanthus trilingue and potsherds from Samaria report that he took the royal name of Artaxerxes IV, following his father and grandfather.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxias_i_armenia', 'Artaxias I of Armenia', 'Artaxias I was the founder of the Artaxiad dynasty of Armenia, ruling from 190 BC to 160 BC. He was succeeded by his son Artavasdes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxias_ii_armenia', 'Artaxias II of Armenia', 'Artaxias II, also known as Artaxes II and Artashes was a Prince of the Kingdom of Armenia, member of the Artaxiad Dynasty and King of Armenia from 30 BC until 20 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxias_iii', 'Artaxias III of Armenia', 'Artaxias III, also known as Zeno-Artaxias, Artaxes or Artashes was a prince of the Bosporan, Pontus, Cilicia, Cappadocia and Roman Client King of Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artaxias_iii_armenia', 'Artaxias III of Armenia', 'Artaxias III, also known as Zeno-Artaxias, Artaxes or Artashes was a prince of the Bosporan, Pontus, Cilicia, Cappadocia and Roman Client King of Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/arte_abdera', 'Arte(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemidorus_bactria', 'Artemidorus of Bactria', 'Artemidoros Aniketos was a king who ruled in the area of Gandhara and Pushkalavati in modern northern Pakistan and Afghanistan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemido_priene', 'Artemido…', 'An individual who issued coins at the ancient city of Priene c. 330-320 BC. Regling completed: Artemidoros. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 368.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemon_abdera', 'Artemon', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemon_athens', 'Artemon', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 618-619, 621-625, 627 / issue 49 (p. 555); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 66 s. v. Artemon, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 369 s. v. Artemon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemon_i_abydus', 'Artemon (I)', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Artemon (218); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 369 s. v. ΑΡΤΕΜΩΝ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artemon_ii_abydus', 'Artemon (II)', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Artemon (219); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 369 s. v. ΑΡΤΕΜΩΝ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/artumpara_lycia', 'Artumpara', 'Dynast in the ancient region of Lycia from approximately 380–370 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M124', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aruwatijesi_lycia', 'Aruwatijesi', 'Dynast in the ancient region of Lycia from approximately 390–370 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M128', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asander_bosporus', 'Asander of Bosporus', 'Asander, named Philocaesar Philoromaios (110 BC – 17 BC) was a Roman client king of the Bosporan Kingdom. He started his career as a general under Pharnaces II, and although not descendent of the Mithraditic Dynasty, he is among their line of kings in the Bosporus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asellius_aemilianus_pirA1211', 'Asellius Aemilianus', 'Asellius Aemilianus, Legatus Augusti pro praetore in Thrace from AD 176 to 180. His name appears on coins of Pautalia, here always as Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 167 no. 33; ibid. I Addenda (2011) 22:033; PIR² A 1211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asga_abdera', 'Asga(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklapon_athens', 'Asklapon', 'Several times attested as third magistrate in Athens, first in 119/118 BC [issue 46], again in 116/115 BC [issue 49], 113/112 BC [issue 52], and in 111/110 BC [issue 54]. Most probably it is the same person abbreviated as ΑΣΚ, ΑΣΚΛΑ, ΑΣΚΛΑΠΩΝ: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 571, 574-577, nos. 619, 621-622, nos. 677, and nos. 706-707 / issues 46, 49, 52 and 54 (commentary on p. 555 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118, 116/115, 113/112 and 111/110 BC); Prosopographia Attica 2582 and 2583; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 73 s. v. Asklapon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. Asklapon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklepiades_abydus', 'Asklepiades', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Asklepiades (561); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. ΑΣΚΛΗΠΙΑΔΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklepiades_chios', 'Asklepiades', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2412', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklepiades_athens', 'Asklepiades', 'Second magistrate attested in Athens in 103/102 BC. From Halai. Son of the first magistrate Hikesos (Habicht 1991, p. 10). Author of tragedies as his uncle (named Asklepiades as well). He was victorious at the Serapeia in Tanagra in the same year Poses (magistrate of the following issue 63 in 102/101 BC) was successful with a comedy (cf. Habicht 1991, p. 10): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 809, 811, 812-822 / issue 62 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (103/102 BC); Prosopographia Attica 2586; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 74 s. v. Asklepiades, no. 105; H. B. Mattingly, NC 157, 1997, p. 259; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. Asklepiades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklepiades_cyzicus', 'Asklepiades', 'Strategos in Cyzicus/Mysia during the reigns of Valerian I and Gallienus. His name appears with and without the title of Strategos, see SNG von Aulock nos. 1249, 1287, 7366-7367. Lit. W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 377 s. v. Asklepiades (AD 253-268); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 82 s. v. Asklepiades (no. 355) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asklepi_athens', 'Asklepi…', 'Third magistrate attested in Athens in 110/109 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 714-716 / issue 55 (p. 556); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. Asklepi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/askle_ii_athens', 'Askle…', 'Third magistrate attested in Athens in 107/106 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 745, 749-751 / issue 58 (p. 556); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. Akle-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/askle_i_athens', 'Askle…', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 478-480 / issue 41 (p. 556); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 376 s. v. Askle- (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/asopios_byzantium', 'Asopios', 'Moneyer attested on the coinage of Byzantium in Thrace, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 139, nos. 1103-1130.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aspeisos_susa', 'Aspeisos', 'Magistrate attested on the Alexander coinage of Susa, c. 316-311 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 3852', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aspurgus_bosporus', 'Aspurgus of Bosporus', 'Tiberius Julius Aspurgus Philoromaios was a Prince and Roman client king of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/astyanax_abydus', 'Astyanax', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Astyanax (6); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 379 s. v. ACTYANAΞ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/astytimos_chios', 'Astytimos', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2440', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ateas_scythia', 'Ateas of Scythia', 'Ateas (ca. 350 BC – 339 BC) was described in Greek and Roman sources as the most powerful king of Scythia, who lost his life and empire in the conflict with Philip II of Macedon in 339 BC. His name also occurs as Atheas, Ateia, Ataias, and Ateus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athanaion_byzantium', 'Athanaion', 'Moneyer attested on the coinage of Byzantium in Thrace, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 133, 136, nos. 1001-2; 1179-1190.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athe_maroneia', 'Athe(…)', 'An individual who issued coins at the ancient city of Maroneia, 495-448 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 125.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athena_samothrace', 'Athena... (Samothrace)', 'Magistrate attested on the coinage of Samothrace c. 2nd-early 1st century BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 289.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenaios_abdera', 'Athenaios', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenaios_abydus', 'Athenaios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Athenaios (149); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 290 s. v. ΑΘΗΝΑΙΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenai_athens', 'Athenai…', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 621, 623, 625 / issue 49 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 289.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenes_abdera', 'Athenes', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenes_i_maroneia', 'Athenes (I)', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenes_ii_maroneia', 'Athenes (II)', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenikon_cyme', 'Athenikon', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1635 and 1642', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/atheni_athens', 'Atheni…', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 615, 617, 619-621 / issue 49 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 290.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenobi_athens', 'Athenobios', 'Third magistrate attested in Athens in 127/126 BC. From Eupiridai. Son of Dionysios and father of the magistrates Niketes and Dionysios [issue 67]. As boy victor at the Theseia (IG II 2. ed. 958; I 60-62). As knight participating in the Pythais in 128/127 BC (FD III 2, 27; I 26): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 435-436 / issue 38 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 19 (127/126 BC); Prosopographia Attica 245; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 12 s. v. Athenobios, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 291 s. v. Athenobios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenodo_athens', 'Athenodoros', 'Third magistrate attested in Athens in 127/126 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 430, 432 / issue 38 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 19 (127/126 BC); Prosopographia Attica 261; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 12 s. v. Athenodoros, no. 14; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 291 s. v. Athenodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenokles_abydus', 'Athenokles', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Athenokles (7); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 291 s. v. ΑΘΗΝΟΚΛΗΣ.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athenopolis_priene', 'Athenopolis', 'An individual who issued coins at the ancient city of Priene c. 270-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 157; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 291.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/athe_athens', 'Athe…', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 546-547, 555 (drachm) / issue 45 (p. 548); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 288.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attalus_i', 'Attalus I', 'Attalus I, surnamed Soter ruled Pergamon, an Ionian Greek polis (what is now Bergama, Turkey), first as dynast, later as king, from 241 BC to 197 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attalus_ii_pergamum', 'Attalus II Philadelphus', 'Attalus II Philadelphus (\"Attalus the brother-loving\"; 220–138 BC) was a King of Pergamum and the founder of modern-day Turkish city Antalya.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attalus_iii_pergamum', 'Attalus III Philomenor Euergetes', 'Attalus III Philometor Euergetes (c. 170 BC – 133 BC) was the last Attalid king of Pergamum, ruling from 138 BC to 133 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attalus_paphlagonia', 'Attalus of Paphlagonia', 'Attalus was appointed king of Paphlagonia following its detachment by Rome from the Kingdom of Pontos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_i_characene', 'Attambelus I of Characene', 'Attambelus I was a king of Characene, a Parthian vassal state and important trading port and emporium on the Persian Gulf. His rule was from 47/46 to 25/24 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_ii_characene', 'Attambelus II of Characene', 'Attambelus II was a king of Characene, a Parthian vassal state and important trading port on the Persian Gulf. His rule was from 17/16 B.C. to A.D. 8/9.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_iii_characene', 'Attambelus III of Characene', 'Attambelus III of Characene was a king of Characene who ruled from approximately A.D. 37/38 to 44/45. His rule is known only by the coins he minted.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_iv_characene', 'Attambelus IV of Characene', 'Attambelus IV of Characene was a first century ruler of the state of Characene. He ruled from 54/55-64/65; but he is known only from coins he minted.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_v_characene', 'Attambelus V of Characene', 'Attambelus V of Characene was a ruler of the state of Characene who ruled from 64/65-73/74 but who is known only from the coins he minted.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_vi_characene', 'Attambelus VI of Characene', 'Attambelus VI of Characene was a ruler of the state of Characene, who ruled from approximately 101/02-105/06 and is known only from the coins he minted.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_vii_characene', 'Attambelus VII of Characene', 'Attambelos VII was a king of Characene, a vassal state of the Parthians. His short reign lasted from A.D. 113/4 to 116/7 and was spent mostly contending with the Roman invasion under Trajan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/attambelus_viii_characene', 'Attambelus VIII of Characene', 'Attambelus VIII was a king of Characene around A.D. 190.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/au_pu_sabeinos_cyzicus', 'Au... Pu... Sabeinos', 'Strategos in Cyzicus/Mysia during the reign of Hadrian. His name appears on coins in combination with the title of Strategos. The reading of the name differs. For the coins see F. Jodin, Revue Numismatique 154, 1999, p. 141 no. 40 (CΤΡΑ ΑΠΟΥ CΑΒΕΙΝΟC) and nos. 41-42, 44; p. 143 no. 63 (CΤΡΑ ΑY ΠΟΥ CΑΒΕΙΝΟC); RPC III nos. 1508-1512 (obv. Hadrian) and no. 1522 (obv. Sabina). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 345 s. v. Apouleios and p. 796 s. v. Sabeinos (AD 117-138); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 396 s. v. Sabinos (no. 24) (AD 117-138); RPC III pp. 182-184.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/audoleon_paeonia', 'Audoleon of Paeonia', 'Audoleon (Greek: Αὐδολέων or Αὐδωλέων; 315–285 BC) was an ancient Paeonian, king son of Patraus or Agis. He was the father of Ariston, and of a daughter who married Pyrrhus of Epirus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/augustin_baccuet_geneva', 'Augustin Baccuet', 'Augustin Baccuet is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/augustus', 'Augustus', 'Roman Emperor from 16 January 27 BC to 19 August AD 14.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aulos_cyzicus', 'Aulos', 'Magistrate in Cyzicus/Mysia. His name is often misread as \"Lydos\" (the coin legend is mainly read as ΕΠΙ ΛΥΔΟΥ, with the exception of F. W. Hasluck, Cyzicus (1910) p. 306, who reads ΑΥΛΟΥ instead. This is confirmed by a coin in Munich, see RPC IV,2 [online] Temp. no. 7139) and it does remarkably appear without any title on coins issued under Antoninus Pius (group 2). For the coins see RPC IV,2 (online) Temp. nos. 668 and 7139 (147-161 AD). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 649 s. v. Lydos (AD 138-161); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 273 s. v. Lydos (no. 6) (AD 138-161).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aulus_gabinius', 'Aulus Gabinius', 'Aulus Gabinius (?-48 or 47 BC) was a Roman statesman, general and supporter of Pompey. He was a prominent figure in the latter days of the Roman Republic. In 57 BC Gabinius went as proconsul to Syria, issuing coins until 55 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/son_of_vitellius', 'Aulus Vitellius Germanicus', 'The young son of the emperor Vitellius, accorded the title of \'Germanicus\' after his father\'s victory in AD 69 over Otho, and depicted on issues of Vitellius. alongside his young sister.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aur_cladaeus_trophi_adramyteum', 'Aur. Cladaeus Trophi(mos)', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Severus Alexander. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190. 231 nos. 228-229 and 231; p. 232 no. 233; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 601 s. v. Kladaios and p. 851 s. v. Trophimos. Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 246 s. v. Kladaios (no. 1) and p. 436 s. v. Trophimos (no. 142) supposes two cognomina for one person. D. Calomino, RPC VI temp. nos. 4135-4138 instead distinguishes two persons and suppose Aur. Kladaios (son of?) Trophimos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aur_eutyches_adramyteum', 'Aur. Eutyches', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Maximinus Thrax. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190, 233 f. nos. 246-249 and 251; RPC VI temp. nos. 4140-4144; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 511 s. v. Eutyches; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 184 s. v. Eutyches (no. 74).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aur_fabianos_adramyteum', 'Aur. Fabianos', 'Strategos in Adramyteum (Mysia). His name (generally with the addition \"B\", \"the younger\") appears on coins issued under Philippus Arabs while his son Philippus already is Augustus. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190, 237 nos. 269-270 (dates 247-249 AD); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 858 s. v. Phabianos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) s. v. Phabianos (no. 1).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelian', 'Aurelian', 'The Roman emperor Aurelian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelios_markos_dardanus', 'Aurelios Markos', 'Archon attested in Dardanos in c. 193-211 AD. Not in LGPN V. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 387 s. v. ΑΥΡΗΛΙΟΣ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelius_alexandros_cyzicus', 'Aurelius Alexandros', 'Strategos in Cyzicus/Mysia. His name appears on coins in combination with the title of Strategos. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 306 s. v. Alexandros (AD 244-249); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 19 s. v. Alexandros (no. 557) (AD 244-249).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelios_gaios_ii_adramyteum', 'Aurelius Gaios', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Severus Alexander, either with the addition of \"Β\" and/or ΝΕ(ος) (bothe indicating \"the younger\"). Instead of the single \"B\" several coins show a monogramm probably meaning \"TO B\" for being strategos for the second time. For the coins see H. von Fritze, Die antiken Münzen Mysiens (1913); pp. 54-56 nos. 161-168; J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190, 231 no. 230 and p. 232 nos. 234-243; RPC VI temp. nos. 4130-4134 (222-235 AD); for the name W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 413 s. v. Gaios (222-235 AD); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 106 s. v. Gaios (no. 140) (222-225 AD).', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/aurelius_gaios_i_adramyteum', 'Aurelius Gaios', 'Strategos in Adramyteum (Mysia). His name appears on coins issued unter Elagabalus. The reading is controversially discussed. See H. von Fritze, Die antiken Münzen Mysiens I (1913) p. 51 no. 153 (ΑΥΡΗΛΙΟΥ Γ?Α[ΙΟΥ?]); J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, p. 230 no. 223 (ΑΥΡΗΛΙΟΥ ΓΑ[ΙΟΥ?]); RPC VI temp. no. 2126 (ΑΥΡΗΛΙΟΥ ΓΑ ΙΟΥΛ, sic); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 385 note 2 (refers to SNG France 5 no. 67, which has ΑΥΡΗΛ[ΙΟ]Υ Ν[Ε]ΡΟΥΑ), followed by Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 106 s. v. Gaios (no. 138).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelius_meidias_cyzicus', 'Aurelius Meidias', 'Strategos and Asiarch in Cyzicus/Mysia c. AD 184-190. His name appears on coins issued with the portrait of Commodus and of the civic deity Kore Soteira) and always with a combintion of both his offices: RPC IV,2 (online) Temp. nos. 742, 754-755, 9167, and 11243 (c. AD 184-190). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 668 s. v. Meidias (c. AD 177-192); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 287 s. v. Meidias (no. 37) (AD 177-192).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelius_polyktetos_cyzicus', 'Aurelius Polyktetos', 'Strategos in Cyzicus/Mysia during the reign of Gordian III. His name appears on coins in comibation with his title of Strategos: RPC VII-1 p. 109 no. 8 (AD 238-244). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 766 s. v. Polyktetos (AD 238-244; Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 372 s. v. Polyktetos (no. 3) (AD 238-244); RPC VII-1 p. 107, 109.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelius_preiskianos_cyzicus', 'Aurelius Preiskianos', 'Aurelius Priscinanus, Strategos in Cyzicus/Mysia. His name (as ΑΥΡ ΠΡΕΙCΚΙΑΝΟΥ) appears on coins issued during the second half of Marcus Aurelius\' reign in combination with the title of Strategos, see RPC IV,2 (online) Temp. nos. 681, 2326-2327, and 11211-11212 (AD 169-175, possibly until AD 180). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 775 s. v. Preiskianos (AD 161-180); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 380 s. v. Priskianos (no. 4) (AD 161-180).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aurelius_severus_agathemeros_cyzicus', 'Aurelius Severus Agathemeros', 'Aurelius Severus Agathemeros (the younger), Strategos in Cyzicus/Mysia during the reign of Philip the Arab. His name appears on coins in combination with his title of Strategos, e.g. BMC Mysia 57 no. 274; H. Bloesch, Griechische Münzen in Winterthur II (1997) no. 2573. Lit.: H. Halfmann, Hymnoden von Asia in Kyzikos, in: Mysische Studien, AMS 1 (1990) pp. 22-23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 278 s. v. Agathemeros (AD 244-249); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 2 s. v. Agathemeros (no. 17) (AD 244-249).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aur_sokrates_cyzicus', 'Aurelius Sokrates', 'Strategos in Cyzicus/Mysia during the reign of Elagabalus. His name appears on coins issued in combination with his title of Strategos: RPC VI (online) Temp. no. 3730. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 825 s. v. Sokrates (AD 218-222).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aur_sostratos_cyzicus', 'Aurelius Sostratos', 'Strategos in Cyzicus/Mysia during the reign of Valerian I. His name appears on coins in combination with his title of Strategos, e.g. SNG Aulock nos. 1286 and 7386; SNG France Mysie no. 858 (Valerian). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 830 s. v. Sostratos (AD 253-260); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 420 s. v. Sostratos (no. 23) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aureolus', 'Aureolus', 'Manius Acilius Aureolus (died 268) was a Roman military commander and would-be usurper.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/autophradates_satrap', 'Autophradates', 'Autophradates (Greek: Aὐτoφραδάτης, Persian: Vadfradad, lived 4th century BC) was a Persian Satrap of Lydia, who also distinguished himself as a general in the reign of Artaxerxes III and Darius III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/avitus', 'Avitus', 'The Roman emperor Avitus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aybak', 'Aybak', 'Izz al-Din Aybak[dn 1] (Arabic: عز الدين أيبك‎) (epithet: al-Malik al-Mu\'izz Izz al-Din Aybak al-Jawshangir al-Turkmani al-Salihi, Arabic: الملك المعز عز الدين أيبك التركماني الجاشنكير الصالحى) was the first of the Mamluk sultans of Egypt in the Turkic Bahri line.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aynal', 'Aynal', 'Al-Malik al-Ashraf Sayf ad-Din Abu an-Nasr Inal al-\'Ala\'i az-Zahiri an-Nasiri al-Ajrud (better known as Sayf ad-Din Inal also spelled Saif ad-Din Aynal) (1381 – 26 February 1461) was the 13th Burji Mamluk sultan ofEgypt, ruling between 1453–1461.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/aynel_byblus', 'Aynel, King of Byblus', 'Ruler of Byblos in the 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/azbaal_citium', 'Azbaal of Citium', 'Fifth century Phoenician king of Citium and Idlalium', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/azes_i_gandhara', 'Azes I of Gandhara', 'Azes I was an Indo-Scythian ruler who completed the domination of the Scythians in Gandhara.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/azes_ii_gandhara', 'Azes II of Gandhara', 'Azes II (reigned c. 35–12 BCE) would have been the last Indo-Scythian king in Gandhara, western Pakistan. He may be the same person as Azes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/azilises_gandhara', 'Azilises of Gandhara', 'Azilises (ruled circa 57-35 BCE) was an Indo-Scythian king who ruled in the area of Gandhara. Azilises issued some joint coins with Azes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baalmelek_i_citium', 'Baalmelek I of Citium', 'Fifth century Phoenician king of Citium.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baalmelek_ii_citium', 'Baalmelek II of Citium', 'Fifth century Phoenician king of Citium and Idalium', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baalram_citium', 'Baalram of Citium', 'Early fourth century Phoenician king of Citium.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baalshillem_ii_sidon', 'Baalshillem II, King of Sidon', 'Ruler of Sidon in the early 4th century B.C. His son was Abdashtart (Straton) I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baana_sidon', 'Baana, King of Sidon', 'According to numismatic evidence, Baana (Ba\'ana) seems to have been a king of Sidon about the time of Baalshallim I, ca. 425-402 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/badr_al-din_lu\'lu\'', 'Badr al-Din Lu\'lu\'', 'Badr al-Din Lu\'lu\' (Arabic: بدر الدين لؤلؤ‎) (died 1259) was successor to the Zangid rulers of Mosul, where he governed in variety of capacities for half a century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/badr_ibn_hasanwayh', 'Badr ibn Hasanwayh', 'Badr ibn Hasanwayh (369-405/980-1014) was the second ruler of the Hasanawayhid or Hasanuyid (Arabic: حسنویه‎, Kurdish: Dewleta Hesnewiyan)which was a Kurdish principality from 961 to 1015, centered at Dinawar (northeast of present-day Kermanshah).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baha\'_al-dawlah_abu_nasr_shahinshah', 'Baha\' al-Dawlah Abu Nasr Shahinshah', 'Abu Nasr Firuz Kharshadh, better known by his laqab of Baha\' al-Dawla (meaning \"Splendour of the State\") was the Buyid amir of Iraq (988–1012), along with Fars and Kerman (998–1012)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bahadur_shah', 'Bahadur Shah', 'Sultan Qutb-ud-Din Bahadur Shah, who reigned 1526–1535 and 1536–1537, was a sultan of Gujarat Sultanate, a late medieval kingdom in India', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bahram-shah', 'Bahram-Shah of Ghazna', 'Sultan of the Ghaznavid empire from 25 February 1117 to 1157.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bajkam', 'Bajkam', 'Abū al-Husayn Bajkam al-Mākānī (Arabic: أبو الحسين بجكم المكاني‎), referred to as Bajkam, Badjkam or Bachkam (from Bäčkäm, a Persian and Turkish word meaning a horse- or yak-tail), was a Turkish military commander and official of the Abbasid Caliphate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bakchios_athens', 'Bakchios', 'Three times attested as third magistrate in Athens, in 122/121 BC [issue 42], in 111/110 BC [issue 54], and in 105/104 BC [issue 60]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 500, 502-503, nos. 701-703, and nos. 789, 793-795, 797-798 / issues 42, 54 and 60 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (123/122, 111/110 and 105/104 BC); Prosopographia Attica 2822 and 2823; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 85 s. v. Bakchios, no. 7; H. B. Mattingly, NC 157, 1997, p. 259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 401 s. v. Bakchios (122/121 BC [issue 42]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/balbinus', 'Balbinus', 'Roman emperor in 238 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bal_rrc', 'Balbus', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ballaeus_illyria', 'Ballaeus of Illyria', 'Ballaios (Ancient Greek: Βαλλαῖος; Latin: Ballaeus; ruled c. 167 – c. 135 BC or c. 195 – c. 175 BC) was an Illyrian king of the Ardiaei. Ballaios was not mentioned by any ancient writers. Ballaios is considered to have been a powerful and influential king as testified by the abundance of his silver and bronze coinage found along both coasts of the Adriatic.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/balthasar_wysselmann_colonia_claudia_ara_agrippinensium', 'Balthasar Wysselmann', 'Appointed General Mint Warden in Cologne (City), Germany, in April 1520. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49 (mistake with date range).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/barakah_qan', 'Barakah Qan', 'Al-Said Barakah (original name: Muhammed Barakah Qan (Arabic: محمد بركة قان‎), royal name: al-Malik al-Said Nasir al-Din Barakah (Arabic: الملك السعيد ناصر الدين بركة) was a Mamluk Sultan who ruled from 1277 to 1279.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/barbarossa', 'Barbarossa', 'Hayreddin Barbarossa, or Barbarossa Hayreddin Pasha (c. 1478 – 4 July 1546), was an Ottoman admiral of the fleet.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/barghash_b_sa\'id', 'Barghash b. Sa\'id', 'Barghash bin Said Al-Busaid, (Arabic: برغش بن سعيد البوسعيد‎), son of Said bin Sultan, was the second Sultan of Zanzibar. Barghash ruled Zanzibar from October 7, 1870 to March 26, 1888.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/barquq', 'Barquq', 'Al-Malik Az-Zahir Sayf ad-Din Barquq (Arabic: الملك الظاهر سيف الدين برقوق‎) (ruled 1382–1389 and 1390 –1399) was the first effective sultan of the Mamluk Burji dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/barsbay', 'Barsbay', 'Al-Ashraf Sayf-ad-Din Barsbay was the ninth Burji Mamluk sultan of Egypt from AD 1422 to 1438. He was Circassian by birth and a former slave of the first Burji Sultan, Barquq.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/basilius_i', 'Basil I', 'The Byzantine emperor Basil I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/basilius_ii', 'Basil II', 'The Byzantine emperor Basil II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/basilius_trapezunt', 'Basil of Trebizond', 'The emperor of Trebozond Basil.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/basilei_athens', 'Basileides', 'Third magistrate attested in Athens in 136/135 BC. From Piraeus. He was councillor c. 155 BC and Hieropoios c. 150 BC (Habicht 1991, p. 19); H. B. Mattingly, NC 157, 1997, p. 258 mentions religious offices in 149/148 and 138/137 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 335, 339, 345 / issue 29 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19 (136/135 BC); Prosopographia Attica 2841; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 86 s. v. Basileides, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 403 s. v. Basileides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/basiliscus', 'Basiliscus', 'The Roman emperor Basiliscus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bastareus_paeonia', 'Bastareus of Paeonia (?)', 'Bastareus (Greek: Βασταρεύς; fl. 4th century BC), was an ancient king of Thrace, known only from a rare coin bearing his name. He was perhaps Paeonian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baybars_i', 'Baybars I', 'Baibars or Baybars (Arabic: الملك الظاهر ركن الدين بيبرس البندقداري‎, al-Malik al-Zahir Rukn al-Din Baibars al-Bunduqdari), nicknamed Abu l-Futuh[1] (Literally \"The father of conquest\"; Arabic: أبو الفتوح), was the fourth Sultan of Egypt from the Mamluk Bahri dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baybars_ii', 'Baybars II', 'Baibars al-Jashnakir  ( Arabic: بيبرس الجاشنكير ) or Baibars II. Royal name: al-Malik al-Muzaffar Rukn al-Din Baibars al-Jashnakir al-Mansuri, (Arabic: الملك المظفر ركن الدين بيبرس الجاشنكير المنصورى) (Nickname: Abu al-Fath (Arabic: أبوالفتح) . The 12th Mamluk Sultan of Egypt who ruled for a short period (1308–1309).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/baydad_persis', 'Baydad I of Persis', 'Baydad I Frataraka ruler of Persis', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bayezid_i_yildirim', 'Bayezid I Yildirim', 'Bayezid I (Ottoman Turkish: بايزيد اول; Turkish: 1. Beyazıt; nicknamed Yıldırım (Ottoman Turkish: ییلدیرم), \"The Lightning\") was the Sultan of the Ottoman Empire from 1389 to 1402.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bayezid_ii_veli', 'Bayezid II Veli', 'Bayezid II or Sultân Bayezid-î Velî (Ottoman Turkish: بايزيد ثانى Bāyezīd-i sānī, Turkish:II. Bayezid or II. Beyazıt) was the eldest son and successor of Mehmed II, ruling as Sultan of theOttoman Empire from 1481 to 1512.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/benjamin_udesheim_bonn', 'Benjamin Udesheim', 'Appointed Special Warden of Bonn, a city in Germany, on 1 January 1736. The only other mention of Benjamin Udesheim was in 1760 in connection with the assaying of Wryott\'schen silverwork. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 340; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen – Köln (1973) n. 11 p. 91.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berenice_i', 'Berenice I', 'Berenice I (c. 340 BC – between 279 and 268 BC) was Queen of Egypt by marriage to Ptolemy I Soter. She became the second queen, after Eurydice, of the Ptolemaic dynasty of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berenice_ii', 'Berenice II Euergetis', 'Berenice II Euergetis (267 or 266 BC – 221 BC) was ruling queen of Cyrenaica from around 250 BC and queen and co-regent of Ptolemaic Egypt from 246 BC to 222 BC as the wife of Ptolemy III Euergetes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berenice_iii', 'Berenice III of Egypt', 'Berenice III (120–80 BC) was known as Cleopatra between 91 and 88 BC, and is sometimes called Cleopatra Berenice in modern scholarship. She was co-regent of Ptolemaic Egypt from 101-88 BC and again in 81 BC, before reigning as sole monarch of Egypt from 81 to 80 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berenice_iv', 'Berenice IV', 'Berenice IV Epiphaneia (77–55 BC, born and died in Alexandria, Egypt) was a Greek Princess and Queen of the Ptolemaic dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bergaeus_thrace', 'Bergaeus of Thrace', 'Bergaios or Bergaeus (Greek: Βεργαῖος), 400 – 350 BC, was a Thracian king in the Pangaian region. He is known mainly from the several types of coins that he struck, which resemble those of Thasos. His authencity is still discussed, maybe the coins were minted by the city Berge.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berthier_louis_alexandre', 'Berthier, Louis Alexandre (d. 1815)', 'Louis Alexandre Berthier, 1st prince de Wagram, 1st duc de Valangin, 1st sovereign Prince of Neuchâtel (20 February 1753 – 1 June 1815), was a Marshal and Vice-Constable of France beginning in 1808, and Chief of Staff (Major général) under Napoleon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/berthollet_claude-louise', 'Berthollet, Claude-Louise (d. 1822)', 'Claude Louis Berthollet (9 December 1748 Talloires, France – 6 November 1822 Arcueil, France) was a Savoyard-French chemist who became vice president of the French Senate in 1804.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bias_i_priene', 'Bias', 'An individual who issued coins at the ancient city of Priene c. 320-300 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 407.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bion_clazomenae', 'Bion', 'Magistrate attested on the Alexander coinage of Clazomenae, c. 200-200 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1748', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bi_priene', 'Bi…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Regling completed: Bias (?) II. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 407 (280-275 BC); See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2234.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/blosys_abdera', 'Blosys', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bocchus_i_mauretania', 'Bocchus I of Mauretania', 'Bocchus، was a king of Mauretania about 110 BC and designated by historians as Bocchus I. He was also the father-in-law of Jugurtha, with whom he made war against the Romans. He delivered Jugurtha to the Romans in 106 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bocchus_ii_mauretania', 'Bocchus II of Mauretania', 'Bocchus II was king of Mauretania. Son of Sosus (Mastanesosus), who was dead in 49 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bodashtart_sidon', 'Bodashtart, King of Sidon', 'Bodashtart was a Phoenician king of Sidon. He was named in a 4th century B.C. inscription.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bogud_mauretania', 'Bogud of Mauretania', 'Bogud (died 31 BC), son of King Bocchus I of Mauretania, was joint king of Mauretania with his elder brother Bocchus II, with Bocchus ruling east of the Moulouya River and his brother west.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bohemond_ii', 'Bohemond II', 'Bohemond II (1108–1130) was the Prince of Taranto and Prince of Antioch from 1111. He was the son of the founder of the principalities, Bohemond I, and Constance, daughter of Philip I of France. Taranto was lost to Roger II of Sicily in 1128.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bohemond_vii', 'Bohemond VII', 'Bohemond VII of Tripoli (1261 – October 19, 1287) was the count of Tripoli and nominal prince of Antioch from 1275 to his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bonosus', 'Bonosus', 'Usurper against Probus in the year 280.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bospon_byzantium', 'Bospon', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 141, nos. 1148-1153.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/boukattes_athens', 'Boukattes', 'Third magistrate attested in Athens in 123/122 BC. Most probably from Boeotia; his uncommon name is not attested otherweise in Athens. Thesmothetes in 128/127 BC. Participating in the Pythais as knight of the phyle Leontis (Habicht 1991, p. 20-21; H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 479-482 / issue 41 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 20 (124/123 BC); Prosopographia Attica 2905; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 89 s. v. Boukattes no. 2; H. B. Mattingly, NC 157, 1997, pp. 258-259 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 410 s. v. Boukattes (123/122 BC, issue 41).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/boular_athens', 'Boularchos', 'Third magistrate attested in Athens in 126/125 BC. Belongs maybe to the same family as Damokleas from the phyle Akamanits / deme Eiresidai (Habicht 1991, p. 20): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 453-454, 456-457 / issue 39 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 20 (126/125 BC); Prosopographia Attica 2909; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 89 s. v. Boularchos, no. 2; H. B. Mattingly, NC 157, 1997, p. 259; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 410 s. v. Boularchos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bouta_maroneia', 'Bouta(…)', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/brabeus_maroneia', 'Brabeus', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/britannicus', 'Britannicus', 'Tiberius Claudius Caesar Britannicus (12 February AD 41 — 11 February AD 55) was the son of the Roman emperor Claudius and his third wife Valeria Messalina. He became the heir-designate of the empire at his birth, until replaced by his step brother Nero. He lived only months into Nero\'s reign, and was probably murdered just before his 14th birthday.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/brogitarus_galatia', 'Brogitarus of Galatia', 'Brogitarus was king of Galatia in Asia Minor between 63 BC and 50 BC, reigning concurrently with his father-in-law Deiotarus Philoromaeus,who was also tetrarch of the Tolistobogii.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/brvtvs_rrc', 'Brutus', 'Roman Republican Moneyer, c. 54 BC, 42 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/burckhard_stickel_stuttgart', 'Burckhard Stickel', 'Mint administrator in Stuttgart, Baden-Wuerttemberg, Germany from 1556. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/byttakos_athens', 'Byttakos', 'Third magistrate attested in Athens in 118/117 BC. From Lamptrai (Habicht 1991, p. 21). Knight in 128/127 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 586, 590-593, 595 / issue 47 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (118/117 BC); Prosopographia Attica 2933 [Thompson] or 2934 [LGPN]; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 91 s. v. Byttakos, no. 3; H. B. Mattingly, NC 157, 1997, p. 259; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 412 s. v. Byttakos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_tal_rrc', 'C. (Iuventius) Thalna', 'Roman Republican Moneyer, c. 154 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_var_rrc', 'C. (Terentius) Varro', 'Roman Republican Moneyer, c. 209 - 208 BC', 'http://xmlns.com/foaf/0.1/Person'),
