('http://nomisma.org/id/c_al_rrc', 'C. Aelius', 'Roman Republican Moneyer, c. 209 - 208 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_alli_bala_rrc', 'C. Allius Bala', 'Roman Republican Moneyer, c. 92 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_anni_t_f_t_n_pro_cos_rrc', 'C. Annius', 'Roman Republican Moneyer, c. 82 - 81 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_annius_pollio', 'C. Annius Pollio', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
