('http://nomisma.org/id/c_antistius_reginus', 'C. Antistius Reginus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_antistius_vetus', 'C. Antistius Vetus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_antivs_c_f_restio_rrc', 'C. Antius Restio', 'Roman Republican Moneyer, c. 47 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_antonivs_m_f_pro_cos_rrc', 'C. Antonius', 'Roman Republican Moneyer, c. 43 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_asinius_gallus', 'C. Asinius Gallus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/avr_rrc', 'C. Aurunculeius', 'Roman Republican Moneyer, c. 209 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_metellvs_rrc', 'C. Caecilius Metellus Caprarius', 'Roman Republican Moneyer, c. 125 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_piso_l_f_frvgi_rrc', 'C. Calpurnius Piso Frugi', 'Roman Republican Moneyer, c. 67 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/c_cassi_rrc', 'C. Cassius', 'Roman Republican Moneyer, c. 126 BC', 'http://xmlns.com/foaf/0.1/Person'),
