('http://nomisma.org/id/c_hadr_sabeinos_adramyteum', 'C. Hadr. Sabeinos', 'Magistrate in Adramyteum (Mysia). His name appears on coins issued under Antoninus Pius. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 188 f., 221 nos. 172 and 174; RPC IV temp. no. 406; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 796 s. v. Sabeinos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 396 s. v. Sabinos (no. 21).', 'http://xmlns.com/foaf/0.1/Person'),
