('http://nomisma.org/id/constantine_i', 'Constantine I', 'Constantine the Great (Latin: Flavius Valerius Aurelius Constantinus Augustus; 27 February c. 272 – 22 May 337), also known as Constantine I or Saint Constantine, was Roman Emperor from 306 to 337.', 'http://xmlns.com/foaf/0.1/Person'),
