('http://nomisma.org/id/contarini_alvise', 'Contarini, Alvise (1676-1684)', 'Alvise Contarini (October 24, 1601 – January 15, 1684) was the 106th Doge of Venice, reigning from his election on August 26, 1676 until his death seven and a half years later. He was the eighth and final member of the House of Contarini to serve as Doge of Venice (with the first being Domenico I Contarini, who became Doge in 1043).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/contarini_carlo', 'Contarini, Carlo (1655-1656)', 'Carlo Contarini (Venice, July 5, 1580 – Venice, May 1, 1656) was the 100th Doge of Venice, reigning from his election on March 27, 1655 until his death a little over a year later.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/contarini_domenico', 'Contarini, Domenico (1659-1674)', 'Domenico II Contarini (Venice, January 28, 1585 – Venice, January 26, 1675) was the 104th Doge of Venice, reigning from his election on October 16, 1659 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/coponius_judaea', 'Coponius', 'Coponius was the first governor (Prefect) of Judaea province, from 6–9 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cornelia_salonina', 'Cornelia Salonina', 'Wife of the Emperer Gallienus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cornelia_supera', 'Cornelia Supera', 'Wife of the Emperor Aemilianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lentvlvs_spint_rrc', 'Cornelius Lentulus Spinther', 'Roman Republican Moneyer, c. 43 - 42 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cornelius_von_leyden_deutz', 'Cornelius von Leyden', 'Mintmaster in the Archbishopric Cologne during October 1502 to no later than 19 May 1505, in the Deutz Mint, and jointly appointed with Grunewalt in the Zons Mint. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) pp. 263, 266, 270.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cosconius_gentianus_pirc1526', 'Cosconius Gentianus', 'Legatus augusti pro praetore Moesiae inferioris AD 195-198. His name appears on coins of Markianopolis and Nikopolis. Lit.: PIR ² C 1526.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/coson_dacia', 'Coson of Dacia', '\"Koson\" is the name of an otherwise historically unrecorded Dacian king, though he may be identical to the Cotison mentioned by Horace and Suetonius. Gold staters and silver drachms imiating Roman coin types were produced in his name.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cossus_cornelius_lentulus', 'Cossus Cornelius Lentulus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_i_bosporus', 'Cotys I of Bosporus', 'Tiberius Julius Cotys I Philocaesar Philoromaios Eusebes, also known as Cotys I or Kotys I was a prince and Roman client king of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_i_odrysian_thrace', 'Cotys I of Thrace', 'Cotys I or Kotys I (Ancient Greek: Κότυς) was born during the reign of Seuthes I. He became king in 384 BC. On gaining the Odrysian kingdom the Athenians made him their ally.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_i_sapaean_thrace', 'Cotys I of Thrace', 'Cotys I was a Sapaean client king of the Odrysian kingdom of Thrace from c. 57 BC to c. 48 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_ii_bosporus', 'Cotys II of Bosporus', 'Tiberius Julius Cotys II Philocaesar Philoromaios Eusebes, also known as Cotys II or Kotys II was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_ii_odrysian_thrace', 'Cotys II of Thrace', 'Cotys II (Ancient Greek: Κότυς) was a king of the Odrysian kingdom of Thrace from c. 300 to c. 280 BC, succeeding his father, Seuthes III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_iii_bosporus', 'Cotys III of Bosporus', 'Tiberius Julius Cotys III Philocaesar Philoromaios Eusebes, also known as Cotys III or Kotys III (died 235) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_iii_odrysian_thrace', 'Cotys III of Thrace', 'Cotys III (also known as Cotys II) was a dynast in Thrace ca. 185/3-165/48 who minted coins.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_iii_sapaean_thrace', 'Cotys III of Thrace', 'Cotys III, also known in dynastic terms as Cotys VIII (Ancient Greek: Κότυς, flourished second half of 1st century BC & first half of 1st century, died 19) was the Sapaean Roman client king of eastern Thrace from 12 to 19.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_iv_astaean_thrace', 'Cotys IV of Astaean Thrace', 'Cotys IV (VI) was a dynast of the Astaean dynasty in Thrace and minted coins from ca. 57-50/48 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cotys_v_astaean_thrace', 'Cotys V of Astaean Thrace', 'Cotys V (VII) was a dynast of the Astaean dynasty in Thrace and minted coins from ca. 31-23/22 BC in Southeastern Thrace.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/crispina', 'Crispina', 'Bruttia Crispina (164 – 191 AD) was Roman Empress from 178 to 191 as wife of Commodus. They had no children.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/crispus', 'Crispus', 'The Roman emperor Crispus, son of Constantine I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/croesus_lydia', 'Croesus of Lydia', 'Croesus (Ancient Greek: Κροῖσος, Kroisos; 595 BC – date of death unknown) was the king of Lydia who, according to Herodotus, reigned for 14 years: from 560 BC until his defeat by the Persian king Cyrus the Great in 546 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cyrus_persia', 'Cyrus the Great', 'Cyrus II of Persia (Old Persian: ????? Kūrauš; Kourosh; New Persian: کوروش Kuruš; Hebrew: כורש, Modern: Kōréš, Tiberian: Kōréš; c. 600 – 530 BC), commonly known as Cyrus the Great, and also called Cyrus the Elder by the Greeks, was the founder of the Achaemenid Empire, the first Persian Empire. Under his rule, the empire embraced all the previous civilized states of the ancient Near East, expanded vastly and eventually conquered most of Western Asia and much of Central Asia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/d_abdera', 'D(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/albinvs_brvti_f_rrc', 'D. Iunius Brutus Albinus', 'Roman Republican Moneyer, c. 48 BC. Died 43 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/d_silanvs_l_f_rrc', 'D. Iunius Silanus', 'Roman Republican Moneyer, c. 91 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/d_tvr_rrc', 'D. Turullius', 'Roman Republican Moneyer, c. 31 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dalmatius', 'Dalmatius', 'The Roman emperor Dalmatius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dam_abdera', 'Dam(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/damatrios_rhodes', 'Damatrios', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2521', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/damokrines_rhodes', 'Damokrines', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2523', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/damon_byzantium', 'Damon', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 146, nos. 1235-1239.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/damon_athens', 'Damon', 'Third magistrate attested in Athens in 127/126 BC [issue 38]. Later attested as first magistrate in 109/108 BC [issue 56]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 433-435 and pp. 262-266 nos. 719, 721, 722, 723-734 / issues 38 and 56 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (127/126 and 109/108 BC); Prosopographia Attica 3135; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 99 s. v. Damon, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 430 s. v. Damon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dam_athens', 'Dam…', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 828-829 / issue 63 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 426 s. v. Dam-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/daniel_sardes_geneva', 'Daniel Sardes', 'Daniel Sardes is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/daniel_sigmund_dockler_nuremberg', 'Daniel Sigmund Dockler', 'Son of Daniel Siegmund the Elder (who was still alive in 1688). Die cutter, medalist, (and goldsmith) in Nürnberg (Nuremberg), Franconia, Germany. He was born Sept. 20, 1667, and died March 31st, 1753. Became a Meister Nov. 29th, 1696 as a silver worker. His initials are DSD. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171; U. Thieme (ed.), Allgemeines Lexikon der bildenden Künstler von der Antike bis zur Gegenwart 9, Leipzig 1999, 357.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darayan_i_persis', 'Darayan I of Persis', 'Darayan I ruler of Persis under the Seleucids', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darayan_ii_persis', 'Darayan II of Persis', 'Darayan II ruler of Persis under Parthia in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darius_i_persia', 'Darius I of Persia', 'Darius I (Old Persian: Dārayava(h)uš, New Persian: داریوش‎ Dāryuš; Hebrew: דָּרְיָוֶשׁ, Modern: Darəyaveš, Tiberian: Dāryāwéš; c. 550–486 BCE), commonly known as Darius the Great, was the third Persian King of Kings of the Achaemenid Empire, reigning from 522 BCE until his death in 486 BCE. He ruled the empire at its peak, when it included much of West Asia, parts of the Caucasus, parts of the Balkans (Thrace-Macedonia, and Paeonia), most of the Black Sea coastal regions, Central Asia, as far as the Indus Valley in the far east and portions of north and northeast Africa including Egypt (Mudrâya), eastern Libya, and coastal Sudan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darius_ii_persia', 'Darius II of Persia', 'Darius II (Old Persian: Dārayavahuš), also called Darius II Nothus or Darius II Ochus, was king of kings of the Persian Empire from 423 BC to 404 or 405 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darius_iii_persia', 'Darius III of Persia', 'Darius III (c. 380 – July 330 BC), originally named Artashata and called Codomannus by the Greeks, was the last king of the Achaemenid Empire of Persia, from 336 BC to 330 BC. Artashata adopted Darius as a dynastic name.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/darius_elymais', 'Darius of Elymais', 'Darius was possibly a usurper of the Elymais who issued coinage from Susa around 129 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/datames_cappadocia', 'Datames of Cappadocia', 'Datames was a satrap in Achaemenid Cappadocia from 380-362 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/david_camp_geneva', 'David Camp', 'David Camp is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/david_guainier_geneva', 'David Guainier', 'David Guainier is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/david_stein_stuttgart', 'David Stein', 'Mintmaster in Christopstal, Baden-Wuerttemberg, Germany from 1622 to 1628. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/david_trapezunt', 'David of Trebizond', 'The emperor of Trebizond David.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ddenewele_lycia', 'Ddenewele', 'Dynast in the ancient region of Lycia from approximately 410–400 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), VI, 67', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ddentimi_lycia', 'Ddentimi', 'Dynast in the ancient region of Lycia from approximately 420–400 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M132', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/decentius', 'Decentius', 'The Roman emperor Decentius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deinias_i_athens', 'Deinias', 'Third magistrate attested in Athens in 110/109 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) pp. 258 f. nos. 709, 714 / issue 55 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 100 s. v. Deinias, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 432 s. v. Deinias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deinias_ii_athens', 'Deinias', 'Third magistrate attested in Athens in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1135, 1137-1139/ her issue 75 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (88/87 BC, his issue 77); Prosopographia Attica 3155; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 100 s. v. Deinias, no. 14; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 432 s. v. Deinias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deinok_athens', 'Deinokrates', 'Third magistrate attested in Athens in 126/125 BC [issue 39]. Again attested as third magistrate in 122/121 BC [issue 42]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 445-446, 448-449 and nos. 500-501 / issues 39 and 42 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 and 123/122 BC); Prosopographia Attica 3182; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 100 s. v. Deinokrates, no. 5; and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 432 s. v. Deinok- (122/121 BC [issue 42]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deiotarus_philadelphus_paphlagonia', 'Deiotarus Philadelphus', 'Deiotarus Philadelphus (died A.D. 6) was the final client-king of Paphlagonia before its absorption into the Roman province of Bithynia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deiotarus_galatia', 'Deiotarus of Galatia', 'Deiotarus of Galatia (surnamed Philoromaios; c. 105 BC – 42 BC, 41 BC or 40 BC) was a Chief Tetrarch of the Tolistobogii in western Galatia, Asia Minor, and a King of Galatia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/delphikos_adramyteum', 'Delphikos', 'Strategos in Adramyteum (Mysia). His name appears on coins issued in Severan times, c. 211-217 AD. See H. von Fritze, Die antiken Münzen Mysien I (1913) pp. 43, 45 nos. 131-132 (according to the bearded imperial portrait: Caracalla\'s sole reign); J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 226 f. no. 203-205; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 433 s. v. Delphikos (c. 198-217 AD); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 119 s. v. Delphikos (no. 1) (193-217 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deme(-)_halicarnassus', 'Deme(…)', 'Magistrate attested on the Alexander coinage of Halicarnassus, c.190-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2475', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demeas_athens', 'Demeas', 'Probably twice attested as first magistrate, in 93/92 BC [issue 72] and again in 73/72 BC [Thompson issue 90]. Earlier already attested as third magistrate in 96/65 BC [issue 69]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1008-1013, nos. 1050-1066, and nos. 1232-1233 / her issues 69, 72 and 90 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (96/95, 93/92 and 73/72 BC, hisissues 69, 72 and 92); Prosopographia Attica 3308-3309; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 103 s. v. Demeas, no. 13; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 437 s. v. Demeas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrios_abdera', 'Demetrios', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrios_priene', 'Demetrios', 'An individual who issued coins at the ancient city of Priene c. 150-125 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 440.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deme_i_athens', 'Demetrios', 'First magistrate attested in Athens in 143/142 BC [Thompson issue 23]. Later attested as third magistrate in 136/135 BC [issue 29]; most probably also the first moneyer\'s monogram of 141/140 BC[issue 24] is to be read as \"Demetrios\" and the person seems to be identical with ΔΗΜΗ... of the two other issues (Thompson p. 91): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 202-227, nos. 228-246, and nos. 330-332, 341-342 / her issues 23, 24 and 29 (pp. 88-91, 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (143/142,141/140 and 136/135 BC, his issues 22, 24 and 29); Prosopographia Attica 3340; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 104 s. v. Demetrios, no. 37; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrios_i_athens', 'Demetrios', 'First magistrate attested in athens in 97/96 BC [issue 66]. Earlier attested as third magistrate in 104/103 BC [issue 61]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 802, 805, 807-809, 811 and nos. 879-928 / issues 61 and 66 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (104/103 and 99/98 BC); Prosopographia Attica 3343and3344; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 104 s. v. Demetrios, no. 67; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios (97/96 BC [issue 66]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrios_abydus', 'Demetrios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Demetrios (699); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. ΔΗΜΗΤΡΙΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrios_ii_athens', 'Demetrios', 'Second magistrate attested in Athens in 83/82 BC [Thompson issue 80]. Again attested as second magistrate in 76/75 BC [Thompson issue 87]: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 372 f. nos. 1169, 1173-1178 and nos. 1228-1229/ issues 80 and 87 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 12 (83/82 and 76/75 BC [issues 82 and 89]); Prosopographia Attica 3352and3342; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 105 s. v. Demetrios, no. 86; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetri_athens', 'Demetrios', 'Third magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 600, 603 / issue 48 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); Prosopographia Attica 3341;P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 104 s. v. Demetrios, no. 56; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deme_ii_athens', 'Demetrios', 'Third magistrate attested in Athens in 129/128 BC [issue 36]. Again attested as third magistrate in 125/124 BC [issue 40]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 414-416 and nos. 464-466, 473 / issues 36 and 40 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 and 125/124 BC); Prosopographia Attica 3341and3343; P. M. Fraser – E. Matthews, A Lexicon of Greek PersonalNames II Attica (1994) p. 104 s. v. Demetrios, no. 45; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetri_ouli_athens', 'Demetrios Ouli…', 'Third magistrate attested in Athens in 132/131 BC. From Alopeke. With the addition ΟΥΛΙ[...] Demetrios is explicitly identified as \"son of Ouliades\", who was probably the Kosmetes in 117 BC (Habicht 1991, p. 20; H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 385-388, 391-392 / issue 33 (pp. 558 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 20 (132/131 BC); Prosopographia Attica 3377;W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 438 s. v. Demetrios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_i', 'Demetrius I Poliorcetes', 'Demetrius I (Greek: Δημήτριος, 337 BC – 283 BC), called Poliorcetes (Greek: Πολιορκητής - \"The Besieger\"), son of Antigonus I Monophthalmus and Stratonice, was a king of Macedon (294–288 BC). He belonged to the Antigonid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_i_soter', 'Demetrius I Soter', 'Demetrius I Soter (\"the Savior\") was the eleventh king of the Seleucid Empire, ruling from 162 to 150 BC. He was sent to Rome as a hostage for the good behavior of his uncle, Antiochus IV, but escaped back to Syria in 162 BC. After disposing of Antiochus V and the regent Lysias, Demetrius I put down the usurpation of Timarchus in 160 BC and successfully fought against the Maccabean Jewish rebels in southern Coele Syria. He further upset the balance of power in Asia Minor by dethroning Ariarathes V of Cappadocia. His many enemies advanced the claims of Alexander I, a supposed son of Antiochus IV, as rightful Seleucid king in 152 BC. After several years of conflict between the two for control of Syria, Demetrius was killed in battle in 150 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_i_bactria', 'Demetrius I of Bactria', 'Demetrius I, also called Dharmamita, was a Greco-Bactrian/Indo-Greek (Yona in Pali language, \"Yavana\" in Sanskrit) king (reigned c. 200–180 BC), who ruled areas from Bactria to ancient northwestern India. He was the son of the Greco-Bactrian ruler Euthydemus I and succeeded him around 200 BC, after which he conquered extensive areas in what is now Afghanistan and Pakistan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_ii_macedon', 'Demetrius II Aetolicus', 'Demetrius II Aetolicus son of Antigonus II Gonatas and Phila, reigned as King of Macedonia from the winter of 239 to 229 BC. He belonged to the Antigonid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_ii_nicator', 'Demetrius II Nicator', 'Demetrius II Theos Nicator (\"the God [and] Victor\") was the twelfth king of the Seleucid Empire who experienced two distinct periods of rule. His first reign took place between 146 and 138 BC. In 146 BC, at the age of thirteen, Demetrius II arrived in Syria with a mercenary army intent on overthrowing his father\'s killer, Alexander I. Demetrius II was successful in this endeavor but alienated much of Syria by quelling riots in Antioch through massacre and by preferring foreign mercenaries to the established Seleucid army. A Seleucid commander named Diodotus proclaimed Antiochus VI, the young son of Alexander I, as rival king and forced Demetrius II out of Antioch. Unable to crush his enemies in Syria and faced with the advance of the Arsacid Parthians into Babylonia, Demetrius II marched to war against the Parthian king Mithradates I. Despite early successes, Demetrius II was defeated and captured in 139 BC. He subsequently lived in honorable captivity at the Parthian court until 129 BC, when he was released. The freed king returned to Antioch and resumed the great unpopularity that had plagued his first reign. His involvement in the conflict between Cleopatra II and Ptolemy VII of Egypt caused the latter to raise a pretender, Alexander II, against him. Demetrius II was defeated near Damascus in 125 BC. He fled to his wife, Cleopatra Thea, at Ptolemais (Ake), but she barred the doors against him. Demetrius II then attempted to find safety at Tyre, but he was killed by the city guards, perhaps on Cleopatra\'s orders.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/demetrius_ii_bactria', 'Demetrius II of Bactria', 'Demetrius II was a Greco-Bactrian/Indo-Greek king who may have ruled from 175 - 170 B.C. or 175 - 140 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_iii_eucaerus', 'Demetrius III Philopator', 'Demetrius III Philopator Soter (\"Father-loving Savior\"), nicknamed Eucaerus (\"the Well-timed\"), was the twenty-first king of the Seleucid Empire, ruling in Damascus from 97/6 to 88/7 BC. A brother of Seleucus VI, Antiochus XI, and Philip I, Demetrius III was installed in Damascus by Ptolemy IX as a means of denying the city to both Antiochus IX and the Nabatean Arabs. He fought an unsuccessful war against the Hasmonean Jewish king, Alexander Jannaeus, but made inroads into northern Syria. In 88 BC, Demetrius III besieged Philip I, in Beroea. The siege was abruptly lifted when Demetrius was captured by Philip\'s Parthian allies. He died in captivity shortly thereafter.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demetrius_iii_bactria', 'Demetrius III of Bactria', 'Demetrius III Aniketos is an Indo-Greek king who reigned in the area of Gandhara and Punjab, ca. 100 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demochares_athens', 'Demochares', 'First magistrate attested in Athens in 66/65 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1248 / her issue 97 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15 (66/65 BC, his issue 91); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 113 s. v. Demochares, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 443 s. v. Demochares.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/democles_rhodes', 'Democles of Rhodes', 'Democles was a magistrate of Rhodes ca. 200 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demokritos_abdera', 'Demokritos', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demonicus_i_lapethus', 'Demonicus I of Lapethus', 'Late sixth/early fifth century king of Lapethus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demonicus_ii_citium', 'Demonicus of Citium', 'Early fourth century Phoenician king of Citium.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demosth_athens', 'Demosthenes', 'Third magistrate attested in Athens in 107/106 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 756-757 / issue 58 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 BC); Prosopographia Attica 3580; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) pp. 110-111 s. v. Demosthenes, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 442 s. v. Demosthenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demosthe_athens', 'Demosthenes', 'Third magistrate attested in Athens in 133/132 BC [issue 32]. Again attested as third magistrate in 122/121 BC [issue 42] and later as second magistrate in 115/114 BC [issue 50]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 368, 376, 373 (drachm), nos. 496X-497, and nos. 631-635 / issues 32, 42 and 50 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132, 123/122 and 115/114 BC); Prosopographia Attica 3579; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 110 s. v. Demosthenes, no. 6; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 442 s. v. Demosthenes (122/121 BC [issue 42]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demostratos_athens', 'Demostratos', 'Second magistrate attested in Athens in 67/66 BC. From Pallene. Belongs to the same family as his colleague Dionysios, the first magistrate (father-son-relationship) (Habicht 1991, p. 15): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1246-1247 / her issue 96 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15 (67/66 BC, his issue 98); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 112 s. v. Demostratos, no. 59; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 442 s. v. Demostratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demos_ii_athens', 'Demos…', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 759-765, 758 (drachm) / issue 59 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 442 s. v. Demos-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demos_i_athens', 'Demos…', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 560-561, 563 / issue 46 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 442 s. v. Demos-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demo_ii_athens', 'Demo…', 'Third magistrate attested in Athens in 113/112 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 673, 677-679 / issue 52 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 441 s. v. Demo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demo_i_athens', 'Demo…', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 484-487 / issue 41 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 441 s. v. Demo- (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/demo_iii_athens', 'Demo…', 'Third magistrate attested in Athens in 99/98 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 929-936 / issue 67 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (98/97 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 441 s. v. Demo- (99/98 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deonys_abdera', 'Deonys', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deonys_i_maroneia', 'Deonys (I)', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deonys_ii_maroneia', 'Deonys (II)', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deonysas_abdera', 'Deonysas', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deonytos_maroneia', 'Deonytos', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deoynys_maroneia', 'Deoynys', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deo_abdera', 'Deo…', 'An individual who issued coins at the ancient city of Abdera, 475-450 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), p. 106, n. 89a; K. Chryssanthaki-Nagle, L\'Histoire monétaire d\'Abdère en Thrace (Athens, 2007), p. 107-111.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/des_abdera', 'Des(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/deva_gangeya', 'Deva, Gangeya (1015-1040)', 'One of the most important rulers of the first Kalachuri dynasty was Gangeya Deva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dhamar\'ali_yuhabirr_himyarites', 'Dhamar\'ali Yuhabirr of Arabia', 'Dhamar\'ali Yuhabirr was a Himyarite king in the second half the of the second century AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dhamarali_yuhabirr_himyar', 'Dhamar\'ali Yuhabirr of Himyar', 'Ruler of the Himyarite kingdom in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dharaghosha_audumbaras', 'Dharaghosha', 'Dharagosha was king of the Audumbaras, east of the Punjab, who minted coinage in the Indo-Greek style in the first century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dhub_qataban', 'Dhub of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysi_priene', 'Di[onys]i…', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Regling completed: Dionysios (?). Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diadumenian', 'Diadumenian', 'Emperor with his father Macrinus in 218 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diaph(-)_colophon', 'Diaph[…]', 'Magistrate attested on the Alexander coinage of Colophon, c. 200-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1860', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/didia_clara', 'Didia Clara', 'Didia Clara (born about 153) was a daughter and only child to the Roman Emperor Didius Julianus and Empress Manlia Scantilla.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/didius_julianus', 'Didius Julianus', 'Roman emperor from 28 March 193 – 1 June 193.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dietrich_gruenwalt_deutz', 'Dietrich Grünwalt', 'Mintmaster in Deutz for the Archbishopric of Cologne from 1547 to possibly 1557. He signed his name as Grunenwalt in 1549. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 6, 18.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diocletian', 'Diocletian', 'The Roman emperor Diocletian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodoros_abydus', 'Diodoros', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Diodoros (228); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 453 s. v. ΔΙΟΔΩΡΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodoros_athens', 'Diodoros', 'Second magistrate attested in Athens in 56/55 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1269-1270 / her issue 107 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (56/55 BC, his issue 109); Prosopographia Attica 3923; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 118 s. v. Diodoros, no. 34; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 453 s. v. Diodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodotos_erythrae', 'Diodotos', 'Magistrate attested on the Alexander coinage of Erythrae, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1914', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodotus_i', 'Diodotus I of Bactria', 'Diodotus I (285-239 BC) was a Seleucid satrap of Bactria who rebelled after the death of Antiochus II. In c. 255 or 246 BC he proclaimed himself an independent king in Bactria. Much of his reign was spent opposing the invading Parthians under their king, Arsaces I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodotus_ii', 'Diodotus II of Bactria', 'Diodotus II (c. 252 BC – c. 223 BC) succeeded his father Diodotus I in 239 BC. An alliance with the Parthians allowed Diodotus II to successfully defend his kingdom against Seleucus II in c. 239 BC, but in c. 223 BC he was killed by Euthydemus (I), a usurping governor of Sogdiana.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diodo_athens', 'Diodo…', 'Second magistrate attested in Athens in 144/143 BC [Thompson issue 22]. Later attested as third magistrate in 135/134 BC [issue 30]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 184-201 and nos. 347-349, 356 / her issues 22 and 30 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (144/143 [his issue 21] and 135/134 BC [issue 30]); Prosopographia Attica 3887 and 3888; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 117 s. v. Diodotos, no. 15; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 452 s. v. Diodo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diogenes_abydus', 'Diogenes', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Diogenes (256); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 450 s. v. ΔΙΟΓΕΝΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diogenes_cyme', 'Diogenes', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1638', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioge_i_athens', 'Dioge…', 'First magistrate attested in Athens in 129/128 BC [issue 36]. Later attested as second magistrate in 120/119 BC [issue 45]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 413-420 and nos. 543-555 / issues 36 and 45 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/129 and 120/119 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 116 s. v. Diogenes, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 450 s. v. Dioge-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioge_ii_athens', 'Dioge…', 'Third magistrate attested in Athens in 107/106 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 753, 755-758 / issue 58 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 116 s. v. Diogenes, no. 22; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 450 s. v. Dioge-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioge_iii_athens', 'Dioge…', 'Third magistrate attested in Athens in 93/92 BC [issue 72]. Again attested as third magistrate in 88/87 BC [Thompson issue 75]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1060-1063 and nos. 1131-1133, 1137 / her issues 72 and 75 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (93/92 and 88/87 BC, his issues 72 and 77); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 116 s. v. Diogenes, no. 31; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 450 s. v. Dioge-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diognetos_chios', 'Diognetos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 2419-2420', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diok_athens', 'Diok...', 'Third magistrate attested in Athens in 107/106 BC [issue 58]. Again attested as third magistrate in 105/104 BC [issue 60]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 749, 747 (drachm) and nos. 794-798 / issues 58 and 60 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 and 105/104 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokl-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioklei(das)_byzantium', 'Dioklei(das?)', 'An individual who issued coins at the ancient city of Byzantium, 2nd c. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 147, n. 1251.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diokle_athens', 'Diokleides', 'Third magistrate attested in Athens in 132/131 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 383-386, 391, 395 / issue 33 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 BC); Prosopographia Attica 3974; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 119 s. v. Diokleides, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokleides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diokl_athens', 'Diokles', 'Third magistrate attested in Athens in 121/120 BC [issue 43]. Again attested as third magistrate in 108/107 BC [issue 57]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 510, 512 and nos. 736-740 / issues 43 and 57 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 and 108/107 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokl- (121/120 BC [issue 43]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diokles_i_athens', 'Diokles', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 478-480 / issue 41 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); Prosopographia Attica 3994; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 120 s. v. Diokles, no. 38; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diokles_ii_athens', 'Diokles', 'Three times attested as first magistrate in Athens, in 65/64 BC [Thompson issue 98], in 61/60 BC [Thompson issue 102], and in 56/55 BC [Thompson issue 107]. From Kephisia. Son of Diokles. Eponymous Archon in Athens in 57/56 BC and priest of Asklepios and Hygieia (his additional symbols Asklepios / Hygieia / Dionysos conform to this priestly office) (Thompson 1961, p. 560; Habicht 1997, p. 16). His subsequent magistracies were explicitly mentioned in the legend by the addition of ΤΟ ΔΕΥ \"for the second time\" and ΤΟ ΤΡΙ \"for the third time\": See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1249-1250, nos. 1259-1262, and nos. 1269-1270 / her issues 98, 102 and 107 (p. 560); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15-17 (65/64, 61/60 and 56/55 BC, his issues 100, 104 and 109); Prosopographia Attica 4033; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 120 s. v. Diokles, no. 112; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diokles_meli_athens', 'Diokles Meli…', 'First magistrate attested in Athens in 55/54 BC. From Melite (explicitly mentioned in the legend by adding ΜΕΛΙ...). From the same family as his colleague Medeios; grandson of Serapion of Melite (Habicht 1991, p. 17): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1271 / her issue 108 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (55/54 BC, his issue 110); Prosopographia Attica 4040; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 120 s. v. Diokles, no. 130; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454 s. v. Diokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diok_priene', 'Diok…', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Regling completed: Diokles?. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 454.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diome_athens', 'Diome...', 'Third magistrate in Athens in 121/120 BC. Not identifed. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 44; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 8-9 (on the two other magistrates, 121/120 BC); H. B. Mattingly, Numismatic Chronicle 1997, p. 258 (124/123 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 455 (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diomedes_bactria', 'Diomedes of Bactria', 'Diomedes Soter was an Indo-Greek king. The places where his coins have been found seem to indicate that his rule was based in the area of the Paropamisadae, possibly with temporary dominions further east, ca. 95-90 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dion_syracuse', 'Dion of Syracuse', 'Dion, tyrant of Syracuse in Sicily, was the son of Hipparinus, and brother-in-law of Dionysius I of Syracuse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diony_i_priene', 'Diony...', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 456.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysas_i_abdera', 'Dionysas (I)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysas_ii_abdera', 'Dionysas (II)', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_byzantium', 'Dionysios', 'An individual who issued coins at the ancient city of Byzantium, end of 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 137, n. 1043.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_priene', 'Dionysios', 'An individual who issued coins at the ancient city of Priene c. 150-125 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 459.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_ii_athens', 'Dionysios', 'As second magistrate in Athens in 99/98 BC he held the office together with his brother Niketes, the first magistrate of the same issue. From Eupiridai. Son of Athenobios, the magistrate of issue 38. He and his brother are attested as boys in the Delphian Pythais in 128/127 BC. Together with their sister Philylla they have dedicated a statue of Chrysis, a priestess of Athena (IG II 2. ed. 3484). He was supervisor of the Agora in Delos in 98/97 BC (Habicht 1991, p. 11 note 15 and H. B. Mattingly, NC 157, 1997, p. 258): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 929-962 / issue 67 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 11 (98/97 BC); Prosopographia Attica 4109; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 123 s. v. Dionysios, no. 319; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios (re-dating the issue 99/98 BC due to his Dionysios\' presence in Delos).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysi_i_athens', 'Dionysios', 'First magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 552-554, 556-579 / issue 46 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 122 s. v. Dionysios, no. 69; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_v_athens', 'Dionysios', 'First magistrate attested in Athens in 67/66 BC [Thompson issue 96]. From Pallene. Belongs to the same family as his colleague Demostratos (father-son-relationship): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1246-1247 / her issue 96 (p. 561; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15 (67/66 BC, his issue 98); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 125 s. v. Dionysios, no. 620; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_iv_athens', 'Dionysios', 'First magistrate attested in Athens in 71/70 BC [Thompson issue 92]. From Ikarion. Belongs to the same family as his colleague, the second magistrate Mnasagoras (cf. Habicht 1991, p. 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1236 / her issue 92 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 14 (71/70 BC, his issue 94); Prosopographia Attica 4109; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 125 s. v. Dionysios, no. 370; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_abydus', 'Dionysios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Dionysios (864); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. p. 457 s. v. ΔΙΟΝΥΣΙΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_colophon', 'Dionysios', 'Magistrate attested on the Alexander coinage of Colophon, c. 180-180 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1871', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_cyme', 'Dionysios', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1640-1641', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysi_ii_athens', 'Dionysios', 'Second magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 552-554, 556-579 / issue 46 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 122 s. v. Dionysios, no. 70; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysi_iii_athens', 'Dionysios', 'Third magistrate attested in Athens in 118/117 BC [issue 47]. Again attested as third magistrate in 117/116 BC [issue 48]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 581-584 and nos. 605-606, 608-609 / issues 47-48 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 and 117/116 BC); Prosopographia Attica 4105; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 122 s. v. Dionysios, no. 71; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_i_athens', 'Dionysios', 'Third magistrate attested in Athens in 133/132 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 378-379, 381 / issue 32 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132 BC); Prosopographia Attica 4105; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 122 s. v. Dionysios, no. 60; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_iii_athens', 'Dionysios', 'Third magistrate attested in Athens in 89/88 BC [Thompson issue 74]. Again attested as third magistrate in 88/87 BC [Thompson issue 75]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1127-1129 and nos. 1135-1137 / her issues 74 and 75 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (89/88 and 88/87 BC, his issues 76 and 77); Prosopographia Attica 4117; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 122 s. v. Dionysios, no. 110; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysios_ke_athens', 'Dionysios Ke...', 'Third magistrate attested in Athens in 114/113 BC. Probably from Kephale (\"KE...\" as toponym): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 655, 658, 660-661, 666, 668 / issue 51 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (114/113 BC); Prosopographia Attica 4186; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 124 s. v. Dionysios, no. 376; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 457 s. v. Dionysios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysius_i_syracuse', 'Dionysius I of Syracuse', 'Dionysius I or Dionysius the Elder (c.432-367 BC) was a Greek tyrant of Syracuse, in Sicily. He conquered several cities in Sicily and southern Italy, opposed Carthage\'s influence in Sicily and made Syracuse the most powerful of the Western Greek colonies.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysius_ii_syracuse', 'Dionysius II of Syracuse', 'Dionysius the Younger (c. 397 BCE – 343 BCE), or Dionysius II, was a Greek politician who ruled Syracuse, Sicily from 367 BCE to 357 BCE and again from 346 BCE to 344 BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysius_bactria', 'Dionysius of Bactria', 'Dionysios Soter was an Indo-Greek king in the area of eastern Punjab, ca. 65-55 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysius_heracleia_pontica', 'Dionysius of Heracleia', 'Dionysius (Greek: Διονύσιος, Dionysios) was a tyrant of Heraclea on the Euxine (known today as the Black Sea). He was a son of Clearchus, who had assumed the tyranny in his place of birth.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionysodo_athens', 'Dionysodoros', 'Third magistrate attested in Athens in 125/124 BC [issue 40]. Later attested as second magistrate in 116/115 BC [issue 49] and again as third magistrate in 112/111 BC [issue 53]. Probably from Oion (Habicht 1991, p. 9): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 465-469, 474, nos. 611-628, and nos. 697-690, 692, 694 / issues 40, 49 and 53 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124, 116/115 and 112/111 BC); Prosopographia Attica 4280-4281; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 128 s. v. Dionysodoros, no. 18 (under Athens in general, no specific deme); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 460 s. v. Dionysodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dionys_athens', 'Dionys…', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 692 / issue 53 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 456 s. v. Dionys-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diony_ii_priene', 'Diony…', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 456.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diony_iii_athens', 'Diony…', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 773-775 / issue 59 (p. 261); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 456 s. v. Diony-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diony_ii_athens', 'Diony…', 'Third magistrate attested in Athens in 124/123 BC [Thompson issue 44]. Again attested as third magistrate in 121/120 BC [Thompson issue 43]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 511-512 and nos. 535, 540-541 / her issues 44 and 43 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 BC [his issue 43] and 121/120 BC [his issue 44]); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 455 f. s. v. Diony- (changing the date: 124/123 BC [issue 44] and 121/120 BC [issue 43]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diony_i_athens', 'Diony…', 'Third magistrate attested in Athens in 132/131 BC [issue 33]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 390, 394 / issue 33 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 455 s. v. Diony-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dion_ii_athens', 'Dion…', 'Third magistrate attested in Athens in 102/101 BC [issue 63]. Again attested as third magistrate in 100/99 BC [issue 65]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 823-826 and nos. 847, 850-851, 854-859, 861-867, 877-878 / issues 63 and 65 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 and 100/99 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 455 s. v. Dion-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dion_i_athens', 'Dion…', 'Third magistrate attested in Athens in 113/112 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 672-673, 674-675 / issue 52 (p. 561); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 455 s. v. Dion-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diophanes_rhodes', 'Diophanes', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2524', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diophantos_abdera', 'Diophantos', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diophantos_athens', 'Diophantos', 'First magistrate attested in Athens in 74/73 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1231 / her issue 89 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (74/73 BC, his issue 91); Prosopographia Attica 4423; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 132 s. v. Diophantos, no. 17; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 463 s. v. Diophantos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diopha_athens', 'Diopha…', 'First magistrate attested in Athens in 144/143 BC [Thompson issue 22]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 184-201 / her issue 22 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (144/143 BC [his issue 21]); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 463 s. v. Diopha-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioph_i_athens', 'Dioph…', 'Second magistrate attested in Athens in 132/131 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 383-395 / issue 33 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 462 s. v. Dioph-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioph_ii_athens', 'Dioph…', 'Third magistrate attested in Athens in 124/123 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 534-538 / issue 44 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 462 s. v. Dioph- (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioscouridas_mesembria', 'Dioscouridas', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1004.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diosk_mesembria', 'Diosk', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1005', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diosk(-)_mesembria', 'Diosk(…)', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1003', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dioskuri_byzantium', 'Dioskuri', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), pp. 137-139, nos. 1044-1102.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diotimos_athens', 'Diotimos', 'First magistrate attested in Athens in 114/113 BC. Probably from Marathon. Maybe identical with Diotimos, Polemarchos in 102/101 BC, but the name seems to be quite common (Habicht 1991, p. 9): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 648-668 / issue 51 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9 (114/113 BC); Prosopographia Attica 4374; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 131 s. v. Diotimos, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 462 s. v. Diotimos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dio_adramyteum', 'Dio…', 'Magistrate in Adramyteum in Mysia. His name is attested on Hellenistic Cistophoric coins issued in the period c. 133-1st cent. BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 449 s. v. Dio-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dio_i_athens', 'Dio…', 'Second magistrate attested in Athens in 150/149 BC [issue 15]. Again attested as second magistrate in 148/147 BC [issue 17]. Maybe Dio[nysios] from Anaphlystos (LGPN and commentary by Thompson): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 94-101 and nos. 111-120 / issues 15 and 17 (pp. 58 and 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (150/149 and 148/147 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 123 s. v. Dionysios, Nr. 211; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 449 s. v. Dio-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dio_ii_athens', 'Dio…', 'Third magistrate attested in Athens in 129/128 BC [issue 36]. Again attested as third magistrate in 120/119 BC [issue 45]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 415-416, 419 and nos. 548-550 / issues 36 and 45 (p. 559); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 and 120/119 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 450 s. v. Dioge-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/diphi(-)_antiocheia_ad_maeandrum', 'Diphi(…)', 'Magistrate attested on the Alexander coinage of Antioch, c. 190-180 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2469', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dixatelmeus_thrace', 'Dixatelmeus of Thrace', 'Dixatelmeus was a first century B.C. Thracian dynast issuing several types of tetradrachms in the Roman province of Macedonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/docimus_thrace', 'Docimus', 'Dynast of uncertain place in the Thraco-Macedonian region, known only from coins', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitia', 'Domitia', 'Domitia Longina (c. AD 53-55–c. AD 126-130) was an Empress of Rome and wife to the Roman Emperor Domitian. She was the youngest daughter of the general and consul Gnaeus Domitius Corbulo. She became Empress of Rome upon Domitian\'s accession in 81, and remained so until his assassination in 96.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitian', 'Domitian', 'Domitian was the Emperor of Rome from 81 to 96. He was the younger brother of Titus and son of Vespasian, his two predecessors on the throne, and the last member of the Flavian dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitian_ii', 'Domitian II', 'A usurper, probably in northern Gaul in late AD 270 or early 271.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitilla_the_elder', 'Domitilla the Elder', 'Flavia Domitilla Major, Flavia Domitilla the Elder or Domitilla the Elder (died before 69, perhaps c. 65) was the wife of the Roman Emperor Vespasian. She was the mother of Domitilla the Younger and of the emperors Titus and Domitian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitius_alexander', 'Domitius Alexander', 'The Roman emperor Domitius Alexander.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/domitius_domitianus', 'Domitius Domitianus', 'The Roman emperor Domitius Domitianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dona_francesco', 'Dona [Donato], Francesco (1545-1553)', 'Francesco Donato was the Doge of Venice from 1545 to 1553.[1] He was married to Giovanna Da Mula and Alicia Giustiniani.[2]', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dorotheos_athens', 'Dorotheos', 'First magistrate in Athens 132/131 BC [Thompson (1961) 562 und issue 33]. Third magistrate on coins of Athens in 134/133 BC (issue 31) and presumably 133/132 BC (issue 32) and 129/128 BC (issue 36), too. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 31-33. 36; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5; Prosopographia Attica nos. 4593. 4594.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/doro_ii_athens', 'Dorotheos', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 829-830, 834 / issue 63 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 136 s. v. Dorotheos, no. 26; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 469 s. v. Dorotheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dorothe_ii_athens', 'Dorotheos', 'Third magistrate attested in Athens in 106/105 BC [issue 59]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 765-768 / issue 59 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); Prosopographia Attica 4594; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 136 s. v. Dorotheos, no. 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 469 s. v. Dorotheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/doro_i_athens', 'Dorotheos', 'Third magistrate attested in Athens in 125/124 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 468, 470-472 / issue 40 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124 BC); Prosopographia Attica 4593; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 136 s. v. Dorotheos, no. 22; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 469 s. v. Dorotheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dositheos_athens', 'Dositheos', 'First magistrate attested in Athens in 100/99 BC. From Aithalidai. Brother of his colleague Charias (second magistrate of the same issue). Ephebe in 117/116 BC (Habicht 1991, p. 11; H. B. Mattingly, NC 157, 1997, p. 259). The annual magistracy he held at the age of c. 35: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 847, 850-851, 854-878 / issue 65 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 11 (100/99 BC); Prosopographia Attica 4632; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 137 s. v. Dositheos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 469 s. v. Dositheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dositheos_abydus', 'Dositheos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Dositheos (10); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 469 s. v. ΔΩΣΙΘΕΟΣ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/dromo_athens', 'Dromo…', 'Third magistrate attested in Athens in 99/98 BC [issue 67]. Again attested as third magistrate in 98/97 BC [issue 68]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 934-936 and nos. 959-961, 963 / issues 67 and 68 (p. 562); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (98/97 and 97/96 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 467 s. v. Dromo- (99/98 BC [issue 67] and 98/97 BC [issue 68]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dropion_paeonia', 'Dropion of Paeonia', 'Dropion (Greek: Δροπίων), (250 BC – 230 BC) was an ancient Paeonian king, son of Leon of Paionia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/drusilla', 'Drusilla', 'Julia Drusilla (16 September 16 AD – 10 June 38 AD) was the second daughter of Germanicus and Agrippina the Elder, and sister of the Emperor Caligula.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/drusus_caesar', 'Drusus Caesar', 'Drusus Julius Caesar (AD 7 – AD 33), was a member of the Julio-Claudian family. He was a son of Germanicus and Agrippina the Elder. He was brother of Caligula, nephew of the Emperor Claudius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nero_claudius_drusus', 'Drusus the Elder', 'Nero Claudius Drusus Germanicus (January 14, 38 BC – Summer of 9 BC), born Decimus Claudius Drusus also called Drusus Claudius Nero, Drusus, Drusus I, Nero Drusus, or Drusus the Elder was a Roman politician and military commander. He was the son of Livia Drusilla and the legal stepson of her second husband, the Emperor Augustus. He was also brother of the Emperor Tiberius, father of the Emperor Claudius, grandfather of the Emperor Caligula, and great-grandfather of the Emperor Nero.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/drusus_son_of_tiberius', 'Drusus the Younger', 'Nero Claudius Drusus, later Drusus Julius Caesar (adoptive name; 13 BC – 14 September 23 AD) was the only child of the Emperor Tiberius and his first wife, Vipsania Agrippina.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dryantilla', 'Dryantilla', 'Sulpicia Dryantilla was the wife of the briefly reigning usurper Regalianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dust_muhammad', 'Dust Muhammad', 'Dost Mohammad Khan (Persian: دوست محمد خان, Pashto: دوست محمد خان) was the founder of the Barakzai dynasty and one of the prominent rulers of Afghanistan during the First Anglo-Afghan War.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/dynamis_bosporus', 'Dynamis of Bosporus', 'Dynamis, nicknamed Philoromaios, was a Roman client queen of the Bosporan Kingdom during the Late Roman Republic and part of the reign of Augustus, the first Roman Emperor. She ruled jointly with her husbands Asander, a certain Scribonius and Polemon I of Pontus until her death, probably in 14 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/d_priene', 'D…', 'An individual who issued coins at the ancient city of Priene c. 190-100 BC. Magistrate? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. -.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ebni_lycia', 'Ebni', 'Dynast in the ancient region of Lycia from approximately 420–400 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M135', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eche_athens', 'Echedemos', 'Second magistrate attested in Athens in 138/137 BC [issue 27]. Then attested as third magistrate in 136/135 BC [issue 29]. ΕΧΕ is probably Echedemos, from Kydathenaion: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 287-314 and nos. 335-336 / issues 27 and 29, commentary on p. 566; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (138/137 and 136/135 BC); Prosopographia Attica 6168; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 514 s. v. Eche-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/echekrates_abdera', 'Echekrates', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/echenikos_temnus', 'Echenikos', 'Magistrate attested on the Alexander coinage of Temnos, c.188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1690', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/echepolis_abydus', 'Echepolis', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Echepolis (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 515 s. v. ΕΧΕΠΟΛΙΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/echesthenes_athens', 'Echesthenes', 'Third magistrate attested in Athens in 114/113 BC. The name is only attested in the deme Keiriadai. Magistrate is probably son of Kallisthenes von Keiriadai, who was epimeletes in 148-134 BC (Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 655, 657-658 / issue 51 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 21 (114/113 BC); Prosopographia Attica 6177; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 192 s. v. Echesthenes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 515 s. v. Echesthenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/egnatia_mariniana', 'Egnatia Mariniana', 'Possibly a wife of the Emperor Valerian I attested by coins in the name of a \"Diva Mariniana\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ehrhard_scherl_nuremberg', 'Ehrhard Scherl', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1585 to 1587. His mint mark is a double lilly. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eirenai_athens', 'Eirenaios', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 702 / issue 54 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 138 s. v. Eirenaios, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 471 s. v. Eirenaios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eirena_athens', 'Eirenaios', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 396-397, 402 / issue 34 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 4643; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 138 s. v. Eirenaios, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 471 s. v. Eirenaios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ekuwemi_lycia', 'Ekuwemi', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M136', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/elagabalus', 'Elagabalus', 'Elagabalus (Marcus Aurelius Antoninus Augustus, ca. 203 – 11 March 222), also known as Heliogabalus, was Roman Emperor from 218 to 222.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eli(-)_colophon', 'Eli(…)', 'Magistrate attested on the Alexander coinage of Colophon\', c. 319-310 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1772-1776', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/elias_gervais_neuwied', 'Elias Gervais', 'Die-cutter who lived mainly in Neuwied, a city in Germany, but did a lot of work for Trier and later Cologne. His monograms are EG or EG F(fecit) for Neuwied (1750-1775), EG for Bonn (1759-1766), G for Poppelsdorff (1776-1777) and EG for Koblenz (1764-1766) and GF. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 380, 416.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eligius', 'Eligius', 'Eligius (c. 588 – 1 December 660). Bishop of Noyon, Merovingian moneyer and goldsmith, patron Saint of Numismatics. Reference: J. Lafaurie, Eligius Monetarius, Revue Numismatique 1977, pp. 111-151.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/elix_athens', 'Elixos', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 543-546 / issue 45 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); Prosopographia Attica 4665; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 141 s. v. Elixos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 475 s. v. Elix.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/elmen_lycia', 'Elmen', 'Dynast in the ancient region of Lycia from approximately 470–450 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 60', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/elpaal_byblus', 'Elpaal of Byblus', 'Ruler of Byblos in the 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/embi_athens', 'Embios', 'Third magistrate attested in Athens in 99/98 BC. From Prospalta. He was priest of Asklepios in 83/82 BC (Habicht 1991, pp. 18 f. 22): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 946-950, 952-961 / issue 67 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 22 (98/97 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 142 s. v. Embios, no. 2 (listed under Athens in general, no specific deme); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 476 s. v. Embios (99/98 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eminacus_olbia', 'Eminacus', 'Dynast possibly of Olbia, known only from coins.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/emmanuel_philibert_de_savoie', 'Emmanuel Philibert de Savoie (1553-1580)', 'Emmanuel Philibert (in Italian Emanuele Filiberto; known as \"Testa di ferro\", in English \"Ironhead\", because of his military career; 8 July 1528 – 30 August 1580) was Duke of Savoy from 1553 to 1580.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/endriss_speidel_stuttgart', 'Endriß Speidel', 'Mint worker in Stuttgart, Baden-Wuerttemberg, Germany 1556 to 1573. Die cutter. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74, 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epai_priene', 'Epai…', 'An individual who issued coins at the ancient city of Priene c. 290-240 BC. Regling completed: Epainetos? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 479.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epam_priene', 'Epam…', 'An individual who issued coins at the ancient city of Priene c. 330-300 BC. Regling completed: Epameinon? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 479.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epander_bactria', 'Epander of Bactria', 'Epander was one of the Indo-Greek kings. He may have been a relative of Menander I, and the findplaces of his coins seem to indicate that he ruled in the area of Punjab, ca. 95-90 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epharmostos_abydus', 'Epharmostos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Epharmostos (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 514 s. v. ΕΦΑΡΜΟΣΤΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epigenes_ii_athens', 'Epigenes', 'First magistrate attested in Athens in 70/69 BC. From Melitene. Brother of his colleague Xenon, grandson of Epigenes. Epimeletes in Delos in 126/125 BC (Habicht 1991, p. 14). Probably the two annual magistrates Epigenes and Xenon are identical with the brothers of the same name who are attested as ephebes in 80/79 BC – in this case they would have held the magistracy in their younger days (Habicht 1991, p. 14). Thesmothetes in 56/55 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1237-1240 / her issue 93 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 14 (70/69 BC, his issue 95); Prosopographia Attica 4812; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 146 s. v. Epigenes, no. 67; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 481 s. v. Epigenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epigenes_athens', 'Epigenes', 'Magistrate in Athens 135/134 BC (issue 30). Appears for a second time as second magistrate in issue 39 of 126/125 BC. [Thompson (1961) 563]. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 30; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5; Prosopographia Attica 4785.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epigen_athens', 'Epigenes', 'Third magistrate attested in Athens in 109/108 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 726-728 / issue 56 (p. 563); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (109/108 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 146 s. v. Epigenes, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 481 s. v. Epigenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epige_prie', 'Epige…', 'An individual who issued coins at the ancient city of Priene c. short time before 270 BC. Regling completed: Epigenes. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 481.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epigo_athens', 'Epigo...', 'Third magistrate in Athens in 135/134 BC (issue 30). Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 30; Prospographia Attica no. 4824; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (135/134 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epigo_ii_athens', 'Epigonos', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 691 / issue 53 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); Prosopographia Attica 4825; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 147 s. v. Epigonos, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 481 s. v. Epigo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epikrates_athens', 'Epikrates', 'Second magistrate attested in Athens in 63/62 BC. From Leukonion. Belongs to the the same family as his colleague, the first magistrate, Kallimachos. Most probably herold of the Aeropagos. Epikrates was mentioned by the young Marcus Cicero in a letter to Tiro, named \"princeps Atheniensium\" (Habicht 1991, p. 16): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1253-1254 / her issue 100 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 16 (63/62 BC, his issue 102); Prosopographia Attica 4903; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 149 s. v. Epikrates, no. 88; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 483 s. v. Epikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epikra_priene', 'Epikra…', 'An individual who issued coins at the ancient city of Priene c. in the middle of the first century BC. Regling completed: Epikrates. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 482.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epimachos_athens', 'Epimachos', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 765, 768-771, 773 , 758 (drachm) / issue 59 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); Prosopographia Attica 4930; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 151 s. v. Epimachos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 483 s. v. Epimachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epini_athens', 'Epinikos', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 543-545 / issue 45 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); Prosopographia Attica 4939; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 151 s. v. Epinikos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 484 s. v. Epini-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epipalos_amathus', 'Epipalos of Amathus', 'Epipalos was a king of Amathus, Cyprus in the mid 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epiphanes_athens', 'Epiphanes', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 592-593 / issue 47 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 4968; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 152 s. v. Epiphanes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 484 s. v. Epiphanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epiphanes_commagene', 'Epiphanes of Commagene', 'Gaius Julius Archelaus Antiochus Epiphanes, also known as Julius Archelaus Epiphanes; Epiphanes; Gaius Julius Antiochus Epiphanes or simply known as Gaius was an influential prince of the Kingdom of Commagene, who lived in the 1st century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epistratos_athens', 'Epistratos', 'Second magistrate attested in Athens in 101/100 BC. From Perithoidai (Habicht 1991, p. 10). Brother of his colleague, the first annual magistrate Amphikrates and probably son of Epistra[tos] (first magistrate in 136/135 [issue 64]) (cf. Thompson 1961, p. 550 with stemma; Habicht 1991, p. 10). Ephebic secretary in 102/101 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 833-835, 837, 840-853 / issue 64 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (101/100 BC); Prosopographia Attica 4951; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 152 s. v. Epistratos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 484 s. v. Epistratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epistra_athens', 'Epistratos', 'Third magistrate attested in Athens in 136/135 BC. From Perithoidai. Probably father of Amphikrates and Epistratos, the two annual magistrates of 101/100 BC [issue 64]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 335, 339 / issue 29, commentary and stemma on p. 550; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 136/135 BC); Prosopographia Attica 4948; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 152 s. v. Epistratos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 484 s. v. Epistratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epithetes_athens', 'Epithetes', 'Second magistrate attested in Athens in 85/84 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1158-1164 / her issue 78 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (85/84 BC, his issue 80); Prosopographia Attica 4836; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 148 s. v. Epithetes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 482 s. v. Epithetes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/epiti_athens', 'Epitimides', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 688-693 / issue 53 (p. 564: ΕΠΙΤΙ[μος) (sic); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 152 s. v. Epitimides, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 484 s. v. Epitimos (sic).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eppivs_leg_f_c_rrc', 'Eppius', 'Roman Republican Moneyer, c. 47 BC, 44 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/er_abdera', 'Er(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/erato_armenia', 'Erato of Armenia', 'Erato also known as Queen Erato (flourished second half of 1st century BC & first half of 1st century, died sometime after 12) was a princess of the Kingdom of Armenia and member of the Artaxiad Dynasty. She served as Roman client queen of Armenia from 10 BC until 2 BC with her brother-husband King Tigranes IV. After living in political exile for a number of years, she co-ruled as Roman client queen of Armenia from 6 until 12 with the Herodian Prince Tigranes V, her distant paternal relative. As a queen of Armenia, she may be viewed as one of the last hereditary rulers of her nation.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eraton_priene', 'Eraton', 'An individual who issued coins at the ancient city of Priene c. 69-79 AD. Regling completed: Eraton II. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 479.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/era_priene', 'Era…', 'An individual who issued coins at the ancient city of Priene c. short time before 240 BC. Regling completed: Epaton. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 486.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ergokles_athens', 'Ergokles', 'Second magistrate in Athens in 121/120 BC (issue 44). Possibly the same person as the Archon of 132/131 BC. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 44; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 9 (121/120 BC); Prosopographia Attica no. 5053; H. B. Mattingly, Numismatic Chronicle 1997, p. 258 (124/123 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 487 (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/erizzo_francesco', 'Erizzo, Francesco (1631-1646)', 'Francesco Erizzo (Venice, February 18, 1566 – Venice, January 3, 1646) was the 98th Doge of Venice, reigning from his election on April 10, 1631 until his death fifteen years later', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ertlleni_lycia', 'Ertlleni', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M144', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/esbehi_lycia', 'Esbehi', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 30', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eshmunazar_sidon', 'Eshmunazar, King of Sidon', 'Ruler of Sidon in the 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euagion_athens', 'Euagion', 'Second magistrate attested in Athens in 72/71 BC. From the same family as his colleague, the first magistrate Alketes, probably father-son-relationsship, maybe from Perithoidai (Habicht 1991, p. 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1234-1235 / her issue 91 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 14 (72/71 BC, his issue 93); Prosopographia Attica 5234; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 162 s. v. Euagion, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 496 s. v. Euagion.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euagon_abdera', 'Euagon', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euagoras_i', 'Euagoras I', 'Evagoras or Euagoras was the king of Salamis (411–374 BC) in Cyprus, known especially from the work of Isocrates, who presents him as a model ruler.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euagoras_ii_salamis', 'Euagoras II of Salamis', 'Evagoras II or Euagoras II (Greek: Εὐαγόρας) was a king of the Ancient Greek city-state of Salamis in Cyprus, and later satrap for Achaemenid Persia in Phoenicia. He was possibly a son of his predecessor, Nicocles, and a grandson of Evagoras I. He followed a pro-Persian course, for which he was deposed ca. 351 BC by a popular revolt led by his nephew Pnytagoras, who succeeded him as king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euan_priene', 'Euan', 'An individual who issued coins at the ancient city of Priene c. 320-270 BC. Regling completed: Epameinon? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 497.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euandros_athens', 'Euandros', 'Third magistrate attested in Athens in 123/122 BC [issue 41]. Later attested as second magistrate in 110/109 BC [issue 55], together with Zoilos he was in charge from the second moth of the year onwards. Probably councillor in the year of Archon Phokion (Habicht 1991, p. 10); Grammmateus in 121/120 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 483-485, 491, 493 and nos. 709, 713-721 / issues 41 and 55 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 10 and 19 (124/123 and 110/109 BC); Prosopographia Attica 5269; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 162 s. v. Euandros, no. 4; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 497 s. v. Euandros (123/122 BC, issue 41).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euanthes_salamis', 'Euanthes of Salamis', 'Euanthes was the king of Salamis in the second quarter of the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eubios_athens', 'Eubios', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 585-586, 588 / issue 47 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 5285; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 163 s. v. Eubios, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 499 s. v. Eubios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euboulides_athens', 'Euboulides', 'First magistrate attested in Athens during the first two months of 110/109 BC. From Trikorynthos. Belongs maybe to the same familiy as the second magistrate Agathokles, he is probably his son (his father\'s as well as his son\'s name is Agathokles). Both held the magistracy only for two months; reasons for their disappearance are dubious (Habicht 1991, p. 9 f.). Epimeletes in 140 BC (IG II 2. ed. 1939, 43), participating in the Rhomaia in Delos in 127/126 BC (ID 2596, 7): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 709-722 / issue 55 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9 f. (110/109 BC); Prosopographia Attica 5338; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 164 s. v. Euboulides, no. 41; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 499 s. v. Euboulides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euboulos_athens', 'Euboulos', 'Third magistrate attested in Athens in 118/117 BC [issue 47]. Again attested as third magistrate in 107/106 BC [issue 58]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 585-586 and nos. 753, 756-757, 748 (drachm) / issues 47 and 58 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 and 107/106 BC); Prosopographia Attica 5345; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 164 s. v. Euboulos, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 499 s. v. Euboulos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eucratides_i_bactria', 'Eucratides I of Bactria', 'Eucratides I (ruled 171–145 BC), sometimes called Eucratides the Great, was one of the most important Greco-Bactrian kings, descendants of dignitaries of Alexander the Great. He uprooted the Euthydemid dynasty of Greco-Bactrian kings and replaced it with his own lineage. He fought against the Indo-Greek kings, the easternmost Hellenistic rulers in northwestern India, temporarily holding territory as far as the Indus, until he was finally defeated and pushed back to Bactria.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eucratides_ii_bactria', 'Eucratides II of Bactria', 'Eucratides II or Eukratides II was a Greco-Bactrian king who was a successor and probably a son of Eucratides I. It seems likely that Eucratides II ruled for a relatively short time after the murder of his namesake, until he was dethroned in the dynastic civil war caused by the same murder. He may have been co-regent with his father.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudemos_ii_athens', 'Eudemos', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 687-690 / issue 53 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); Prosopographia Attica 5390; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 166 s. v. Eudemos, no. 12 (111/110 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 500 s. v. Eudemos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eude_athens', 'Eudemos', 'Third magistrate attested in Athens in 128/127 BC [issue 37]. Again attested as third magistrate in 124/123 BC [issue 44]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 421, 423 and nos. 529-531 / issues 37 and 44 (on p. 565 she distinguishes ΕΥΔΗ and ΕΥΔΗΜΟΣ in issue 37 as two individuals); C. Habicht, Zu den Münzmagistrate n der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 and 121/120 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 166 s. v. Eudemos, no. 11; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 500 s. v. Eudemos (124/123 BC, issue 44).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudemos_i_athens', 'Eudemos', 'Third magistrate attested in Athens in 128/127 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 421-423 / issue 37 (on p. 565 she distinguishes ΕΥΔΗΜΟΣ and ΕΥΔΗ as two individuals); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 5389; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 166 s. v. Eudemos, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 500 s. v. Eudemos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudi_uruk', 'Eudi- of Uruk', 'Individual of uncertain status apparently appearing on a bronze coin found in excavations at Susa. See Le Rider, Suse, pp. 458 f.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudi_ii_athens', 'Eudikos', 'Third magistrate attested in Athens in 101/100 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 841-848 / issue 64 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (101/100 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 166 s. v. Eudikos, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 501 s. v. Eudi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudi_i_athens', 'Eudikos', 'Third magistrate attested in Athens in 125/124 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 469-473 / issue 40 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 166 s. v. Eudikos, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 500 s. v. Eudi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eudocia_makrembolitissa', 'Eudokia Makrembolitissa', 'The second wife of the Byzantine emperor Constantine X.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euelthon_salamis', 'Euelthon of Salamis', 'Euelthon was the king of Salamis in the last quarter of the 6th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euelthos_mytilene', 'Euelthos', 'Magistrate attested on the Alexander coinage of Mytilene, c.188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1737', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eugenius', 'Eugenius', 'The Roman emperor Eugenius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euhemeros_priene', 'Euhemeros', 'An individual who issued coins at the ancient city of Priene c. 150-125 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 502.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukleon_i_chios', 'Eukleon', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2413', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukleon_ii_chios', 'Eukleon', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2439', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukles_chios', 'Eukles', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2421', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukles_ii_athens', 'Eukles', 'Second magistrate attested in Athens in 107/106 BC [issue 58]. Again attested as second magistrate in 105/104 BC [issue 60]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 745, 747-758, 747-748 (drachm) and nos. 777-800 / issues 58 and 60, with commentary on p. 565; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 and 105/104 BC); Prosopographia Attica 5708; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 174 s. v. Eukles, no. 17 (listed under Athens in general, no specific deme); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 504 s. v. Eukles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukles_i_athens', 'Eukles', 'Third magistrate attested in Athens in 130/129 BC [issue 35]. Again attested as third magistrate in 115/114 BC [issue 50]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 406-407 and nos. 637, 639-640 / issues 35 and 50 (p. 565); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 and 115/114 BC); Prosopographia Attica 5707; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 174 s. v. Eukles, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 504 s. v. Eukles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukrates_abydus', 'Eukrates', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Eukrates (20); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 504 s. v. EYKΡATΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukra_athens', 'Eukrates', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 641-643 / issue 50 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 5746; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 175 s. v. Eukrates, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 504 s. v. Eukra-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eukrines_abydus', 'Eukrines', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Eukrines (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 505 s. v. ΕΥΚΡΙΝΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euma_athens', 'Eumachos', 'Second magistrate attested in Athens in 139/138 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 266-286 / issue 26 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (139/138 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 506 s. v. Eumachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumachos_athens', 'Eumachos', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 397, 403 / issue 34 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 5814; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 177 s. v. Eumachos, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 506 s. v. Eumachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumareides_athens', 'Eumareides', 'First magistrate attested in Athens in 113/112 BC [issue 52]: ΕΥΜΑΡΕΙΔΗΣ. Previously attested as third magistrate in 122/121 BC [issue 42]: ΕΥΜΑΡΕΙ, an in 120/119 BC [issue 45]: ΕΥΜΑ. From Euonymon. Born c. 156 BC, brother of his colleague Alkidamos [issue 52]. Both are sons of Euphanes. Attested as ephebe in 138/137, as Knight in Delphi in 128/127 BC (Habicht 1991, p. 9; Mattingly 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 500-502, nos. 543-546, 555, and nos. 669-685 / issues 42 and 45 and 52 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 9 and 21 (123/122, 120/119 and 113/112 BC); Prosopographia Attica 5808 and 5809; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 177 s. v. Eumareides, no. 3; H. B. Mattingly, NC 157, 1997, pp. 258 f. reads ΕΥΜΑ as Eumachos and recognizes him as eponymous Archon of 120/119 BC) and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) pp. 505 f. s. v. Eumareides and/or Eumachos (122/121 BC, issue 42)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumelos_i_athens', 'Eumelos', 'First magistrate attested in Athens in 108/107 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 729-732, 735-748 / issue 57 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 10 and 13 (108/107 BC); Prosopographia Attica 5833; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 177 s. v. Eumelos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 506 s. v. Eumelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumelos_ii_athens', 'Eumelos', 'First magistrate attested in Athens in 80/79 BC. The name Eumelos is common in Athens, probably he is father of the councillor Philomelos from Cholleidai (Habicht 1991, p. 13): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1196-1204 / her issue 83 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 13 (80/79 BC, his issue 85); Prosopographia Attica 5834; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 177 s. v. Eumelos, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 506 s. v. Eumelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumenes_i_pergamum', 'Eumenes I of Pergamum', 'Eumenes I was dynast (ruler) of the city of Pergamum in Asia Minor from 263 BC until his death in 241 BC. He was the son of Eumenes, the brother of Philetaerus, the founder of the Attalid dynasty, and Satyra, daughter of Poseidonius. As he had no children, Philetaerus adopted Eumenes to become his heir.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumenes_ii_pergamum', 'Eumenes II of Pergamum', 'Eumenes II (ruled 197–159 BC) surnamed Soter meaning \"Savior\" was a ruler of Pergamon, and a son of Attalus I Soter and queen Apollonis and a member of the Attalid dynasty of Pergamum.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eume_athens', 'Eume…', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 445-447, 449 / issue 39 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 5833 (?); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 506 s. v. Eume-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eumolis_maroneia', 'Eumolis', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eunom_athens', 'Eunomos', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 400 / issue 34 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 5862; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 178 s. v. Eunomos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 507 s. v. Eunom-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eunostus_soli_cyprus', 'Eunostos of Soli', 'Eunostos (Greek: Εὔνοστος) was king of the city of Soli on Cyprus towards the end of the 4th century BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eup_maroneia', 'Eup(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupator_bosporus', 'Eupator', 'Tiberius Julius Eupator Philocaesar Philoromaios Eusebes (174), also known as Eupator, was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupei_athens', 'Eupeithes', 'Third magistrate attested in Athens in 93/92 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1060-1061 / issue 72 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (93/92 BC); Prosopographia Attica 5917; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 180 s. v. Eupeithes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 508 s. v. Eupei-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupha(-)_mesembria', 'Eupha(…)', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1035', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euphemia', 'Euphemia', 'The wife of the Byzantine emperor Justin I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupole_athens', 'Eupolemos', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 590-592 / issue 47 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 5921; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 181 s. v. Eupolemon, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 508 s. v. Eupole-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupolemus_caria', 'Eupolemos, strategos of Caria', 'Macedonian strategos in Caria. His bronze coins were most probably struck at Caunus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupolis_maroneia', 'Eupolis', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupol_priene', 'Eupol…', 'An individual who issued coins at the ancient city of Priene c. 290-250 BC. Regling completed: Eupolis or Eupolemos. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 508.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eupro(-)_odessus', 'Eupro(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 280-200 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1174', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/eup_adramyteum', 'Eup…', 'Magistrate in Adramyteum (Mysia). His name is attested on Hellenistic Cistophoric coins issued in the period c. 133-66 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 508 s. v. Eup-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euresippos_abdera', 'Euresippos', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eurycles_lacedaemon', 'Eurycles of Sparta', 'Gaius Julius Eurycles or Eurycles of Sparta (b. Sparta, fl. 1st century BCE), was \"hegemon of the Lacedaemonians\" (Λακεδαιμονίων ἡγεμών), a benefactor of Greek cities, and founder of the family of the Euryclids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eurydice_smyrna', 'Eurydice of Smyrna', 'Eurydice was a Greek Princess who was of Macedonian and Thessalian descent. She was the wife of Antipater II, co-regent of Macedon from 297-294 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euryklei_athens', 'Euryklei...', 'Eurykleides, a magistrate in Athens in 122/121 BC (issue 43). Previously third magistrate in 135-134 BC (issue 30) and second magistrate in 124/123 BC (issue 41). Known from an inscription at Delos of 127/126 BC [ID 2596,6, see Habich (1991) p. 8]. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issues 30, 41 and 43; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 7; Prosopographia Attica nos. 5967 and 5965.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eurysthenes_pergamum', 'Eurysthenes of Pergamum', 'Eurysthenes was a descendant of the Spartan king Demaratus, who reigned over the territory of Pergamum. His coinage attests to 399 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eusebes_chios', 'Eusebes', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2429', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euthydamas_clazomenae', 'Euthydamas', 'Magistrate attested on the Alexander coinage of Clazomenae, c. 180-180 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1749', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euthydemus_i_bactria', 'Euthydemus I of Bactria', 'Euthydemus I was a Greco-Bactrian king in about 230 or 223 BC according to Polybius; he is thought to have originally been a satrap of Sogdiana who overturned the dynasty of Diodotus of Bactria and became a Greco-Bactrian king. Strabo, on the other hand, correlates his accession with internal Seleucid wars in 223–221 BC. His kingdom seems to have been substantial, including probably Sogdiana to the north, and Margiana and Ariana to the south or east of Bactria.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euthydemus_ii_bactria', 'Euthydemus II of Bactria', 'Euthydemus II was Graeco-Bactrian king; the son of Demetrius I of Bactria, he became king in the 180s BCE, either after his father\'s death or as a sub-king to him.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/eutyches_priene', 'Eutyches', 'An individual who issued coins at the ancient city of Priene AD 249-251. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 511.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euxe(-)_istrus', 'Euxe(…)', 'Magistrate attested on the Alexander coinage of Istrus, c. 200-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 970', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/euxithemis_maroneia', 'Euxithemis', 'An individual who issued coins at the ancient city of Maroneia, 365-330s BC. See S. Psoma, The coins of Maroneia and the classical city at Molyvoti. A contribution to the history of Aegean Thrace (Athens, 2008), p.170. (Cf. also E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45 who prefers 386/385-348/347 BC.); P. M. Fraser - E. Matthews, A Lexicon of Greek Personal Names IV (2005) p. 134 s. v. Εὐξίθεμις.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_fan_c_f_rrc', 'Fannius C.f. M.', 'Roman Republican Moneyer, c. 123 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/faraj_b_barquq', 'Faraj b. Barquq', 'Nasir-ad-Din Faraj (Urdu; Arabic; Persian: ناصر الدین فرج ; r. 1399–1411 CE) succeeded his father Sayf-ad-Din Barquq as the second Sultan of the Burji dynasty of the Mamluk Sultanate of Egypt with the title Al-Nasir.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/farrukhzad', 'Farrukhzad', 'Farrukh-Zad (Full name: Jamal ad-Dawlah Abu Shuja Farrukh-Zad), was sultan of the Ghaznavid Empire from ca. 1053 to 4 April 1059.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/faruh_bin_taj', 'Faruh bin Taj', 'An official whose name appears on Abbasid glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/faruq', 'Faruq', 'Farouk I of Egypt (Arabic: فاروق الأول ‎ Fārūq al-Awwal, Turkish: I. Faruk) (11 February 1920 – 18 March 1965) was the tenth ruler from the Muhammad Ali Dynasty and the last King of Egypt and the Sudan, succeeding his father, Fuad I of Egypt, in 1936.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/fath_ali_shah', 'Fath Ali Shah', 'Fath-Ali Shah Qajar (Persian: فتح على شاه قاجار‎; var. Fathalishah, Fathali Shah, Fath Ali Shah) was the second Qajar Shah of Persia. He reigned from 17 June 1797 until his death. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/fausta', 'Fausta', 'The wife of the Roman emperor Constantine I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/faustina_i', 'Faustina the Elder', 'Annia Galeria Faustina, more familiarly referred to as Faustina I or Faustina the Elder; born on September 21, in about 100; died in October or November of 140), was Roman Empress and wife of Roman Emperor Antoninus Pius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/faustina_ii', 'Faustina the Younger', 'Annia Galeria Faustina Minor, Faustina Minor or Faustina the Younger (16 February between 125 and 130 – 175) was a daughter of Antoninus Pius and Faustina the Elder. She was Empress and wife to her cousin Marcus Aurelius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/favstvs_rrc', 'Faustus Cornelius Sulla', 'Roman Republican Moneyer, c. 56 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ferdinand_vii_of_spain', 'Ferdinand VII of Spain (1808, 1813-1833)', 'Ferdinand VII (Spanish: Fernando VII de Borbón', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/flavia_iulia_constantia', 'Flavia Iulia Constantia', 'Flavia Iulia Constantia, sister of the Roman Emperor Constantine the Great and wife of Licinius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/flavius_marcus', 'Flavius Marcus', 'The Roman emperor Flavius Marcus, son of the emperor Basiliscus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/flavius_ulpianus_pirf402', 'Flavius Ulpianus', 'Legatus augusti pro praetore Ciliciae in AD 201-205, ditto Moesiae inferioris in AD 210-213. His name appears on coins of Markianopolis and Nikopolis. Lit.: PIR² F 402; B. E. Thomasson, Laterculi Praesidum I (1984) 140 Nr. 111 (under Septimius Severus and sons, AD 209-212); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) S. 737 s. v. Oulpianos (AD 209-211).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/flavius_victor', 'Flavius Victor', 'The Roman emperor Flavius Victor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/florianus', 'Florianus', 'Roman emperor in AD 276.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/franz_engels_bonn', 'Franz Engels', 'Mintmaster in Bonn, a city in Germany, 1638 to possibly 1639. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 427.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/franz_hermann_hermanns_colonia_claudia_ara_agrippinensium', 'Franz Hermann Hermanns', 'In July 1698 the results of the Assay Commission were signed off by the Goldsmith Hermanns as though he were Mint Warden in Cologne (City), Germany. Around 1699 Hermanns was appointed Mintmaster, then General Warden on 6 October 1702, a position he held until 1713 before he reverted on 14 November 1716 to General Warden. Hermanns was requested to produce 10,000 new Ratszeichen (German coin denomination) according to the old standard. He died in 1719. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 259, 275, 279, 286, 294. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/franz_joseph', 'Franz Joseph (1848-1916)', 'Franz Joseph I or Francis Joseph I (German: Franz Joseph I., Hungarian: I. Ferenc József, 18 August 1830 – 21 November 1916) was Emperor of Austria and Apostolic King of Hungary from 1848 until his death in 1916. From 1 May 1850 until 24 August 1866 he was President of the German Confederation.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/franz_modenschein_juelich', 'Franz Mondenschein', 'Warden in Jülich, a city in Germany, in 1609. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 96.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/francois_arnold_d_uphoff_bonn', 'François Arnold d\'Uphoff', 'François Arnold d\'Uphoff outfitted the Bonn Mint 8 October 1741 as organised by Johann Nicolaus Rayemaker. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 355.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/francois_briot', 'François Briot', 'Medalist and die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1579/80 to 1616. Worked in Mömpelgard, too. Born in 1550. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109,127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/francois_grenus_geneva', 'François Grenus', 'François Grenus is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/francois_guichard', 'François Guichard', 'Medalist and die cutter in Stuttgart and Stuttgart-Berg, Baden-Wuerttemberg, Germany from 1610 to 1634. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127, 203', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/friedrich_daig_stuttgart', 'Friedrich Daig', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1606 to 1608/09. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/friedrich_rodorff_colonia_claudia_ara_agrippinensium', 'Friedrich Rodorff', 'Appointed Mint Warden of the Cologne Circle, Germany, on 10 May 1644, in 1653 General Warden. Rodorff was a nephew of Konrad Duisberg, His death was reported in May 1686 at the Assay Commission. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 185, 186, 224; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1244, p. 492.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/friedrich_wendels_deutz', 'Friedrich Wendels', 'Mintmaster in Deutz, Germany, in 1693, and in Bonn from 1698 to 1728. Friedrich Wendels, was listed as a Silversmith in 1693, was enrolled as Unverdienter on 5 August 1657. He died on 26 August 1728. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 338, 427; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1548 pp. 541-542.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/friedrich_von_berck_colonia_claudia_ara_agrippinensium', 'Friedrich von Berck', 'On 12 August 1481 Friederich von Berck was recommended to be appointed to the position of Die cutter, in Cologne (City), Germany, but nothing is known of what happened subsequently or his work. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), p. 17.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/fu\'ad', 'Fu\'ad', 'Fuad I (Arabic: فؤاد الأول‎ Fu’ād al-Awwal, Turkish: I. Fuad or Ahmed Fuad Paşa); 26 March 1868 - 28 April 1936) was the Sultan and later King of Egypt and Sudan, Sovereign of Nubia, Kordofan, and Darfur. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gabriel_phinoir_deutz', 'Gabriel Phinoir', 'The Cologne goldsmith Phinoir was appointed Special Warden in Deutz on 31 March 1569, a position he held until 1584. He was listed as being in employment already in 1542. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 47; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) p. 527; Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 206, 224; ibid., Die Münzen der Stadt Neuss n. 774 p. 444.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_caecina_largus_pirc102', 'Gaius Caecina Largus', 'Legatus Augusti pro praetore provinciae Thraciae in AD 198. His name appears on coins of Plotinopolis, Serdica, Augusta Traiana, and Pautalia, in letter case always as Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 169-170 no. 44; ibid., I Addenda (2011) 22:044; PIR² C 102.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_caesar', 'Gaius Caesar', 'Gaius Julius Caesar (20 BC – 21 February AD 4), most commonly known as Gaius Caesar or Caius Caesar, was the oldest son of Marcus Vipsanius Agrippa and Julia the Elder.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/cassius', 'Gaius Cassius Longinus', 'Gaius Cassius Longinus (October 3rd, before 85 BC - October 3rd, 42 BC) was a Roman senator, a leading instigator of the plot to kill Julius Caesar, and the brother in-law of Marcus Junius Brutus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_fabius_agrippinus_pirf20', 'Gaius Fabius Agrippinus', 'Consul suffectus AD 148. Legatus Augusti pro praetore Thraciae AD 144 to 148. Found on coins of Topeiros. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 164 no. 22; ibid., Addenda I (2011) no. 22:022; PIR² F 20.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_flavius_trophimos_cyzicus', 'Gaius Flavius Trophimos', 'Archon in Cyzicus/Mysia during the reign of Severus Alexander. His name appears on coins issued with the imperial portrait or the image of Kore Soteira, the main civic deity, and in combination with his title of Archon: RPC VI (online) Temp. no. 3795-3796 (time of Severus Alexander, group II). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 851 s. v. Trophimos (AD 222-235); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 436 s. v. Trophimos (no. 169) (AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gallonius_fronto_pirg50', 'Gaius Gallonius Fronto Q. Marcius Turbo', 'Legatus augusti pro praetore provinciae Thraciae under Antoninus Pius during AD 150ies. He appears with his title of Hegemon on coins of Philippopolis. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 166 no. 24; ibid. Addenda (2011) no. 22:024; PIR² G 50.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_iulius_bassus_piri205', 'Gaius Iulius Bassus', 'Consul suffectus in AD 99. Proconsul of Bithynia and Pontus AD 101/102. His name and title (in Greek) appear on coin issued on behalf of the Koinon of Bithynia. Lit.: PIR² I 205; G. Stumpf, Numismatische Studien zur Chronologie der römischen Statthalter in Kleinasien 122 v. Chr.-163 n. Chr. (1991) pp. 278-280; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 405.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_iulius-commodus_orfitianus_piri271', 'Gaius Iulius Commodus Orfitianus', 'Legatus Augusti pro praetore in Thrace in AD 155. Consul suffectus in AD 157. His name appears on coins of Anchialus, Hadrianopolis, Perinthus, and Topeiros. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 165 no. 22.25; ibid., Addenda (2011) 22:025; PIR² I 271.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_iulius-quintilianus_pirq18', 'Gaius Iulius Quintilianus', 'Legatus Augusti pro praetore Moesiae inferioris. His name appears on coins in Marcianopolis under Caracalla, c. AD 211-217. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 140 no. 112 (time of Caracalla’s early reign); PIR² Q 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 630 s. v. Kyntilianos (c. AD 211-217).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_licinius_crassus_mucianus_pirl216', 'Gaius Licinius Crassus Mucianus', 'Consul suffectus c. AD 64, Consul in AD 70 and 73. Legatus augusti pro praetore provinciae Syriae from AD 67 to 69. His name appears on coins of the legate series of Antioch. Lit.: RPC I pp. 629-630; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) pp. 629-630; PIR² L 216.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_papius_c_f_mutilus', 'Gaius Papius Gaii filius Mutilus', 'C. Papius C.f. Mutilus, from a Samnite family, was a general in the Social War. He issued coins with his name sometimes with the additional title of imperator (90-88 BC). Lit.: N. K. Rutter, Historia Numorum Italy (2001) p. 57; Der Neue Pauly IX (2000) 295 s. v. Papius no. I 4 (K.-L. Elvers).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_publilius_quaestor', 'Gaius Publilius, Roman Quaestor', 'Quaestor who issued coins in Macedonia, probably under L. Mummius', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius', 'Gaius/Caligula', 'Caligula, properly Gaius Julius Caesar Augustus Germanicus was Roman emperor from AD 37–41. Born Gaius Julius Caesar Germanicus, Caligula was a member of the house of rulers conventionally known as the Julio-Claudian dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/galba', 'Galba', 'Galba was Roman Emperor for seven months from 68 to 69.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/galeria_valeria', 'Galeria Valeria', 'Daughter of Diocletian and wife of Galerius', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/galerius', 'Galerius', 'The Roman emperor Galerius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/galla_placidia', 'Galla Placidia', 'Daughter of the Roman emperor Theodosius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gallienus', 'Gallienus', 'The Roman Emperor Gallienus (c. 218 - 268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/galus', 'Galus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gamal_abdel_nasser', 'Gamal Abdel Nasser', 'Gamal Abdel Nasser Hussein (Arabic: جمال عبد الناصر حسين‎) was the second President of Egypt, serving from 1956 until his death in September, 1970.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gamilath_nabataea', 'Gamilath of Nabataea', 'Gamilath was the sister of Rabbel II, the last king of Nabataea. She held the office of the queen.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gargilius_antiquus_pirg79', 'Gargilius Antiquus', 'Marcus Paccius Silvanus Coredius Gallus Lucius Pullaienus Gargilius Antiquus was Legatus Augusti pro praetore in Thrace in AD 161. His name appears on coins of Hadrianopolis, Perinthus, Philippopolis, Plotinopolis, and Pautalia. In latter case always as Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 165-166 no. 28; ibid., I Addenda (2011) 22:028; PIR² G 79.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaspar_guichard', 'Gaspar Guichard', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1618/19 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/geitas_temnus', 'Geitas', 'Magistrate attested on the Alexander coinage of Temnos, c.188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1690', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gelon_ii_syracuse', 'Gelon II of Syracuse', 'Gelo (or Gelon) (before 266 BC – 216 BC) was the eldest son of Hiero II, king of Syracuse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gelon_i_syracuse', 'Gelon of Syracuse', 'Gelon also known as Gelo (Greek: Γέλων Gelon, gen.: Γέλωνος; died 478 BC), son of Deinomenes, was a 5th-century BC ruler of Gela and Syracuse and first of the Deinomenid rulers.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gene_maroneia', 'Gene(…)', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/genthius_illyria', 'Genthius of Illyria', 'Gentius (Ancient Greek: Γένθιος, \"Génthios\"; fl. 181–168 BC) was a king of the Ardiaei, a powerful tribe in Illyria. He ruled in 181–168 BC,[1] being the last Ardiaei ruler.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_friedrich_loos_nuremberg', 'Georg Friedrich Loos', 'Die cutter in Nürnberg (Nuremberg), Franconia, Germany from ca. 1742 to ca. 1762. Died in 1766. His intitials are LOOS, L or Lf. He did also work as a die-cutter fur Würzburg from 1762 to 1766. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_friedrich_nuernberger_nuremberg', 'Georg Friedrich Nürnberger', 'Medalist and Mintmaster in Nürnberg (Nuremberg), Franconia, Germany, from 1677 to 1716. His initials are GFN and mark a cross. Lit.: H.-J. and E. Kellner, Die Münzen der Reichsstadt Nürnberg (1991) p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_hartmann_plappert_colonia_claudia_ara_agrippinensium', 'Georg Hartmann Plappert', 'The Goldsmith Georg Hartmann Plappert was appointed Die cutter in Cologne (City), Germany, in 1658. His monogram was GHP. He died in 1692. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) p. 49. 206; Max Bernhart, Medaillen und Plaketten, Berlin (1920) p. 221.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_hautsch_(1659-1745)', 'Georg Hautsch', 'Medalist and die cutter in Nürnberg (Nuremberg), Franconia, Germany from 1683 to 1712. His initials are H or GH. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_michael_mann_nuremberg', 'Georg Michael Mann', 'Mint Warden in Nürnberg (Nuremberg), Franconia, Germany from ca. 1755 to ca. 1760. His initial is M. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_nikolaus_riedner_nuremberg', 'Georg Nikolaus Riedner', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1764 to 1793. His initials are R or GNR. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_nuernberger_der_aeltere_nuremberg', 'Georg Nürnberger the Elder', 'Born 1598, died 1667. Mintmaster in Nürnberg (Nuremberg), Franconia, Germany, from 1622 to 1657. His initials are GN and mark a cross. From 1620 and working together with Caspar Ayrer, Mintmaster in Frankfurt am Main, he also owned a refinery. Lit.: H.-J. and E. Kellner, Die Münzen der Reichsstadt Nürnberg (1991) p. 171; P. Joseph - E. Fellner, Die Münzen von Frankfurt am Main (1896) p. 210.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_nuernberger_der_juengere_nuremberg', 'Georg Nürnberger the Younger', 'Mintmaster in Frankfurt am Main from 1644 to 1645. Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1665 to 1677. His mark is a cross. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171,', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_pfruendt_(1603-1663)', 'Georg Pfründt', 'Medalist, die cutter, wax modeler, and engineer in Stuttgart, Baden-Wuerttemberg, Germany from 1659 to 1663. Lived 1603 to 1663. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 210', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georg_von_dorneck_werl', 'Georg von Dorneck', 'Appointed Mintmaster in the Werl Mint of the Archbishopric Cologne, on the Friday after Easter 1489 for a period of six years. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 337.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/georgius_trapezunt', 'George Komnenos', 'The emperor of Trebizond George Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gepaepyris_bosporus', 'Gepaepyris', 'Gepaepyris was a Thracian princess, and a Roman Client Queen of the Bosporan Kingdom, the longest known surviving Roman Client Kingdom. When Aspurgus died in 38, Gepaepyris ruled with their first son Mithridates the Bosporan Kingdom until 45. Later, her other son Cotys I succeeded her and Mithridates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gerashtart_aradus', 'Gerashtart, King of Aradus', 'Ruler of Aradus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gerhard_huels_colonia_claudia_ara_agrippinensium', 'Gerhard Hüls', 'Mintmaster in Cologne (City), Germany, from 1735 to 1765. Gerhard (Gerardus) Hüls was baptised on 27 March 1688 and died in 1765. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 306, 310, 325 p. 47; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1708 p. 599.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/germanicus', 'Germanicus', 'Germanicus Julius Caesar (24 May 15 BC – 10 October AD 19), commonly known as Germanicus, was a member of the Julio-Claudian dynasty and a prominent general of the early Roman Empire. He was the great-nephew of the Augustus, nephew and adoptive son of Tiberius, father of Caligula, brother of Claudius, and grandfather of Nero.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/germanicus_iulius_caesar', 'Germanicus Julius Caesar', 'Germanicus Julius Caesar was a member of the Julio-Claudian dynasty. He was a son of Drusus the Younger and a grandson of Tiberius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gesios_adramyteum', 'Gesios', 'Magistrate in Adramyteum (Mysia). He donated (anetheken) a series of coins with the portrait of Antinoos, c. 130-138 AD. See J. Stauber, Die Bucht von Adramytteion. Inschriften griechischer Städte aus Kleinasien 51 II (1996) 189, 221 no. 171; RPC III no. 1677; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 417 s. v. Gesios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gessios_charidemos_adramyteum', 'Gessios Charidemos', 'Magistrate in Adramyteum (Mysia). His name is attested on two series of coins issued under Augustus, not always including his cognomen Charidemos. See J. Stauber, Die Bucht von Adramytteion. Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 219 nos. 161-162; RPC I p. 394 nos. 2330-2331 (reads \"Gessios, son of Charidemos\"); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 417 s. v. Gessios, and p. 890 s. v. Charidemos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 462 s. v. Charidemos (no. 41).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/geta', 'Geta', 'Roman emperor from 209 to 211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/getas_edoni', 'Getas, King of the Edoni', 'Getas was a king of the Edoni Thracians.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghazan_mahmud', 'Ghazan Mahmud', 'Mahmud Ghazan (1271–1304) (Mongolian: Газан хаан, Chinese: 合贊, sometimes referred to as Casanus by Westerners) was the seventh ruler of the Mongol Empire\'s Ilkhanate division in modern-day Iran from 1295 to 1304.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghiyath_al-din_abu_ja\'far_mas\'ud_ibn_muhammad', 'Ghiyath al-Din Abu Ja\'far Mas\'ud ibn Muhammad', 'Ghiyath al-Din Abu Ja\'far Mas\'ud ibn Muhammad (529-547/1134-1152) was one of the Seljuqs of Hamadhan who were the rulers of western Persia and who maintained a very loose grip on the Abbasids of Baghdad.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghiyath_al-din_abu_shuja\'_muhammad_ibn_malikshah', 'Ghiyath al-Din Abu Shuja\' Muhammad ibn Malikshah', 'Muhammad I (also known as Ghiyath ad-Din Muhammad or Muhammad Tapar, died 1118) was a son of Seljuq Sultan Malik Shah I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghiyath_al-din_kay_khusraw_ii', 'Ghiyath al-Din Kay Khusraw II', 'Ghiyath al-Din Kaykhusraw II (Persian: غياث الدين كيخسرو بن كيقباد‎ Ghiyāth ad-Dīn Kaykhusraw bin Kayqubād) was the sultan of the Seljuqs of Rûm from 1237 until his death in 1246.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghiyath_al-din_mas\'ud_ii', 'Ghiyath al-Din Mas\'ud II', 'Kaykhusraw III (Old Anatolian Turkish: كَیخُسرو, Persian: غياث الدين كيخسرو بن قلج ارسلان‎, Ghiyāth ad-Dīn Kaykhusraw bin Qilij Arslān) was between two and six years old when in 1265 he was named Seljuq Sultan of Rûm.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ghiyath_al-din_muhammad_ibn_sam', 'Ghiyath al-Din Muhammad ibn Sam', 'Ghiyath al-Din Muhammad (Persian: غیاث‌ الدین محمد بن سام‎), was sultan of the Ghurid dynasty from 1163 to 1202. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gilles_von_siburg_deutz', 'Gilles von Siburg', 'First mentioned in 1542, Gilles was appointed Mintmaster in Deutz for the Archbishopric Cologne, on 15 May 1581, a position he held until 1584, Gilles was listed in 1587 as a Citizen in Frankfurt a am Main, and in 1589 he was Mintmaster for the Archbishopric Pfalz in Heidelberg. He died in office on 23 March 1598 in Frankfurt. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 67, 90, 91; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 917b p. 527; Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 206, 224; ibid., Die Münzen der Stadt Neuss p. 450.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/giustimani_marcantonio', 'Giustimani, Marcantonio (1684-1688)', 'Marcantonio Giustinian (March 2, 1619 – March 23, 1688) was the 107th Doge of Venice, reigning from his election on January 26, 1684 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/glauketes_dardanus', 'Glauketes', 'Magistrate attested in Dardanus in ca. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Glauketas (2). See also NC 1892, p. 16 no. 25; BMC Troas, p. 48, no. 2. On the coins, however, the name clearly reads ΓΛΑΥΚΕΤΗΣ, not ΓΛΑΥΚΕΤΑΣ. Cf. Babelon, Coll. Waddington, no. 1130.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/glaukos_athens', 'Glaukos', 'First magistrate attested in Athens in 138/137 BC [issue 27]. Later attested as second magistrate in 127/126 BC [issue 38] together with his brother Lysan[dros], who was first magistrate of this issue. From Piraeus: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 287-314 and nos. 429-440X / issues 27 and 38 (p. 557); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 8 (138/137 and 127/126 BC); Prosopographia Attica 3006; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 52 s. v. Glaukos, no. 52; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 419 s. v. Glaukos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/glau_athens', 'Glau…', 'Third magistrate attested in Athens in 99/98 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 937-940 / issue 67 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (98/97 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 418 s. v. Glau- (99/98 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/glycerius', 'Glycerius', 'The Roman emperor Glycerius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gl_athens', 'Gl…', 'Third magistrate attested in Athens in 100/99 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 870-871 / issue 65 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (100/99 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 418 s. v. Gl-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gn_pedanius_fuscus_salinator_pirp199', 'Gn. Pedanius Fuscus Salinator', 'Proconsul (Anthypatos) in Asia in the period between AD 98 and 102. The year of his consulate is not known, consul suffectus before AD 87. His name is attested in inscriptions (e.g. as dedicator of a statue of the Hiera Synkletos, the Romane Senate, in Ephesus) and appears on coins in various cities: in Cyzicus/Mysia (ЄΠΙ ΦΟΥCΚΟΥ lacking a title), in Smyrna/Ionia (ΑСΙ ΦΟΥCΚΩ ΑΝΘΥ…), and in Thyatira/Lydia (ΑΝΘΥΠΑΤΩ ΦΟΥCΚΩ). Lit.: PIR VI 2nd ed. (1989) p. 70-71 no. P199 (Pedanius); G. R. Stumpf, Numismatische Studien zur Chronologie der römischen Statthalter in Kleinasien (1991) pp. 259-261 nos. 534-537 (Cyzicus), no. 538 (Smyrna) and nos. 539-543 (Thyatira) (AD 98-102); RPC III p. 156 and nos. 1490-1491 (Cyzicus, AD 98-102), no. 1964 (Smyrna, AD 98/99?) and nos. 1815-1817 (Thyatira, AD 98/99?); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 883 with note 8 s. v. Phouskos (AD 98-117).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gnosis_chios', 'Gnosis', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2424', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gordian_i', 'Gordian I', 'Roman emperor in 238 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gordian_ii', 'Gordian II', 'Roman emperor in 238 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gordian_iii', 'Gordian III', 'Gordian III (Latin: Marcus Antonius Gordianus Pius Augustus; 20 January 225 – 11 February 244), was Roman Emperor from 238 to 244.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gorgias_abydus', 'Gorgias', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Gorgias (19); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 421 s. v. ΓΟΡΓΙΑΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gorgias_athens', 'Gorgias', 'Second magistrate attested in Athens in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1131-1142, 1130 (drachm) / her issue 75 (p. 558; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 11 (88/87 BC, his issue 77); Prosopographia Attica 3066; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 96 s. v. Gorgias, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 421 s. v. Gorgias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gorgion_gambrium', 'Gorgion of Gambrium', 'Gorgion, tyrant of Gambrium in the Troad in the early 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gorgip_athens', 'Gorgippos', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 487-488, 492 / issue 41 (p. 558); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); Prosopographia Attica 3079; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 96 s. v. Gorgippos, no. 3; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 422 s. v. Gorgippos (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gotarzes_i_parthia', 'Gotarzes I of Parthia', 'Gotarzes I was king of the Parthian Empire from 91 BC to 87 or 80 BC. He was the son and successor of Mithridates II (r. 124–91 BC), and was succeeded by his son Orodes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gotarzes_ii_parthia', 'Gotarzes II of Parthia', 'Gotarzes II of Parthia was a Prince of Iranian ancestry. He ruled the Parthian Empire as King intermittently between about 40 to 51. He was one of the sons of Artabanus III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gottfried_kuhorst_stuttgart', 'Gottfried Kuhorst (Cohorst, Kuharst, Khueharscht, Kuheharsch)', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1644 to 1649. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 210', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/govinda_chandra_gahadavala', 'Govinda Chandra Gahadavala (1114-1154)', 'Madanpala was succeeded by his son, Govind Chandra in 1114 A.D. He is supposed to be the most powerful king of his dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gras_idalium', 'Gras of Idalium', 'Gras was a 5th century B.C. king of Idalium, Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/grata_honoria', 'Grata Honoria', 'Daughter of the Roman emperor Constantius III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gratian', 'Gratian', 'The Roman emperor Gratian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gritti_andrea', 'Gritti, Andrea (1523-1539)', 'Gritti was born in Bardolino, near Verona. He spent much of his early life in Constantinople (actual Istanbul) as a grain merchant, looking after Venetian interests.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gruenwalt_deutz', 'Grünwalt', 'Grünwalt (first name unknown) was appointed Mintmaster in the Deutz Mint of the Archbishopric Cologne around 1506 to 1507. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 272.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gulussa_numidia', 'Gulussa of Numidia', 'Gulussa son of Masinissa, was the second legitimate son of Masinissa. Gulussa became the King of Numidia along with his two brothers around 148 BC and reigned as part of a triumvirate for about three years.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/habib_allah_khan', 'Habib Allah Khan', 'Habibullah Khan was the Emir of Afghanistan from 1901 until 1919.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/habron_athens', 'Habron', 'Third Magistrate attested on the New Style Coinage of Athens in 131/130 BC. From Bate. Son of Ophelas. Hieropoios in 156/155 BC (Habicht 1991, p. 20): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 396-397, 402 / issue 34 (p. 547); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 20 (131/130 BC); Prosopographia Attica 6; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 1 s. v. Habron, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 277 s. v. Habron.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hadrian', 'Hadrian', 'Roman Emperor from 10 August 117 to 10 July 138.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hafs_ibn_al-walid', 'Hafs ibn al-Walid', 'Hafs ibn al-Walid ibn Yusuf al-Hadrami was a governor of Egypt for the Umayyad Caliphate in the mid-8th century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hagru_nabataea', 'Hagru of Nabataea', 'Hagru was the second wife of Rabbel II of Nabataea', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hajjaj', 'Hajjaj', 'An official noted on an Islamic glassware objects.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hajji_i', 'Hajji I', 'Hajji I (747-748/1346-1347) was a Mamluk sultan during the Bahri period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hajji_ii', 'Hajji II', 'Al-Salih Hajji (Epithet: Al-Salih Salah Zein al-Din Hajji II), also Haji II, was a Mamluk ruler, and the last ruler of the Bahri dynasty in 1382. He briefly ruled again in 1389, during the advent of the Burji dynasty', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hannibalianus', 'Hannibalianus', 'The Roman emperor Hannibalianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_baumann_stuttgart', 'Hans Baumann', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany 1572 to 1587/88. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_christian_lauer_nuremberg', 'Hans Christoph Lauer', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany, from 1618 to his death in 1639. His mintmarks are star/lily. Lit.: H.-J. and E. Kellner, Die Münzen der Reichsstadt Nürnberg (1991) p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_david_lauer_nuremberg', 'Hans David Lauer', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1639 to 1645. His intial is a star. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_kerber_stuttgart', 'Hans Kerber', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1596 to 1606, and 1608. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_pfaffenbruch_stuttgart', 'Hans Pfaffenbruch', 'Die-cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1601 to possibly 1634. Died in 1639. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373-1693 (1993) p. 109.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_putzner_nuremberg', 'Hans Putzer', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1616 to 1618 and then from 1620 to ca. 1630. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_rottenburger_stuttgart', 'Hans Rot(t)enburger (Rottenberger)', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany 1573. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_schwertzge_the_elder', 'Hans Schwertzge the Elder', 'Die cutter in Cologne, Germany, from 1569. Hans Schwertzge von der Liegnitz der Ältere made dies for Trier, the Cologne Archbishopric and other places. By 1617 he was already an old man. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) p. 141.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hans_schwertzge_colonia_claudia_ara_agrippinensium', 'Hans Schwertzge the Younger', 'Hans Schwertzge von der Liegnitz der Jüngere, son or grandson of Hans Schwertzge von der Liegnitz dem Älteren. He wrote that he had been cutting dies for the Cologne Mintmaster since August 1625. He was appointed die cutter for the Cologne Circle on 16 May 1626, and died in May 1659. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 10, 47-49, 161, 169, 206, 224; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1374h, p. 510.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/harb_ibn_muhammad', 'Harb ibn Muhammad', 'Khwarazm-Shah governor of Sijistan Harb ibn Muhammad (597-612/1201-1215)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/harithat_hagar', 'Harithat of Hagar', 'Harithat of Hagar issued coins in Eastern Arabia in the 2nd century BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/harun_al-rashid', 'Harun al-Rashid', 'Harun al-Rashid (Arabic: هَارُون الرَشِيد‎; hārūn ar-rašīd) (17 March 763 or February 766 — 24 March 809) was the fifth Abbasid Caliph.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/harun_b_khumarawayh', 'Harun b. Khumarawayh', 'Harun ibn Khumarawayh (Arabic: ہارون ابن خمارویہ ‎) was the fourth Tulunid ruler of Egypt (896–904).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hasan_mamluks', 'Hasan', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hasan_al-misri_mamluks', 'Hasan al-Misri', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hawfiamm_yubanam_qataban', 'Hawfi\'amm Yuban\'am of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hayyan_shurayh', 'Hayyan in Shurayh', 'A magistrate noted on Islamic glassware.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hebesas_maroneia', 'Hebesas', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hebryzelmis_odrysian_thrace', 'Hebryzelmis of Thrace', 'Hebryzelmis (Ancient Greek: Εὐρύζελμις, Ἑβρύζελμις, Ἑβροζέλμης, Εὐρύτελμις) was a king of the Odrysian kingdom of Thrace, from 390 BC–384 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hecatomnus_caria', 'Hecatomnus of Caria', 'Hecatomnus of Mylasa or Hekatomnos (Greek: Ἑκατόμνος) was an early 4th-century BC ruler of Caria. He was the satrap (governor) of Caria for the Persian Achaemenid king Artaxerxes II (404–358 BC). However, the basis for Hecatomnus\' political power was twofold: he was both a high appointed Persian official and a powerful local dynast, who founded the hereditary dynasty of the Hecatomnids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hege_abdera', 'Hege(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegema_athens', 'Hegemachos', 'Third magistrate attested in Athens in 129/128 BC [issue 36]. Again attested as third magistrate in 122/121 BC [issue 42]. Probably as epehebic athlete victorious in the Theseia of 140 BC (Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 416X-417 and nos. 500-502 / issues 36 and 42 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (129/128 and 123/122 BC); Prosopographia Attica 6281; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 200 s. v. Hegemachos, no. 4; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 526 s. v. Hegema- (122/121 BC, issue 42).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegemo_athens', 'Hegemon', 'Third magistrate attested in Athens in 131/130 BC [issue 34]. Again attested as third magistrate in 130/129 BC [issue 35]: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 156 no. 401 and p. 160 nos. 401, 406 / issues 34 and 35 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 and 130/129 BC); Prosopographia Attica 6284; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 200 s. v. Hegemon, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 527 s. v. Hegemon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegesagoras_maroneia', 'Hegesagoras', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegesagores_abdera', 'Hegesagores', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegesileos_maroneia', 'Hegesileos', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/hegesimachos_colophon', 'Hegesimachos', 'Magistrate attested on the Alexander coinage of Colophon, c.180-180 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1872', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegesi_priene', 'Hegesi…', 'An individual who issued coins at the ancient city of Priene c. 190-160 BC. Regling completed: Hegesias or Hegesippos Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 527 (SNG Turkey 590, late third century BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegias_athens', 'Hegias', 'Third magistrate attested in Athens in 98/97 BC. Maybe from Halimus. Different spellings are known: ΗΓΕΑΣ and ΗΓΙΑΣ, whereas the latter is the more common version. Maybe known as Ephebe in 117/116 BC (Habicht 1991, p. 22): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 970-989 / issue 68 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 22 (97/96 BC); Prosopographia Attica 6362; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 201 s. v. Hegias, no. 7; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 526 s. v. Hegeas (98/97 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hegisippos_abdera', 'Hegisippos', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_aldendorff_bonn', 'Heinrich Aldendorff', 'Appointed Warden in Jülich, a city in Germany, in 1628, then in 1632 he is thought to have held a position in the Archbishopric Cologne followed by Warden in Bonn in 1652 (but he was also Mintmaster there, at least in 1655, 1657 and 1663). He presented reports in 1674 and 1676, but his position was not shown. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 154, 194.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_attendahr_colonia_claudia_ara_agrippinensium', 'Heinrich Attendahr', 'Die cutter in Cologne (City), Germany, from c. 1575 to 1579. He cut dies for a range of Mints, including Trier, Jülich, Neuß, Münster, Bielefeld, Hamburg and Aachen. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 113, 115.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_deyser_deutz', 'Heinrich Deyser', 'Mint worker in Deutz for the Archbishopric Cologne in 1580. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 67.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_koppers_colonia_claudia_ara_agrippinensium', 'Heinrich Koppers', 'Appointed Mintmaster in Cologne (City), Germany, on 22 June 1723, monogram HK. He died in 1735. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 297, 310.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_lambertz_deutz', 'Heinrich Lambertz', 'Mintmaster in Deutz for the Archbishopric Cologne from 1615 to 1617. Lambertz came from Wilsen near Kampen. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 149, 427.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_mittweg_colonia_claudia_ara_agrippinensium', 'Heinrich Mittweg', 'Appointed Die-cutter for Cologne City, Germany, on 7 May 1642. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 185.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_roth_dorsten', 'Heinrich Roth', 'Roth was responsible for the production of low quality gelders in Dorsten (where Roth was known as Kühte), said to have been struck in the cellar of his house. In 1662, at the request of the Prince-Elector, Roth struck small coin denominations in Recklinghausen, notwithstanding the protestations of the Mayor and Council as Recklinghausen already had its own Mintmaster (Peter Nießmann). Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 245, 246, 247.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_roerichs_deutz', 'Heinrich Rörichs', 'Mintmaster in Deutz for the Archbishopric Cologne, who appointed in October in 1580, but died the following month. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 66-67.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_udesheim_bonn', 'Heinrich Udesheim', 'The Bonn goldsmith Heinrich Udesheim was appointed General Warden of the Archbishopric Cologne on 7 September 1717, but was dismissed in 1728 following his conviction for embezzlement. He was listed as goldsmith (in the Bonngasse) in both 1773 and 1785. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 313, 338; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 11 p. 91.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_von_coisfeld_colonia_claudia_ara_agrippinensium', 'Heinrich von Coisfeld', 'Appointed Assay Master in Cologne (City), Germany, on 30 May 1506, then Mintmaster on 12 September 1511, a position he held until 1515 when he was sacked because of under-weight coinage. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 28. 32, 44, 46-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heinrich_von_lynnar_colonia_claudia_ara_agrippinensium', 'Heinrich von Lynnar', 'Mintmaster in Mülheim, he was appointed Mintmaster in Cologne (City), Germany, in 1515. Heinrich von Lynnar was a buyer for gold and silver in 1517, and he died early in 1518. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 28, 46-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hekat_abdera', 'Hekat(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hekataios_abdera', 'Hekataios', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hekatodoros_byzantium', 'Hekatodoros', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), pp. 136, 143, 146, nos. 1017-1025,1191-1199, 1240-1241.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hekatonymos_abdera', 'Hekatonymos', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/helena', 'Helena', 'Flavia Iulia Helena, the mother of the Roman emperor Constantine I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/helik_priene', 'Helik…', 'An individual who issued coins at the ancient city of Priene c. 320-270 BC. Regling completed: Helikon? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 475.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heliocles_i_bactria', 'Heliocles I of Bactria', 'Heliocles (145–130 BCE) was a Greco-Bactrian king, relative (son or brother) and successor of Eucratides the Great, and probably the last Greek king to reign over the Bactrian country.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heliocles_ii_bactria', 'Heliocles II of Bactria', 'Heliocles II Dikaios is thought to have been one of the later Indo-Greek kings and a relative of the Bactrian king Heliocles I, ruling ca 95–80 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heliodo_athens', 'Heliodoros', 'Second magistrate attested in Athens in 128/127 BC [issue 37: ΗΛΙ]. Then attested as third magistrate in 126/125 BC [issue 39: ΗΛΙΟΔΩ for tetradrachms and ΗΛΙ für drachm]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 418, 421-428, 411 (drachm) and nos. 449-450, 459 (drachm) / issues 37 and 39 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 and 126/125 BC); Prosopographia Attica 6405; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 203 s. v. Heliodoros, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 529 f. s. v. Heli- and Heliodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/helio_athens', 'Heliodoros', 'Second magistrate attested in Athens in 147/146 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 121-128 / issue 18 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (147/146 BC); Prosopographia Attica 6404; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 203 s. v. Heliodoros, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 530 s. v. Heli-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hephaistion_rhodes', 'Hephaistion', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2522', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hephaistoleos_abydus', 'Hephaistoleos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Hephaistoleos (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 540 s. v. ΗΦΑΙΣΤΟΛΕΩΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/her_maroneia', 'Her(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hera_abdera', 'Hera(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hera_athens', 'Hera...', 'Magistrate in Athens in 136/135 BC (issue 29). Possibly the same person as the second magistrate of issue 19 of 146/145 BC, but because of the common nature of this name there is no degree of certainty [Thompson (1961) p. 567]. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 29; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraclius', 'Heraclius', 'The Byzantine emperor Heraclius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraclius_son_of_constans_ii', 'Heraclius', 'The son of the Byzantine emperor Constans II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraclius_the_elder', 'Heraclius the Elder', 'The father of the Byzantine emperor Heraclius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heragoras_abdera', 'Heragoras', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heragores_abdera', 'Heragores', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herak_abdera', 'Herak(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herak_erythrae', 'Herak[…]', 'Magistrate attested on the Alexander coinage of Erythrae, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1912', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleides_maroneia', 'Herakleides', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleides_i_athens', 'Herakleides', 'First magistrate atteststed in Athens twice, in 107/106 BC [issue 58], and in 105/104 BC [issue 60]. Previously attested as third magistrate in 112/111 BC [issue 53]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 688-690, nos. 745, 749-758, 747 (drachm), 748 (hemidrachm), and nos. 777-800 / issues 53, 58 and 60 (pp. 567-568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111, 107/106 and 105/104 BC); Prosopographia Attica 6446; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 204 s. v. Herakleides, no. 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 533-534 s. v. Heraklei- and Herakleides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleides_ii_athens', 'Herakleides', 'Second magistrate attested in Athens in 59/58 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1264 / her issue 104 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (59/58 BC, his issue 106); Prosopographia Attica 6446 (?); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 204 s. v. Herakleides, no. 39; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 534 s. v. Herakleides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraklei_athens', 'Herakleides', 'Three times attested as third magistrate in Athens, in 128/127 BC [issue 37], in 122/121 BC [issue 42], and in 121/120 BC [issue 43]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 421, 423, 425, nos. 499, 501, and nos. 515-518 / issues 37, 42, 43 (pp. 567 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127, 123/122 and 122/121 BC); Prosopographia Attica 6445; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 204 s. v. Herakleides, no. 23; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 533 s. v. Heraklei- (issue 42 in 122/121 and issue 43 in 121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleitos_ii_chios', 'Herakleitos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2428', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleitos_i_chios', 'Herakleitos', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2406', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakle_byzantium', 'Heraklei…', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 144, nos. 1209-1211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleod_athens', 'Herakleodoros', 'Third magistrate attested in Athens in 114/113 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 663-664 / issue 51 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (114/113 BC); Prosopographia Attica 6506; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 206 s. v. Herakleodoros, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 535 s. v. Herakleod-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleos_erythrae', 'Herakleos', 'Magistrate attested on the Alexander coinage of Erythrae, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1913', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakleos_odessus', 'Herakleos', 'Magistrate attested on the Alexander coinage of Odessus, c.125-70 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1208', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakle_i_athens', 'Herakle…', 'Third magistrate attested in Athens in 118/117 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 583-584 / issue 47 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 BC); Prosopographia Attica 6445; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 533 s. v. Herakle-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakle_ii_athens', 'Herakle…', 'Third magistrate attested in Athens in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1140 / her issue 75 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (88/87 BC, his issue 77); Prosopographia Attica 6451; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 533 s. v. Herakle-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraklon_athens', 'Heraklon', 'First magistrate attested in Athens in 59/58 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1264 / her issue 104 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (59/58 BC, his issue 106); Prosopographia Attica 6509; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 207 s. v. Heraklon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 526 s. v. Heraklon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/heraclonas', 'Heraklonas', 'The Byzantine emperor Heraklonas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herakon_athens', 'Herakon', 'Third magistrate attested in Athens in 136/135 BC [issue 29]. Again attested as third magistrate in 130/129 BC [issue 35]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 337, 344 and nos. 404-406, 411 / issues 29 and 35 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 and 139/129 BC); Prosopographia Attica 6509; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 207 s. v. Herakon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 536 s. v. Herakon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hera_ii_athens', 'Hera…', 'Third magistrate attested in Athens in 108/107 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 736, 738-748 / issue 57 (p. 567); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (108/107 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 532 s. v. Hera-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herbert_gronwalt_colonia_claudia_ara_agrippinensium', 'Herbert Gronwalt', 'Appointed Mintmaster for Cologne (City), Germany, in December 1574 following the death of his uncle Ludwig Gronwalt who held the position at that time. Herbert Gronwalt died in the middle of 1602. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 78, 120.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herennia_etruscilla', 'Herennia Etruscilla', 'Wife of the Emperor Trajan Decius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herennius_etruscus', 'Herennius Etruscus', 'Roman emperor in 251 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermaeus_bactria', 'Hermaeus of Bactria', 'Hermaeus Soter or Hermaios Soter was a Western Indo-Greek king of the Eucratid Dynasty, who ruled the territory of Paropamisade in the Hindu-Kush region, with his capital in Alexandria of the Caucasus, ca. 90-70 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermann_cramer_colonia_claudia_ara_agrippinensium', 'Hermann Cramer', 'Appointed Mintmaster in Cologne (City), Germany, on 7 November 1629 (and sworn in a week later), a position he held until 1652. His mintmark was a star. Cramer applied for the position of General Warden for the Cologne Circle and was sworn in on 11 October 1643. He died sometime between Autumn 1652 and early 1653. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 162, 173, 185, 186; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1444b, p. 519.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herma_athens', 'Herma…', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 823-826 / issue 63 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 487 s. v. Erma- (103/102 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermogenes_athens', 'Hermogenes', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 630-631, 633 / issue 50 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 5122; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 158 s. v. Hermogenes, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 490 s. v. Hermogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermokleitos_mytilene', 'Hermokleitos', 'Magistrate attested on the Alexander coinage of Mytilene, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1739', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermokles_athens', 'Hermokles', 'Second magistrate attested in Athens in 93/92 BC. Probably from the tribe Antiochis: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1050-1066 / issue 72, commenatry on p. 564; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (93/92 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 159 s. v. Hermokles, no. 13; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 491 s. v. Hermokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermokra_athens', 'Hermokrates', 'Three times attested as third magistrate in Athens, in 129/128 BC [issue 36], in the following year 128/127 BC [issue 37], and in 116/115 BC [issue 49]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 417-418, nos. 422-423, 418, and nos. 621-623, 625 / issues 36-37 and 49 (p. 564); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128, 128/127 and 116/115 BC); Prosopographia Attica 5151; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 159 s. v. Hermokrates, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 491 s. v. Hermokrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermokratides_abdera', 'Hermokratides', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermolaos_cyzicus', 'Hermolaos', 'Magistrate and Strategos in Cyzicus/Mysia during the reign of Gallienus. His name appears on coins issued with the portrait of Gallienus both in combination with his title of Strategos and without: See SNG France Mysie nos. 868-869. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 492 s. v. Hermolaos (AD 253-268); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 170 s. v. Hermolaos (no. 53) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hermon_cyme', 'Hermon', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1644', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hero_abdera', 'Hero(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hero_priene', 'Hero[i/d]…', 'An individual who issued coins at the ancient city of Priene c. 330-240 BC. Regling completed: Hero(i)des. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 539.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herobolos_maroneia', 'Herobolos', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_agrippa', 'Herod Agrippa', 'Herod Agrippa, also known as Herod or Agrippa I, was a King of Judea from 41 to 44 AD. He was the last ruler with the royal title reigning over Judea and the father of Herod Agrippa II, the last king from the Herodian dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_agrippa_ii_judaea', 'Herod Agrippa II', 'Herod Agrippa II officially named Marcus Julius Agrippa and sometimes shortened to Agrippa, was the eighth and last ruler from the Herodian dynasty. He was the fifth member of this dynasty to bear the title of king, but he reigned over territories outside of Judea only as a Roman client. Agrippa was overthrown by his Jewish subjects in 66 and supported the Roman side in the First Jewish–Roman War.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_antipas_judaea', 'Herod Antipas', 'Herod Antipater, known by the nickname Antipas, was a 1st-century ruler of Galilee and Perea, who bore the title of tetrarch (\"ruler of a quarter\") and is referred to as both \"Herod the Tetrarch\" and \"King Herod\" in the New Testament, although he never held the title of king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_archelaus_judaea', 'Herod Archelaus', 'Herod Archelaus was ethnarch of Samaria, Judea, and Idumea (biblical Edom), including the cities Caesarea and Jaffa, for a period of nine years (c. 4 BC to 6 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_chalcis', 'Herod of Chalcis', 'Herod of Chalcis (d. 48-49 AD), also known as Herod V, listed by the Jewish Encyclopedia as Herod II, was a son of Aristobulus IV, and the grandson of Herod the Great, Roman client king of Chalcis. He was the brother of Herod Agrippa I and Herodias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod', 'Herod the Great', 'Herod (Hebrew: הוֹרְדוֹס, Hordos, Greek: Ἡρῴδης, Hērōdēs), also known as Herod the Great (born 73 or 74 BCE, died 4 BCE in Jericho), was a Roman client king of Judea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_i_judaea', 'Herod the Great', 'Herod, also known as Herod the Great and Herod I, was a Roman client king of Judea, referred to as the Herodian kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodes_priene', 'Herodes', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 540.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodes_abydus', 'Herodes', 'Magistrate attested in Abydos in c. 75-65 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 539 s. v. ΗΡΩΔΗΣ. For chronology, cf. F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodes_athens', 'Herodes', 'Second magistrate attested in Athens in 68/67 BC [Thompson issue 95]. Again attested as second magistrate in 64/63 BC [Thompson issue 99]. From Marathon. Eponymous Archon of 60/59 BC. Mentor of the younger Cicero in Athens and ancestor of Herodes Atticus (Habicht 1991, p. 15): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1245 and nos. 1251-1252 / her issues 95 and 99 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15 (68/67 and 64/63 BC, his issues 97 and 101); Prosopographia Attica 6538; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 208 s. v. Herodes, no. 13; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 539 s. v. Herodes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodo(-)_clazomenae', 'Herodo(…)', 'Magistrate attested on the Alexander coinage of Clazomenae, c. 225-225 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1743', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodo_athens', 'Herodotos', 'Third magistrate attested in Athens in 101/100 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 841-844 / issue 64 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (101/100 BC); Prosopographia Attica 6524; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 207 s. v. Herodotos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 537 s. v. Herodotos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodotos_i_abdera', 'Herodotos (I)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herodotos_ii_abdera', 'Herodotos (II)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herogeiton_abdera', 'Herogeiton', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herok_abdera', 'Herok(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herophanes_abdera', 'Herophanes', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herophilos_maroneia', 'Herophilos', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hesstiai(-)_odessus', 'Hesstiai(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 125-70 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1206-1207', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hestiaios_athens', 'Hestiaios', 'Third magistrate attested in Athens in 129/128 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 413-415, 419 / issue 36 (pp. 564 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 BC); Prosopographia Attica 5196; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 161 s. v. Hestiaios, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 494 s. v. Hestiaios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hicetas', 'Hicetas', 'Hicetas (Greek: Ἱκέτας or Ἱκέτης) was tyrant of Syracuse, during the interval between the reign of Agathocles and that of Pyrrhus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hiempsal_i_numidia', 'Hiempsal I of Numidia', 'Hiempsal I (died c. 117 BC), son of Micipsa and grandson of Masinissa, was a king of Numidia in the late 2nd century BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hiempsal_ii_numidia', 'Hiempsal II of Numidia', 'Hiempsal II was a king of Numidia (ruled 88 BC - 60 BC). He was the son of Gauda, half-brother of Jugurtha, and was the father of Juba I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hieron_athens', 'Hieron', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 706, 685 (drachm) / issue 54 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 233 s. v. Hieron, no. 14 (maybe Hieron[ymos?]); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 565 s. v. Hieron.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hieron_i_syracuse', 'Hieron I of Syracuse', 'Hieron I (Greek: Ἱέρων Α΄; usually Latinized Hiero) was the son of Deinomenes, the brother of Gelon and tyrant of Syracuse in Sicily from 478 to 467 BC. In succeeding Gelon, he conspired against a third brother, Polyzelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hieron_ii', 'Hieron II', 'Hieron II was the Greek Sicilian Tyrant of Syracuse from 270 to 215 BC, and the illegitimate son of a Syracusan noble, Hierocles, who claimed descent from Gelon. He was a former general of Pyrrhus of Epirus and an important figure of the First Punic War.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hieronymos_adramyteum', 'Hieronymos', 'Magistrate in Adramyteum (Mysia). His name appears on pseudo-autonomous coins from imperial times (c. 117?-138?). See See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 212 f. no. 124 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 565 s. v. Hieronymos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 224 s. v. Hieronymos (no. 22) (all assume a minting date in Hadrianic time, but there is no RPC III reference).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hieronymus_syracuse', 'Hieronymus of Syracuse', 'Hieronymus (Greek: Ἱερώνυμος; 231–214 BC) was a tyrant of Syracuse. He succeeded his grandfather, Hiero II, in 215 BC. He was at this time only fifteen years old', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hiero_i_athens', 'Hiero…', 'Second magistrate attested in Athens in 143/142 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 202-227 / her issue 23 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (143/142 BC, his issue 22); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 564 s. v. Hiero-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hiero_ii_athens', 'Hiero…', 'Third magistrate attested in Athens in 127/126 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 429-431 / issue 38 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (127/126 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 564 s. v. Hiero-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hikes_abdera', 'Hikes(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hikesias_abdera', 'Hikesias', 'An individual who issued coins at the ancient city of Abdera, 375/373-365/360 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hikesios_maroneia', 'Hikesios', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hikesios_athens', 'Hikesios', 'First magistrate attested in Athens in 103/102 BC. From Halai. Father of the second magistrate Asklepiades (Habicht 1991, p. 10): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 809, 811, 812-822 / issue 62 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (103/102 BC); Prosopographia Attica 7573 and add. 2589b; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 234 s. v. Hikesios, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 566 s. v. Hikesios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hikesios_abydus', 'Hikesios', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Hikesios (63); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 566 s. v. ΙΚΕΣΙΟΣ.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/himerus_parthia', 'Himerus of Parthia', 'Himerus was a Parthian governor of Babylon who struck coinage in the names of Phraates II and Artabanus I (ca. 130s-120s B.C.)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hippo_abdera', 'Hippo(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hippon_abdera', 'Hippon', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hipponax_abdera', 'Hipponax', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hipponikos_athens', 'Hipponikos', 'Third magistrate attested in Athens in 128/127 BC [issue 37]. Again attested as third magistrate in 121/120 BC [issue 43]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 423-424, 411 (drachm) and nos. 509-510, 512 / issues 37 and 43 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 and 122/121 BC); Prosopographia Attica 7655; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 238 s. v. Hipponikos, no. 8; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 576 s. v. Hippon(e)ikos (121/120 BC, issue 43).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hippostratus_bactria', 'Hippostratus of Bactria', 'Hippostratos was an Indo-Greek king who ruled central and north-western Punjab and Pushkalavati, ca. 65-55 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hiromnemon_abdera', 'Hiromnemon', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hisham_i', 'Hisham I', 'Hisham I or Hisham Al-Reda (Arabic: هشام بن عبد الرحمن الداخل‎) was the second Umayyad Emir of Cordoba, ruling from 788 to 796 in the Al-Andalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hisham_ii_al-mu\'ayyad_billah', 'Hisham II', 'Hisham II (Arabic: ھشام‎‎) was the third Caliph of Cordoba, of the Umayyad dynasty. He ruled 976–1009, and 1010–13 in the Al-Andalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/histiaeus_termera', 'Histiaeus of Termera', 'Histiaeus was tyrant of Termera in Caria and father of Tymnes, also tyrant.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hntruma_lycia', 'Hntruma', 'Dynast in the ancient region of Lycia from approximately 410–390 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), VI, 99', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/holm_frits', 'Holm, Frits (d.1930)', 'Frits Vilhelm Holm[1] (ca. 1881[2] – May 1930) was a Danish scholar and adventurer. His books usually gave his name as simply Frits Holm or Frits V. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/homeros_abdera', 'Homeros', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/honorius', 'Honorius', 'The Roman emperor Honorius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hostilian', 'Hostilian', 'Roman emperor in 251 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hulequ', 'Hulequ', 'Hulagu Khan, also known as Hülegü or Hulegu (Mongolian: Hülegü Khaan, \"Warrior\"; Mongolian Cyrillic: Хүлэгу хаан; Kurdish: هۆلاکۆ; Turkish: Hülagû Han; Chagatai/Urdu: ہلاکو Hulaku; Persian: هولاکو خان‎; Chinese: 旭烈, was a Mongol ruler who conquered much of Southwest Asia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/humayun_padishah', 'Humayun Padishah', 'Humayun (Persian: نصیر الدین محمد همایون‎ ) was the second Mughal Emperor who ruled over territory in what is now Afghanistan, Pakistan, and parts of northern India from 1531–1540 and again from 1555–1556.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/husam_al-din_timurtash', 'Husam al-Din Timurtash', 'Husam al-Din Timurtash (516-548/1122-1154) was the fifth ruler of the Mardin branch of the Artuqid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/husam_al-din_yuluq_arslan', 'Husam al-Din Yuluq Arslan', 'Husam al-Din Yuluq Arslan (580-599/1184-1203) was a ruler of the Mardin branch of the Artuqid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/husayn_b_ali', 'Husayn b. Ali', 'Husayn (Hussein) bin Ali, GCB (Arabic: الحسين بن علي الهاشمي‎, al-Ḥusayn ibn ‘Alī al-Hāshimī; 1854 – 4 June 1931) was the Sharif and Emir of Mecca from 1908 until 1917, when he proclaimed himself and was internationally recognized as King of the Kingdom of Hejaz. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/husayn_ibn_uways', 'Husayn ibn Uways', 'Shaikh Hussain Jalayir was a Jalayirid ruler (1374–1382). He was the son of Shaikh Awais Jalayir.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/huvishka_kushan', 'Huvishka', 'Huvishka was the emperor of the Kushan Empire from the death of Kanishka (assumed on the best evidence available to be in 150 CE) until the succession of Vasudeva I about thirty years later. His rule was a period of consolidation for the Empire. Huvishka\'s territory encompassed Balkh in Bactria to Mathura in India, locations were it is known that he minted his coinage.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hybristas_cyme', 'Hybristas', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1643', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hygiaenon_bosporus', 'Hygiaenon', 'Hygiainon or Hygiaenon was an Archon of the Bosporan Kingdom after his predecessor, Leukon II, was slain by his wife Alkathoe in c. 220 BC. Although he was not part of the Spartocids, he seems to have been a supporter of Kamasarye, then heiress and queen of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hyllippos_abydus', 'Hyllippos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Hyllippos (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 856 s. v. ΥΛΛΙΠΠΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hyspaosines_characene', 'Hyspaosines of Characene', 'Hyspaosines (also spelled Aspasine, c. 209 BC - 11 June 124 BC) was an Iranian satrap installed by Antiochus IV Epiphanes and later the first King (before 127-124 BC) of Characene (Mesene/Meshun). The portraiture of his coinage is Hellenistic in character.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hyssaldomos_mylasa', 'Hyssaldomos of Mylasa', 'Dynast of the Carian city of Mylasa in the late 5th century BC, father of Hecatomus who would become satrap of Caria', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ia_abdera', 'Ia(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iason_ii_priene', 'Iason', 'An individual who issued coins at the ancient city of Priene c. 250-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 561.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iason_i_priene', 'Iason', 'An individual who issued coins at the ancient city of Priene c. 320-270 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 561.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iason_athens', 'Iason', 'Third magistrate attested in Athens in 112/111 BC [issue 53]. Again attested as third magistrate in 109/108 BC [issue 56]. Maybe Archon of the same year 109/108 BC (H. B. Matttingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 699-690 and nos. 721, 727-728 / issues 53 and 56 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 and 109/108 BC); Prosopographia Attica 7425; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 231 s. v. Iason, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 561 s. v. Iason.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ibn_ibrahim_(isma\'il)', 'Ibn Ibrahim, (Isma\'il)', 'An official in Egypt under the Abbasid caliph al-Mahdi (158-169/775-785)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ibrahim', 'Ibrahim', 'Ibrahim (Ottoman Turkish: ابراهيم, Turkish: İbrahim) was the Sultan of the Ottoman Empire from 1640 until 1648.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ibrahim_pasha', 'Ibrahim Pasha', 'Ibrahim Pasha (Turkish: Kavalalı İbrahim Paşa, 1789 – November 10, 1848) was the eldest son of Muhammad Ali, the Wāli and unrecognised Khedive of Egypt and Sudan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/hidrieus_caria', 'Idrieus of Caria', 'Idrieus, or Hidrieos (Ancient Greek: Ἱδριεύς, romanized: Hidrieús; died 344 BC) was a ruler of Caria under the Achaemenid Empire, nominally a Satrap, who enjoyed the status of king or dynast by virtue of the powerful position his predecessors of the House of Hecatomnus (the Hecatomnids)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/idris_i', 'Idris I', 'Idris I (or Idris ibn Abdullah) (Arabic: إدريس بن عبدالله‎ Idrīs ibn ‘Abdallāh) was the first ruler and founder of the Idrisid dynasty and also of the kingdom of Morocco, ruling from 788 to 791.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/imad_al-dawlah_ahmad_i_al-muqtadir', 'Imad al-Dawlah Ahmad I al-Muqtadir', 'Imad al-Dawlah Ahmad I al-Muqtadir (441-475/1049-1082) was a ruling member of the Hudud dynasty which ruled from Saragossa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/imad_al-din_isma\'il', 'Imad al-Din Isma\'il', 'al-Salih \'imad al-Din Isma\'il (743-746/1342-1345) as a Mamluk sultan during the Bahri period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/imese_lycia', 'Imese', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See J. Spier, ‘Lycian Coins in the Decadrachm Hoard’ I.A. Carradice (ed.), Coinage and Administration in the Athenian and Persian Empires: The Ninth Oxford Symposium on Coinage and Monetary History (Oxford, 1987), pp. 29-37, Pl. vii. 17', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ingenuus', 'Ingenuus', 'Usurper during the reign of the Emperor Gallienus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ininthimeus_bosporus', 'Ininthimeus', 'Tiberius Julius Ininthimeus Philocaesar Philoromaios Eusebes, also known as Ininthimaeus, Ininthimeus or Inithimeus (means lover of Caesar, lover of Rome who is the Pious one, flourished 3rd century – died 240) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iotape_commagene', 'Iotape of Commagene', 'Julia Iotapa, or simply Iotapa (before 17 – around 52), daughter of King Antiochus III of Commagene, was Queen of Commagene, consort of her King brother Antiochus IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ipa(-)_miletus', 'Ipa(…)', 'Magistrate attested on the Alexander coinage of Miletus, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2219', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iphiades_i_abydus', 'Iphiades (I)', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Iphiades (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 582 s. v. ΙΦΙΑΔΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iphiades_ii_abydus', 'Iphiades (II)', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Iphiades (4); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 582 s. v. ΙΦΙΑΔΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ippodikos_dardanus', 'Ippodikos', 'Magistrate attested in Dardanus in the 4th cent. BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Ippodikos (1); Münsterberg, Nachtrag p. 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p 575 s. v. Ippodikos = Vienna, Kunsthist. Mus. 34429 (coin) ([῾Ι]ππόδικος)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ip_priene', 'Ip…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 573 (Price 2232, 280-275 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iqbal_al-dawlah_ali_ibn_mujahid', 'Iqbal al-Dawlah Ali ibn Mujahid', 'Iqbal al-Dawlah Ali ibn Mujahid (436-468/1045-1076) was a ruler of the taifa of Dénia which was a Muslim kingdom in medieval Spain, ruling over part of the Valencian coast and Ibiza. With Dénia as its capital, the taifa included the Balearic Islands and parts of the Spanish mainland.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/irene_trapezunt', 'Irene Palaiologina', 'The empress of Trebizond Irene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/irene', 'Irene of Athens', 'The Byzantine empress Irene of Athens.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isaac_i', 'Isaac I Komnenos', 'The Byzantine emperor Isaac I Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isaac_ii', 'Isaac II Angelos', 'The Byzantine emperor Isaac II Angelos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isagoras_abdera', 'Isagoras', 'An individual who issued coins at the ancient city of Abdera, first half of 3rd cent. BC. See K. Chryssanthaki-Nagle, L\'Histoire monétaire d\'Abdère en Thrace (Athens, 2007), p. 257 n. 457-458.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isfandiyar', 'Isfandiyar', 'İsfendiyar Bey (full name: İzzettin İsfendiyar) was the bey (ruler) of Candaroğlu Beylik an Anatolian beylik between 1385 and 1440.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ishaq_ibn_ahmad', 'Ishaq ibn Ahmad', 'Ishaq ibn Ahmad (usurper ) (301/914) was the great uncle of Nasr II [http://en.wikipedia.org/wiki/Nasr_II ] who lead a brief revolt which failed.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ismail_pasha', 'Isma\'il Pasha', 'Isma\'il Pasha, known as Ismail the Magnificent (31 December 1830 – 2 March 1895), was the Khedive of Egypt and Sudan from 1863 to 1879, when he was removed at the behest of the United Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isma\'il_al-samin', 'Isma\'il al-Samin', 'Moulay Ismaïl Ibn Sharif (Arabic: مولاي إسماعيل بن الشريف ابن النصر‎) was the second ruler of the Moroccan Alaouite dynasty. He is also known in his native country as the \"Warrior King\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ismail_ibn_ahmad_i', 'Ismail ibn Ahmad I', 'Abu Ibrahim Ismail ibn Ahmad (Persian: ابو ابراهیم اسماعیل بن احمد سامانی‎), better known as Isma\'il ibn Ahmad, was the Samanid amir of Transoxiana (892–907) and Khorasan (900–907).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/isaac_comnenus', 'Issac Komnenos of Cyprus', 'The Byzantine emperor Isaac Komnenos of Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ite_lycia', 'Ite', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M146-7', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ithystratos_abdera', 'Ithystratos', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iulius_castus_pirI251', 'Iulius Castus', 'P. (?) Iulius Castus, Legatus Augusti pro praetore in Thrace AD 184 to 185. His name appears on coins of Anchialus, Hadrianopolis, and Pautalia. In latter case always as Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 168 no. 37; ibid., I Addenda (2011) 22:037; PIR² I 251.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iulius_glaukos_cyzicus', 'Iulius Glaukos', 'Strategos in Cyzicus/Mysia during the reign of Traianus. His name appears on coins always in comibation with his title of Strategos. Leschhorn and LGPN read \"Iulius\" as nomen gentile and ΕΠ ΙΟΥΛ…, the authors of RPC III assume \"Ulpius\" and therefore read ΕΠΙ ΟΥΛ…. For the coins see F. Jodin, Revue Numismatique 154, 1999, pp. 140-141 nos. 31-33; RPC III nos. 1492-1495. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 419 s. v. Glaukos (AD 98-117); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 110 s. v. Glaukos (no. 35) (AD 98-117); RPC III p. 181 (AD 102 and later).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/iulius_sekundos_cyzicus', 'Iulius Sekundos', 'Archon in Cyzicus/Mysia during the reign of Severus Alexander. His name appears on coins in combination with his title of Archon: RPC VI (online) Temp. no. 3771 (time of Severus Alexander, group I). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 801 s. v. Sekoundos (AD 222-235); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 400 s. v. Sekoundos (no. 75) (AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/izz_al-dawlah_abu_mansur_bakhtiyar', 'Izz al-Dawlah Abu Mansur Bakhtiyar', 'Bakhtiyar (Persian: بختیار, died 978), better known by his laqab of ʿIzz al-Dawla (Arabic: عز الدولة،, \"Glory of the Dynasty\"), was the Buyid amir of Iraq (967–978).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/izz_al-din_mas\'ud_ii_ibn_arslan_shah', 'Izz al-Din Mas\'ud II ibn Arslan Shah', 'Izz al-Din Mas\'ud II ibn Arslan Shah (607-615/1211-1218) was a Zengid ruler of Mosul.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ja_lullin_geneva', 'J. A. Lullin', 'J. A. Lullin is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/j_christian_stockicht_bonn', 'J. Christian Stockicht', 'Appointed Mintmaster for the Cologne Circle in Bonn, a city in Germany, on 10 August 1776 to possibly 1780, nominated as Assay Master on 3 December 1794, and was noted as living at Sternstrasse 42 in 1804. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 413, 414; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 32a p. 94.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jacob_kohlhaas_bonn', 'Jacob Kohlhaas', 'Mintmaster in Bonn, a city in Germany, from 1739 to about 1776, in which year he is thought to have died, with monogram I K. Kohlaas was the son-in-law of Hittorff\'s widow. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 350, 353, 415.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jacob_lamberts_colonia_claudia_ara_agrippinensium', 'Jacob Lamberts', 'Appointed die cutter for the Lower Rhine-Westphalian Circle in 1578, his outstanding work on a thaler of 1587 was noted by Noss. Lamberts died in office early (before 5 March) in 1602. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 82, 100; Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49; 104, 120.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jacob_leer_colonia_claudia_ara_agrippinensium', 'Jacob Leer', 'The Seal and Coat of Arms engraver Jacob Leer was appointed in 1659 as die cutter for the Cologne Circle, Germany. In May 1680 Jacob Leer was admonished by the Lower Rhine-Westphalia Circle for cutting dies for the Cologne Archbishopric Mintmaster in Dorsten without permission. Leer was most likely the die cutter for an Archbishopric of Cologne 1693 gulden because of the similarity with the workmanship on a ducat that he cut. Noted by Scheffler as Jacobus Leher with the alternative names Leer, Lyher and Lier. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 240, 286; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1486 p. 527.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jacob_pfahler_marsberg', 'Jacob Pfahler', 'Appointed Mintmaster for Paderborn in May 1612, although he had already been minting there as early as 1609, and before 1612 he was Mintmaster in Marsberg. In 1618 he took up the Directorship of the Detmold Mint. In October 1620 he was removed from his position as Mintmaster at Corvey (Imperial Abbey of Corvey, now within territory of the city of Höxter) and Lippe on account of his age and ill health. In fact he was appointed to the Mint in Höxter in October 1619, and in the same decade he was striking coins for Hameln and Nordheim. His health seemed to have improved and he was reappointed Mintmaster for Corvey in May 1631; Coins with dates 1631 and 1632 were struck by Pfahler in Corvey, after which time nothing was heard of him. Pfahler was born in Saalfeld in 1568. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 127.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jakob_vischer_stuttgart', 'Jakob Vischer', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1607/08 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jakob_wichert_stuttgart', 'Jakob Wichert', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1607 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jaqmaq', 'Jaqmaq', 'Jaqmaq (842-857/1438-1453) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jaysh_b_khumarawayh', 'Jaysh b. Khumarawayh', 'Abu \'l-Asakir Jaysh ibn Khumarawayh (Arabic: ابو العشیر ابن خمارویہ ‎; born c. 882) was the third Emir of the Tulunids in Egypt, ruling briefly in 896.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jean_cassignot', 'Jean Cassignot', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1602 to 1606. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jean_richard_geneva', 'Jean Richard', 'Jean Richard is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jeremias_pfaffenhaeuser_stuttgart', 'Jeremias Pfaffenhäuser (Böpfenhäuser, Pfepfenhäuser, Pfeffenhäuser, Peffenhäuser)', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1660 to 1664, and Mint Warden there from 1665 to 1677. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 210, 232', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jesus_christ', 'Jesus Christ', 'Jesus (5 BC to 30–33 AD), also referred to as Jesus of Nazareth, is the central figure of Christianity, whom the teachings of most Christian denominations hold to be the Son of God. Christianity regards Jesus as the awaited Messiah (or \"Christ\") of the Old Testament and refers to him as Jesus Christ, a name that is also used in non-Christian contexts.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jihan_shah', 'Jihan Shah', 'Muzaffar al-Din Jahan Shah ibn Yusuf (Persian: جهان شاه‎; Azerbaijani: Cahan Şah/جهان شاه) was the leader of the Kara Koyunlu oghuz Turks tribal federation in Azerbaijan and Arran who reigned c.1438-1467.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jna_lycia', 'Jna', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M148', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/joanna_of_spain', 'Joanna of Spain (1504-1555)', 'Joanna (6 November 1479 – 12 April 1555), known as Joanna the Mad (Spanish: Juana la Loca), was queen of Castile from 1504 and of Aragon from 1516', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/joannes', 'Joannes', 'The Roman emperor Joannes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_adam_longerich_colonia_claudia_ara_agrippinensium', 'Johann Adam Longerich', 'The eldest son of Nikolaus Longerich, Johann Adam was sworn in as Mintmaster for the Cologne Circle, Germany, on 22 October 1700 and held this position until his resignation on 6 November 1705. He was then Mintmaster in Jülich-Berg and Dortmund. Longerich was also the Mint Warden for the Lower Rhine-Westphalian Circle, as noted in the Protocols of 1700, 1705 and 1712, and mintmaster in Düsseldorf, 1707 and 1708. His mintmark was IAL. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 266, 275; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1680, p. 584; F. W. A. Schlickeysen, Reinhold Pallmann - W. Spemann, Erklaerung der Abkuerzungen auf Muenzen der neueren Zeit, des Mittelalters und des Alterthums (1896) p. 222.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_baudistel_stuttgart', 'Johann Baudistel', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1597/98 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_bitter_von_raesfeld_neuss', 'Johann Bitter von Raesfeld', 'Mintmaster in Mülheim, a city in Germany, in 1555, appointed as Mintmaster in Deutz on 4 August 1558, also continued striking coins in Mülheim from 1 November 1560. Mintmaster in Neuss, Germany, from 1561 to 1564. He died 14 March 1565. Johan Bitter was born in Holland; the Mülheim Mintmaster Kaspar Fleming was his father in law. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 24-25, 46; Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_christoph_holder_stuttgart', 'Johann Christoph Holder (Helderer, Hölderer, Holderer)', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1664 to 1667. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), pp. 210, 232', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_christoph_knoll_nuremberg', 'Johann Christoph Knoll', 'Mint Warden in Nuremberg, Germany from 1775 to 1800. His initial is K. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_christoph_mueller_stuttgart', 'Johann Christoph Müller', 'Mint Inspector in Stuttgart, Baden-Wuerttemberg, Germany from 1680 to 1683. Mint warden there from 1691 to ?, Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1669 to 1695. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), pp. 210, 232, 234', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_duisberg_colonia_claudia_ara_agrippinensium', 'Johann Duisberg', 'Appointed Special Mint Warden for the Cologne Circle, Germany, on 8 May 1643, immediately following the death of his uncle Konrad Duisberg. Johann Duisberg left office by 10 May 1644, was on the employee list in 1655 but no longer in 1686. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 185; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1380, p. 510.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_egydius_roesch_nuremberg', 'Johann Egydius Rösch', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1805 to 1807?. His initials are IER. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_eltmann_colonia_claudia_ara_agrippinensium', 'Johann Eltmann', 'Appointed Mint Warden in Cologne (City), Germany, most likely as early as 1547, and Master Tinsmith in 1551. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 69.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_friedrich_meidinger_vienna', 'Johann Friedrich Meidinger', 'Mint Director in Trier, a city in Germany, in 1761, then as Warden in the Würzburg Circle in 1763, and by 1766 he was Mint Director in Vienna. He was born in 1726 and died in 1777. Nobilized in 1767, Meidinger was granted the title Freiherr (Baron) in 1774. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 371.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_foerster_neuss', 'Johann Förster', 'Mintmaster in Neuss, Germany from 1579 to ? Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_gerhard_huels_colonia_claudia_ara_agrippinensium', 'Johann Gerhard Hüls', 'Mintmaster from 8 July 1765 to 1797, but he had been adjunct to his father Gerhard Johann Gerhard Hüls since 1753, and Mint Warden from 18 December 1775 to 1797 in Cologne (City), Germany. Hüls was baptised on 6 January 1732 and died 18 August 1815. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 62, 325, 327; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln, Walter de Gruyter (1973) n. 1774, p. 626.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_gerhardt_deutz', 'Johann Gerhardt', 'Mint Warden in Deutz, Germany, from 1615 to 1617. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 149.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_grunewalt_zons', 'Johann Grunewalt', 'Mintmaster in the Archbishopric Cologne during October 1502 to at least 1505, in the Zons Mint, jointly appointed with van Leyden in the Deutz Mint. There is further reference in 1523 to a Johann Gronewalt in a delegation to Nürnberg, described as the Cologne mintmaster; this is assumed to be the same person. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) pp. 263, 266, 318.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_gryffen_riehl', 'Johann Gryffen', 'Appointed on 22 March 1463 as Warden in Burg Riehl, since 1888 a part of the city of Cologne in Germany, for the Archbishopric of Cologne. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 216.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_helmann_colonia_claudia_ara_agrippinensium', 'Johann Helmann', 'Johann Helmann was Assay Master from 1481 to 1506 and Mint Warden in Cologne in 1481. He was appointed on 5 April 1481 as Assayer in Rhiel, a city in Germany, for Trier, Jülich, Cologne and the Archbishopric of Cologne. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 17, 21, 22, 28, 47-49; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 494, p. 419.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_hittorff_bonn', 'Johann Hittorff', 'Mintmaster in Bonn, a city in Germany, from 1734 to 1738. He died on 7 August 1738. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 350.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_jacob_broich_bonn', 'Johann Jacob Broich', 'Mint warden in Bonn, a city in Germany, around 1762 (there is an undated hand-written application from Broich around this time). He was involved in the minting of both silver and copper coins. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 393.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_jacob_huels_colonia_claudia_ara_agrippinensium', 'Johann Jacob Hüls', 'Hüls was Mint Warden from 1720 to 1752 and General Warden from 1731 to 1752 in Cologne (City), Germany. Born in 1684, he died 28 September 1752. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 294, 321.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_jakob_wagner_stuttgart', 'Johann Jakob Wagner', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1681 to 1702. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 234', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_josef_hermanns_colonia_claudia_ara_agrippinensium', 'Johann Josef Hermanns', 'Appointed Mintmaster in Cologne (City), Germany, on 22 May 1713, a position he held until about 1722. Johann Josef (Josephus) Hermanns was baptised on 11 April 1688, and died at the end of 1722 or the beginning of 1723. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 279; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1707, p. 598.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_josef_langenberg_colonia_claudia_ara_agrippinensium', 'Johann Josef Langenberg', 'Appointed Mint Warden and General Mint Warden in Cologne (City), Germany, on 25 September 1752, positions that he held until shortly before his death. Langenberg was baptised on 7 October 1708 and was buried on 10 November 1772. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 321, 328; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1741, p. 612.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_kerber_stuttgart', 'Johann Kerber', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from ? to ca. 1620. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 126', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_kreidtfisch_neuss', 'Johann Kreidtfisch', 'Mintmaster in Neuss, Germany from 1568 to 1579. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_lamberts_colonia_claudia_ara_agrippinensium', 'Johann Lamberts', 'Appointed Die-cutter for Cologne Circle, Germany, on 10 March 1602, following the death of his father, Jacob Lamberts. Johann Lamberts died (before 5 May) in 1608. He was registered as Unverdienter in 1598. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 120, 140; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 166 p. 484.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_leonard_oexlein_(1715-1787)', 'Johann Leonard Oexlein', 'Medalist and die cutter in Nürnberg (Nuremberg), Franconia, Germany who lived from 1715 to 1787. His initials are OEXLEIN F, OEXLEIN, OE, I L OE. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_martin_foerster_nuremberg', 'Johann Martin Förster', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany, from 1755 to 1764. He uses IMF or F as a mintmark. Lit.: H.-J. and E. Kellner, Die Münzen der Reichsstadt Nürnberg (1991) p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_mayer_stuttgart', 'Johann Mayer', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1673 to 1681. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), pp. 210, 234', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_moerynck_colonia_claudia_ara_agrippinensium', 'Johann Moerynck', 'Appointed Mintmaster in Cologne (City), Germany, on 17 December 1475 and remained in this position until 1481. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 9, 20, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/j_p_longerich_bonn', 'Johann Peter Longerich', 'Mintmaster in Bonn, a city in Germany, from 1681 to 1688, possibly J(ohann) P(eter) Longerich. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 240, 427.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_peter_werner_nuremberg', 'Johann Peter Werner', 'Die cutter in Nürnberg (Nuremberg), Franconia, Germany active from ca. 1760 to ca. 1796. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_pfister_stuttgart', 'Johann Pfister', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany, mintmark I-P. Also active in Stuttgart-Berg. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127, 204', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_post_colonia_claudia_ara_agrippinensium', 'Johann Post', 'The Goldsmith and Silversmith Johann Post was appointed Mint Warden and General Warden for the Cologne Circle, Germany, on 18 July 1685, soon after Rodorff\'\'s death. His earliest appointment was noted as Citizen on 18 May 1663, and he died on 15 September 1702. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 224; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1571, pp. 546-548.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_reess_colonia_claudia_ara_agrippinensium', 'Johann Reeß', 'A cousin of Reiner Gronwalt, Johann Reeß was appointed Mintmaster for Cologne (City), Germany, in 1605. He died in office shortly before 8 October 1629. After his death Conrad Duisberg took his minting dies into safe keeping Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 121, 139, 162; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen – Köln, Walter de Gruyter, 1973, p. 462; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) p. 484.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_ruetgers_colonia_claudia_ara_agrippinensium', 'Johann Rütgers', 'Appointed Mintmaster for Cologne (City), Germany, on 17 February 1723, but resigned before 22 June in that year. There is a bowl made by Rütgers in the possession of the Evangelischen Gemeinde in Düren, dated 1733. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 296-297.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_schmidt_stuttgart', 'Johann Schmidt', 'Mint administrator in Stuttgart, Baden-Wuerttemberg, Germany from ? to 1622. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_schutz_colonia_claudia_ara_agrippinensium', 'Johann Schutz', 'Mint Warden in Cologne (City), Germany from 1493 to ?. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 24, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_valentin_vayh_stuttgart', 'Johann Valentin Vay', 'Mint administrator in Stuttgart, Baden-Wuerttemberg, Germany 1622. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_de_voss_stuttgart', 'Johann de Voss', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1609/10 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_von_eltmer_colonia_claudia_ara_agrippinensium', 'Johann von Eltmer', 'Appointed Mintmaster in Cologne (City), Germany, in April 1518. He died in 1548. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 52.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_von_homberg_colonia_claudia_ara_agrippinensium', 'Johann von Homberg', 'Mint Warden in Jülich (City), Germany, von Homberg was appointed Warden of the Cologne Circle on 3 April 1551. He is assumed to have died in 1566, as Johann von Worrigen took over the Wardenship in that year. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 73, 76.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_von_lomgrae_deutz', 'Johann von Lomgrae', 'Mint Official in Deutz, a city in Germany, in 1617 (in 1617 he signed a list of coins struck for the Archbishopric Cologne with \"Johann vom Lomgrae, churf. [kurfürstlicher] Wardein\". Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 151.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johann_von_worringen_colonia_claudia_ara_agrippinensium', 'Johann von Worringen', 'Mint Warden in Cologne (City), Germany from 11 April 1565, then 1566, von Worringen became General Warden of the Lower Rhine-Westphalia Circle, but resigned from this latter position on 14 May 1607. He died in January 1611. The earliest mention of von Worringen was in 1544 when he was shown as Unverdienter eingeschrieben. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 76, 141; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln, (1973) p. 462; n. 752, p. 442.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/john_hyrcanus_i_judaea', 'John Hyrcanus I', 'John Hyrcanus was a Hasmonean (Maccabean) leader and Jewish high priest of the 2nd century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/john_hyrcanus_ii_judaea', 'John Hyrcanus II', 'John Hyrcanus II (died 30 B.C.), a member of the Hasmonean dynasty, was for a long time the Jewish High Priest in the 1st century B.C.. He was also briefly King of Judea 67–66 B.C. and then the ethnarch (ruler) of Judea, probably over the period 47–40 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_tzimisces', 'John I Tzimiskes', 'The Byzantine emperor John I Tzimiskes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_i_trapezunt', 'John I of Trebizond', 'The emperor of Trebizond John I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_ii', 'John II Komnenos', 'The Byzantine emperor John II Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_ii_trapezunt', 'John II of Trebizond', 'The emperor of Trebizond John II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_iii', 'John III Doukas', 'The Byzantine emperor John III Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_iii_trapezunt', 'John III of Trebizond', 'The emperor of Trebizond John III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_iv', 'John IV Laskaris', 'The emperor of Nicaea John IV Laskaris.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_iv_trapezunt', 'John IV of Trebizond', 'The emperor of Trebizond John IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_thessalonica', 'John Komnenos Doukas', 'The emperor of Thessalonica John Komnenos Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_v', 'John V Palaiologos', 'The Byzantine emperor John V Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_vi', 'John VI Kantakouzenos', 'The Byzantine emperor John VI Kantakouzenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_vii', 'John VII Palaiologos', 'The Byzantine emperor John VII Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/johannes_viii', 'John VIII Palaiologos', 'The Byzantine emperor John VIII Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/josse_de_buisson', 'Josse de Buisson', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1597/98 to 1608/09. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jost_deutz', 'Jost', 'Jost (first name unknown) was appointed Warden for Deutz, a city in Germany, in 1579, working in collaboration with the Mintmaster Reiner Budels. (It is not known if this was Ernst Jost who in 1580 worked in the foundry of the niederrheinisch-westfälischen Kreise). Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 66.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jotapianus', 'Jotapianus', 'Roman imperial usurper of 249 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jovianus', 'Jovianus', 'The Roman emperor Jovianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jovinus', 'Jovinus', 'The Roman emperor Jovinus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/juba_i_numidia', 'Juba I', 'Juba I of Numidia was a king of Numidia (reigned 60–46 BC). He was the son and successor to Hiempsal II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/juba_ii_mauretania', 'Juba II', 'Juba II (48 BC – AD 23) was the son of Juba I and King of Numidia and Mauretania. His first wife was Cleopatra Selene II, daughter of the Greek Ptolemaic Queen Cleopatra VII of Egypt and Roman triumvir Mark Antony.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/judas_aristobulus_judaea', 'Judas Aristobulus', 'Judas (or Judah) Aristobulus I (also known as Aristobulus I) was the first Hasmonean King of Judaea from 104 B.C. until his death in 103 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/jugurtha', 'Jugurtha', 'Jugurtha or Jugurthen (ca. 160 – 104 BC) was a King of Numidia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_domna', 'Julia Domna', 'Julia Domna (170 AD –217 AD) was a member of the Severan dynasty of the Roman Empire. Empress and wife of Roman Emperor Lucius Septimius Severus and mother of Emperors Geta and Caracalla, Julia was among the most important women ever to exercise power behind the throne in the Roman Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_livilla', 'Julia Livilla', 'Julia Livilla (early AD 18 - late AD 41 or early AD 42) was the youngest child of Germanicus and Agrippina the Elder and the youngest sister of the Emperor Caligula.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_maesa', 'Julia Maesa', 'Sister of Julia Domna. Grandmother to Elagabalus and Severus Alexander.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_mamaea', 'Julia Mamaea', 'Julia Avita Mamaea (14 or 29 August after 180–235) was the second daughter of Julia Maesa, a powerful Roman woman of Syrian origin, and Syrian noble Gaius Julius Avitus Alexianus. She was a niece of empress Julia Domna; emperor Lucius Septimius Severus and sister of Julia Soaemias Bassiana. She was born and raised in Emesa (modern Homs, Syria).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_paula', 'Julia Paula', 'Wife of Elagabalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_soaemias', 'Julia Soaemias', 'Mother of Elagabalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_titi', 'Julia Titi', 'Flavia Julia Titi (13 September 64 – 91) was the daughter of the Emperor Titus from his second marriage to Marcia Furnilla. She became the mistress of the Emperor Domitian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julia_daughter_of_augustus', 'Julia the Elder', 'Julia the Elder (30 October 39 BC – AD 14), known as Julia Caesaris filia or Julia Augusti filia was the daughter and only biological child of Augustus, by his second wife, Scribonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sabinus_julianus', 'Julian of Pannonia', 'The Roman usurper Marcus Aurelius Sabinus Julianus, often referred to as Julian of Pannonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julian_the_apostate', 'Julian the Apostate', 'The Roman emperor Julian the Apostate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julius_caesar', 'Julius Caesar', 'Gaius Julius Caesar (July 100 BC – 15 March 44 BC) was a Roman general, statesman, Consul and Dictator Perpetuus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/julius_nepos', 'Julius Nepos', 'The Roman emperor Julius Nepos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/junadah_maysarah', 'Junadah b. (Maysarah?)', 'An official whose name appeared on glass weights of indeterminate origin (Umayyad or Abbasid).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/justin_i', 'Justin I', 'The Byzantine emperor Justin I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/justin_ii', 'Justin II', 'Justin II (Latin: Flavius Iustinus Iunior Augustus;[1] Ancient Greek: Φλάβιος Ἰουστίνος ὁ νεώτερος; c. 520 – 5 October 578) was Byzantine Emperor from 565 to 578.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/justinian_i', 'Justinian I', 'Justinian I (play /dʒʌˈstɪniən/) (Latin: Flavius Petrus Sabbatius Iustinianus Augustus, Greek: Φλάβιος Πέτρος Σαββάτιος Ἰουστινιανός) (c. 482 – 14 November 565), commonly known as Justinian the Great, was Byzantine Emperor from 527 to 565.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/justinian_ii', 'Justinian II', 'The Byzantine emperor Justinian II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/k_basileus_cyzicus', 'K... Basileus', 'Magistrate and Strategos in Cyzicus/Mysia during the reigns of Valerian I and Gallienus. His name and title appear on coins as CΤΡΑ ΒΑCΙΛΕΥC (SNG France Mysie no. 884), CΤΡΑ ΚΡΑ ΒΑCΙΛΕΥC (SNG Aulock no. 1251) or CΤΡΑ ΚΑ (sic) ΒΑCΙΛΕΥC (BMC Mysia p. 57 no. 273). There are also cases lacking the title of Strategos. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 404 s. v. Basileus (AD 253-268); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 98 s. v. Basileus (no. 5) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kafur', 'Kafur', 'Abu al-Misk Kafur (905–968), also called al-Laithi, al-Suri, al-Labi was a dominant personality of Ikhshidid Egypt and Syria.  Originally a black slave from Ethiopia, he was promoted as vizier of Egypt, becoming its de facto ruler from 946.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kalesikrates_abdera', 'Kalesikrates', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kalliades_athens', 'Kalliades', 'Third magistrate attested in Athens in 114/113 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 658, 660 / issue 51 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (114/113 BC); Prosopographia Attica 7779; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 245 s. v. Kalliades, no. 17; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 586 s. v. Kalliades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallianax_abdera', 'Kallianax', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallias_athens', 'Kallias', 'Third magistrate attested in Athens in 122/121 BC [issue 42]. Again attested as third magistrate in 121/120 BC [issue 43], later second magistrate in 118/117 BC [issue 47]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 497-500, nos. 518, 520, 522, and nos. 577, 580-595 / issues 42, 43 and 47 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (123/122, 122/121 and 118/117 BC); Prosopographia Attica 7820; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 245 s. v. Kallias, no. 62; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) pp. 586-587 s. v. Kallia- and Kallias (122/121 BC [issue 42] and 121/120 BC [issue 43]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallidamas_abdera', 'Kallidamas', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallikrates_maroneia', 'Kallikrates', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallikra_athens', 'Kallikrates', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 441-443, 459 / issue 39 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 7943; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 248 s. v. Kallikrates, no. 23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 587 s. v. Kallikra-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallikratides_athens', 'Kallikratides', 'Second magistrate attested in Athens in 73/72 BC. From Steiria: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1232-1233 / her issue 90 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (73/72 BC, his issue 92); Prosopographia Attica 7989; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 248 s. v. Kallikratides, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 588 s. v. Kallikratides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallimachos_ii_athens', 'Kallimachos', 'First magistrate attested in Athens in 63/62 BC. From Leukonoe. Belongs to the same family as his colleague Epikrates. Epimeletes in Delos (Habicht 1991, p. 16). See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1253-1254 / her issue 100 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 16 (63/62 BC, his issue 102); Prosopographia Attica 8021; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 249 s. v. Kallimachos, no. 62; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 588 s. v. Kallimachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallimachos_i_athens', 'Kallimachos', 'Second magistrate attested in Athens in 94/93 BC. Probably the Archon basileus in 100/99 BC who comes from Leukonoe. Also possibe is an origin from Philaidai; in this case it would be another Kallimachos, who had dedicated the statue of a priest of Athena in Eleusis (Habicht 1991, p. 11): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1032-1049 / issue 71 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 11 (94/93 BC); Prosopographia Attica 8000; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 249 s. v. Kallimachos, no. 61; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 588 s. v. Kallimachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kalliphon_ii_athens', 'Kalliphon', 'Second magistrate attested in Athens in 58/57 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1265-1267 / her issue 105 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (58/57 BC, his issue 107); Prosopographia Attica 8231; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 254 s. v. Kalliphon, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 590 s. v. Kalliphon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kalliphon_i_athens', 'Kalliphon', 'Third magistrate attested in Athens in 115/114 BC [issue 50]. Later attested as second magistrate in 108/107 BC [issue 57]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 633-635, 637 and nos. 729-732, 735-748 / issues 50 and 57 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (115/114 and 108/107 BC); Prosopographia Attica 8229; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 254 s. v. Kalliphon, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 590 s. v. Kalliphon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallistratos_abydus', 'Kallistratos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Kallistratos (49); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 590 s. v. ΚΑΛΛΙΣΤΡΑΤΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kallis_athens', 'Kallis…', 'Third magistrate attested in Athens in 119/118 BC [issue 46]. Again attested as third magistrate in 115/114 BC [issue 50]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 564-567 and nos. 637-640 / issues 46 and 50 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 and 115/114 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 589 s. v. Kallis-.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/kallitheos_athens', 'Kallitheos', 'Third magistrate attested in Athens in 94/93 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1045-1049 / issue 71 (p. 570); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (94/93 BC); Prosopographia Attica 7909; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 247 s. v. Kallitheos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 587 s. v. Kallitheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_i_elymais', 'Kamnaskires I', 'Kamnaskires I Soter was the first king of the Kamnaskirid Dynasty of Elymais, from 147 to 139 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_ii_elymais', 'Kamnaskires II', 'Kamnaskires II, surnamed Nikephoros (\"the Bringer of Victory\") was a king of the Elymais only known from his coins. He reigned from about 147 to 139 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_iii_elymais', 'Kamnaskires III', 'Kamnaskires III', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_iv_elymais', 'Kamnaskires IV', 'Kamnaskires IV (sometimes III) was a king of the Elymais, often depicted on coinage with his queen, Anzaze. Following the dating on his coins he reigned from about 82/81 BC to 75 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_ix_elymais', 'Kamnaskires IX', 'Kamnaskires IX (sometimes VIII) was king of Elymais AD 15-25.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_v_elymais', 'Kamnaskires V', 'Kamnaskires V (sometimes IV) was king of Elymais 73/2- c. 46 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_vi_elymais', 'Kamnaskires VI', 'Kamnaskires VI (sometimes V) was king of Elymais 46-28 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_vii_elymais', 'Kamnaskires VII', 'Kamnaskires VII (sometimes VI) was king of Elymais 28 BC - AD 1.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kamnaskires_viii_elymais', 'Kamnaskires VIII', 'Kamnaskires VIII (sometimes VII) was king of Elymais AD 1-15.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kinishka_kushan', 'Kanishka the Great', 'Kanishka I or Kanishka the Great, an emperor of the Kushan dynasty in the second century (c. 127–150 CE), is famous for his military, political, and spiritual achievements. A descendant of Kujula Kadphises, founder of the Kushan empire, Kanishka came to rule an empire in Bactria extending to Pataliputra on the Gangetic plain.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/canites_scythia', 'Kanites of Scythia', 'King of Scythia, c. 210-195 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/karaichos_athens', 'Karaichos', 'Magistrate in Athens. Third magistrate in 133/132 (issue 32), second magistrate in 131/130 (issue 34), and first magistrate in 121/120 BC (issue 44). Karaichos, son of Karaichos, the Epimeletes of Delos 132/122 BC (ID 1924, compare 1650). Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issues 32, 34 and 44; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 8-9 (121/120 BC); Prosopographia Attica no. 8252; H. B. Mattingly, Numismatic Chronicle 1997, p. 258 (124/123 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 593 (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/karibil_yehunim_wattar_himyar', 'Karib\'il Yehun\'im Wattar of Himyar', 'Ruler of the Himyarite kingdom in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/karl_seckler_stuttgart', 'Karl Seckler', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1587 to ?. Died in 1619. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kas(-)_mesembria', 'Kas(…)', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 998', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kaspar_cramer_colonia_claudia_ara_agrippinensium', 'Kaspar Cramer', 'Appointed Mintmaster in Cologne (City), Germany in 1652 on the death of his father Hermann Cramer, a position Kaspar Cramer held until his death in 1680. He was baptised on 26 March 1632. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 186, 221; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1623a, p. 564.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kaspar_diestler_stuttgart', 'Kaspar Distler', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1578 to 1595/96. Died that same year. Die cutter as of 1583. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87, 109.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kaspar_rave_colonia_claudia_ara_agrippinensium', 'Kaspar Rave', 'Mint Warden in Cologne (City), Germany from 1519 to 1531. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kaspar_scholl_stuttgart_stuttgart', 'Kaspar Scholl', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1501 to 1535. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 41', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kaspar_zurlahn_stuttgart', 'Kaspar zur Lahn (Zurlahn)', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from ca. 1638 to 1650. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 210', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kay_ka\'us_i', 'Kay Ka\'us I', 'Kaykaus I or Kayka\'us I or Keykavus I (Old Anatolian Turkish: كَیکاوس, Persian: عز الدين كيكاوس بن كيخسرو‎ ʿIzz ad-Dīn Kaykāwūs ibn Kaykhusraw) was the Sultan of Rum from 1211 until his death in 1220.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kay_ka\'us_ii', 'Kay Ka\'us II', 'Kaykaus II or Kayka\'us II (Persian: عز الدين كيكاوس بن كيخسرو‎, ʿIzz ad-Dīn Kaykāwūs bin Kaykhusraw) was the eldest of three sons of Kaykhusraw II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kay_khusraw_i', 'Kay Khusraw I', 'Kaykhusraw I (Old Anatolian Turkish: كَیخُسرو, Persian: غياث الدين كيخسرو بن قلج ارسلان‎, Ghiyāth ad-Dīn Kaykhusraw bin Qilij Arslān) was Seljuk Sultan of Rûm. He succeeded his father in 1192, but had to fight his brothers for control of the Sultanate. He ruled it 1192-1196 and 1205-1211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ka_athens', 'Ka…', 'Third magistrate attested on drachms and hemidrachms in Athens in 129/128 BC. KA... might be ΚΑ[ΛΛΙΦΩΝ]. The person then ist probably identical with Kalliphon, second and third magistrate in late 2nd. cent. BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 419-420 / issue 36, commentary on p. 571; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 BC); Prosopographia Attica 8229; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 583 s. v. Ka- with note 4.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kephalos_abydus', 'Kephalos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Kephalos (4); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 598 s. v. ΚΕΦΑΛΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kephisod_athens', 'Kephisod…', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 691-692, 694-695 / issue 53 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 599 s. v. Kephisod-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kha_lycia', 'Kha...', 'Dynast in the ancient region of Lycia from approximately 480–450 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M42', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khadritime_lycia', 'Khadritime', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M149', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khaejei_lycia', 'Khaejei', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 13', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khalil', 'Khalil', 'Al-Malik al-Ashraf Salāh al-Dīn Khalil ibn Qalawūn (Arabic: الملك الأشرف صلاح الدين خليل بن قلاوون‎) was the eighth Mamluk sultan of Egypt from 1290 until his assassination in December, 1293.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kherei_lycia', 'Kherei', 'Dynast in the ancient region of Lycia from approximately 430–410 BC. See O. Mørkholm and J. Zahle, ‘The Coinage of the Lycian Dynasts Kheriga, Kherêi and Erbbina. A Numismatic and Archaeological Study’, Acta Archaeologica 47 (1976), pp. 47-90', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kheriga_lycia', 'Kheriga', 'Dynast in the ancient region of Lycia from approximately 440–430 BC. See O. Mørkholm and J. Zahle, ‘The Coinage of the Lycian Dynasts Kheriga, Kherêi and Erbbina. A Numismatic and Archaeological Study’, Acta Archaeologica 47 (1976), pp. 47-90', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khinaka_lycia', 'Khinaka', 'Dynast in the ancient region of Lycia from approximately 470–440 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), IV, 67-8', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khor_lycia', 'Khor...', 'Dynast in the ancient region of Lycia from approximately 480–440 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M170', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khudayar_khan', 'Khudayar Khan', 'Sayid Muhammad Khudayar Khan, usually abbreviated to Khudayar Khan, was a Khan of Kokand who reigned between 1845 and 1875 with interruption.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khumarawayh', 'Khumarawayh', 'Abu \'l-Jaysh Khumarawayh ibn Ahmad ibn Tulun was the Tulunid ruler of Egypt and Syria between 270-282 AH/884-896 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khushqadam', 'Khushqadam', 'Khushqadam (865-872/1461-1467) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khusraw_i', 'Khusraw I', 'Khusraw I (also known as Chosroes I and Kisrā in classical sources; 501–579, most commonly known in Persian as Anushiruwān, was the King of Kings (Shahanshah) of the Sasanian Empire from 531 to 579. He was the successor of his father Kavadh I (488–531). Khosrow I was the twenty-second Sasanian Emperor of Persia, and one of its most celebrated emperors.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/khusraw_ii', 'Khusraw II', 'Khosrau II (Chosroes II in classical sources, entitled \"Aparvez\"; later garbled into Parviz), \"The Victorious\" – was the last great king of the Sasanian Empire, reigning from 590 to 628.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/king_william_iii', 'King William III (1849-1890)', 'William III (Dutch: Willem III; 4 November 1650 – 8 March 1702)[1] was sovereign Prince of Orange from birth,Stadtholder of Holland, Zeeland, Utrecht, Gelderland, and Overijssel in the Dutch Republic from 1672, and King of England, Ireland, and Scotland from 1689 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kis_perinthus', 'Kis(sos?)', 'An individual who issued coins at the ancient city of Perinthus, 357-338 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 34.; E. Babelon, Traité des monnaies grecques et romaines 2/4 (Paris, 1926), pp. 969-970 n. 1523.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/klean(-)_odessus', 'Klean(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 280-200 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1173', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/klearch_athens', 'Klearchos', 'Third magistrate attested in Athens in 128/127 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 421, 424 / issue 37 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 8477; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 263 s. v. Klearchos, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 611 s. v. Klearch-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleas_athens', 'Kleas', 'Second magistrate attested in Athens in 89/88 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1122-1123, 1125-1130 / her issue 74 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (89/88 BC, his issue 76); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 263 s. v. Kleas, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 611 s. v. Kleas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleber_jean-baptiste', 'Kleber, Jean-Baptiste (d.1800)', 'Jean Baptiste Kléber (9 March 1753 – 14 June 1800) was a French general during the French Revolutionary Wars.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleidamo_athens', 'Kleidamos', 'Three times attested as third magistrate in Athens, in 109/108 BC [issue 56], in 99/98 BC [issue 67], and in 93/92 BC [issue 72]. Most probably the same person in all three issues. From the tribe Antiochis. Belongs to the same family as Hermokles, second magistrate of issue 72 (Habicht 1991, p. 19): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 727, 733, nos. 937, 939-942, and nos. 1050-10531063 / issues 56, 67 and 72 with commentary on p. 571; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5-6, 19 and 22 (109/108, 98/97 and 93/92 BC); Prosopographia Attica 8489 and 8490; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 263 s. v. Kleidamos, no. 4; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 611 s. v. Klei- and Kleidamos (99/98 BC, issue 67).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleinatides_abdera', 'Kleinatides', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleoma_athens', 'Kleomachos', 'Third magistrate attested in Athens in 101/100 BC. The name is rare in Athens; during 2nd/1st century BC attested only once: Kleomachos, son of from Dion, from Perithoidai, ephebe in 102/101 BC (Habicht 1991, p. 22). In case of identical identity the magistrate would have been very young: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 833-835, 840, 837, 852 / issue 64 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 22 (101/100 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 265 s. v. Kleomachos, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 613 s. v. Kleoma-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleomen_athens', 'Kleomenes', 'Second magistrate attested in Athens in 113/112 BC. Early in the year he took the magistracy – after the death/disappearance of his predecessor Alkidamos (Habicht 1991, p. 9): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 673, 676-684 / issue 52 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); Prosopographia Attica 8592; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 266 s. v. Kleomenes, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 614 s. v. Kleomenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleom_priene', 'Kleom…', 'An individual who issued coins at the ancient city of Priene c. 330-300 BC. Regling completed: Kleomenes? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 613.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleon_athens', 'Kleon', 'Third magistrate attested in Athens in 134/133 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 366-368 / issue 31 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 267 s. v. Kleon, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) pp. 615-616 s. v. Kleon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleophanes_ii_athens', 'Kleophanes', 'First magistrate attested in Athens in 85/84 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1158-1164 / her issue 78 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (85/84 BC, his issue 80); Prosopographia Attica 8630; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 267 s. v. Kleophanes, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 614 s. v. Kleophanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleophanes_i_athens', 'Kleophanes', 'Second magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 758-776 / issue 59 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); Prosopographia Attica 8630; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 267 s. v. Kleophanes, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 614 s. v. Kleophanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleophan_athens', 'Kleophanes', 'Third magistrate attested in Athens in 127/126 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 430-432 / issue 38 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (127/126 BC); Prosopographia Attica 8629; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 267 s. v. Kleophanes, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 614 s. v. Kleophanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleopolis_maroneia', 'Kleopolis', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kleo_byzantium', 'Kleo…', 'An individual who issued coins at the ancient city of Byzantium, 5th-4th cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 131, nos. 954-978.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kle_athens', 'Kle….', 'Third magistrate attested in Athens in 124/123 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 530-532, 542 / issue 44 (p. 571); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 609 s. v. Kle- (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kointos_ii_athens', 'Kointos', 'First magistrate attested in Athens in 86/85 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1427-1728 (\"imitation\", therefore not listed under her regular issues, commentary on p. 464-467); O. Mørkholm, Museum Notes ANS 29, 1984, pp. 31-32; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (86/85 BC, his issue 79); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 618 s. v. Kointos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 618 s. v. Kointos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kointos_i_athens', 'Kointos', 'First magistrate attested in Athens in 89/88 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1122- 1123, 1135-1130 / her issue 74 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (89/88 BC, his issue 76); Prosopographia Attica 8688; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 269 s. v. Kointos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 618 s. v. Kointos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/konrad_baudistel_stuttgart', 'Konrad Baudistel (Bawebdistel)', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1556 to ?. Mint Warden there from 1560 to 1561. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/konrad_duisberg_colonia_claudia_ara_agrippinensium', 'Konrad Duisberg', 'Taken into service on 14 May 1607 by his father-in-law Johann von Worringen, the Goldsmith Konrad Duisberg (Duisburg) became Mint Warden in Cologne (City), Germany, in 1608 and General Warden in 1631. Born in 1570, he died 7 May 1643 [Scheffler has 1648?] Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 140, 185; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1154, p. 481.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/constantius_ducas', 'Konstantios Doukas', 'The Byzatine emperor Konstantios Doukas, son of Constantine X and brother of Michael VII.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kotys_mesembria', 'Kotys', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1033', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kraton_chios', 'Kraton', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2422', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kriton_athens', 'Kriton', 'Third magistrate attested in Athens in 110/109 BC [issue 55]. Again attested as third magistrate in 109/108 BC [issue 56], maybe again in 104/103 BC [issue 61]: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 260 nos. 717, 719, 721, p. 262-264 nos. 719, 721, 723-727, 722 (drachm), and nos. 795-798, 801-802, 800 and 810 (drachms) / issues 55, 56 and 61 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109, 109/108 and 104/103 BC); Prosopographia Attica 8818; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 274 s. v. Kriton, no. 8 (for issues 55 and 56); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 627 s. v. Kriton.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ktesi_athens', 'Ktesi…', 'First magistrate attested in Athens in 139/138 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 266-286 / issue 26 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (139/138 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 627 s. v. Ktesi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kubernis_lycia', 'Kubernis', 'Dynast in the ancient region of Lycia from approximately 500–480 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 1-3', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kuj-tegin_(\'adud_al-dawla)', 'Kuj-Tegin (\'Adud al-Dawla)', 'Kuj-Tegin (\'Adud al-Dawla) (418-423/1023-1032) was a ruling member of the Qarakhanid/Kara-Khanid Khanate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kujula_kadphises_kushan', 'Kujula Kadphises', 'Kujula Kadphises (40-90 CE according to Bopearachchi) was a Kushan prince who united the Yuezhi confederation during the 1st century A.D., and became the first Kushan emperor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kuprlli_lycia', 'Kuprlli', 'Dynast in the ancient region of Lycia from approximately 470–440 BC. See O. Mørkholm and J. Zahle, ‘The Coinage of Kuprlli. Numismatic and Archaeological Study’, Acta Archaeologica 43 (1972), pp. 57-113', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/kursa(-)_odessus', 'Kursa(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 280-200 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1175-1176', 'http://xmlns.com/foaf/0.1/Person'),
