('http://nomisma.org/id/l_iulius_apolinarios_adramyteum', 'L. Iulius Apolinarios', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Gordianus III. On some coins he is additionally named \"son of the asiarches\" (ΥΟΥ ΑΣΙΑΡΧΟΥ). See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 190, 213 f. nos. 131-132 and 136-138, p. 215 no. 139; pp. 235 f. nos. 254, 257-258 and 260; RPC VII 1, nos. 53-55 and 62-64; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 337 s. v. Apol(l)inarios; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 43 s. v. Apollinarios (no. 14).', 'http://xmlns.com/foaf/0.1/Person'),
