('http://nomisma.org/id/l_severus_mas_cyzicus', 'L. Severus Mas', 'Magistrate and Strategos in Cyzicus/Mysia during the reigns of Valerian I and Gallienus. His name appears on coins (with portraits of the emperor Gallienus, of Kore Soteira, or Heros Kyzikos) issued both with his title of Strategos and without. ΛΟΚΕ… or Λ ΟΚΕ… in SNG France Mysie no. 618 is misread, actually there is CΤΡΑ ΛΟΚ (sic) CЄΒΗΡΟ-Υ; an identification as \"Lucius\" or \"Lucilius\" therefore seems clear. Lit.: F. Imhoof-Blumer, Monnaies grecques (1883) p. 613 no. 171; BMC Mysia p. 58 no. 280; SNG Aulock no. 1250; SNG France Mysie nos. 614, 618, 870; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 645 s. v. Loke- and p. 800 s. v. Seberos (AD 253-268); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 402 s. v. Seoueros (no. 46) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mvrcvs_imp_rrc', 'L. Staius Murcus', 'Roman Republican Moneyer, c. 42 - 41 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_thorivs_balbvs_rrc', 'L. Thorius Balbus', 'Roman Republican Moneyer, c. 105 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_titvri_l_f_sabinvs_rrc', 'L. Titurius Sabinus', 'Roman Republican Moneyer, c. 89 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_trebani_rrc', 'L. Trebanius', 'Roman Republican Moneyer, c. 135 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_valerivs_aciscvlvs_rrc', 'L. Valerius Acisculus', 'Roman Republican Moneyer, c. 45 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_valerius_catullus', 'L. Valerius Catullus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_valeri_flacci_rrc', 'L. Valerius Flaccus', 'Roman Republican Moneyer, c. 108 - 107 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_vinci_rrc', 'L. Vinicius', 'Roman Republican Moneyer, c. 52 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_vinicius', 'L. Vinicius', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/l_vol_l_f_strab_rrc', 'L. Volumnius Strabo', 'Roman Republican Moneyer, c. 81 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lachares', 'Lachares', 'Lachares was one of the most influential leaders in Athens in the late 4th and early 3rd centuries B.C., after democracy had been re-established by Demetrius Poliorcetes. He was afterwards secretly gained over by Cassander, who incited him to aim at the acquisition of the tyranny, hoping to be able through his means to rule Athens.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laches_athens', 'Laches', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 824, 826-830 / issue 63 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 280 s. v. Laches, no. 21; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 637 s. v. Laches.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laelianus', 'Laelianus', 'Ulpius Cornelius Laelianus was a usurper against the Gallic Emperor Postumus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lain_athens', 'Laines', 'Third magistrate attested in Athens in 130/129 BC. Maybe grandson of Laines, author of comedies, from Dekeleia (Habicht 1991, p. 20): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 408, 411 / issue 35 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 20 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 278 s. v. Laines, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 634 s. v. Laines.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lajin', 'Lajin', 'Lachin (Arabic: لاجين) royal name: al-Malik al-Mansour Hossam ad-Din Lachin al-Mansuri (Arabic: الملك المنصور حسام الدين لاجين المنصورى was a Mamluk sultan of Egypt from 1297 to 1299.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lakon_priene', 'Lakon', 'An individual who issued coins at the ancient city of Priene c. 290-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 635.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lakon_odessus', 'Lakon', 'Magistrate attested on the Alexander coinage of Odessus, c. 125-70 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1193-1194', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lamios_athens', 'Lamios', 'Third magistrate attested in Athens in 114/113 BC [issue 51]. Again attested as third magistrate in 110/109 BC [issue 55]. From Rhamnous. Grammateus of the council in 112/111 BC (Habicht 1991, p. 21; H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 658, 660-663 and no. 717 / issues 51 and 55 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (114/113 and 110/109 BC); Prosopographia Attica 8984; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 279 s. v. Lamios, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 635 s. v. Lamios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lampines_abydus', 'Lampines', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Lampines (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 635 s. v. ΛΑΜΠΙΝΗΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lampis_priene', 'Lampis', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 635.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lampon_abydus', 'Lampon', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Lampon (11); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 636 s. v. ΛΑΜΠΩΝ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laodice_iv', 'Laodice IV', 'Laodice IV (flourished second half 3rd century BC and first half 2nd century BC) was a Greek Princess, Head Priestess and Queen of the Seleucid Empire. Antiochus III appointed Laodice in 193 BC, as the chief priestess of the state cult dedicated to her late mother Laodice III in Media. She later was married to three Kings of the Seleucid Empire, all her brothers.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laodice_v', 'Laodice V', 'Laodice V (flourished 2nd century BC, died 150 BC) was a Seleucid princess. Through marriage to Perseus king of Macedon she was a Queen of the ruling Antigonid dynasty in Macedonia and possibly later of the Seleucid dynasty. Laodice was a daughter of the Seleucid King Seleucus IV Philopator and his wife, Laodice IV. She had two brothers: Antiochus and Demetrius I Soter. She was born and raised in the Seleucid Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laodice_vi_pontus', 'Laodice VI of Pontus', 'Laodice VI was a Greek Seleucid princess and through marriage was a queen of the Kingdom of Pontus. She ruled jointly with her husband Mithradates V from 150 BC until his death in 120, when her regency extended from 116 to 113 B.C., when Mithradates VI was hailed as king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laodice_bactria', 'Laodice of Bactria', 'Laodice appears on Bactrian coinage in conjunction with Heliocles, and therefore she may be the mother of Eucratides I. However, the son of Eucratides, Heliocles, may also have married a princess by the name Laodice, possibly the grand-daughter of Antiochus III of Syria.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laodice_wife_of_mithradates_iv_pontus', 'Laodice, wife of Mithradates IV', 'Laodice (flourished 2nd century BC) was a Princess and Queen of the Kingdom of Pontus, married to her brother Mithridates IV of Pontus. Numismatic evidence makes it likely that Laodice was co-regent with Mithridates IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/larrey_dominique_jean', 'Larrey, Dominique Jean (d.1842)', 'Dominique Jean Larrey (French: [larɛ]', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lason_chios', 'Lason', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2435', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/laumos_chios', 'Laumos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2436', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/le_perinthus', 'Le(…)', 'An individual who issued coins at the ancient city of Perinthus, after 280 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 93, nos. 9-13.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leo_i', 'Leo I', 'The Roman emperor Leo I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leo_ii', 'Leo II', 'The Roman emperor Leo II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leo_iii', 'Leo III', 'The Byzantine emperor Leo III.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/leo_iv', 'Leo IV', 'The Byzantine emperor Leo IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leo_v', 'Leo V the Armenian', 'The Byzantine emperor Leo V the Armenian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leo_vi', 'Leo VI', 'The Byzantine emperor Leo VI.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leome_priene', 'Leome…', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Regling completed: Leomedon. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 641.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leon_dionysopolis_thrace', 'Leon', 'Magistrate attested on the Alexander coinage of Dionysopolis\', c. 225-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 959', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leon_athens', 'Leon', 'Third magistrate attested in Athens in 113/112 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 679-682 / issue 52 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); Prosopographia Attica 9102; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 283 s. v. Leon, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 642 s. v. Leon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leonides_athens', 'Leonides', 'Second magistrate attested in Athens in 65/64 BC. Probably from Melite (Habicht 1991, p. 16). Probably the same Leonides, who met Marcus Cicero, the younger: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1249 / her issue 98 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (65/64 BC, his issue 100); Prosopographia Attica 9123; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 283 s. v. Leonides, no. 34; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 643 s. v. Leonides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leonippos_abydus', 'Leonippos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Leonippos (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 643 s. v. ΛΕΩΝΙΠΠΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leontiskos_dionysopolis_thrace', 'Leontiskos', 'Magistrate attested on the Alexander coinage of \'Dionysopolis\', c. 225-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1991), no. 960', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leontius', 'Leontius', 'Leontius was a general of the Eastern Roman Empire and claimant to the throne who led a rebellion against emperor Zeno in 484–488. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leontome_athens', 'Leontomenes', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 453-454, 456-457 / issue 39 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 126/125 BC); Prosopographia Attica 9039; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 281 s. v. Leontomenes, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 639 s. v. Leontomenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lepidus_cyzicus', 'Lepidus', 'Strategos in Cyzicus/Mysia during the reign of Gordian III (post AD 241). His name appears on coins in combination with his title of Strategos: RPC VII-1 pp. 107, 109, 111 nos. 12-14, 29,1-29,2 (AD 241-244 following the marriage with Tranquillina). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 640 s. v. Lepidos (AD 241-244); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 266 s. v. Lepidos (no. 9) (AD 238-244); RPC VII-1 p. 107 (AD 241-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lepton_dardanus', 'Lepton', 'Magistrate attested in Dardanus in ca. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Lepton (1); SNG von Aulock 7593; Coll. Waddington 1131 (coin)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lesseps_ferdinand_de', 'Lesseps, Ferdinand de (d.1894)', 'Ferdinand Marie, Vicomte de Lesseps GCSI (French: [də lesɛps]; 19 November 1805 – 7 December 1894) was a French diplomat and later developer of the Suez Canal, which in 1869 joined the Mediterranean and Red Seas, substantially reducing sailing distances and times between the West and the East.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leucon_ii_bosporus', 'Leucon II', 'Leucon II of Bosporus, also known as Leuco, seems to have been the second son of Paerisades II and a Spartocid ruler of the Bosporan Kingdom in 240 BC due to his surviving coinage.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leukios_athens', 'Leukios', 'First magistrate attested in Athens in 77/76 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1227 / her issue 86 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 8 (77/76 BC, his issue 88); Prosopographia Attica 9053; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 281 s. v. Leukios, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 640 s. v. Leukios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leukoullos_abydus', 'Leukoullos', 'Local hero (?) attested on the coins of Abydos in c. 166-238 AD. Not in LGPN; not in Leschhorn LAGM.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/leu_athens', 'Leux…', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 828-830, 836 / issue 63 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 641 s. v. Leux-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/le_priene', 'Le…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 638 (Price 2237, 280-275 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/libius_severus', 'Libius Severus', 'The Roman emperor Libius Severus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/licinia_eudoxia', 'Licinia Eudoxia', 'Daughter of the Roman emperor Theodosius II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/licinius', 'Licinius', 'Licinius I (Latin: Gaius Valerius Licinianus Licinius Augustus (c. 263-325), was Roman Emperor from 308 to 324.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/licinius_ii', 'Licinius II', 'The Roman emperor Licinus II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lienhardt_sayler_stuttgart', 'Lienhardt Sayler', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany 1593. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lip(-)_priene', 'Lip(…)', 'Magistrate attested on the Alexander coinage of Priene, c. 280-275 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2231; K. Regling, Die Münzen von Priene (Berlin 1927) p. 39. 158 no. 38.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/livia', 'Livia', 'Livia Drusilla (30 January 58 BC– 28 September AD 29), after her formal adoption into the Julian family in AD 14 also known as Julia Augusta, was the wife of Augustus, the mother of Tiberius, grandmother of Claudius, great-grandmother of Caligula, and great-great-grandmother of Nero. She was deified by Claudius who acknowledged her title of Augusta.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/livineius_regulus', 'Livineius Regulus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lodovico_manin', 'Lodovico Manin (1789-1797)', 'Ludovico Manin (14 May 1725 – 24 October 1802) was the last Doge of Venice. He governed Venice from 9 March 1789 until 1797, when he was forced to abdicate by Napoleon Bonaparte.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lord_nelson', 'Lord Nelson (d.1805)', 'Horatio Nelson, 1st Viscount Nelson, KB (29 September 1758 – 21 October 1805) was a British flag officer in the Royal Navy.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/loredano_francesco', 'Loredano, Francesco (1752-1762)', 'Francesco Loredan (born Venice, 9 February 1685 – died there 19 May 1762) was a Venetian statesman of the Loredan family; he served as the 116th Doge of Venice from 18 March 1752 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/louis_ii_prince_de_dombes', 'Louis II, Prince de Dombes (1560-1582)', 'In 1561 Dombas was granted to Louis, duc de Montpensier, by whose descendants it was held till, in 1682. Louis II, Prince of Dombes was also known as Louis II de Bourbon-Montpensier.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/louis_phillipe', 'Louis Phillipe (1830 - 48)', 'Louis Philippe I (6 October 1773 – 26 August 1850) was King of the French from 1830 to 1848 as the leader of the Orléanist party.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/loukios_priene', 'Loukios', 'An individual who issued coins at the ancient city of Priene c. AD 222-235. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 647.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucilius_atyleus_adramyteum', 'Lucilius Atyleus', 'Strategos in Adramyteum (Mysia). His name appears on coins issued unter Marcus Aurelius. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 222 no. 176; RPC IV temp. no. 409; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 383 s. v. Atyleus; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 90 s. v. Atyleus (no. 1).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucilla', 'Lucilla', 'Annia Aurelia Galeria Lucilla or Lucilla (March 7, 148 or 150–182) was a daughter of Marcus Aurelius and Faustina the Younger and sister to Commodus. Commodus ordered Lucilla\'s execution after a failed assassination attempt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_aelius', 'Lucius Aelius', 'Lucius Aelius Caesar (January 13, 101 – January 1, 138) became the adopted son and intended successor, of Roman Emperor Hadrian (January 24, 76 AD – July 10, 138 AD), but never attained the throne. Aelius was born with the name Lucius Ceionius Commodus, and later called Lucius Aelius Caesar.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_aemilius_paullus', 'Lucius Aemilius Paullus Macedonicus', 'Lucius Aemilius Paullus Macedonicus (c. 229 BC – 160 BC). Cos. 182 and 168, victor over Perseus of Macedon at the Battle of Pydna in 168 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_antonius_pietas', 'Lucius Antonius Pietas', 'Roman Consul in 41 BC and brother to Marc Antony.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_aurelius_gallus_pira1517', 'Lucius Aurelius Gallus', 'Consul ordinarius AD 198. Legatus augusti pro praetore Moesiae inferioris c. AD 201 to c. 204. Appears on coins of Nikopolis ad Istrum and Markianopolis. Lit.: PIR² A 1517.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_caesar', 'Lucius Caesar', 'Lucius Julius Caesar (17 BC - 20 August AD 2), most commonly known as Lucius Caesar, was the second son of Marcus Vipsanius Agrippa and Julia the Elder.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_firmou_adramyteum', 'Lucius Firmou', 'Lucius, son of Firmos. Strategos in Adramyteum (Mysia). His name appears on coins issued under Septimius Severus, usually with the addition B (\"the younger\"), sometimes additionally with his father\'s name (ΤΟΥ ΦΙΡΜΟΥ). See H. von Fritze, Die antiken Münzen Mysiens (1913) p. 40 f. nos. 119-121; J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189. 214 nos. 133-135; p. 223 f. nos. 188 and 190-192; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 646 s. v. Loukios; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 271 s. v. Loukios (no. 100).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_iulius_faustinianus_piri304', 'Lucius Iulius Faustinianus', 'Legatus augusti pro praetore Mosiae inferioris c. AD 207-210. His name appears on coins of Markianopolis. Lit.: PIR² I 304.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_verus', 'Lucius Verus', 'Roman emperor from 8 March 161 – 169.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lucius_vitellius_pater', 'Lucius Vitellius Pater', 'Lucius Vitellius the Elder (before 5 BC - 51) was the youngest son of quaestor Publius Vitellius, and the father of Aulus Vitellius Germanicus (Emperor in 69).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ludwig_gronwalt_colonia_claudia_ara_agrippinensium', 'Ludwig Gronwalt', 'A Mintmaster in Dortmund. He was required to take up this same position in Cologne (City), Germany, on 1 September 1547. Gronwalt died in office in December 1574. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 69, 78.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lycceius_paeonia', 'Lycceius of Paeonia', 'Lycceios, Lycpeios or Lyppeios (Greek: Λύκκειος, Λύκπειος or Λύππειος; ruled 356–340 BC) was an ancient Paeonian king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lykisko_athens', 'Lykiskos', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 691, 693-694 / issue 53 (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 287 s. v. Lykiskos, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 650 s. v. Lykiskos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lyki_athens', 'Lyki…', 'Third magistrate attested in Athens in 125/124 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 465, 469-471, 473 / issue 40 (p. 572) (p. 572); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 649 s. v. Lyki-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lykos_byzantium', 'Lykos', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 144, n. 1205.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysago_iii_priene', 'Lysago…', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Regling completed: Lysagoras III. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 652.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysago_ii_priene', 'Lysago…', 'An individual who issued coins at the ancient city of Priene c. 290-250 BC. Regling completed: Lysagoras II. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 652.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysago_i_priene', 'Lysago…', 'An individual who issued coins at the ancient city of Priene c. 334-330 BC. Regling completed: Lysagoras I. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 652.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysan_athens', 'Lysan...', 'Magistrate in Athens in 127/126 BC (issue 38). Previously third magistrate in 135/134 BC (issue 30). Brother to Glaukos, with whom his name appears on coins in 127/126 BC. From the Demos Piraeus. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issues 30 and 38; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 8; Prosopographia Attica no. 9290.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysandros_i_athens', 'Lysandros', 'First magistrate attested in Athens in 82/81 BC. From Piraeus. Maybe son of Lysan[dros] (one of the third magistrates of 135/134 BC [Thompson issue 38], father of Lysandros (magistrate of the very last issue [Thompson issue 109]) (s. Habicht 1991, p. 13): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1179-1186 / her issue 81 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 (82/81 BC, his issue 83); Prosopographia Attica 9293; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 289 s. v. Lysandros, no. 40; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 652 s. v. Lysandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysandros_ii_athens', 'Lysandros', 'Second magistrate attested in Athens in 54/53 BC [last issue]. From Piraeus. Maybe Archon of 52/51 BC (Habicht 1991, p. 17) or son of Lysandros (first magistrate in 82/81 BC [Thompson issue 81] and grandson of Lysa[ndros] (one of the third magistrates in 135/134 BC [Thompson issue 38] (Habicht 1991, p. 13). Belongs to the same family as his colleague, the first magistrate Apolexis (cf. Habicht 1991, p. 17): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1272 / her issue 109 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (54/53 BC, his issue 111, last issue); Prosopographia Attica 9294; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 289 s. v. Lysandros, no. 41; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 654 s. v. Lysandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysandrus_amathus', 'Lysandros of Amathus', 'Lysandros was a king of Amathus, Cyprus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysani_athens', 'Lysanias', 'Third magistrate attested in Athens in 118/117 BC and again in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 581-584 / issue 47 nos. 600-603 / issue 48 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (118/117 resp. 117/116 BC); Prosopographia Attica 9301; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 289 s. v. Lysanias, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 652 s. v. Lysanias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysanias_i_chalcis', 'Lysanias I of Chalcis', 'Lysanias was the tetrarch of Chalcis and Iturea from 40-36 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysas_abydus', 'Lysas', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Lysas (4); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 653 s. v. ΛΥΣΑΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysia_athens', 'Lysias', 'Second magistrate attested in Athens in 145/144 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 158-169 / issue 20 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (145/144 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 290 s. v. Lysias, no. 27; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 653 s. v. Lysia-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysias_bactria', 'Lysias Anicetus', 'Lysias Anicetus was an Indo-Greek king who ruled 130-120 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysimach_athens', 'Lysimachos', 'Third magistrate attested in Athens in 93/92 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1060-1061, 1063-1066 / issue 72 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (93/92 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 292 s. v. Lysimachos, no. 23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 654 s. v. Lysimachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysimachus', 'Lysimachus', 'Lysimachus (Greek: Λυσίμαχος, Lysimachos; c. 360 BC – 281 BC) was a Macedonian officer and diadochus (i.e. \"successor\") of Alexander the Great, who became a basileus (\"King\") in 306 BC, ruling Thrace, Asia Minor and Macedon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysimen_athens', 'Lysimenes', 'Third magistrate attested in Athens in 110/109 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 709 / issue 55 (573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 293 s. v. Lysimenes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 654 s. v. Lysimenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/lysipp_athens', 'Lysippos', 'Third magistrate attested in Athens in 110/109 BC [issue 55]. Again attested as third magistrate in 106/105 BC [issue 59]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 709, 713-715, 722 and nos. 770-773 / issues 55 and 59 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 and 105/105 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 293 s. v. Lysippos, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 654 s. v. Lysippos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ly_cyzicus', 'Ly…', 'Possibly a magistrate in Cyzicus/Mysia in the 2nd/1st centuries BC. The abbreviation ΛΥ occurs on coins issued in Hellenistic times. See SNG Paris no. 456 (2nd-1st cent. BC). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 648 s. v. Ly- (local magistrate?, 2nd-1st cent. BC); O. Morkholm, ANSMN 28, 1983, pp. 89-90 instead supposes ΛΥ to be an abbreviation of a mint\'s officina.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_abdera', 'M(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
