('http://nomisma.org/id/m_aur_aristeides_cyzicus', 'M. Aurelius Aristeides', 'Strategos in Cyzicus/Mysia during the reign of Severus Alexander. His name appears on coins in combination with his title of Strategos (some of them pseudo-autonomous coins with portrait of the eponymous hero Cyzicus): RPC VI (online) Temp. nos. 3797-3799 (Severus Alexander, group II). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 355 s. v. Aristeides (AD 222-235?); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 62 s. v. Aristeides (no. 36) (AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_avreli_cota_rrc', 'M. Aurelius Cotta', 'Roman Republican Moneyer, c. 139 BC', 'http://xmlns.com/foaf/0.1/Person'),
