('http://nomisma.org/id/m_claudius_bassos_adramyteum', 'M. Claudius Bassos', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Hadrian. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 213 nos. 126, 129; p. 220 nos. 168-169; RPC III nos. 1669-1672; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 404 s. v. Bassos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 99 s. v. Bassos (no. 114).', 'http://xmlns.com/foaf/0.1/Person'),
