('http://nomisma.org/id/m_marci_mn_f_rrc', 'M. Marcius', 'Roman Republican Moneyer, c. 134 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_mettivs_rrc', 'M. Mettius', 'Roman Republican Moneyer, c. 44 BC', 'http://xmlns.com/foaf/0.1/Person'),
