('http://nomisma.org/id/m_plaetorivs_cest_rrc', 'M. Plaetorius Cestianus', 'Roman Republican Moneyer, c. 69 BC, 67 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_cato_rrc', 'M. Porcius Cato', 'Roman Republican Moneyer, c. 89 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_porc_laeca_rrc', 'M. Porcius Laeca', 'Roman Republican Moneyer, c. 125 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_poblici_leg_pro_pr_rrc', 'M. Publicius', 'Roman Republican Moneyer, c. 46 - 45 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_piso_m_f_frvgi_rrc', 'M. Pupius Piso', 'Roman Republican Moneyer, c. 61 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_salvius_otho', 'M. Salvius Otho', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_sanquinius', 'M. Sanquinius', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_sergi_silvs_q_rrc', 'M. Sergius Silus', 'Roman Republican Moneyer, c. 116 - 115 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_serveili_c_f_rrc', 'M. Servilius', 'Roman Republican Moneyer, c. 100 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_servilivs_leg_rrc', 'M. Servilius', 'Roman Republican Moneyer, c. 43 - 42 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_sila_rrc', 'M. Silanus', 'Roman Republican Moneyer, c. 116 - 115 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_statius_longinus_pirs631', 'M. Statius Longinus', 'Legatus Augusti pro praetore Moesiae inferioris under Macrinus and Diadumenianus in AD 217/218. His name appears on coins issued in Nikopolis. Lit.: A. Stein, Moesia (1940) p. 90; PIR S 631.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_titini_rrc', 'M. Titinius', 'Roman Republican Moneyer, c. 189 - 180 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_tvlli_rrc', 'M. Tullius', 'Roman Republican Moneyer, c. 120 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_valerivs_laevinvs_rrc', 'M. Valerius Laevinus', 'Roman Republican Moneyer, c. 211 - 210 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/messal_f_rrc', 'M. Valerius Messalla', 'Roman Republican Moneyer, c. 53 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_vargv_rrc', 'M. Vargunteius', 'Roman Republican Moneyer, c. 130 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ver_rrc', 'M. Ver[gilius]', 'Roman Republican Moneyer, c. 86 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_voltei_m_f_rrc', 'M. Volteius', 'Roman Republican Moneyer, c. 78 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/macrianus_major', 'Macrianus Major', 'Usurper during the reign of the Emperor Gallienus. Died AD 261.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/macrianus_minor', 'Macrianus Minor', 'Usurper during the reign of the Emperor Gallienus. Died AD 261.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/macrinus', 'Macrinus', 'Roman emperor from 217 to 218.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maec_nep_pirm43', 'Maec(ius) Nepos/Nepotianus', 'Legatus Augusti pro praetore during the reign of the emperor Hadrian. He appears as Presbeutes and Antistrategos on coins of Perinthus and Bizye. Lit.: E. Schönert-Geiss, Die Münzprägung von Perinthos (1965) 153; Y. Youroukova, Die Münzprägung von Bizye (1981) 9. 50; B. E. Thomasson, Laterculi Praesidum I (1984) 163-164 no. 18; ibid., I Addendum (2011) 22:018; PIR² M 43 (reads Maecilius Nepos); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (Wien, 2009) p. 706.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maga_characene', 'Maga of Characene', 'Maga was a King of Characene a vassal state of the Parthian Empire. He probably ruled at the end of the second century (195-210AD) and is known only from numerous coins that he minted.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magas_athens', 'Magas', 'Second magistrate attested in Athens in 114/113 BC. Probably from Marathon. Evidence for this name is rare in Athens, only one person is known: Magas, father of Megallis, who donated a dedication for the Egyptian deities (Habicht 1991, p. 9): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 948-668 / issue 51 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9 (114/113 BC); Prosopographia Attica 9650; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 295 s. v. Magas (under Athens, no particular deme), no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 655 s. v. Magas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magas_cyrene', 'Magas, governor of Cyrene', 'Governor of Cyrenaica under Ptolemy I of Egypt. He subsequently rebelled against Ptolemy II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magnentius', 'Magnentius', 'The Roman emperor magnentius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magnetes', 'Magnetes', 'The Magnetes, a people in Thessaly. Head (1911) assigns their coins to the mint of Demetrias in Thessaly.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magnia_urbica', 'Magnia Urbica', 'The wife of the Roman emperor Carinus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/magnus_maximus', 'Magnus Maximus', 'The Roman emperor Magnus Maximus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mahmud', 'Mahmud', 'Yamīn-ud-Dawla Abul-Qāṣim Maḥmūd ibn Sebüktegīn (Persian: یمین‌الدوله ابوالقاسم محمود بن سبکتگین‎), more commonly known as Mahmud of Ghazni (محمود غزنوی), also known asMahmūd-i Zābulī (محمود زابلی), was the most prominent ruler of the Ghaznavid Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mahmud_i', 'Mahmud I', 'Mahmud I (Ottoman Turkish: محمود اول, Turkish: ) was the Sultan of the Ottoman Empire from 1730 to 1754.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mahmud_ii_adli', 'Mahmud II Adli', 'Mahmud II (Ottoman Turkish: محمود ثانى Mahmud-u sānī, محمود عدلى Mahmud-u Âdlî) (Turkish: II. Mahmud)  was the 30th Sultan of the Ottoman Empire from 1808 until his death in 1839.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/majorian', 'Majorian', 'The Roman emperor Majorian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/malichus_i_nabataea', 'Malichus I of Nabataea', 'Malichus I or Malchos I was a king of Nabataea who reigned from 59 to 30 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/malichus_ii_nabataea', 'Malichus II of Nabataea', 'Malichus II was ruler of Nabatea from 40 to 70 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/malik_ibn_dalham', 'Malik ibn Dalham', 'Malik ibn Dalham (192-193/808) was an Abbasid governor of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/malla_khan', 'Malla Khan', 'Malla Khan (1275-1278/1858-1862) was a ruling member of the Khans of Khoqand.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mancir_i_mithra_persis', 'Mancir I Mithra of Persis', 'Mancir I Mithra ruler of Persis under Parthia in the late 1st to early 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mancir_ii_persis', 'Mancir II Mithra of Persis', 'Mancir II Mithra ruler of Persis under Parthia in the 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mancir_iii_persis', 'Mancir III Mithra of Persis', 'Mancir III ruler of Persis under Parthia in the 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mancir_iv_persis', 'Mancir IV Mithra of Persis', 'Mancir IV Mithra ruler of Persis under Parthia in the 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mandron_abdera', 'Mandron', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mandronax_abdera', 'Mandronax', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manlia_scantilla', 'Manlia Scantilla', 'Manlia Scantilla (fl. 193) was Roman Empress as wife to the Roman Emperor Didius Julianus. She was the mother of Didia Clara.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manlius_acilius_aviola_pira49', 'Manlius Acilius C. f. Aviola', 'Consul ordinarius in AD 54, proconsul in Asia in AD 65/66. Lit.: PIR² A 49; G. R. Stumpf, Numismatische Studien zur Chronologie der römischen Statthalter in Kleinasien (122 v. Chr.-163 n. Chr.) (1991) p. 180.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mannus_ix_osroene', 'Mannus IX of Osroene', 'Mannus IX was son of Abgarus VIII of Osroene, seated in Esessa. He was depicted on the coinage of his father, though he never seemed to have ruled Osroene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mannus_viii_osroene', 'Mannus VIII of Osroene', 'Mannus VIII was installed on the throne of Edessa in the Kingdom of Osroene by the Romans following the defeat of Vologases IV of Parthia ca. 165.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manoitimos_chios', 'Manoitimos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2441', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mansur_i_ibn_nuh_i', 'Mansur I ibn Nuh I', 'Abu Salih Mansur was amir of the Samanids (961–976).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mansur_ii_ibn_nuh_ii', 'Mansur II ibn Nuh II', 'Abu\'l-Harith Mansur II (Persian: منصور دوم سامانی‎) was amir of the Samanids (997–999).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_thessalonica', 'Manuel Doukas', 'The emperor of Thessalonica Manuel Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_i', 'Manuel I Komnenos', 'The Byzantine emperor Manuel I Komnenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_i_trapezunt', 'Manuel I of Trebizond', 'The emperor of Trebizond Manuel I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_ii', 'Manuel II Palaiologos', 'The Byzantine emperor Manuel II Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_ii_trapezunt', 'Manuel II of Trebizond', 'The emperor of Trebizond Manuel II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/manuel_iii_trapezunt', 'Manuel III of Trebizond', 'The emperor of Trebizond Manuel III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mar_silbannacus', 'Mar. Silbannacus', 'Mar. Silbannacus was a usurper in the Roman Empire during the time of Philip the Arab (244-249), or between the fall of Aemilianus and the rise to power of Valerian I (253).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maraios_priene', 'Maraios', 'An individual who issued coins at the ancient city of Priene c. 90-50 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 660.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marc-antoine_garnier_bonn', 'Marc-Antoine Garnier', 'In a contract dated 16 August 1721, the entire Bonn Mint was leased out to the French (or Walloon) speaking Marc-Antoine Garnier and Antoine Lourdet. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 326.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_claudius_marcellus', 'Marcellus', 'Marcus Claudius Marcellus (42 BC – 23 BC) was the eldest son of Augustus\'s sister Octavia Minor and husband of Augustus\' only daughter, Julia the Elder. Until his death he was widely regarded as Augustus\' potential successor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcian', 'Marcian', 'The Roman emperor Marcian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marciana', 'Marciana', 'Ulpia Marciana (August 15 and 30 48 – 112/114) was the elder sister of Roman Emperor Trajan. She was the eldest child born to the Spanish Roman senator Marcus Ulpius Traianus and his wife Marcia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcius_clau_agrippa_pirm224', 'Marcius Claudius Agrippa', 'Legatus Augusti pro praetore Moesiae inferioris under Macrinus and Diadumenianus from April AD 217 to May AD 218. His name appears on coins of Nikopolis. Lit.: A. Stein, Moesia (1940) p. 91; PIR² M 224 = PIR² C 775 [Clau(dius) Agrippa].', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_ambibulus', 'Marcus Ambibulus', 'Roman Procurator of Judaea, AD 9–AD13.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_antonius_antyllus', 'Marcus Antonius Antyllus', 'Son of Marc Antony and his wife Fulvia. Born 47, executed 30 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_antonius_zeno_pira883', 'Marcus Antonius Zeno', 'Legatus Augusti pro praetore in Thrace c. AD 142-144. Consul suffectus in AD 148. His name appears on coins of Philippopolis and Perinthos partially with the title of Presbeutes, and in Nikopolis as Hegemon. Lit.: PIR² A 883; B. E. Thomasson, Laterculi Praesidum I (1984) 164 no. 21; ibid., Addenda I (2011) no. 22:021.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_aurelius', 'Marcus Aurelius', 'Roman emperor from 7 March 161 to 17 March 180.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_licinius_crassus', 'Marcus Licinius Crassus', 'Marcus Licinius Crassus (c. 112 BC – 6 May 53 BC) was a Roman general and politician who played a key role in the transformation of the Roman Republic into the Roman Empire. He was triumvir with Caesar and Pompey, and died in 53 BC during his failed invasion of Parthia at Carrhae.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/m_pont_sabinus_pirp822', 'Marcus Pontius Sabinus', 'Legatus Augusti pro praetore provinciae Thraciae. Appears with title of hegemon on coins from Philippopolis in Thrace during the reign of Antoninus Pius (AD 138-161) between AD 145 and 153. Consul suffectus in AD 153. Later, in AD 159/160 he was administering Moesia superior. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) pp. 164-165 no. 23; PIR VI² (1998) no. 822 s. v. Pontius; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 796.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marcus_ulpius_traianus', 'Marcus Ulpius Traianus', 'Marcus Ulpius Traianus Maior (c. 30 – before 100) was a Roman senator. He was father of the Roman Emperor Trajan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maria_theresa', 'Maria Theresa', 'Maria Theresa Walburga Amalia Christina (reigned 1740-1780) was the only Queen regnant of the Habsburg dominions and the last of the House of Habsburg. She was the sovereign of Austria, Hungary, Croatia, Bohemia, Mantua, Milan, Lodomeria and Galicia, the Austrian Netherlands and Parma. By marriage, she was Duchess of Lorraine, Grand Duchess of Tuscany and Holy Roman Empress.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maria_bagrationi', 'Maria of Alania', 'The wife of the Byzantine emperors Michael VII and Nikephoros III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/marius', 'Marius', 'Marius is the second emperor of the so-called \"Gallic Empire\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mark_antony', 'Mark Antony', 'Marcus Antonius, commonly known in English as Mark Antony (January 14, 83 BC – August 1, 30 BC), a Roman politician and general. He was an important supporter of Julius Caesar. After Caesar\'s assassination, Antony formed an official political alliance with Octavian and Lepidus (the Second Triumvirate).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/markianos_adramyteum', 'Markianos', 'Strategos in Adramyteum (Mysia). His name appears on coins issued under Caracalla, c. 205-217 AD. Sometimes the name is complemented by \"B\" (\"the younger\"), sometimes a monogramm \"TO B\" (\"strategos for the second time\") refers to his office. See H. von Fritze, Die antiken Münzen Mysien (1913) p. 47-50 nos. 139-142, 145-149; J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 216 f. no. 148; p. 217 f. nos. 149-154; p. 226 no. 202; p. 227 f. nos. 213-216; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 661 s. v. Markianos; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 283 s. v. Markianos (no. 65).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/martina', 'Martina', 'The wife of the Byzantine emperor Heraclius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sextus_martinianus', 'Martinianus', 'The Roman emperor [Sextus] Mar(cius?) Martinianus. Made Augustus by Licinius I in July 324.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/masinissa_numidia', 'Masinissa', 'Masinissa was the first King of Numidia. During his younger years, before he was king, he fought in the Second Punic War (218–201 BC), first against the Romans as an ally of Carthage and later switching sides (206 BC). With Roman support, he united the eastern and western Numidian tribes and founded the Kingdom of Numidia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mastanesosus_mauretania', 'Mastanesosus of Mauretania', 'Mastanesosus, or Sosus, was a king of Mauretania from ca. 80 - 49 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/masud_i', 'Masud I', 'Mas\'ud I of Ghazni (Persian: مسعود غزنوی‎), known as Amīr-i Shahīd (امیر شهید; \"the martyr king\"), was sultan of the Ghaznavid Empire from 1030 to 1040.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/matidia', 'Matidia', 'Salonina Matidia (4 July 68 – 23 December 119) was the daughter of Ulpia Marciana and Gaius Salonius Matidius Patruinus. She was the niece of the Emperor Trajan. Her daughter Vibia Sabina married the Emperor Hadrian. Matidia died in AD 119 and was deified by Hadrian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mat_rrc', 'Matienus', 'Roman Republican Moneyer, c. 179 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/matrikon_byzantium', 'Matrikon', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), pp. 144-146, nos.1200-1204, 1229-1232, 1242-1243.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/matris_byzantium', 'Matris', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 133, nos. 997-1000.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/matthias_distler_stuttgart', 'Matthias Distler', 'Mint Warden in Stuttgart and Stuttgart-Berg, Baden-Wuerttemberg, Germany from 1616 to 1635. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/maues_saka', 'Maues', 'Maues was the first Indo-Scythian king, ruling from 98/85 to 60/57 B.C. He invaded India and established Saka hegemony by conquering Indo-Greek territories. Maues issued joint coins mentioning a queen Machene (\"ΜΑΧΗΝΗ\"). Machene may have been a daughter of one of the Indo-Greek houses. An Indo-Greek king, Artemidoros, also issued coins where he describes himself as \"Son of Maues\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mauricius', 'Maurice', 'The Byzantine emperor Maurice.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maurice', 'Mauricius Tiberius (582-602)', 'Maurice (Latin: Flavius Mauricius Tiberius Augustus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mausolus_caria', 'Mausolus of Caria', 'Mausolus (Greek: Μαύσωλος or Μαύσσωλλος; Carian: ?????? Mauśoλ “very dear”) was a ruler of Caria (377–353 BC), nominally a satrap of the Achaemenid Empire. He enjoyed the status of king or dynast by virtue of the powerful position created by his father Hecatomnus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maxentius', 'Maxentius', 'The Roman emperor Maxentius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maximian', 'Maximian', 'Maximian (Latin: Marcus Aurelius Valerius Maximianus Herculius Augustus; c. 250 – c. July 310) was Roman Emperor from 286 to 305.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maximinus_daia', 'Maximinus Daia', 'The Roman emperor Maximinus Daia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maximinus_thrax', 'Maximinus Thrax', 'The Roman emperor Maximinus Thrax.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gaius_julius_verus_maximus', 'Maximus', 'Gaius Julius Verus Maximus (217/220 – April 238), also incorrectly called Gaius Julius Verus Maximinus or Maximinus the Younger was the son of the Roman Emperor Maximinus Thrax and his wife, Caecilia Paulina.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/maximus_barcelona', 'Maximus of Barcelona', 'Maximus, the Roman usurper (409 - 411) in Hispania.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mazaces_satrap', 'Mazaces', 'Mazaces, also Mazakes (Aramaic: MZDK), was the last Achaemenid satrap of ancient Egypt during the late reign of Darius III of the 31st Dynasty of Egypt. Mazaces succeeded Sabaces after the latter\'s death at the battle of Issus (333 BCE). His office lasted less than a year, until Alexander the Great invaded Egypt in late 332 BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mazaeus_satrap', 'Mazaeus', 'Satrap in Cilicia, Transeuphratene and Babylonia under first the Achaemenids and then Alexander the Great.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/medeios_athens', 'Medeios', 'Second magistrate attested in Athens in 61/60 BC [Thompson issue 102]. Again attested as second magistrate in 55/54 BC [Thompson issue 108]. From Piraeus. Eponymous Archon in Athens in c. 65 BC (or sightly earlier). Belongs to the same family as his colleague Diokles Meli... (Habicht 1991, p. 17): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1259-1262 and no. 1271 / her issues 102 and 108 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 17 (61/60 and 55/54 BC, his issues 104 and 110); Prosopographia Attica 10099; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 310 s. v. Medeios, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 679 s. v. Medeios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mega_abdera', 'Mega(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/megakles_maroneia', 'Megakles', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mehmed_(muhammad)_ali', 'Mehmed (Muhammad) Ali', 'Muhammad Ali Pasha al-Mas\'ud ibn Agha (Ottoman Turkish: محمد علی پاشا المسعود بن آغا; Arabic: محمد علي باشا‎ / ALA-LC: Muḥammad ‘Alī Bāshā; Albanian: Mehmet Ali Pasha; Turkish: Kavalalı Mehmet Ali Paşa) was an Ottoman Albanian commander in the Ottoman army, who became Wāli, and ruler of Egypt and Sudan with the Ottomans\' temporary approval.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mehmed_ii_fatih', 'Mehmed II Fatih', 'Mehmed II (Ottoman Turkish: محمد ثانى, Meḥmed-i s̠ānī; Turkish: II. Mehmet Turkish pronunciation: [ˈmeh.met]; also known as el-Fātiḥ, الفاتح, \"the Conqueror\" in Ottoman Turkish; in modern Turkish, Fatih Sultan Mehmet Han, was an Ottoman sultan who ruled first for a short time from August 1444 to September 1446, and later from February 1451 to May 1481.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mehmed_iii', 'Mehmed III', 'Mehmed III Adli (Ottoman Turkish: محمد ثالث Meḥmed-i sālis, Turkish: III.Mehmed) was sultan of the Ottoman Empire from 1595 until his death in 1603.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mehmed_iv_avci', 'Mehmed IV Avci', 'Mehmed IV Modern Turkish Mehmet (Ottoman Turkish: محمد رابع Meḥmed-i rābi‘; also known as Avcı Mehmed, Mehmed the Hunter) was the Sultan of the Ottoman Empire from 1648 to 1687.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mehmed_v_resad', 'Mehmed V Resad', 'Mehmed V Reshad (Ottoman Turkish: محمد خامس Meḥmed-i ẖâmis, Turkish: Mehmed V Reşad or Reşat Mehmet) was the 35th Ottoman Sultan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meidi_abdera', 'Meidi(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meidon_athens', 'Meidon', 'Third magistrate attested in Athens in 122/121 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 497-499 / issue 42 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (123/122 BC); Prosopographia Attica 9735; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 300 s. v. Meidon, no. 2; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 668 s. v. Meidon (122/121 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meister_daniel_colonia_claudia_ara_agrippinensium', 'Meister Daniel', 'Die cutter in Cologne, Germany from 1567 to ca. 1575. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) p. 104.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meister_michael_colonia_claudia_ara_agrippinensium', 'Meister Michael', 'General Warden for Cologne Circle, Germany, from 1511 to 1520. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/melanippos_i_abdera', 'Melanippos (I)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/melanippos_ii_abdera', 'Melanippos (II)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/melchior_kistel_stuttgart', 'Melchior Kistel', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1566 to 1568. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/melchior_scherer_stuttgart', 'Melchior Scher(r)er', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1559 to 1560. Died in 1568. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meleager_macedon', 'Meleager of Macedon', 'Meleager of Macedon was the brother of Ptolemy Ceraunus and son of Ptolemy I Soter and Eurydice. Meleager ruled as King of Macedon during 279 BC for two months until he was compelled by his Macedonian troops to resign his crown.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/melekiathon_citium', 'Melekiathon of Citium', 'Early fourth century Phoenician king of Citium.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mena_perinthus', 'Mena(…)', 'An individual who issued coins at the ancient city of Perinthus, after 280 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), pp. 93-94, nos. 15-19.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menander_i_bactria', 'Menander I of Bactria', 'Menander I Soter was an Indo-Greek King of the Indo-Greek Kingdom (165/155 –130 BC) who administered a large empire in the Northwestern regions of the Indian Subcontinent from his capital at Sagala. Menander is noted for having become a patron of Buddhism.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menander_ii_bactria', 'Menander II of Bactria', 'Menander II Dikaios was an Indo-Greek King who ruled in the areas of Arachosia and Gandhara ca. 90-85 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mena_athens', 'Menandros', 'Third magistrate attested in Athens in 124/123 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 527-529 / issue 44 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); Prosopographia Attica 9860; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 304 s. v. Menandros, no. 18; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 671 s. v. Menandros (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menan_athens', 'Menandros', 'Third magistrate attested in Athens in 134/133 BC [issue 31]. Again attested as third magistrate in 131/130 BC [issue 34]. He is to seperate from ΜΕΝΑΝΔΡΟΣ, another third magistrate of the same name [issue 31] (following Thompson 1961, p. 573 and LGPN): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 364, 369 and nos. 399-400 / issues 31 and 34 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 and 131/130 BC); Prosopographia Attica 9860; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 304 s. v. Menandros, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 671 s. v. Menandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menandros_athens', 'Menandros', 'Third magistrate attested in Athens in 134/133 BC. He is to seperate from MENAN[dros], another third magistrate of the same name [issue 31] (following Thompson 1961, p. 573 and LGPN): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 364-365 / issue 31 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 BC); Prosopographia Attica 9860; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 304 s. v. Menendros, no. 15; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 671 s. v. Menandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mened_athens', 'Mened...', 'Magistrate in Athens in 135/134 BC (issue 30). Presumably previously third magistrate in 136/135 BC [Thompson (1961 p. 573 and issue 29] and again third magistrate [ibid. p. 573 and issue 38] in 127/126 BC. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 30 (and 29, 38); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5; Prosopographia Attica no. 9889.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menedemos_athens', 'Menedemos', 'First magistrate attested in Athens in 69/68 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1241-1244 / her issue 94 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (69/68 BC, his issue 96); Prosopographia Attica 9891; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 305 s. v. Menedemos, no. 15; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 672 s. v. Menedemos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menedemoms_abydus', 'Menedemos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Menedemos (26); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 672 s. v. ΜΕΝΕΔΗΜΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menekl_priene', 'Menekl…', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Regling completed: Menekles. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 673.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menekr_byzantium', 'Menekr...', 'Moneyer attested on the coinage of Byzantium in Thrace, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 145, nos. 1226-1228.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menekrates_chios', 'Menekrates', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2426', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menek_byzantium', 'Menek…', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 145, nos. 1226-1228.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menelaos_cyzicus', 'Menelaos', 'Strategos in Cyzicus/Mysia during the reign of Severus Alexander. His name appears on coins in combination with his title of Strategos: RPC VI (online) Temp. no. 3800 (time of Severus Alexander, group II). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 675 s. v. Menelaos (AD 222-235); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 297 s. v. Menelaos (no. 38 probably = no. 37) (AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menelaus_salamis', 'Menelaos of Cyprus', 'Menelaus (Greek: Μενέλαος, Menelaos), son of Lagus and brother of Ptolemy I Soter (ruler of Egypt), served as priest of the eponymous state cult of Alexander, and was for a time king in Cyprus, under his brother. He issued coins, apparently as a king, at Salamis.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menelaos_cyprus', 'Menelaos, governor of Cyprus', 'Governor of Cyrpus under Ptolemy (I) of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menes_abydus', 'Menes', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Menes (12); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 676 s. v. ΜΕΝΗΣ.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menesippos_abydus', 'Menesippos', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Menesippos (2); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 676 s. v. ΜΕΝΕΣΙΠΠΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mene_athens', 'Mene…', 'Third magistrate attested in Athens in 99/98 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 935, 937 / issue 67 (p. 573); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (98/97 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 672 s. v. Mene- (99/98 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menis_abydus', 'Menis', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Menis (19); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 680 s. v. ΜΗΝΙΣ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meniskos_byzantium', 'Meniskos', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), pp. 133, 142, 146, nos. 979-995, 1154-1166, 1234.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menneas_athens', 'Menneas', 'First magistrate attested in Athens in 68/67 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1245 / her issue 95 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15 (68/67 BC, his issue 97); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) pp. 308-309 s. v. Menneas, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 677 s. v. Menneas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mennon_athens', 'Mennon', 'Third magistrate attested in Athens in 110/109 BC. Spelling with \"NN\" may be a die-cutter\'s mistake: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 713-714 / issue 55, commentary on p. 574; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 309 s. v. Menon, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 678 s. v. Menon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menod_priene', 'Menod…', 'An individual who issued coins at the ancient city of Priene c. 290-240 BC. Regling completed: Menodotos or Menodoros. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 680.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menoi_athens', 'Menoites', 'Third magistrate attested in Athens in 117/116 BC. Eponymous Archon of the same year 117/116 BC (H. B. Mattingly, JHS 91, 1971, p. 88; idem, NC 157, 1997, p. 259 and Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 597-598, 600-601 / issue 48 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (117/116 BC); Prosopographia Attica 10057; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 309 s. v. Menoites, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 677 s. v. Menoi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menoitios_abydus', 'Menoitios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Menoitios (5); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 677 s. v. ΜΕΝΟΙΤΙΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mentor_i_priene', 'Ment[or]', 'An individual who issued coins at the ancient city of Priene c. 290-240 BC. Regling completed: Mentor I. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 678.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mentor_ii_priene', 'Mentor', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 678.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mentor_athens', 'Mentor', 'First magistrate attested in Athens in 84/83 BC [Thompson issue 79]. Then attested as second magistrate in the period 83/82-72/71 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1165-1172 / her issue 79 (p. 574); M. Caramessini-Oeconomides – F. S. Kleiner, RBNum 121, 1975, pp. 16-18 (Mnasagoras and Mentor-issue); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (84/83 BC, his issue 81) and p. 2 note 2 (period of Mnasagoras and Mentor-issue); Prosopographia Attica 10060; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 309 s. v. Mentor, no. 2 ; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 678 s. v. Mentor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mentor_abydus', 'Mentor', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Mentor (23); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 678 s. v. ΜΕΝΤΩΡ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/meredates_characene', 'Meredates of Characene', 'Meredates was a Parthian prince who ruled the state of Characene, a vassal of the Parthian Empire and important trading port, which he ruled from 131 to 150/151.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/messallina', 'Messalina', 'Valeria Messalina, sometimes spelled Messallina, (c. 17/20–48) was the third wife of the Emperor Claudius. She was also a cousin of Nero, second cousin of Caligula, and great-grandniece of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/messalla', 'Messalla', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/met_maroneia', 'Met(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/methen_perinthus', 'Methen(…)', 'An individual who issued coins at the ancient city of Perinthus, after 280 BC. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 93, n. 14.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/methrophon_maroneia', 'Methrophon', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodoros_maroneia', 'Metrodoros', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodoros_athens', 'Metrodoros', 'First magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 629-647 / issue 50 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 10138; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 312 s. v. Metrodoros, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. Metrodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodo_athens', 'Metrodoros', 'Third magistrate attested in Athens in 128/127 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 425-427 / issue 37 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 10138; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 312 s. v. Metrodoros, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. Metrodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodoros_i_abydus', 'Metrodoros (I)', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Metrodoros (574); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. ΜΗΤΡΟΔΩΡΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodoros_ii_abydus', 'Metrodoros (II)', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Metrodoros (575); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. ΜΗΤΡΟΔΩΡΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrodotos_maroneia', 'Metrodotos', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metron_maroneia', 'Metron', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrophanes_i_maroneia', 'Metrophanes (I)', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrophanes_ii_maroneia', 'Metrophanes (II)', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metrophon_maroneia', 'Metrophon', 'An individual who issued coins at the ancient city of Maroneia, 436/435-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 26, 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metro_athens', 'Metro…', 'Three times attested as third magistrate in Athens, in 126/125 BC [issue 39], in 122/121 BC [issue 42], and in 119/118 BC [issue 46]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 450-454, nos. 494-496, and nos. 566-569 / issues 39, 42 and 46 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125, 123/122 and 119/118 BC); H. B. Matingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. Metro- (122/121 BC, issue 42).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metro_di_athens', 'Metro… Di…', 'Third magistrate attested in Athens in 126/125 BC. Additional ΔΙ to seperates this person from the other ΜΕΤΡΟ..., who signed as third magistrate of issue 39 as well, it may have functioned as mark of origin (deme Diomeia) or as patronymic: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 451-452, 454 / issue 39, commentary on p. 574; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 10138; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 684 s. v. Metro-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/metr_athens', 'Metr…', 'Third magistrate attested in Athens in 113/112 BC. See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 673, 677-680 / issue 52 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 683 s. v. Metr-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/met_athens', 'Met…', 'Third magistrate attested in Athens in 102/101 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 824-829 / issue 63 (p. 574); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (102/101 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 683 s. v. Met-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_i', 'Michael I Rangabe', 'The Byzantine Michael I Rangabe.', 'http://xmlns.com/foaf/0.1/Person'),
