('http://nomisma.org/id/michael_ii_epirus', 'Michael II Komnenos Doukas', 'The emperor of Epiros Michael II Komnenos Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_iii', 'Michael III', 'The Byzantine emperor Michael III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_iv', 'Michael IV the Paphlagonian', 'The Byzantine emperor Michael IV the Paphlagonian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_ix', 'Michael IX Palaiologos', 'The Byzantine emperor Michael IX Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
