('http://nomisma.org/id/michael_vi', 'Michael VI Bringas', 'The Byzantine emperor Michael VI Bringas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_vii', 'Michael VII Doukas', 'The Byzantine emperor Michael VII Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_viii', 'Michael VIII Palaiologos', 'The Byzantine emperor Michael VIII Palaiologos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/michael_trapezunt', 'Michael of Trebizond', 'The emperor of Trebizond Michael.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/micipsa_numidia', 'Micipsa of Numidia', 'Micipsa was the eldest legitimate son of Masinissa, the King of Numidia, a Berber kingdom in North Africa. Micipsa became the King of Numidia in 148 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mika\'il_ibn_ja\'far', 'Mika\'il ibn Ja\'far', 'Mika\'il ibn Ja\'far (306/919) was one of the Volga Bulgaria, or Volga–Kama Bulghar, which was a historic Bulgar state that existed between the seventh and thirteenth centuries around the confluence of the Volga and Kama rivers, in what is now European Russia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mikion_athens', 'Mikion', 'First magistrate attested in Athens in 137/136 BC [issue 28] and in 123/122 BC [issue 41]. From Kephisia as his colleague Theophra[stos], the second magistrate of issue 28 (Habicht 1991, p. 7). Brother of his colleague Eurykleides of issue 41 (Habicht 1991, p. 8): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 315-329 and nos. 475-493 / issues 28 and 41 (p. 574 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 8 (137/136 and 124/123 BC); Prosopographia Attica 10186 and 10187; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 314 s. v. Mikion, no. 21; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 688 s. v. Mikion (123/122, issue 41).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/milesios_abydus', 'Milesios', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Milesios (6); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 689 s. v. ΜΙΛΗΣΙΟΣ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/miltiades_byzantium', 'Miltiad(es)', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 135, n. 1014.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/miltiades_athens', 'Miltiades', 'Second magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 629-647 / issue 50 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 10208; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 314 s. v. Miltiades, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 689 s. v. Miltiades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mineus_paphus', 'Mineus of Paphos', 'Fifith century king of Paphos in Cyprus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_i_bosporus', 'Mithradates I of Bosporus', 'Mithridates I of the Bosporus sometimes known as Mithridates II of the Bosporus and Mithridates of Pergamon (flourished 1st century BC), was a nobleman from Anatolia. Mithridates was one of the sons born to King Mithridates VI of Pontus from his mistress, the Galatian Princess Adobogiona the Elder.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_i_commagene', 'Mithradates I of Commagene', 'Mithridates I Callinicus was a king of Orontid Armenian descent who lived during the late 2nd century BC and early 1st century BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_i_parthia', 'Mithradates I of Parthia', 'Mithridates I, also known as Mithridates I the Great, was king of the Parthian Empire from 171 BC to 132 BC. During his reign, Parthia was transformed from a small kingdom into a major political power in the Ancient East as a result of his conquests.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_ii_commagene', 'Mithradates II of Commagene', 'Mithridates II Antiochus Epiphanes Philorhomaeus Philhellen Monocrite, also known as Mithridates II of Commagene, was a man of Armenian and Greek descent who lived in the 1st century BC. He was a prince of Commagene and one of the sons of King Antiochus I Theos of Commagene and Queen Isias Philostorgos of Commagene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_ii_parthia', 'Mithradates II of Parthia', 'Mithridates II was king of the Parthian Empire from 124 to 91 BC. He was known as \"Mithridates the Great\" in antiquity. He was the first Arsacid monarch to regularly use the title \"King of Kings\", thus stressing the association of the ruling Parthian dynasty with the Persian Achaemenid Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_ii_pontus', 'Mithradates II of Pontus', 'Mithridates II, third king of Pontus and son of Ariobarzanes, whom he succeeded on the throne.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_iii_commagene', 'Mithradates III of Commagene', 'Mithridates III Antiochus Epiphanes was a prince who served as a King of Commagene from 20-12 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_iii_parthia', 'Mithradates III of Parthia', 'Mithridates III was king of the Parthian Empire. He may have usurped the throne from Orodes I and ruled from 87-80 B.C. (Assar, Gholamreza F. (2006). A Revised Parthian Chronology of the Period 91-55 BC.). Older scholarship places him as the successor to Phraates III and fighting his brother, Orodes II, and ruling from 57-54 B.C. (now attributed to Mithradates IV).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_iii_pontus', 'Mithradates III of Pontus', 'Mithridates III was the fourth King of Pontus, son of Mithridates II of Pontus and Laodice. Mithridates had two sisters: Laodice III, the first wife of the Seleucid King Antiochus III the Great, and Laodice of Pontus. He may have ruled in an uncertain period between 220 BC and 183 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_iv_parthia', 'Mithradates IV of Parthia', 'Mithridates IV was a Parthian king from to 57 to 54 BC. He was the son and successor of Phraates III (r. 69–57 BC). Mithridates IV\'s reign was marked by a dynastic struggle with his younger brother, Orodes II. See also older attributions of Mithradates III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_iv_pontus', 'Mithradates IV of Pontus', 'Mithridates IV of Pontus, sometimes known by his full name Mithridates Philopator Philadelphus, was a prince and sixth ruler of the Kingdom of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_v_pontus', 'Mithradates V of Pontus', 'Mithridates V Euergetes also known as Mithridates V of Pontus, Mithradates V of Pontus and Mithradates V Euergetes, was a Prince and seventh king of the Kingdom of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithradates_vi_pontus', 'Mithradates VI', 'As son of Mithradates V and Laodice VI he was born c. 134 BC in Sinope. From c. 120 until his death in 63 BC he ruled the Pontic kingdom. Because of his growing influence in Asia Minor he came in conflict with Rome, and as a consequence the balance of power in the Eastern Mediterranean was newly defined by the three \"Mithradatic wars\". In the course of these wars he issued rich currency. Also he is attested as first magistrate in Athens in 87/86 BC, explicitly identified as the Pontic king by the addition ΒΑΣΙΛΕ(υς): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1143-1146 / her issue 76 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 12 (87/86 BC, his issue 78); Prosopographia Attica 10186 and 10187; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 687 s. v. Mithradates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mithrapata_lycia', 'Mithrapata', 'Dynast in the ancient region of Lycia from approximately 390–370 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M224-8', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_acilivs_iii_vir_rrc', 'Mn. Acilius', 'Roman Republican Moneyer, c. 49 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_acili_balbvs_rrc', 'Mn. Acilius Balbus', 'Roman Republican Moneyer, c. 125 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_aemilio_l_e_p_rrc', 'Mn. Aemilius Lepidus', 'Roman Republican Moneyer, c. 114 - 113 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_aqvil_rrc', 'Mn. Aquillius', 'Roman Republican Moneyer, c. 109 - 108 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_aqvil_mn_f_mn_n_rrc', 'Mn. Aquillius', 'Roman Republican Moneyer, c. 71 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_cordivs_rvfvs_iiivir_rrc', 'Mn. Cordius Rufus', 'Roman Republican Moneyer, c. 46 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_fontei_rrc', 'Mn. Fonteius', 'Roman Republican Moneyer, c. 108 - 107 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mn_fontei_c_f_rrc', 'Mn. Fonteius', 'Roman Republican Moneyer, c. 85 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mnasagoras_athens', 'Mnasagoras', 'First magistrate attested in Athens in a period of 83/82-72/71 BC. Then attested as second magistrate in 71/70 BC [Thompson issue 92]. From Ikarion. Belongs to the same family as his colleague Dionysios, the first magistrate in 71/70 BC (Habicht 1991, p. 14). Maybe identical with the second magistrate of issue 69 (following Caramessini-Oeconomides – Kleiner 1975, p. 17, against LGPN where two different persons were listed): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1236 / her issue 92 (p. 575); M. Caramessini-Oeconomides – F. S. Kleiner, RBNum 121, pp. 1975, pp. 16-18 (Mnasagoras and Mentor-issue); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (84/83 BC, his issue 81) and ibid. p. 2 note 2 (period of the Mnasagoras and Mentor-issue); ibid. p. 6 and 14 (71/70 BC, his issue 94); Prosopographia Attica 10227; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 315 s. v. Mnasagoras, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 691 s. v. Mnasagoras.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mnasago_athens', 'Mnasagoras', 'Second magistrate attested in Athens in 96/95 BC. Probably member of a family from Ikarion (Habicht 1991, pp. 11 and 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 990-1015 / issue 69 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6, 11 and 18 (96/95 BC); Prosopographia Attica 10227; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 315 s. v. Mnasagoras, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 691 s. v. Mnasagoras.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mnaseas_athens', 'Mnaseas', 'First magistrate attested in Athens in 91/90 BC [Thompson issue 77]. Then attested as second magistrate in 79/78 BC [Thompson issue 84]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1147-1157 and nos. 1205-1221 / her issues 77 and 84 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (91/90 and 79/78 BC, his issues 74 and 86); Prosopographia Attica 10228; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 315 s. v. Mnaseas, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 691 s. v. Mnaseas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mnasik_athens', 'Mnasikles', 'Third magistrate attested in Athens in 134/133 BC. Herold of the Areopagos in 128/127 BC (H. B. Mattingly, NC 157, 1997, p. 258): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 361-363 / issue 31 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 BC); Prosopographia Attica 10235; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 315 s. v. Mnasikles, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 691 s. v. Mnasikles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mnesar_athens', 'Mnesarchos', 'Third magistrate attested in Athens in 119/118 BC. ΜΝΗΣΑΡ might be Mnesarchos or Mnesarchides (cf. LGPN): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 569571, 573-577 / issue 46 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 316 s. v. Mnesarchos, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 692 s. v. Mnesar-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mo-_amathus', 'Mo- of Amathus', 'Mo- was a ruler (of uncertain name) of Amathus, Cyprus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mocenigo_alvise_i', 'Mocenigo, Alvise I (1570-1577)', 'Alvise I Mocenigo (26 October 1507 – 4 June 1577) was doge of Venice from 1570 to 1577.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mocenigo_alvise__iv', 'Mocenigo, Alvise IV (1763-1778)', 'Alvise Giovanni Mocenigo (1701–1778) was doge of Venice from 1763 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/modius_terventinus_pirm671', 'Modius Terventinus', 'Procurator equestris. He was Legatus Augusti pro praetore in Moesia inferior under Alexander Severus, c. AD 225-229 AD. His name apppears on coins in Marcianopolis inferior under Severus Alexander, Iulia Mamaea, and Iulia Maesa. he is also labbeled Hegemon on some coins. As praefectus vehiculorum and together with others he dedicated a statue of Roma to the emperor Caracalla. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 143 no. 127 (Um(brius?) Tereventinus, coins with portraits of Severus Alexander and Iulia Maesa, c. 222-226 AD); PIR² V 880 (VM[---] TEREVENTINVS = Modius Tereventinus); PIR² M 671 (Modius Terventinus); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 838 s. v. Terebentios (AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molon', 'Molon', 'Molon was appointed Seleucid strategos (military governor) of Media by Antiochus III in 223 BC, but a year later revolted along with his brother Alexander, the strategos of Persis, and a dynast of Media Atropatene. Molon claimed the title of king and ruled Media, Persis, and Babylonia as a breakaway kingdom from 222 BC to 220 BC. When Antiochus III at last defeated him in 220 BC, Molon and his brother commited suicide.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molpagores_i_abdera', 'Molpagores (I)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molpagores_ii_abdera', 'Molpagores (II)', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molpas_abdera', 'Molpas', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molpas_abydus', 'Molpas', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Molpas (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 694 s. v. ΜΟΛΠΑΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/molpo_maroneia', 'Molpo(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/monge_gaspard', 'Monge, Gaspard (d. 1818)', 'Gaspard Monge, Comte de Péluse (9 May 1746[1] – 28 July 1818) was a French mathematician, the inventor ofdescriptive geometry (the mathematical basis of technical drawing), and the father of differential geometry.[2]', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/monunius_illyria', 'Monunius of Illyria', 'Monunius (Ancient Greek: Μονούνιος; ruled c. 290 – c. 270 BC) was an Illyrian king of Dardania. As a figure, Monunius has left more archaeological traces than historical records. Monunius was a strong opponent of Macedonia but offered aid of 10,000 soldiers to Ptolemy Keraunos during the Gallic Invasions, which was refused. The Dardanian State while headed by Monunius ranked among the strongest in the Balkans at that time. The invasions of the Gauls through the Balkans did not affect the Dardanians as much as the Macedonians.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mormottos_assus', 'Mormottos', 'Magistrate attested on the Alexander coinage of Assos, c. 188-160 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1610', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/morosini_francesco', 'Morosini, Francesco (1688-1694)', 'Francesco Morosini (26 February 1619 – 16 January 1694) was the Doge of Venice from 1688 to 1694, at the height of theGreat Turkish War.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/morphilig_sophene', 'Morphilig of Sophene', 'Morphilig, son of Zariadres, may have been king of Sophene from 150-148 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/moschion_i_priene', 'Moschi[on]', 'An individual who issued coins at the ancient city of Priene c. 290-240 BC. Regling completed: Moschion I. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 697.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/moschion_ii_priene', 'Moschion', 'An individual who issued coins at the ancient city of Priene c. 244-249 AD. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 697.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/moschion_ii_athens', 'Moschion', 'Second magistrate attested in Athens in 84/83 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1165-1172 / her issue 79 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (84/83 BC, his issue 81); Prosopographia Attica 10434; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 320 s. v. Moschion, no. 21; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 696 s. v. Moschion.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/moschion_i_athens', 'Moschion', 'Third magistrate attested in Athens in 107/106 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 754-755 / issue 58 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 BC); Prosopographia Attica 10434; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 320 s. v. Moschion, no. 17; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 696 s. v. Moschion.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/moschi_athens', 'Moschi…', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 441-445 / issue 39 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 10433; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 320 s. v. Moschion, no. 14; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 696 s. v. Moschi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mosses_macedon', 'Mosses of Macedon', 'Mosses was perhaps a king of the Edoni or the Bisaltae in Macedon. He is only attested by his coinage, ca. 500-480 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mostis_caeni', 'Mostis', 'Mostis (Ancient Greek: Μόστις, reigned ~ 130 BC - ~ 90 BC). King of the Caeni ruled over territories in South East Thrace - Strandzha mountain in today Bulgaria and Turkey.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mousag_athens', 'Mousagenes', 'Third magistrate attested in Athens in 106/105 BC. Ephebe in 119/118 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 772-775 / issue 59 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 321 s. v. Mousagenes, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 698 s. v. Mousagenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mousai_athens', 'Mousaios', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 616, 618 / issue 49 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 321 s. v. Mousaios, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 698 s. v. Mousaios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mu\'ayyad_mamluks', 'Mu\'ayyad', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mu\'izz_al-dawlah_abu_al-husayn_ahmad', 'Mu\'izz al-Dawlah Abu al-Husayn Ahmad', 'Ahmad ibn Buya (Persian: احمد بن بویه), after 945 better known by his laqab of Mu\'izz al-Dawla (Arabic: المعز الدولة الحمداني‎, \"Fortifier of the Dynasty\"), was the first of the Buyid emirs of Iraq, ruling from 945 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mu\'izz_al-din_mahmud', 'Mu\'izz al-Din Mahmud', 'Mu\'izz ad-Din Mahmud was the Zengid Emir of Jazira 1208–1241.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mubahil_dhu-raydan_qataban', 'Mubahil Dhu-Raydan of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhabil_dhu-raydan', 'Muhabil dhu-Raydan', 'First century B.C. king of the Himyarites.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_mamluks', 'Muhammad (Mamluks)', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ahmad_al-mahdi', 'Muhammad Ahmad al-Mahdi', 'Muhammad Ahmad bin Abd Allah (Arabic: محمد أحمد ابن عبد الله) (August 12, 1844 – June 22, 1885) was a religious leader of the Samaniyya order in Sudan who, on June 29, 1881, proclaimed himself the Mahdi (or Madhi), the messianic redeemer of the Islamic faith.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_i', 'Muhammad I', 'Muhammad I (Arabic: محمد بن عبد الرحمن الأوسط‎) (823–886) was the Umayyad emir of Córdoba from 852 to 886 in the Al-Andalus (Moorish Iberia).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_iii_ibn_abd_allah', 'Muhammad III ibn Abd Allah', 'Mohammed Ben Abdellah al-Khatib (Arabic: محمد الثالث بن عبد الله الخطيب‎) was Sultan of Morocco from 1757 to 1790 under the Alaouite dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_iv', 'Muhammad IV', 'Moulay Muhammad ibn Abd al-Rahman, also known as Muhammad IV  (Arabic: محمد الرابع‎) was the Sultan of Morocco from 1859 to 1873.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_karim_khan', 'Muhammad Karim Khan', 'Karim Khan Zand (Persian:کریم خان زند), was the founder of the Zand Dynasty, ruling from 1751 to 1779. He ruled all of Iran except for Khorasan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_khan', 'Muhammad Khan', 'Muhammad Khan (died July 1338) was a claimant to the throne of the Ilkhanate. He was a great-grandson of Mengu Timur, who was a son of Hulegu.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_khan_ibn_ali', 'Muhammad Khan ibn Ali', 'Muhammad Khan ibn Ali (c.400-c.411/c.1009-c.1021) was a ruling member of the Qarakhanid/Kara Khanid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_mirza_shah', 'Muhammad Mirza Shah', 'Mohammad Shah Qajar (born Mohammad Mirza, Persian: محمد شاه قاجار‎) was king of Persia from the Qajar dynasty (23 October 1834 – 5 September 1848).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_al-\'awdi', 'Muhammad al-\'Awdi', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_al-baba', 'Muhammad al-Baba', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_sa\'id', 'Muhammad ibn Sa\'id', 'Muhammad ibn Sa\'id (152-157/769-773) was an Abbasid governor of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_safwan', 'Muhammad ibn Safwan', 'Muhammad ibn Safwan (275-276/889-890) was a member of the Uqaylids who declared his independence for a brief period, 275-276/889-890.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_shahin', 'Muhammad ibn Shahin', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_sulyaman', 'Muhammad ibn Sulyaman', 'Muhammad ibn Sulyaman (159-61/775-778) was a Muslim official in the Abbasud period whose name appears on Islamic glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_tughj_al-ikhshid', 'Muhammad ibn Tughj al-Ikhshid', 'Abū Bakr Muḥammad ibn Ṭughj ibn Juff ibn Yiltakīn ibn Fūrān ibn Fūrī ibn Khāqān, better known by the title al-Ikhshīd (Arabic: آلإخشي‎) after 939, was an Abbasid commander and governor who became the autonomous ruler of Egypt and parts of Syria from 935 until his death in 946.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_abd_al-habib_al-kasadi', 'Muhammad ibn `Abd al-Habib al-Kasadi', 'Muhammad ibn `Abd al-Habib al-Kasadi was the fifth ruler of the al-Kasadi dynasty, from August 1842 to 25 April 1851.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_al-ash\'ath', 'Muhammad ibn al-Ash\'ath', 'Muhammad ibn al-Ash\'ath al-Khuza\'i was an early Abbasid follower and later governor in Iran, Egypt and Ifriqiya for the Abbasid Caliphate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_ibn_al-fath_al-shakir_lillah', 'Muhammad ibn al-Fath al-Shakir lillah', 'Muhammad ibn al-Fath al-Shakir lillah( 321-347/933-958) was one of the Midrarid dynasty under whom the city was able to assert its independence, freeing itself from the Abbasid Caliphate as early as 771.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muhammad_governor_of_al-iraq_and_north_persia', 'Muhammad, Governor of al-Iraq and North Persia', 'Muhammad, Governor of al-Iraq and North Persia (846-855/1442-1451) was a Timurid governor in Shiraz.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muizz_al-din_muhammad_ibn_sam', 'Muizz al-Din Muhammad ibn Sam', 'Mu\'izz ad-Din Muhammad (Persian: معزالدوله الدین محمد‎), also known as Muhammad of Ghor, was Sultan of the Ghurid Empire along with his brother Ghiyath ad-Din Muhammad from 1173 to 1202, and as the supreme ruler of the Ghurid Empire from 1202 to 1206.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mumahhid_al-dawlah_abu_mansur_sa\'id_ibn_marwan', 'Mumahhid al-Dawlah Abu Mansur Sa\'id ibn Marwan', 'Mumahhid al-Dawlah Abu Mansur Sa\'id ibn Marwan (387-401/997-1011) was the third ruler of the Marwanids, (990–1085), which was an Arab or Kurdish dynasty in the Diyar Bakr region of Upper Mesopotamia and Armenia, centered on the city of Amid (Diyarbakır).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/murad_ii', 'Murad II', 'Murad II Kodja (Ottoman Turkish: مراد ثانى Murād-ı sānī, Turkish:II. Murat) was the Sultan of the Ottoman Empire from 1421 to 1451 (except for a period from 1444 to 1446 when his son Mehmed II reigned).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/murad_iii', 'Murad III', 'Murad III (Ottoman Turkish: مراد ثالث Murād-i sālis, Turkish:III.Murat) was the Sultan of the Ottoman Empire from 1574 until his death in 1595.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/murad_iv', 'Murad IV', 'Murad IV (Ottoman Turkish: مراد رابع Murād-ı Rābi‘) was the Sultan of the Ottoman Empire from 1623 to 1640, known both for restoring the authority of the state and for the brutality of his methods.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/murad_v', 'Murad V', 'Murad V (Ottoman Turkish: مراد خامس) was the 33rd Sultan of the Ottoman Empire who reigned from 30 May to 31 August 1876.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/musa_ibn_abi_al-\'abbas', 'Musa ibn Abi al-\'Abbas', 'Musa ibn Abi al-\'Abbas ( 219-224/834-838) was an Abbasid official whose name appeared on Islamic glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/musa_parthia', 'Musa of Parthia', 'Musa, also known as Thermusa, was queen of the Parthian Empire from 2 BC to 2 AD. Originally the queen of the Parthian monarch Phraates IV (r. 37 BC – 2 BC), she killed the latter, and co-ruled the empire with her son, Phraates V.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muslim_ibn_al-\'araf', 'Muslim ibn al-\'Araf', 'An official whose name appears on Umayyad glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mustafa_i', 'Mustafa I', 'Mustafa I (Ottoman Turkish: مصطفى اول), son of Mehmed III, was the Sultan of the Ottoman Empire from 1617 to 1618 and from 1622 to 1623.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mustafa_ii', 'Mustafa II', 'Mustafa II (Ottoman Turkish: مصطفى ثانى Muṣṭafā-yi sānī) was the Sultan of the Ottoman Empire from 1695 to 1703.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mustafa_iii', 'Mustafa III', 'Mustafa III (Ottoman Turkish: مصطفى ثالث Muṣṭafā-yi sālis) was the Sultan of the Ottoman Empire from 1757 to 1774.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mustafa_iv', 'Mustafa IV', 'Mustafa IV (Ottoman Turkish: مصطفى رابع Muṣṭafā-yi rābi‘) was the Sultan of the Ottoman Empire from 1807 to 1808.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/mutlei_lycia', 'Mutlei', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M232', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muzaffar_al-din_gokburi_ibn_ali', 'Muzaffar al-Din Gokburi ibn Ali', 'Muzaffar al-Din Gokburi ibn Ali (563-630/1168-1233) was a ruling member of the Berteginid dynasty, the name of a dynasty in Arbela (Irbil), founded by Zain al-Dīn ʿAlī Küčük b. Begtegīn.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muzaffar_al-din_shah', 'Muzaffar al-Din Shah', 'Mozaffar ad-Din Shah Qajar, (Persian: Mozafar Ŝāhe Qājār‎, Muẓaffari’d-Dīn Shāh Qājār) was the fifth Qajar king of Persia. He reigned between the years 1896 and 1907.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/muzzi_beg_giacomo', 'Muzzi Beg, Giacomo', 'Giacomo Muzzi, an Italian, was the first post master general in Khedieval Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/myrsos_abdera', 'Myrsos', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/menqu_[mongke]_khan', 'Möngke Khan', 'Möngke Khan (Mongolian: ᠮᠥᠩᠬᠡ ᠬᠠᠭᠠᠨ / Möngke qaγan /Мөнх хаан), born Möngke (ᠮᠥᠩᠬᠡ / Мөнх) (January 10, 1209 – August 11, 1259 ), was the fourth Great Khan of the Mongol Empire, ruling from July 1, 1251, to August 11, 1259.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/n_aradus', 'N-, king of Aradus', 'Ruler of Aradus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/n_fabi_pictor_rrc', 'N. Fabius Pictor', 'Roman Republican Moneyer, c. 126 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nabis_lacedaemon', 'Nabis of Sparta', 'Nabis (Greek: Νάβις) was ruler of Sparta from 207 BC to 192 BC, during the years of the First and Second Macedonian Wars and the eponymous \"War against Nabis\", i.e. against him. After taking the throne by executing two claimants, he began rebuilding Sparta\'s power.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/naevius_quintus_maximus_cyzicus', 'Naevius Quintus Maximus', 'Strategos in Cyzicus/Mysia c. AD 180-182, a Roman citizen of the gens Naevia. His name appears on coins issued in the time of Commodus (some of them are pseudo-autonomous coins with the portrait of Kore Soteira, some Homonoia-issues with Smyrna), and always in combination with his title of Strategos. See RPC IV,2 (online) Temp. nos. 727, 744-747, 763, 2909, 2945, 3072, and 11221-11222 (c. AD 180-182). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 701 s. v. Naibios (AD 177-192).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/najm_al-din_alpi', 'Najm al-Din Alpi', 'Najm al-Din Alpi (548-572/1154-1176) was the fifth ruler of the Mardin branch of the Artuqid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/najm_al-din_ghazi_i_al-sa\'id', 'Najm al-Din Ghazi I al-Sa\'id', 'Najm al-Din Ghazi I al-Sa\'id (637-658/1239-1260) was a ruler of the Mardin branch of the Artuqid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nambed_persis', 'Nambed of Persis', 'Uncertain issuer of anonymous coinage of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nanni_byzantium', 'Nann…', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 144, nos. 1206-1208.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/napad_persis', 'Napad of Persis', 'Uncertain issuer of anonymous coinage of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/napoleon_bonaparte', 'Napoleon Bonaparte (d.1821)', 'Napoléon Bonaparte, born Napoleone di Buonaparte, (15 August 1769 – 5 May 1821) was a French military and political leader who rose to prominence during the French Revolution and its associated wars.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/napoleon_iii', 'Napoleon III (1852 - 70)', 'Louis-Napoléon Bonaparte (20 April 1808 – 9 January 1873) was the first President of the French Second Republic and, as Napoleon III, the Emperor of the Second French Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-dawlah', 'Nasir al-Dawlah', 'Mozaffar ad-Din Shah Qajar, (Persian: Mozafar Ŝāhe Qājār‎, Muẓaffari’d-Dīn Shāh Qājār) was the fifth Qajar king of Persia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-din_artuq_arslan', 'Nasir al-Din Artuq Arslan', 'Nasir al-Din Artuq Arslan (597-637/1201-1239) was a ruler of the Mardin branch of the Artuqid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-din_hasan', 'Nasir al-Din Hasan', 'Al-Nasir Muhammad (Arabic :الناصر محمد‎ Epithet: al-Malik al-Nasir Nasir al-Din Muhammad ben Qalawun)( Arabic: الملك الناصر ناصر الدين محمد بن قلاوون) ( Nickname: Abu al-Ma\'ali (أبو المعالى ‎) was the ninth Mamluksultan of Egypt who was inaugurated three times, from December 1293 to December 1294, from 1299 to 1309 and from 1309 till his death in 1341', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-din_mahmud', 'Nasir al-Din Mahmud', 'Nasir al-Din Mahmud (597-619/1201-1222) was a ruler of the Hisn Kayfa and Amid branch of the Artuqids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-din_mahmud_ibn_mas\'ud_ii', 'Nasir al-Din Mahmud ibn Mas\'ud II', 'Nasir ad-Din Mahmud (or Mahmud II) was the Zengid Emir of Mossul 1219–1234. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasir_al-din_shah', 'Nasir al-Din Shah', 'Nasser al-Din Shah Qajar (Persian: ناصرالدین شاه قاجار‎) was the King of Persia from 17 September 1848 to 1 May 1896 when he was assassinated.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasr_allah', 'Nasr Allah', 'Nasrullah Khan or Nasr-Allah bin Haydar Tora was the Emir of Bukhara (1827–1860).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasr_ii_ibn_ahmad_ii', 'Nasr II ibn Ahmad II', 'Nasr II (Persian: نصر‎), nicknamed \"the Fortunate\", was the ruler (amir) of Transoxiana and Khurasan as the head of the Samanid dynasty from 914 to 943.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nasr_al-dawlah_abu_nasr', 'Nasr al-Dawlah Abu Nasr', 'Nasr al-Dawlah Abu Nasr (402-453/1011-1061) was the fifth and last effective ruler of the Marwanids, (990–1085), which was an Arab or Kurdish dynasty in the Diyar Bakr region of Upper Mesopotamia and Armenia, centered on the city of Amid (Diyarbakır).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nectanebo_ii_egypt', 'Nectanebo II of Egypt', 'Nectanebo II (Manetho\'s transcription of Egyptian Nḫt-Ḥr-(n)-Ḥbyt, \"Strong is Horus of Hebit\"), ruled in 360—342 BC was the third and last pharaoh of the Thirtieth Dynasty of Egypt as well as the last native ruler of ancient Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/neilon_abydus', 'Neilon', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Neilon (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 705 s. v. ΝΕΙΛΩΝ.  For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nem_titus_cyzicus', 'Nem… Titus', 'Strategos in Cyzicus/Mysia during the reign of Philip the Arab. A Hippikos (Roman knight, member of the ordo equester). His name appears in coins, always in combination with his title of Strategos and the designation as Hippikos. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 705 s. v. Nem- and p. 849 s. v. Titos (AD 244-249).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/neomenios_maroneia', 'Neomenios', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nepotianus', 'Nepotianus', 'The Roman emperor Nepotianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nero', 'Nero', 'Nero was Roman Emperor from 54 to 68, and the last in the Julio-Claudian dynasty. Nero was adopted by his great-uncle Claudius to become his heir and successor, and like him, became emperor with the consent of the praetorian guard.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nero_caesar', 'Nero Caesar', 'Nero Julius Caesar Germanicus (c. AD 6 –AD 30) was a member of the Julio-Claudian dynasty. He was born around AD 6, to Germanicus and Agrippina the Elder. His paternal grandparents were Nero Claudius Drusus and Antonia Minor, daughter of Mark Antony and Octavia Minor. His maternal grandparents were Marcus Vipsanius Agrippa and Julia the Elder, daughter of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nerva', 'Nerva', 'Nerva was Roman Emperor from 96 to 98. Nerva became Emperor at the age of sixty-five, after a lifetime of imperial service under Nero and the rulers of the Flavian dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nestis_abdera', 'Nestis', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nestor_athens', 'Nestor', 'First magistrate attested in Athens in 79/78 BC [Thompson issue 84]. Previously attested as second magistrate in 91/90 BC [Thompson issue 77]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1147-1157 and nos. 1205-1221 / her issues 77 and 84 (p. 575); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (91/90 and 79/78 BC, his issues 74 and 86); Prosopographia Attica 10657; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 329 s. v. Nestor, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 707 s. v. Nestor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ne_byzantium', 'Ne…', 'An individual who issued coins at the ancient city of Byzantium, 5th-4th cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 131, nos. 954-978.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicarchus_macedonia', 'Nicarchus', 'An unknown Macedonian dynast, probably contemporary with Patraus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicias_bactria', 'Nicias of Bactria', 'Nicias was an Indo-Greek king who ruled in the Paropamisade. Most of his relatively few coins have been found in northern Pakistan, indicating that he ruled a smaller principate around the lower Kabul valley. He was possibly a relative of Menander I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicias_cos', 'Nicias of Cos', 'Tyrant installed on Cos by Mark Antony, between c. 40 and 31 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicolas_girard_geneva', 'Nicolas Girard', 'Nicolas Girard is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicolaus_longerich_colonia_claudia_ara_agrippinensium', 'Nicolaus Longerich', 'Mintmaster in Jülich-Berg from 1681 to 1691, then for the Archbishopric Cologne from 1693 to 1694 in Deutz. Nicolaus (Nikolaus) Longerich was appointed Mintmaster in Cologne (City), Germany, on 5 June 1699. He died between 24 and 26 April, 1700. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 264, 266, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicolaus_nyber_colonia_claudia_ara_agrippinensium', 'Nicolaus Nyber', 'Mintmaster in Kelev, Netherlands. Nicolaus (Niclaus) Nyber was given a 10 year contract on 1 February 1493 as Mintmaster in Cologne (City), Germany. He was then appointed Mintmaster in Nymegen (Netherlands), where he remained in office until 1515. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 24, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicomedes_i_bithynia', 'Nicomedes I of Bithynia', 'Nicomedes I was the second king of Bithynia, son of Zipoetes, who had taken the royal title c. 298.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicomedes_ii_bithynia', 'Nicomedes II of Bithynia', 'Nicomedes II was the son of Prusias II. He allied with Rome in the war against Aristonicus (133–129), but his request for territory in Phrygia was refused. Nicomedes introduced the Bithynian era for numbering years on his coins.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicomedes_iii_bithynia', 'Nicomedes III of Bithynia', 'Nicomedes III was the son and successor of Nicomedes II of Bithynia. He declined to help Rome against the Cimbri in 104 BC on the grounds that the most of his men had been seized and enslaved by Roman publicani', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicomedes_iv_bithynia', 'Nicomedes IV of Bithynia', 'Nicomedes IV Philopator was the king of Bithynia from c. 94 BC to 74 BC. He was the first son and successor of Nicomedes III of Bithynia and Nysa. As one of his last acts as king of Bithynia, in 74 BC, Nicomedes IV bequeathed the entire kingdom of Bithynia to Rome. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nigrinian', 'Nigrinian', 'The Roman emperor Nigrinian, son of Carinus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikagoras_athens', 'Nikagoras', 'Second magistrate in Athens in 134/133 BC (issue 31). Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 31; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5; Prosopographia Attica no. 10672.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikanon_athens', 'Nikanon', 'Third magistrate attested in Athens in 128/127 BC. The name is otherwise unknown; ΝΙΚΑΝΩΝ might be a misspelling of ΝΙΚΑΝΩΡ of the same issue: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 423 / issue 37 (p. 576 and commentary on p. 168); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 330 s. v. Nikanon, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 710 s. v. Nikanon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikanor_athens', 'Nikanor', 'Third magistrate attested in Athens in 128/127 BC [issue 37]. Again attested as third magistrate in 127/126 BC [issue 38]: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 422 and nos. 437-439 / issues 37 and 38 (p. 576 and commentary on p. 168 f. for the possible identity with ΝΙΚΑΝΩΝ of issue 37 as well); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 and 127/126 BC); Prosopographia Attica 10696; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 330 s. v. Nikanor, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 711 s. v. Nikanor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nika_athens', 'Nika…', 'Third magistrate attested in Athens in 112/111 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 686-689 / issue 53 (p. 576); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (112/111 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 710 s. v. Nika-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikephorus_bryennius', 'Nikephoros Bryennios', 'The Byzentine emperor Nikephoros Bryennios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikephorus_i', 'Nikephoros I', 'The Byzantine emperor Nikephoros I,', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikephorus_ii', 'Nikephoros II Phokas', 'The Byzantine emperor Nikephoros II Phokas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikephorus_iii', 'Nikephoros III Botaneiates', 'The Byzantine emperor Nikephoros III Boteneiates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/niketes_athens', 'Niketes', 'First magistrate attested in Athens in 99/98 BC [issue 67]. Previously and later attested as third magistrate in Athens, in 100/99 BC [issue 65], and in 94/93 BC [issue 71]. From Eupyridai. Brother of his colleague Dionysios [issue 67]. Son of Athenobios, one of the third magistrates of issue 38. He and his brother are attested as boys in the Delphian Pythais in 128/127 BC. Together with their sister Philylla they have dedicated a statue of Chrysis, a priestess of Athena (IG II 2. ed. 3484). Being ephebe in 117/116 (Habicht 1991, p. 11) or 118/117 BC (Mattingly 1997, p. 259) he held the magistracy at the age of c. 37: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 857-861, nos. 929-962, and nos. 1044-1046 / issues 65, 67 and 71 (p. 576); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5-6 and 11 (100/99, 98/97 and 94/93 BC); Prosopographia Attica 10754; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 332 s. v. Niketes, no. 15; H. B. Mattingly and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 712 s. v. Niketes (99/98 BC, issue 67).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikias_chios', 'Nikias', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2437', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicodamus_salamis', 'Nikodamos of Salamis', 'Nicodamus was the king of Salamis in the third quarter of the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikodemos_athens', 'Nikodemos', 'Third magistrate attested in Athens in 114/113 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 648-654 / issue 51 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (114/113 BC); Prosopographia Attica 10857; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 335 s. v. Nikodemos, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikodemos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikodo_athens', 'Nikodoros', 'Third magistrate attested in Athens in 132/131 BC [issue 33]. Again attested as third magistrate in 127/126 BC [issue 38]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 388-389, 394 and nos. 434-437 / issues 33 and 38 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (132/131 BC); Prosopographia Attica 10879 and 10880; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 335 s. v. Nikodoros, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikogenes_ii_athens', 'Nikogenes', 'First magistrate attested in Athens in 94/93 BC [issue 71]. Previously attested as third magistrate in 96/95 BC [issue 69]. From Philaidai. Maybe grandson of Nikogenes (who held second and third magistracies in the 130s BC): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1010, 1012 and nos. 1032-1049 / issues 69 and 71, commentary on p. 577; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 11 (94/93 BC); Prosopographia Attica 10849; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 335 s. v. Nikogenes, no. 14; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikog_athens', 'Nikogenes', 'Third magistrate attested in Athens in 135/134 BC [issue 30]. Then attested as second magistrate twice, in 133/132 BC [issue 32], and again in 131/130 BC [issue 34]. From Philaidai. Probably father of Nikogenes the younger (ΝΙΚΟΓ ΝΕ[ώτερος]), who also was one of the third magistrates of issue 30 (Thompson 1961, p. 576). In his youth victor in Panathenaic games twice, Agonothetes of the Theseia in 161/160 BC, Hipparchos in 157/156 BC, Hieropoios c. 150 BC (Habicht 1991, p. 20 and H. B. Mattingly, NC 157, 1997, p. 258): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 351, 353, nos. 368, 373, 376-382, and nos. 396-403 / issues 30, 32 and 34 (p. 576-577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5, 11 and 19-20 (135/134, 133/132 and 131/130 BC); Prosopographia Attica 10850; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 335 s. v. Nikogenes, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikogenes_i_athens', 'Nikogenes the younger', 'Third magistrate attested in Athens in 135/134 BC. From Philaidai. Son of the other Nikogenes, who signed as third magistrate in the same issue 30 as well. Thus he held the third magistracy in the same year as his father. To distinguish two persons he was explicitly named \"the younger\" (ΝΙΚΟΓ ΝΕ[ώτερος]): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 351, 353-354 / issue 30 (p. 576-577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19-20 (135/134 BC); Prosopographia Attica 10850; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 335 s. v. Nikogenes, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikokles_paphus', 'Nikokles of Paphos', 'Magistrate attested on the Alexander coinage of Paphos, c. 325-317 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 3118', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicocles_salamis', 'Nikokles of Salamis', 'Nicocles (Greek: Νικοκλῆς, Nikoklēs) was an Ancient Greek Cyprus king of Salamis, Cyprus. In 374/3 BC, he succeeded his (presumed) father Evagoras I. Nicocles continued the philhellenic politics of his father. Nicocles died probably together with Straton of Sidon during the revolt of satraps (362 to 360 BC v. Chr.). He was followed as the Cypriot king of Salamis by his son Evagoras II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nicocreon_salamis', 'Nikokreon of Salamis', 'Nicocreon (Greek Nικoκρέων; lived 4th century BC) was king of Salamis in Cyprus, at the time of Alexander the Great\'s (336–323 BC) expedition against Persia. Nicocreon submitted to the conqueror along with the other princes of Cyprus, without opposition. In 331 BC, after the return of Alexander from Egypt, Nicocreon visited the city of Tyre to pay homage to him, where he distinguished himself by the magnificence which he displayed in furnishing his theatrical exhibitions. After the death of Alexander, Nicocreon allied with Ptolemy against Antigonus, and in 315 BC, he colluded with Seleucus and Menelaus, two of Ptolemy\'s generals, in neutralizing the Cypriot city-kingdoms which had supported Antigonus. In return for these services, Ptolemy awarded him personal command of Citium, Lapithos, Keryneia, and Marion, in addition to retaining Salamis. He was also entrusted with the chief command over the whole island of Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikok_athens', 'Nikok…', 'Third magistrate attested in Athens in 130/129 BC. ΝΙΚΟΚ might be Nikokles or Nikokrates (LGPN): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 410-411 / issue 35 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 336 s. v. Nikokles, no. 14; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 713 s. v. Nikok-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikolochos_adramyteum', 'Nikolochos', 'Magistrate in Adramyteum (Mysia). His name appears on Hellenistic coins from the 2nd century BC. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) p. 188 f., 197 no. 33; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 714 s. v. Nikolochos (2nd cent. BC); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 336 s. v. Nikolochos (no. 2) (2nd cent. BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikon_abydus', 'Nikon', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Nikon (47); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 716 s. v. ΝΙΚΩΝ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikon_athens', 'Nikon', 'Third magistrate attested in Athens in 127/126 BC [issue 38]. Again attested as third magistrate in 114/113 BC [issue 51]. Maybe from Philaidai (?): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 429, 431-432 and nos. 658, 660 / issues 38 and 51, commentary on p. 577; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (127/126 and 114/113 BC); Prosopographia Attica 11096; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 341 s. v. Nikon, no. 20 (listed under Athens, no particular deme); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 716 s. v. Nikon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikon_ke_athens', 'Nikon Ke…', 'Third magistrate attested in Athens in 131/130 BC. The added monogram could be read as ΚΗ... which might be an abbreviated patronymic or demotic: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 396-397 / issue 34, commentary on p. 577; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 11123; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 341 s. v. Nikon, no. 19; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 716 s. v. Nikon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikono_athens', 'Nikonomos', 'Third magistrate attested in Athens in 109/108 BC. From Kedoi (LGPN): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 721, 725-727, 733 / issue 56 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (109/108 BC); Prosopographia Attica 10979; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 338 s. v. Nikonomos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 715 s. v. Nikonomos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nikostratos_abdera', 'Nikostratos', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/noumenias_maroneia', 'Noumenias', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/noumenios_abydus', 'Noumenios', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Noumenios (50); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 717 s. v. ΝΟΥΜΗΝΙΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nuh_i_ibn_nasr_ii', 'Nuh I ibn Nasr II', 'Nuh ibn Nasr, or Nuh I, was the amir of the Samanids in 943–954.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nuh_iii_ibn_mansur_i', 'Nuh III ibn Mansur I', 'Nuh II (Persian: نوح‎, died 997) was amir of the Samanids (976–997).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/numerian', 'Numerian', 'The Roman emperor Numerian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/numi_zoilos_cyzicus', 'Numi(sius) Zoilos', 'Strategos in Cyzicus/Mysia c. AD 209-217. His name appears on coins issued with the portrait of Caracalla (bearded portrait-type starting in c. AD 209), always in combination with his title of Strategos: SNG France Mysie no. 783. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 523 s. v. Zoilos and p. 718 s. v. Noumi(sios) (AD 198-217); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 192 s. v. Zoilos (no. 99) (AD 198-217).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nur_al-din_arslan_shah_i_ibn_mas\'ud', 'Nur al-Din Arslan Shah I ibn Mas\'ud', 'Nur ad-Din Arslan Shah I (or Arslan Shah) was the Zengid Emir of Mossul 1193–1211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nur_al-din_mahmud_ibn_zengi', 'Nur al-Din Mahmud ibn Zengi', 'Nūr ad-Dīn Abū al-Qāsim Maḥmūd ibn ʿImād ad-Dīn Zangī, also known as Nur al-Din (from Arabic: نور الدين‎, \"Light of the Faith\") or Nur ed-Din, was a member of the Turkic Zengid dynasty which ruled the Syrian province of the Seljuk Empire. He reigned from 1146 to 1174.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nymphagores_abdera', 'Nymphagores', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nymphodoros_abdera', 'Nymphodoros', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/nysa_cappadocia', 'Nysa of Cappadocia', 'Nysa or Nyssa (Greek: Νύσ(σ)α, flourished 150s BC-126 BC) was a princess from the Kingdom of Pontus and was a Queen of Cappadocia. She was the ruler of Cappadocia on behalf of her minor son in 130-126 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/obodas_ii_nabataea', 'Obodas II of Nabataea', 'Obodas II was a king of Nabataea who reigned following Aretas III in the first century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/obodas_iii_nabataea', 'Obodas III of Nabataea', 'Obodas III was a Nabataean king who ruled from 30 to 9 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/octavian', 'Octavian', 'Adopted son of Julius Caesar, the future Emperor Augustus. The preferred URI is http://nomisma.org/id/augustus but this URI is available when specificity is necessary.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/odoacer', 'Odoacer', 'Flavius Odoacer was a Germanic soldier, who became the first King of Italy (476-493).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ogvl_rrc', 'Ogul[nius]', 'Roman Republican Moneyer, c. 86 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oinia(-)_mesembria', 'Oinia(…)', 'Magistrate attested on the Alexander coinage of Mesembria, c. 250-175 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1024-1026, 1039-1040', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oinophilos_athens', 'Oinophilos', 'Second magistrate attested twice in Athens, in 82/81 BC [Thompson issue 81] and again in the following year 81/80 BC [Thompson issue 82] – a sequence which is quite uncommon. From Aphidnai. Belongs to the same family as his colleague Amphias [Thompson isssue 82], most probably his father (Habicht 1991, p. 13): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1179-1186 and nos. 1187-1195 / her issues 81 and 82 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 (82/81 and 81/80 BC, his issues 83 and 84); Prosopographia Attica 11363; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 349 s. v. Oinophilos, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 727 s. v. Oinophilos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oionpides_chios', 'Oionpides', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2405', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/okkonapses_elymais', 'Okkonapses of Elymais', 'Okkonapses was a usurper of the Kingdom of Elymais in Susa ca. 139-138 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oly(-)_colophon', 'Oly(…)', 'Magistrate attested on the Alexander coinage of Colophon, c. 200-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1869', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/olybrius', 'Olybrius', 'The Roman emperor Olybrius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/olympiodoros_byzantium', 'Olympiodoros', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 135, nos. 1015-1016.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/olympios_athens', 'Olympios', 'Third magistrate attested in Athens in 118/117 BC. Maybe from Kephisia (Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 588, 590 / issue 47 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (118/117 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 351 s. v. Olympios, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 728 s. v. Olympios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oly_athens', 'Oly…', 'Third magistrate attested in Athens in 97/96 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 883, 903, 906-907 / issue 66 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (99/98 BC); H. B. Mattingly, NC 157, 1971, 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 727 s. v. Oly- (97/96 BC).', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/onasi_paphus', 'Onasi(-) of Paphus', 'Onasi(-) (possibly Onasioikos or Onasicharis) was an early 4th century B.C. Phoenician king of Paphus on Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/onesianax_abydus', 'Onesianax', 'Magistrate attested in Abydos in c. 75-65 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 730 s. v. ΟΝΗΣΙΑΝΑΞ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/onomarchus_phocis', 'Onomarchos', 'Onomarchus (Ancient Greek: Ὀνόμαρχος) was general of the Phocians in the Third Sacred War, brother of Philomelus and son of Theotimus. After his brother\'s death he became commander of the Phocians and pursued a warmongering policy until his final defeat.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/opei_rrc', 'Opei[mius]', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/opeimi_rrc', 'Opeimi[us]', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ophelas_athens', 'Ophelas', 'Third magistrate attested in Athens in 135/134 BC. ΟΦΕΛΟΥ is to be read as Genitive form of Ophelas (Thompson 1961, p. 578). From Bate. Son of Habron. In his younger days victor at the Panathenaic games, Hipparchos in 157/156 BC and Epimeletes in Delos in 148/147 BC (Habicht 1991, p. 19 and H. B. Mattingly, NC 157, 1997, p. 258): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 348, 350 / issue 30 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19 f. (135/134 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 355 s. v. Ophelas, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 738 s. v. Ophelas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ophellas_cyrene', 'Ophellas, governor of Cyrene', 'Officer of Alexander the Great, and subsequently governor of Cyrenaica under Ptolemy (I) as satrap of Egypt', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orabazes_i_characene', 'Orabazes I of Characene', 'Orabazes I was a king of Characene, a vassal state of Parthia, whose few coins seem to date to AD 18-19, although the coins of Abinergaos I both pre- and post- date this reign.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orabazes_ii_characene', 'Orabazes II of Characene', 'Orabazes II was a king of Characene. His reign was from 150/51 to 165.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orchamos_abdera', 'Orchamos', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oreites_abydus', 'Oreites', 'Magistrate attested in Abydos in c. 75-65 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 732 s. v. ΟΡΕΙΤΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodaltis_prusias_ad_mare', 'Orodaltis of Prusias ad mare', 'Orodaltis (Greek: Ωροδάλτις 1st century BC), was an Ancient princess who may have ruled the city of Prusias ad Mare in Anatolia. She was a contemporary to the first Roman Emperor Augustus, who ruled from 27 BC to 14 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_i_elymais', 'Orodes I of Elymais', 'Orodes I of Elymais was the ruler of Elymais in the 1st-century. Unlike the previous rulers of the kingdom, he belonged to a cadet branch of the Arsacid dynasty. His reign thus marks the start of a second line of rulers that replaced the original Kamnaskirid line. Orodes I was succeeded by his son Orodes II, known as Kamnaskires-Orodes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_i_parthia', 'Orodes I of Parthia', 'Orodes I ruled the Parthian Empire from 87/80 to 75 BC in succession to Gotarzes I. He reigned during the \"Parthian Dark Age,\" which was a period of internal turmoil and civil war for the Parthian Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_ii_elymais', 'Orodes II of Elymais', 'Orodes II (c. 50–c. 70 AD) son of Orodes I, an Arsacid king of Elymais.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_ii_parthia', 'Orodes II of Parthia', 'Orodes II of Parthia was the king of the Parthian Empire from 57 BC to 37 BC. Orodes was a son of Phraates III, whom he murdered in 57 BC, assisted by his brother Mithridates. He married a Greek Princess from the Kingdom of Commagene, called Laodice who was a daughter of King Antiochus I Theos of Commagene and Queen Isias Philostorgos of Commagene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_iii_elymais', 'Orodes III of Elymais', 'Orodes III (c. 90–c. 100 AD) son of Orodes II and king of Elymais.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_iii_parthia', 'Orodes III of Parthia', 'Orodes III was king of the Parthian Empire from 4 to 6. Albeit he was an Arsacid, his lineage is unknown. He was raised to the throne by the nobility two years after the death of the previous co-rulers, Phraates V and Musa (r. 4 BC – 2 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_iv_elymais', 'Orodes IV of Elymais', 'Orodes IV (c. 140–c. 160 AD) was king of Elymais', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_v_elymais', 'Orodes V of Elymais', 'Orodes V (c. 170–c. 180 AD) son of Beldusa and king of Elymais.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orodes_vi_elymais', 'Orodes VI of Elymais', 'Orodes VI (c. 220 – 224 AD) was the final Arsacid king of Elymais before absortion of the kingdom into the Sasanian Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orontas_satrap', 'Orontas', 'A Bactrian, son of Artasouras/Artasyras, satrap of Armenia under Artaxerxes II, and subsequently a sub-strapal ruler in western Asia Minor where he struck coinage.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orontobates_caria', 'Orontobates of Caria', 'Orontobates (in Greek Ὀρoντoβάτης. Old Persian Aurandabad, lived 4th century BC) was a Persian, who married the daughter of Pixodarus, the usurping satrap of Caria, and was sent by the king of Persia to succeed him. On the approach of Alexander the Great of Macedon (334 BC) Orontobates and Memnon of Rhodes entrenched themselves in Halicarnassus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orophernes_cappadocia', 'Orophernes of Cappadocia', 'Orophernes Nicephorus (in Greek Oρoφέρνης Nικηφόρoς, also known as Olophernes) was one of the two sons Antiochis (the daughter of Antiochus III the Great) pretended to have had with Ariarathes IV, the king of Cappadocia because she failed to have children (the name of the other was Ariarathes). However, she then did bear a child, Mithridates, and told her husband about the fake sons. These were sent to Rome and Ionia respectively to avoid a succession dispute with the legitimate son, whose name was changed to Ariarathes and who succeeded his father as Ariarathes V in 163 BC. A few years later Orophernes deposed him with the help of Demetrius I Soter, who became the king of the Syria-based Seleucid Empire in 161 BC when he overthrew Antiochus V, an underage king, and his regent, Lysias. The reign of Orophernes was short-lived. The Romans restored Ariarathes V.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orsoaltius_tylis_thrace', 'Orsoaltius of Thrace', 'Orsoaltios, otherwise unknown ruler of Tylis in Thrace, 3rd century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orsobaris_prusias_ad_mare', 'Orsobaris of Prusias ad mare', 'Orsabaris, also spelt as Orsobaris (Greek: η Όρσάβαρις, η Ορσοβάριος, meaning in Persian: brilliant Venus,flourished 1st century BC) was a Princess of the Kingdom of Pontus. She was a Queen of Bithynia by marriage to Socrates Chrestus and later married to Lycomedes of Comana.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/osman_ii', 'Osman II', 'Osman II (Ottoman Turkish: ثانى عثمان ‘Osmān-i sānī), commonly known as Genç Osman (\"Osman the Young\" in Turkish), was the Sultan of the Ottoman Empire from 1618 until his death on 20 May 1622.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/osman_iii', 'Osman III', 'Osman III (Ottoman Turkish: عثمان ثالث ‘Osmān-i sālis) was the Sultan of the Ottoman Empire from 1754 to 1757.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orsoes_i_parthia', 'Osroes I of Parthia', 'Osroes I was a prince of Iranian and Greek ancestry. He ruled the Parthian Empire from 109 to 129, with a brief interruption from 116 to 117.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/orsoes_ii_parthia', 'Osroes II of Parthia', 'Osroes II of Parthia was a claimant of the throne of the Parthian Empire c. 190. He is unknown to history except for the coins he issued.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/osroes_elymais', 'Osroes of Elymais', 'Osroes was a an Arsacid king of Elymais from AD 125-130.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/otacilia_severa', 'Otacilia Severa', 'Marcia Otacilia Severa or Otacilia Severa was the Empress of Rome and wife of Emperor Marcus Julius Philippus or Philip the Arab, who reigned over the Roman Empire from 244 to 249.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/otho', 'Otho', 'Otho was Roman Emperor for three months, from 15 January to 16 April 69. He was the second emperor of the Year of the Four Emperors.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oxyathres_heracleia_pontica', 'Oxyathres of Heracleia', 'Oxyathres (Ancient Greek: Οξυάθρης; died 284 BC) was a son of Dionysius, tyrant of Heraclea and of Amastris, the daughter of the brother of Darius III Codomannus, also called Oxyathres. He succeeded, together with his brother Clearchus, to the sovereignty of Heraclea on the death of Dionysius, 306 BC: but the government was administered by Amastris during the minority of her two sons. Soon after the young men had attained to manhood and taken the direction of affairs into their own hands, they caused their mother to be put to death (284 BC): but this act of matricide brought upon them the immediate vengeance of Lysimachus, who made himself master of Heraclea, and put both Clearchus and Oxyathres to death. According to Diodorus, they had reigned seventeen years; but their death should be assigned to the year 284 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/oxyathres_persia', 'Oxyathres of Persia', 'Oxyathres was a brother of the Persian king Darius III Codomannus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ozbaal_byblus', 'Ozbaal of Byblus', 'Ruler of Byblos in the 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
