('http://nomisma.org/id/p_aelius_eutyches_adramyteum', 'P. Aelius Eutyches', 'Strategos in Adramyteum (Mysia). His name appears on coins issued c. 198-211 AD. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 225 f. nos. 198-199; p. 226 no. 201; 227 no. 206-207 and 211; p. 228 nos. 217-218; p. 228 no. 219 (211-212 AD); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 511 (198-217 AD); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 184 s. v. Eutyches (no. 73) (198-217 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_aelius_reginos_adramyteum', 'P. Aelius Reginos', 'Strategos in Adramyteum (Mysia). His name with the addition \"B\" (\"the younger\") appears on coins issued c. 177-180 AD. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 189, 223 nos. 186-187; RPC IV temp. nos. 418-419 (177-180 AD); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 789 mit Anm. 8 s. v. Regeinos (177-180 AD); Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 391 s. v. Reginos (no. 12) (177-192 AD).', 'http://xmlns.com/foaf/0.1/Person'),
