('http://nomisma.org/id/aufidius_hoenius_severianus_piri882', 'P. Iuventius Celsus T. Aufidius Hoenius Severianus', 'Legatus Augusti pro praetore in Thrace before AD 114. Consul suffectus AD 115, Consul ordinarius II in AD 129. His name appears on coins of Perinthus with title of Presbeutes [see E. Schönert, Die Münzprägung von Perinthos (1965) 18. 150 (dates c. AD 107-117)]. Lit.: PIR² I 882; B. E. Thomasson, Laterculi Praesidum I (1984) 163 no. 10; ibid., I Addenda (2011) 22:010.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_iuventius_celsus_t_aufidius_hoenius_severianus_piri882', 'P. Iuventius Celsus T. Aufidius Hoenius Severianus', 'Legatus Augusti pro praetore in Thrace before AD 114. Consul suffectus AD 115, Consul ordinarius II in AD 129. His name appears on coins of Perinthus with title of Presbeutes [see E. Schönert, Die Münzprägung von Perinthos (1965) 18. 150 (dates c. AD 107-117)]. Lit.: PIR² I 882; B. E. Thomasson, Laterculus Praesidium I (1984) 163 no. 10; ibid., Laterculus Praesidium I Addenda (2011) 22:010.', 'http://xmlns.com/foaf/0.1/Person'),
