('http://nomisma.org/id/pacatianus', 'Pacatianus', 'Usurper during 248-249, during the reign of Philip I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pacorus_i_parthia', 'Pacorus I of Parthia', 'Pacorus I (died 38 BC) was a Parthian prince, who was the son of King Orodes II and Queen Laodice. It is possible that Pacorus was co-ruler with his father for at least part of his father\'s reign.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pacorus_ii_parthia', 'Pacorus II of Parthia', 'Pacorus II was the King of Kings of the Parthian Empire from 78 to 110. He was the son and successor of Vologases I (r. 51–78).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pae_rrc', 'Pae[tus]', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paerisades_i_bosporus', 'Paerisades I of Bosporus', 'Paerisades I also known as Birisades, Pairisades, and Parysades was a Spartocid king of the Bosporan Kingdom from 342 to 310/9 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paerisades_ii_bosporus', 'Paerisades II of Bosporus', 'Paerisades II or Parysades was king of the Bosporan Kingdom from 284 to 245 BC. He may have been a son of either Spartokos III, or Satyros II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paerisades_iii_bosporus', 'Paerisades III of Bosporus', 'Paerisades III was a son of Leukon II and Alkathoe, he also succeeded his brother Spartokos V as Spartocid king of the Bosporan Kingdom from 180 to 150 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paerisades_iv_bosporus', 'Paerisades IV of Bosporus', 'Paerisades IV Philometor seems to have been a Spartocid king of the Bosporan Kingdom from c. 150 to 125 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paerisades_v_bosporus', 'Paerisades V of Bosporus', 'Paerisades V was the son of Paerisades III and Kamasarye Philoteknos. He was last Spartocid ruler of the Bosporan Kingdom and ruled from 125 to c. 109 BC after the death of his brother Paerisades IV Philometor. With his death, ended a dynasty of Bosporan kings that had ruled the Bosporan Kingdom for over 3 centuries, starting in 438 BC with his ancestor Spartocus I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pag_abdera', 'Pag(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pakor_i_persis', 'Pakor I of Persis', 'Pakor I ruler of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pakor_ii_persis', 'Pakor II of Persis', 'Pakor II of Persis ruler of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/palli_lycia', 'Palli', 'Dynast in the ancient region of Lycia from approximately 480–440 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M239', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pammenes_athens', 'Pammenes', 'Second magistrate attested in Athens in 66/65 BC [Thompson issue 97]. Again attested as second magistrate in 62/61 BC [Thompson issue 101]. From Marathon from a famous and influential family. Probably Archon of 83/82 BC and grandfather of Pammenes, who was Gymnasiarch and priest of Apollo in Delos, Agoranommos in 27 BC, and then priest of Augustus and Roma in Athens (Habicht 1991, p. 15): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1248 and nos. 1255-1258 / her issues 97 and 101 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 15-16 (66/65 and 62/61 BC, his issues 99 and 103); Prosopographia Attica 11520; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 356 s. v. Pammenes, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 742 s. v. Pammenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pamphilos_miletus', 'Pamphilos', 'Magistrate attested on the Alexander coinage of Miletus, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2197', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pamphi_athens', 'Pamphi…', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 453-454, 457-458 / issue 39 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 11528; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 357 s. v. Pamphilos, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 742 s. v. Pamphi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pantaleon_bactria', 'Pantaleon of Bactria', 'Pantaleon was a Greek king who reigned some time between 190–180 BC in Bactria and India. He was a younger contemporary or successor of the Greco-Bactrian king Demetrius, and is sometimes believed to have been his brother and/or subking.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pantalkes_athens', 'Pantalkes', 'First magistrate attested in Athens in 76/75 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1228-1229 / her issue 87 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (76/75 BC, his issue 89); Prosopographia Attica 11596; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 359 s. v. Pantalkes, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 744 s. v. Pantalkes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/para_athens', 'Para…', 'Third magistrate attested in Athens in 123/122 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 483-485 / issue 41 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (124/123 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 746 s. v. Para- (123/122 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/parmenion_erythrae', 'Parmenion', 'Magistrate attested on the Alexander coinage of Erythrae, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1916', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/parmeniskos_abydus', 'Parmeniskos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Parmeniskos (18); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 747 s. v. ΠΑΡΜΕΝΙΣKOΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/parmenon_abdera', 'Parmenon', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/parthamaspates', 'Parthamaspates', 'Roman client king of Parthia (AD 116-7) and later of Osroene (AD 118-123), the son of the Parthian emperor Osroes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pasicrates_soli_cyprus', 'Pasicrates of Soli', 'Pasicrates was king of the city of Soli on Cyprus from ca. 331-315 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pasikle_priene', 'Pasikle…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Regling completed: Pasikles. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 748.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/patika_kusulaka_chukhsa', 'Patika Kusulaka', 'Patika Kusulaka was an Indo-Scythian satrap in the northwestern South Asia during the 1st century BCE. He is mentioned in the Mathura lion capital. He is also mentioned in the Taxila copper plate inscription (Konow 1929: 23-29), dated between 90 and 6 BCE. In the scroll Patika is said to be the son of the Satrap of Chuksa, Liaka Kusuluka.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/patraus', 'Patraus', 'Patraus (340 BC – 315 BC) was an ancient Paeonian king. It has been proposed that Ariston, who notably served as a cavalry general to Alexander the Great, was Patraus\' brother.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/patrokles_maroneia', 'Patrokles', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/patron_perinthus', 'Patron', 'An individual who issued coins at the ancient city of Perinthus, end of 3rd cent. BC and later. See E. Schönert, Die Münzprägung von Perinthos (Berlin, 1965), p. 100, nos. 65-66.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/patro_athens', 'Patron', 'Third magistrate attested in Athens in 125/124 BC. From Perithoidai. Brother of Polemon, first magistrate of this issue [issue 40]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 464-467, 473, 474 / issue 40 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 19 (125/124 BC); Prosopographia Attica 11702; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 363 s. v. Patron, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 749 s. v. Patron.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paul_gottlieb_nuernberger_nuremberg', 'Paul Gottlieb Nürnberger', 'Mintmaster in Nürnberg (Nuremberg), Franconia, Germany from 1716 to 1746. His initials are PGN or a cross. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/paul_rottenburger_stuttgart', 'Paul(us) Rottenburger', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1568 to 1569. Died in 1586. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74, 87.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pausanias_abdera', 'Pausanias', 'An individual who issued coins at the ancient city of Abdera, 375/373-365/360 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pausanias_macedon', 'Pausanias of Macedon', 'Pausanias of Macedon was the successor of Archelaus II. He was assassinated in the year of his accession by Amyntas III who then succeeded him as King of Macedon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peisistratos_mytilene', 'Peisistratos', 'Magistrate attested on the Alexander coinage of Mytilene, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1738', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peison_athens', 'Peison', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 407 / issue 35 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 366 s. v. Peison, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 753 s. v. Peison.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peithesiles_abdera', 'Peithesiles', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peithola_athens', 'Peitholaos', 'Third magistrate attested in Athens in 107/106 BC. Ephebe c. 120 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 753, 755-756, 748 (drachm) / issue 58 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (107/106 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 365 s. v. Peitholaos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 751 s. v. Peitholaos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pelo_priene', 'Pelo…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 754.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/perdiccas_ii_macedon', 'Perdiccas II of Macedon', 'Perdiccas II was a king of the ancient kingdom of Macedonia from about 448 BC to about 413 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/perdiccas_iii_macedon', 'Perdiccas III of Macedon', 'Perdiccas III was king of the ancient Greek kingdom of Macedonia from 365 BC to 360 BC, succeeding his brother Alexander II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peri_abdera', 'Peri(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/perikle_lycia', 'Perikles', 'Dynast in the ancient region of Lycia from approximately 380–360 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M240', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/perseus', 'Perseus', 'Perseus (c. 212 – 166 BC) was the last king of the Antigonid dynasty in Macedon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pertinax', 'Pertinax', 'Roman emperor from 1 January 193 – 28 March 193.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pesaro_giovanni', 'Pesaro, Giovanni (1658-1659)', 'Giovanni Pesaro (Venice, September 1, 1589 – Venice, September 30, 1659) was the 103rd Doge of Venice, reigning from his election on April 8, 1658 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pescennius_niger', 'Pescennius Niger', 'Roman usurper from 193 to 194.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_bentzelroide_colonia_claudia_ara_agrippinensium', 'Peter Bentzelroide', 'Appointed Mint Warden in Cologne (City), Germany on 1 September 1474. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 3, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_bitter_von_raesfeld_deutz', 'Peter Bitter von Raesfeld', 'Mintmaster in Deutz, Germany, from 1565 to 1572. Peter Bitter is most likely the son of Johann Bitter. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 46.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_isselburg_colonia_claudia_ara_agrippinensium', 'Peter Isselburg', 'The Goldsmith and Silversmith Peter Isselburg (Ysselburg) was appointed Mint Warden for Cologne (City), Germany, in 1685, and Special Warden from 1686. Isselburg died on 15 September 1702. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 196; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1294 p. 494.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_newers_colonia_claudia_ara_agrippinensium', 'Peter Newers', 'Appointed Mintmaster in Cologne (City), Germany in 1680, Newers was baptised on 14 April 1641. He died in office sometime between July/August 1698 and 5 June 1699. His monogram was the letter N. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 222, 264; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 1458, p. 521; Numismatische Zeitschrift 20, 1888, p. 150.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_niessmann_recklinghausen', 'Peter Nießmann', 'Appointed Mintmaster in Recklinghausen, Germany, on 1 September 1662. Nießmann presented his appointment letter to the Assay Commission in May 1664. It appears that Peter Nießmann was the underage son of the Lünen Mintmaster Reiner Nießmann, and it was the father that carried the responsibility. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 247.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_paul_werner_(1689-1771)', 'Peter Paul Werner', 'Medalist and die cutter in Nürnberg (Nuremberg), Franconia, Germany from ? to ?. Born 1689, died 1771. His initials are PPW. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_schlebusch_colonia_claudia_ara_agrippinensium', 'Peter Schlebusch', 'Appointed Die cutter for the Cologne Circle, Germany, in 1608, Schlebusch seems to have died in office in 1625. His mintmark was a clover. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49, 140, 161, 169.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_von_eykeningen_colonia_claudia_ara_agrippinensium', 'Peter von Eykeningen', 'Appointed Mintmaster in Cologne (City), Germany, on 30 August 1486. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 22, 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peter_von_der_renen_dorsten', 'Peter von der Renen', 'Mintmaster in Dorsten, Germany, in about 1680. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 245.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/petillivs_capitolinvs_rrc', 'Petillius Capitolinus', 'Roman Republican Moneyer, c. 43 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/petronius_maximus', 'Petronius Maximus', 'The Roman emperor Petronius Maximus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/peucolaus_bactria', 'Peucolaus, Bactria', 'Peucolaus Soter Dikaios was an Indo-Greek king who ruled in the area of Gandhara c. 90 B.C.. His reign was probably short and insignificant, since he left only a few coins, but the relations of the latter Indo-Greek kings remain largely obscure.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phainnos_athens', 'Phainnos', 'Third magistrate attested in Athens in 120/119 BC. Spelling as Phainnos and Phainos (with single and double \"N\") is possible: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 551-554 / issue 45 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 440 s. v. Phainnos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 859 s. v. Phain(n)os.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phalaecus_phocis', 'Phalaecus', 'Phalaecus was the ruler of Phocis in Greece during the Third Sacred War before he was ousted. After he was ousted he became the leader of a group of mercenaries whose services were sought by Knossos in Crete. Once in Crete. The leaders of Knossos ordered him to attack their enemy, the city of Lyttus. The Lyttians appealed to the Spartans who came to Crete with an army under their king Archidamus III. As Phalaikos was besieging Lyttus, the Spartans arrived and relieved the siege. Later in 343 BC Phalaikos attacked and laid siege to Kydonia, where he was routed and he lost his life.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phalai_athens', 'Phalaikos', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 409-410 / issue 35 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 440 s. v. Phalaikos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 859 s. v. Phalai-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanaos_abdera', 'Phanaos', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanes_abdera', 'Phanes', 'An individual who issued coins at the ancient city of Abdera, 375/373-365/360 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanes', 'Phanes', 'Phanes name is attested on a series of early electrum coins, the most ancient inscribed coin series at present known, of Caria, Asia Minor. This group of coins has a Greek legend reading \"Phaneōs eimi sēma\" (Φάνεως ειμί σήμα) which can be translated either as \"I am the badge of Phanes\" or as \"I am the sign of light\" or maybe \"I am the tomb of light\" or \"I am the tomb of Phanes\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanion_byzantium', 'Phanion', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 141, nos. 1135-1143, p. 145, nos. 1224-1225.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanokle_athens', 'Phanokleides', 'Third magistrate attested in Athens in 134/133 BC [issue 31] and in the following year 133/132 BC [issue 32]. He signs tetradrachms in the last month of issue 31 and drachms in the first of the following issue 32: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 144-146 nos. 367, 373 and p. 149 no. 373 (drachm) / issues 31 and 32, commentary on p. 582; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 and 133/132 BC); Prosopographia Attica 14043; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 441 s. v. Phanokleides, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 861 s. v. Phanokleides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanokles_athens', 'Phanokles', 'First magistrate attested in Athens in 111/110 BC. Ephebe in 128/127 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 697-709, 685 / issue 54 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 14046; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 441 s. v. Phanokles, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 861 s. v. Phanokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phanokri_athens', 'Phanokritos', 'Third magistrate attested in Athens in 121/120 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 517-518 / issue 43 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 BC); Prosopographia Attica 14061; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 441 s. v. Phanokritos, no. 1; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 861 s. v. Phanokritos (121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pharnabazus_satrap', 'Pharnabazus', 'The Achaemenid Persian Satrap in Asia Minor, c. 413-374 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pharnaces_i_pontus', 'Pharnaces I of Pontus', 'Pharnaces I (lived 2nd century BC), fifth king of Pontus, was of Persian and Greek ancestry. He was the son of King Mithridates III of Pontus and his wife Laodice, whom he succeeded on the throne.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pharnaces_ii_bosporus', 'Pharnaces II of Pontus', 'Pharnaces II of Pontus, also known as Pharnaces II was the king of the Bosporan Kingdom until his death. He was a monarch of Persian and Greek Macedonian ancestry. He was the youngest child born to King Mithridates VI of Pontus from his first wife, his sister Queen Laodice.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pharsanzes_bosporus', 'Pharsanzes', 'Tiberius Julius Pharsanzes, also known as Pharsanzes was a prince and Roman Client King of the Bosporan Kingdom. Between 253–254, Pharsanzes co-ruled with his father Rhescuporis V.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pharzoius_scythia', 'Pharzoius of Scythia', 'Pharzoius was a Scythian king who seems to have struck coinage at Olbia in Thrace in the Flavian period', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phausis_salamis', 'Phausis of Salamis', 'Phausis was the king of Salamis in the second quarter of the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phe_lycia', 'Phe...', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 6', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pheidi_athens', 'Pheidi…', 'Third magistrate attested in Athens in 124/123 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 535-536, 538-540 / issue 44 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 863 s. v. Pheidi- (124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pherenikos_abydus', 'Pherenikos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Pherenikos (2); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 864 s. v. ΦΕΡΕΝ(E)ΙΚΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philaios_abdera', 'Philaios', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philan_athens', 'Philan…', 'Third magistrate attested in Athens in 136/135 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 335, 337-338, 344, 346 / issue 29 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 867 s. v. Philan-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philas_abdera', 'Philas', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phile-_odrysian_thrace', 'Phile(tas) or Phile(mon)', 'Phile(tas ?) or Phile(mon ?), Thracian ruler of the mid 3rd cent. BC, struck bronze coins similar to those of Cersobleptes', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philem_athens', 'Philem…', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 405-406, 411 / issue 35 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 447 s. v. Philemon, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 868 s. v. Philem-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philetaerus', 'Philetaerus', 'Philetaerus was the founder of the Attalid dynasty of Pergamum. In 301 BC, Lysimachus appointed him to guard a treasury of 9,000 talents of silver at Pergamum. Amid the dynastic turmoil in Lysimachus\' kingdom in 281 BC, Philetaerus invited Seleucus I to kill his master and take possession of the kingdom. After the deaths of Lysimachus and Seleucus I, he became an increasingly independent dynast. He was a eunuch and had no children of his own, adopting his nephew Eumenes I as his successor.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phile_ii_priene', 'Phile…', 'An individual who issued coins at the ancient city of Priene c. 190-170 BC. Regling completed: Phileas or Phileros II. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 867.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phile_i_priene', 'Phile…', 'An individual who issued coins at the ancient city of Priene c. 330-240 BC. Regling completed: Phileas or Phileros I. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 867.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philinos_athens', 'Philinos', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 702, 707 / issue 54 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 14309; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 449 s. v. Philinos, no. 22; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 868 s. v. Philinos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philio_athens', 'Philion', 'Third magistrate attested in Athens in 129/128 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 416 / issue 36 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 452 s. v. Philion, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 871 s. v. Philion.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/philip_i_philadelphus', 'Philip I Epiphanes Philadelphus', 'Philip I Epiphanes Philadelphus (\"God Manifest, Brother-loving\") was the twenty-second king of the Seleucid Empire, reigning from c. 94/3 to perhaps 76/5 BC. A brother of Seleucus VI, Antiochus XI, and Demetrius III, Philip I ruled jointly with Antiochus XI in Cilicia in 94/3 BC. By 94/3 BC, Antiochus XI was dead and Philip I controlled parts of northern Syria. He was besieged at Beroea by Demetrius III in 88/7 BC, but the siege was lifted when Demetrius was captured by Philip\'s Parthian allies. Philip I subsequently ruled from Antioch and briefly managed to sieze Damascus from Antiochus XII. The ancient sources are unclear about the fate of Philip I, but he seems to have died by 76/5 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_ii', 'Philip II', 'King (basileus) of Macedon from 359 BCE until his assassination in 336 BCE. He was the father of Alexander the Great and Philip III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philippus_ii', 'Philip II', 'Marcus Julius Philippus Severus, also known as Philippus II, Philip II and Philip the Younger (238–249) was the son and heir of the Roman Emperor Philip the Arab by his wife Roman Empress Marcia Otacilia Severa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_ii_spain', 'Philip II (1556-1598)', 'Philip II (Spanish: Felipe II; 21 May 1527 – 13 September 1598) was King of Spain[a] from 1556 and of Portugal from 1581 (as Philip I, Felipe I).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_iii_arrhidaeus', 'Philip III Arrhidaeus', 'Philip III Arrhidaeus (Ancient Greek: Φίλιππος Γ\' ὁ Ἀρριδαῖος; ca. 359 BC – December 25, 317 BC) was the king of Macedonia from after June 11, 323 BC until his death. He was a son of King Philip II of Macedonia by Philinna of Larissa, allegedly a Thessalian dancer, and a half-brother of Alexander the Great. Named Arrhidaeus at birth, he assumed the name Philip when he ascended to the throne.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_iv_france', 'Philip IV (1285-1314)', 'Philip IV (April–June 1268 – 29 November 1314), called the Fair (French: Philippe le Bel) or the Iron King (French: le Roi de fer), was King of France from 1285 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_iv_macedon', 'Philip IV of Macedon', 'Philip IV of Macedon was the son of Cassander. He briefly succeeded his father on the throne of Macedon prior to his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_v_macedon', 'Philip V', 'Philip V was King of the ancient kingdom of Macedonia from 221 to 179 BC. Philip\'s reign was principally marked by an unsuccessful struggle with the emerging power of the Roman Republic.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philip_the_arab', 'Philip the Arab', 'Philip the Arab (Latin: Marcus Julius Philippus Augustus; c. 204 – 249), also known as Philip or Philippus Arabs, was Roman Emperor from 244 to 249. He came from Syria and rose to become a major figure in the Roman Empire. He achieved power after the death of Gordian III, quickly negotiating peace with the Sassanid Empire. During his reign, Rome celebrated its millennium.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/herod_philip_ii_judaea', 'Philip the Tetrarch', 'Philip the Tetrarch, sometimes called Herod Philip II by modern writers (ruled from 4 BCE until his death in CE 34) was the son of Herod the Great and his fifth wife, Cleopatra of Jerusalem.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philipp_aldendorff_colonia_claudia_ara_agrippinensium', 'Philipp Aldendorff', 'The goldsmith Philipp Aldendorff was appointed Die-cutter for the Cologne Circle, Germany, in 1608, and General Warden in Cologne (City), Germany, from 1611 to 1625. He died early in 1625. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49, 140, 161.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philipp_heinrich_mueller_(1654-1719)', 'Philipp Heinrich Müller', 'Medalist and die cutter in Nürnberg (Nuremberg), Franconia, Germany who lived from 1654 to 1719. His initials are PHM. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/bardanes', 'Philippikos Bardanes', 'The Byzantine emperor Philippikos Bardanes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philippos_dardanus', 'Philippos', 'Archon attested in Dardanos in c. 193-211 AD. Not in LGPN V. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 869 s. v. ΦΙΛΙΠΠΟΣ.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philippos_chios', 'Philippos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2423', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philiskos_abydus', 'Philiskos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Philiskos (46); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 870 s. v. ΦΙΛΙΣΚΟΣ.  Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philistis_syracuse', 'Philistis of Syracuse', 'Philistis, the wife of Hieron II, was a queen of ancient Syracuse, known only from her coins, which are numerous, and of fine workmanship, and from the occurrence of her name (bearing the title of queen, as it does also on her coins) in an inscription in large letters on the great theatre of Syracuse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phili_athens', 'Phili…', 'Third magistrate attested in Athens in 96/95 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1000, 1003-1008, 1010 / issue 69 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (96/95 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 868 s. v. Phili-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philo_athens', 'Philo...', 'Φιλω-..., third magistrate in Athens in 136/135 BC (issue 29). Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 29; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 876.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philodo_athens', 'Philodo…', 'Third magistrate attested in Athens in 133/132 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 376, 378 / issue 32 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 872 s. v. Philodo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philokra_dardanus', 'Philokra( )', 'Magistrate attested in Dardanus in the 3rd century BC. Not in LGPN V. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p.873 s. v. ΦΙΛΟΚΡΑ-; SNG München 181 (4th cent. BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philokrates_athens', 'Philokrates', 'First magistrate attested in Athens in 64/63 BC [issue 99]. Again attested as first magistrate in 58/57 BC [issue 105]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1251-1252 and nos. 1265-1267 / issues 99 and 105 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (64/63 [issue 101] and 58/57 BC [issue 107]); Prosopographia Attica 14583; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 455 s. v. Philokrates, no. 38; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 873 s. v. Philokrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philokra_athens', 'Philokrates', 'Third magistrate attested in Athens in 127/126 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 433-436, 44-440X / issue 38 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (127/126 BC); Prosopographia Attica 14581; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 455 s. v. Philokrates, no. 32; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 873 s. v. Philokra-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philon_athens', 'Philon', 'Second magistrate attested in Athens in 98/97 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 959-961, 963-989 / issue 68 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (97/96 BC); Prosopographia Attica 14812; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 461 s. v. Philon, no. 49; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 876 s. v. Philon (98/97 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philo_ii_athens', 'Philon', 'Third magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 597 / issue 48 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 461 s. v. Philon, no. 44; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 876 s. v. Philo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philonides_abydus', 'Philonides', 'Magistrate attested in Abydos in c. 375-325 BC. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philoni_athens', 'Philonides', 'Third magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 596-599 / issue 48 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); Prosopographia Attica 14886; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 463 s. v. Philonides, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 877 s. v. Philonides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philonikos_maroneia', 'Philonikos', 'An individual who issued coins at the ancient city of Maroneia, c. 365-330s BC. See S. Psoma, The coins of Maroneia and the classical city at Molyvoti. A contribution to the history of Aegean Thrace (Athens, 2008), p.170. (Cf. also E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45 who prefers 386/385-348/347 BC.)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philopator_cilicia', 'Philopator of Cilicia', 'Philopator II was a Cilician king who died in 17 AD. His death induced a commotion amongst his realm. This prompted the Roman emperor Tiberius to send his heir Germanicus to the Eastern provinces with the putative aim of quelling the disturbances that existed in the region', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philopo_athens', 'Philopo…', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 640, 642 / issue 50 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 875 s. v. Philopo-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philotade_athens', 'Philotades', 'Third magistrate attested in Athens in 89/88 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1128-1130 / her issue 74 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (89/88 BC, his issue 76); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 463 s. v. Philotades, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 877 s. v. Philotades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philothemis_cyprus', 'Philothemis, Uncertain Cypriot city', 'Philothemis is a Cypriot king attested only by coins of an uncertain mint', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philotheos_athens', 'Philotheos', 'Third magistrate attested in Athens in 111/110 BC [issue 54] and in the following year 110/109 BC [issue 55]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 705, 707, 709 and nos. 709, 711-714 / issues 54 and 55 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 and 110/109 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 453 s. v. Philotheos, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 872 s. v. Philotheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philoth_athens', 'Philotheos', 'Third magistrate attested in Athens in 135/134 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 348-350, 356 / issue 30 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (135/134 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 453 s. v. Philotheos, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 872 s. v. Philotheos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philox_athens', 'Philoxenos', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 543-544, 546 / issue 45 (p. 583); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 458 s. v. Philoxenos, no. 13; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 874 s. v. Philox-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/philoxenus_bactria', 'Philoxenus of Bactria', 'Philoxenus Anicetus was an Indo-Greek king who ruled in the region spanning the Paropamisade to Punjab. Philoxenus seems to have been quite an important king who might briefly have ruled most of the Indo-Greek territory. Bopearachchi dates Philoxenus to c. 100–95 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phintias_agrigentum', 'Phintias of Akragas', 'Phintias was an ancient Greek tyrant of the Sicilian town of Acragas (c. 288 - 279 BC). He appears to have established his power over that city during the period of confusion which followed the death of Agathocles (289 BC), about the same time that Hicetas obtained the chief command at Syracuse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phittalos_i_abdera', 'Phittalos (I)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phittalos_ii_abdera', 'Phittalos (II)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phi_athens', 'Phi…', 'Third magistrate attested in Athens in 97/96 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 880-882, 886-887, 889-890, 893, 905-908, 922, 923 / issue 66 (p. 582); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (99/98 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 865 s. v. Phi- (97/96 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phocas', 'Phocas', 'The Byzantine emperor Phocas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phoi_lycia', 'Phoi...', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), II, 9', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phokritos_byzantium', 'Phokritos', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 145, nos. 1215-1223.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phormion_priene', 'Phormion', 'An individual who issued coins at the ancient city of Priene c. 330-290 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 883.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_v_parthia', 'Phraataces of Parthia', 'Phraates, also known by the diminutive version of his name, Phraataces, was the King of Kings of the Parthian Empire from 2 BC to 2 CE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_i_parthia', 'Phraates I of Parthia', 'Phraates I was ruler of the Parthian Empire from c. 176–171 BC. He subdued the Amardians (lat. Amardis), mountaineers occupying the eastern portion of the Elburz range, south of the Caspian Sea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_ii_parthia', 'Phraates II of Parthia', 'Phraates II was king of the Parthian Empire from 132 BC to 127 BC. He is mostly known for his attempt to reconquer Babylon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_iii_parthia', 'Phraates III of Parthia', 'Phraates III, was King of Kings of the Parthian Empire from 69 BC to 57 BC. He was the son and successor of Sinatruces (r. 78/7–69 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_iv_parthia', 'Phraates IV of Parthia', 'Phraates III, was King of Kings of the Parthian Empire from 37 to 2 BC. He was appointed successor to the throne in 37 BC, after the death of his brother Pacorus I. He soon murdered his father and all his brothers.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phraates_elymais', 'Phraates of Elymais', 'Phraates was an Arsacid king of Elymais from ca. AD 70-90. He was the son of Orodes I or II of Elymais.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/phratapernes_persia', 'Phrataphernes of Persia', 'Phrataphernes was a Persian who held the government of Parthia and Hyrcania, under the king Darius III Codomannus, and joined that monarch with the contingents from the provinces subject to his rule, shortly before the battle of Gaugamela in 331 BC. He afterwards accompanied the king on his flight into Hyrcania. Numismatic legends alternatively name Phahaspes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/priapatius_parthia', 'Phriapatius of Parthia', 'Priapatius (also spelled Phriapatius or Phriapites), was the Arsacid king of Parthia from 191 BC to 176 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pierre_girard_geneva', 'Pierre Girard', 'Pierre Girard is a mint master from Geneva.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pixodarus_caria', 'Pixodarus of Caria', 'Pixodarus or Pixodaros (in Lycian ???????? Pixedara; in Greek Πιξώδαρoς; ruled 340–335 BC), was a ruler of Caria, nominally the Achaemenid Empire Satrap, who enjoyed the status of king or dynast by virtue of the powerful position his predecessors of the House of Hecatomnus (the Hecatomnids)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pl_maroneia', 'Pl(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/plato_bactria', 'Plato of Bactria', 'Plato was a Greco-Bactrian king who reigned for a short time in southern Bactria or the Paropamisade during the mid 2nd century B.C., perhaps about 145-140 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/platon_athens', 'Platon', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 765-768, 758 (drachm) / issue 59 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); Prosopographia Attica 11847; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 369 s. v. Platon, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 758 s. v. Platon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/plautilla', 'Plautilla', 'Publia Fulvia Plautilla, Fulvia Plautilla or Plautilla (c. 185/around 188/189 - early 212) was the only wife of the Roman emperor Caracalla, who was her paternal second cousin. After her father was condemned for treason, she was exiled and eventually killed on Caracalla\'s orders.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pleistias_athens', 'Pleistias', 'Third magistrate attested in Athens in 93/92 BC [issue 72]. Again attested as third magistrate in 89/88 BC [Thompson issue 74]. From Kephisia (the name is common in this deme, otherwise unknown. Habicht\'s assumption, ibid. p. 22 \"Ephebe in 148/147 BC\" seems unlikely as there would be more than 50 years between ephebeia and magistracy): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1052-1053, 1055 and nos. 1127, 1130 / her issues 72 and 74 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 22 (93/92 and 89/88 BC, his issues 72 and 76); Prosopographia Attica 11865; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 369 s. v. Pleistias, no. 4 (listed under Athens in general, no particular deme); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 758 s. v. Pleistias.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/plotina', 'Plotina', 'Pompeia Plotina Claudia Phoebe Piso (d. 121/122) was a Roman Empress and wife of Roman Emperor Trajan. When Plotina died, c. 121/122, she was deified.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pny-_paphus', 'Pny- of Paphos', 'Fifith century king of Paphos in Cyprus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pnytagoras_salamis', 'Pnytagoras of Salamis', 'Pnytagoras (Greek: Πνυταγόρας) was a king of the Ancient Greek city-state of Salamis in Cyprus. He was the nephew and successor of Evagoras II, who was overthrown in 351 BC and exiled due to his pro-Achaemenid stance.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polyxenus_bactria', 'PoIyxenus, Bactria', 'Polyxenos Epiphanes Soter was an Indo-Greek king who ruled briefly in western Punjab or Gandhara ca. 100 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pol_maroneia', 'Pol(…)', 'An individual who issued coins at the ancient city of Maroneia, 495-448 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 124.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polemar_priene', 'Polemar…', 'An individual who issued coins at the ancient city of Priene c. 190-160 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 761.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polemon_athens', 'Polemon', 'First magistrate attested in Athens in 125/124 BC. From Perithoidai as his colleague, the second magistrate Alketes. His brother Patro[n] was one of the third magistrates of the same issue (Habicht 1991, p. 19). Epimeletes in Delos in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 461-474 / issue 40 (p. 578); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 8 (125/124 BC); Prosopographia Attica 11890; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 370 s. v. Polemon, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 761 s. v. Polemon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polemon_i_pontus', 'Polemon I of Pontus', 'Polemon Pythodoros, also known as Polemon I or Polemon I of Pontus was the Roman Client King of Cilicia, Pontus, Colchis and the Bosporan Kingdom. Polemon was the son and heir of Zenon and possibly Tryphaena. Zenon and Polemon adorned Laodicea with many dedicated offerings.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polemon_ii_pontus', 'Polemon II of Pontus', 'Marcus Antonius Polemon Pythodoros, also known as Polemon II of Pontus and Polemon of Cilicia was a prince of the Bosporan, Pontus, Cilicia and Cappadocia. He served as a Roman Client King of Pontus, Colchis and Cilicia. Polemon II was the second son and middle child of the Pontic Rulers Polemon Pythodoros and Pythodorida of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poli_priene', 'Poli…', 'An individual who issued coins at the ancient city of Priene c. 240-170 BC. Regling completed: Polites? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 762.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polli_priene', 'Polli…', 'An individual who issued coins at the ancient city of Priene c. 170-160 BC. Regling completed: Pollis? Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 762.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polyaretos_abdera', 'Polyaretos', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polyaretos_maroneia', 'Polyaretos', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polycharm_athens', 'Polycharmos', 'First magistrate attested as in Athens in 133/132 BC [issue 32]. Earlier attested as third magistrate in 136/135 BC [issue 29]: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 133 nos. 324, 330-331 and nos. 368, 376-373, 381-382 / issues 29 and 32 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 and 133/132 BC); Prosopographia Attica 12109; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 375 s. v. Polycharmos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 767 s. v. Polycharmos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polycharmos_athens', 'Polycharmos', 'Second magistrate attested in Athens in 57/56 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1268 / her issue 106 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (57/56 BC, his issue 108); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 375 s. v. Polycharmos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 767 s. v. Polycharmos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polygnotos_cyme', 'Polygnotos', 'Magistrate attested on the Alexander coinage of Cyme, c. 188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1639', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poly_athens', 'Polykles', 'First magistrate attested in Athens in 149/148 BC. From Thorikos. Belonging to the same family as his colleague, the second magistrate Timarchides – either his brother (Thompson 1961, p. 579) or his cousin (Habicht 1991, p. 7) – he was member of a family of famous Athenian sculptors: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 101X-110 / issue 16 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 7 (149/148 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 373 s. v. Polykles, no. 42; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 765 s. v. Polykles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polykle_athens', 'Polykles', 'Third magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 408, 411 / issue 35 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 373 s. v. Polykles, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 765 s. v. Polykles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polykra_athens', 'Polykrates', 'Third magistrate attested in Athens in 110/109 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 714 / issue 55 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); Prosopographia Attica 12010; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 373 s. v. Polykrates, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 765 s. v. Polykra-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polykrates_i_abdera', 'Polykrates (I)', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polykrates_ii_abdera', 'Polykrates (II)', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polym_athens', 'Polym…', 'Third magistrate attested in Athens in 136/135 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 332-333, 342-344 / issue 29 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (136/135 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 766 s. v. Polym-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polynikos_maroneia', 'Polynikos', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polyphantos_abdera', 'Polyphantos', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/polyxenos_samothrace', 'Polyxenos', 'Magistrate attested on the coinage of Samothrace c. 188-150 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (Wien, 2009) p. 766.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pompey', 'Pompey', 'Gnaeus Pompeius Magnus (29 September 106 BC – 28 September 48 BC), usually known in English as Pompey or Pompey the Great, was a military and political leader of the late Roman Republic.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/gnaeus_pompeius', 'Pompey the Younger', 'Gnaeus Pompeius (ca. 75 BC – April 12, 45 BC), also known as Pompey the Younger, was a Roman politician and general. He was the elder son of Pompey the Great, and older brother of Sextus Pompey.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_fu_pontianus_pirf496', 'Pontius Furius (?) Pontianus', 'Legatus augusti pro praetore Moesiae inferioris in AD 217-218. His name appears (without any title) on coins of Markianpolis and Nikopolis. Lit.: PIR² F 496.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pontius_pilate', 'Pontius Pilate', 'Pontius Pilatus was the fifth Prefect of the Roman province of Judaea, from AD 26–36.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/popli_athens', 'Poplios', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 771, 774-776 / issue 59 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 376 s. v. Poplius, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 769 s. v. Popli-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/porcius_festus', 'Porcius Festus', 'Porcius Festus was procurator of Judea from about AD 59 to 62, succeeding Antonius Felix.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poseidippos_maroneia', 'Poseidippos', 'An individual who issued coins at the ancient city of Maroneia, 437/436-436/435 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/posei_athens', 'Poseidonios', 'Second magistrate attested in Athens in 129/128 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 413-420 / issue 36 (p. 579); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 377 s. v. Poseidonios, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 771 s. v. Posei- (130/129 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poseid_priene', 'Poseid…', 'An individual who issued coins at the ancient city of Priene c. 170-160 BC. Regling completed: Poseidippos or Poseidonios. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 771.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poses_athens', 'Poses', 'Second magistrate attested in Athens in 102/101 BC. From Phaleron. Belongs to the same family as his colleague Timostratos, probably his brother (for the stemma cf. Thompson 1961, p. 579). Attested as author of comedies, victor with one of his comedies at the Serapieia in Tanagra in the same year Asklepiades (magistrate of issue 62 in 103/102 BC) was successful with a tragedy (Habicht 1991, p. 10). Thesmotetes in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 823-839 / issue 63 (p. 579 f.); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (102/101 BC); Prosopographia Attica 12149; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 378 s. v. Poses, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 772 s. v. Poses.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/posideios_i_maroneia', 'Posideios (I)', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/posideios_ii_maroneia', 'Posideios (II)', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/posideus_maroneia', 'Posideus', 'An individual who issued coins at the ancient city of Maroneia, 411/410-398/397 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/postumus', 'Postumus', 'Marcus Cassianius Latinius Postumus was a Roman emperor of Batavian origin. He usurped power from Gallienus in 260 and formed the so-called Gallic Empire. He was recognised in Gaul, Germania, Britannia and Iberia until his murder in 269.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/poumyathon_citium', 'Poumyathon of Citium', 'Poumyathon (Pumiathon) was the final king of Phoenician Citium, killed in 312 B.C. when Ptolemy I invaded Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pramathesvari', 'Pramathesvari (Phulesvari ) (d. 1731)', 'Pramathesvari (Phulesvari ) (d. 1731), also known as Bar Raja Phuleswari Konwari, was the queen of Sutanphaa (or Siva Singha) (Assamese: স্বৰ্গদেউ শিৱ সিংহ) (reign 1714–1744) was a King in Assam.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/praxippus_lapethus', 'Praxippus of Lapethus', 'Praxippus was a king of Lapethus in Cyprus in the mid 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prince_X_persis', 'Prince X of Persis', 'Nambed of Persis ruler of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prince_Y_persis', 'Prince Y of Persis', 'Napad of Persis ruler of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prince_Z_persis', 'Prince Z of Persis', 'Uncertain issuer of anonymous coinage of Persis under Parthia in the 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/priscus_attalus', 'Priscus Attalus', 'The Roman emperor Priscus Attalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/priuli_girolamo', 'Priuli, Girolamo (1559-1567)', 'Girolamo Priuli (1486 in Venice – 4 November 1567 in Venice) was a Venetian noble, who served as the eighty-third Doge of Venice, from 1 September 1559 until his sudden death from a stroke in 1567.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/priuli_lorenzo', 'Priuli, Lorenzo (1556-1559)', 'Lorenzo Priuli (1489 – 17 August 1559) was the 82nd Doge of Venice. He reigned from 1556 to 1559.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pro_abdera', 'Pro(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/probus', 'Probus', 'Probus (Latin: Marcus Aurelius Probus Augustus; c. 19 August 232 – September/October 282), was Roman Emperor from 276 to 282.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/procles_i_teuthrania', 'Procles I of Teuthrania', 'Procles I was a king of the city of Teuthrania in Mysia, near Pergamum, who was allied with the Achaemeneids ca. 399 B.C. The coinage of Procles displays one of the earliest portraits of a Greek ruler on a coin.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/procopius', 'Procopius', 'The Roman emperor Procopius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/proculus', 'Proculus', 'Usurper against the Roman Emperor Probus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/proklos_i_abydus', 'Proklos', 'Archon in Abydos in c. 193-217 AD. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Proklos (76); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 777 s. v. ΠΡΟΚΛΟΣ; Robinson, NC 1921, p. 15 (coin) (Φαβ. Ἀτ. Πρόκλος)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/proklos_ii_abydus', 'Proklos', 'Archon in Abydos in c. 222-235 AD. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Proklos (77); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 777 s. v. ΠΡΟΚΛΟΣ; Coll. Winterthur 2696 (coin) (Αὐρ. Πρόκλος)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/promethides_abdera', 'Promethides', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prosius_tertullianus_pirp1015', 'Prosius Tertullianus', 'Legatus Augusti pro praetore in Moesia. He appears by name only on coins from Marcianopolis/Moesia inferior during the reign of Gordianus III and Tranquillina AD 241-244. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 144 no. 134; PIR VI² (1998) 428 no. 1015 s. v. Prosius; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 838.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protagoras_abydus', 'Protagoras', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Protagoras (18); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 780 s. v. ΠΡΩΤΑΓΟΡΑΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protagores_abydus', 'Protagores', 'Magistrate attested in Abydos in c. 375-325 BC. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protes_i_abdera', 'Protes (I)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protes_ii_abdera', 'Protes (II)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protes_iii_abdera', 'Protes (III)', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protim_athens', 'Protimos', 'Third magistrate attested in Athens in 133/132 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 379-381 / issue 32 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132 BC); Prosopographia Attica 12280; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 383 s. v. Protimos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 779 s. v. Protimos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protoge_athens', 'Protogenes', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 398-399 / issue 34 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 12306; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 383 s. v. Protogenes, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 780 s. v. Protogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protogonos_abydus', 'Protogonos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Protogonos (3); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 780 s. v. ΠΡΩΤΟΓΟΝΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/protom_athens', 'Protomachos', 'Third magistrate attested in Athens in 116/115 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 620, 622 / issue 49 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 384 s. v. Protomachos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 780 s. v. Protomachos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prusias_i_bithynia', 'Prusias I of Bithynia', 'Prusias I Cholus was the son of Ziaëlas, king of Bithynia. He sdiedd with Philip V against the Attalid kingdom. He remianed neutral in the Roman against Antiochus, but lost territory as the result of a subsequent unsuccessful war against the Attalids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/prusias_ii_bithynia', 'Prusias II of Bithynia', 'Prusias II was the son and successor of Prusias I. He married the sister of Perseus of Macedon, and was forced to abase himself before the Senate to seek rehabilitation. He was despoed by his son and stoned to death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemaeus_commagene', 'Ptolemaeus of Commagene', 'Ptolemaeus was of Armenian descent. Initially satrap of Commagene, he became the first King of Commagene in 163 BC. He was of Orontid Armenian descent, being related to the king of Sophene Arsames I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_apion_cyrene', 'Ptolemy Apion', 'Ptolemy Apion or simply known as Apion (Ancient Greek: Πτολεμαῖος Ἀπίων, between 150 BC and 145 BC – 96 BC) was the last Greek King of Cyrene and was a member of the Ptolemaic dynasty. Ptolemy was Greek and native Egyptian in descent. His second name Apion is a name of ancient Egyptian origin and could be a name from his maternal ancestry.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_ceraunus', 'Ptolemy Ceraunus', 'Ptolemy Ceraunus (ca. 319 BC – January/February 279 BC) was a member of the Ptolemaic dynasty and briefly king of Macedon. As the son of Ptolemy I Soter, he was originally heir to the throne of Ptolemaic Egypt, but he was displaced in favour of his younger brother Ptolemy II Philadelphus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_i', 'Ptolemy I Soter', 'Ptolemy I Soter I (Ancient Greek: Πτολεμαῖος Σωτήρ, Ptolemaĩos Sōtḗr, i.e. Ptolemy (pronounced /ˈtɒləmi/) the Savior), also known as Ptolemy Lagides,[1] c. 367 BC – c. 283 BC, was a Macedonian general under Alexander the Great, who became ruler of Egypt (323 BC – 283 BC) and founder of both the Ptolemaic Kingdom and the Ptolemaic Dynasty. In 305/4 BC he took the title of pharaoh.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_i_telmessus', 'Ptolemy I of Telmessus', 'Ptolemy I of Telmessus, or Ptolemy Epigonos, (299/298 BC–February 240 BC) was a Greek Prince from Asia Minor who was of Macedonian and Thessalian descent. He was the son of Lysimachus and Arsinoe II. After failing to ascend the throne of the Kingdom of Macedonia, he fled to Egypt, where he ruled as co-regent with Ptolemy II from no later than 267 B.C. until 259 B.C. He was sent to Miletus, where he revolted against Ptolemy II in 259/258, but reconcilated. He then ruled as client-king of the Ptolemaic Empire in Telmessus from 258 to 240 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_ii', 'Ptolemy II Philadelphus', 'Ptolemy II Philadelphus was the king of Ptolemaic Egypt from 283 to 246 BCE. He was the son of the founder of the Ptolemaic kingdom Ptolemy I Soter and Berenice, and was educated by Philitas of Cos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_iii', 'Ptolemy III Euergetes', 'Ptolemy III Euergetes (reigned 246–222 BC) was the third king of the Ptolemaic dynasty in Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_iv', 'Ptolemy IV Philopator', 'Ptolemy IV Philopator (Greek: Πτολεμαῖος Φιλοπάτωρ, Ptolemaĩos Philopátōr, reigned 221–205 BCE), son of Ptolemy III and Berenice II of Egypt was the fourth Pharaoh of Ptolemaic Egypt. Under the reign of Ptolemy IV, the decline of the Ptolemaic kingdom began.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_ix', 'Ptolemy IX Soter II', 'Ptolemy IX Soter II, commonly nicknamed Lathyros reigned twice as king of Ptolemaic Egypt. He took the throne after the death of his father Ptolemy VIII in 116 BC, in joint rule with his mother Cleopatra III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_v', 'Ptolemy V Epiphanes', 'Ptolemy V Epiphanes (reigned 204–181 BC), son of Ptolemy IV Philopator and Arsinoe III of Egypt, was the fifth ruler of the Ptolemaic dynasty.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/ptolemy_vi', 'Ptolemy VI Philometor', 'Ptolemy VI Philometor was a king of Egypt from the Ptolemaic period. He reigned from 180 to 145 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_vii', 'Ptolemy VII Neos Philopator', 'Ptolemy VII Neos Philopator (\"Ptolemy the New Beloved of his Father\") was an Egyptian king of the Ptolemaic period. His reign is controversial, and it is possible that he did not reign at all, but was only granted royal dignity posthumously.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_viii', 'Ptolemy VIII Physcon', 'Ptolemy VIII Euergetes II (\"Ptolemy the Benefactor\"; c. 182 BC – June 26, 116 BC), nicknamed Physcon (\"the Fat\"), was a king of the Ptolemaic dynasty in Egypt, ruling from 169 to 164 B.C. with siblings Ptolemy VI and Cleopatra II and a second time from 144 to 132/1 and again from 126 to 116.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_x', 'Ptolemy X Alexander I', 'Ptolemy X Alexander I was King of Egypt from 110 BC to 109 BC and 107 BC till his death in 88 BC, in co-regency with his mother Cleopatra III until 101 BC, and then possibly with his niece-wife Berenice III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xi', 'Ptolemy XI Alexander II', 'Ptolemy XI Alexander II was a member of the Ptolemaic dynasty who ruled Egypt for a few days in 80 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xii', 'Ptolemy XII Auletes', 'Ptolemy Neos Dionysos Theos Philopator Theos Philadelphos was a pharaoh of the Ptolemaic dynasty of Ancient Egypt. He was commonly known as \"Auletes\" (\"the Flutist\"), referring to the king\'s love of playing the flute in Dionysian festivals.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xiii', 'Ptolemy XIII Theos Philopator', 'Ptolemy XIII Theos Philopator (\"Ptolemy, God Beloved of his Father\"; 62 BC/61 BC – prob. January 13, 47 BC, reigned from 51 BC) was one of the last members of the Ptolemaic dynasty (305–30 BC) of Egypt. He was the son of Ptolemy XII and the brother of and co-ruler with Cleopatra VII. Cleopatra\'s exit from Egypt caused a civil war to break out between the pharaohs. Ptolemy later ruled jointly with his other sister, Arsinoe IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xiv', 'Ptolemy XIV', 'Ptolemy XIV (who lived 60 BC/59 BC–44 BC and reigned 47 BC–44 BC), was a son of Ptolemy XII of Egypt and one of the last members of the Ptolemaic dynasty of Egypt. Following the death of his older brother Ptolemy XIII of Egypt on January 13, 47 BC, he was proclaimed Pharaoh and co-ruler by their older sister and remaining Pharaoh, Cleopatra VII of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xv', 'Ptolemy XV Caesarion', 'Ptolemy XV Philopator Philometor Caesar (June 23, 47 BC – August 23, 30 BC), better known by the nicknames Caesarion and Ptolemy Caesar, was the last Pharaoh of Egypt, reigning with his mother Cleopatra VII from 2 September 44 BC until her death by 12 August 30 BC and as sole ruler until his own death was ordered by Octavian, the later Roman emperor Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_xvi', 'Ptolemy XVI Philadelphus', 'Ptolemy Philadelphus (\"Ptolemy the brother-loving\", August/September 36 BC – 29 BC) was a Ptolemaic prince and was the youngest and fourth child of Greek Ptolemaic Queen Cleopatra VII of Egypt, and her third with Roman Triumvir Mark Antony.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_chalcis', 'Ptolemy of Chalcis', 'Ptolemy or Ptolemaeus, son of Mennaeus, was tetrarch of Iturea and Chalcis from about 85 BC to 40 BC, in which year he died.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_jubae_ii_mauretania', 'Ptolemy of Mauretania', 'Ptolemy of Mauretania was the last Roman client king and ruler of Mauretania for Rome. He was a member of the Berber Massyles tribe of Numidia; via his mother Cleopatra Selene II, he was also a member of Egypt\'s Ptolemaic dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ptolemy_cyprus', 'Ptolemy, King of Cyprus', 'Ptolemy of Cyprus was the king of Cyprus c. 80-58 BC. He was the younger brother of Ptolemy XII Auletes, king of Egypt, and, like him, an illegitimate son of Ptolemy IX Lathyros. He was also the uncle of Cleopatra VII.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pu_lycia', 'Pu...', 'Dynast in the ancient region of Lycia from approximately 500–480 BC. See E. Babelon, Traité des monnaies grecques et romaines 2.1. Contenant les monnaies grecques depuis les origines jusqu\'aux guerres médiques, Paris, 1907, no. 789', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_aelius_artemidoros_cyzicus', 'Publius Aelius Artemidoros', 'Strategos and Asiarch in Cyzicus/Mysia during the reign of Gordian III. His name appears on coins always in combination with his title of Strategos and sometimes with the additional one of Asiarchos: RPC VII-1 pp. 107, 109 nos. 4-6, 7,1-7,2 (AD 238-244). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 367 s. v. Artemidoros (AD 238-244 ); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 73 s. v. Artemidoris (no. 542) (AD 238-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_petronius_p_f_pirp269', 'Publius Petronius P. f.', 'Consul suffectus in AD 19. Proconsul Provinciae Asiae from mid AD 28 to mid AD 36. His name appears on coins of Pergamum in Mysia and Smyrna in Ionia. Legatus Augusti pro praetore provinciae Syriae between AD 39 and 42. Lit.: PIR² P 269; P. R. Franke, Publius Petronius und L. Aelius Seianus, Archäologischer Anzeiger 83, 1969, 474 pp; G. R. Stumpf, Numismatische Studien zur Chronologie der römischen Statthalter in Kleinasien (122 v. Chr.-163 n. Chr.) (1991) pp. 120-122.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/publius_quinctilius_varus', 'Publius Quinctilius Varus', 'Legatus Augusti pro praetore provinciae Syriae and Legatus Augusti pro praetore in Germania. Died in AD 9 in battle of the Teutoburg Forest. His name and portrait respectively appear on coins of Achulla, Hadrumentum, and Antiochia. Countermarks bear his name in Germania and Gallia resp.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/puna_lycia', 'Puna...', 'Dynast in the ancient region of Lycia from approximately 420–400 BC. See E. Babelon, Traité des monnaies grecques et romaines 2.1. Contenant les monnaies grecques depuis les origines jusqu\'aux guerres médiques, Paris, 1907, no. 817', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pupienus', 'Pupienus', 'Roman emperor in 238 A.D.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/puresi_lycia', 'Puresi', 'Dynast in the ancient region of Lycia from approximately 420–380 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M245', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pylaemenes_ii_paphlagonia', 'Pylaemenes II of Paphlagonia', 'Pylaemenes II was king of Paphlagonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pylaemenes_iii_paphlagonia', 'Pylaemenes III of Paphlagonia', 'Pylaemenes III was the son of Nicomedes III of Bithynia and king of Paphlagonia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pyrrhi_athens', 'Pyrrhi…', 'Third magistrate attested in Athens in 113/112 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 679-680, 682-684 / issue 52 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 786 s. v. Pyrrhi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pyrrhos_priene', 'Pyrrhos', 'An individual who issued coins at the ancient city of Priene c. 270-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 787.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pyrrhos_athens', 'Pyrrhos', 'Third magistrate attested in Athens in 115/114 BC. From Lamptrai. Attested as knight in 128/127 BC (H. B. Mattingly, NC 157, 1997, p. 259). Brother of Byttakos, one of the third magistrates in 118/117 BC (Thompson 1961, p. 580; Habicht 1991, p. 21): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 631-636 / issue 50 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 12509; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 389 s. v. Pyrrhos, no. 32; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 787 s. v. Pyrrhos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pyrrhus', 'Pyrrhus', 'Pyrrhus was a Greek general and statesman of the Hellenistic period. He was king of the Greek tribe of Molossians, of the royal Aeacid house (from c. 297 BC), and later he became king of Epirus (r. 306–302, 297–272 BC). He was one of the strongest opponents of early Rome.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pyrwos_amathus', 'Pyrwos of Amathus', 'Pyrwos was a king of Amathus, Cyprus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythagores_abdera', 'Pythagores', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythagores_lydia', 'Pythagores', 'Pythagores was the issuer or authority behind an enigmatic series of coins beraing an image of the Great King of Persia on one side, and what appears to be a mpa of Lydia on the reverse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythes_i_abdera', 'Pythes (I)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythes_ii_abdera', 'Pythes (II)', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythinnes_i_abdera', 'Pythinnes (I)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythinnes_ii_abdera', 'Pythinnes (II)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythodoris_pontus', 'Pythodoris of Pontus', 'Pythodorida or Pythodoris of Pontus was a Roman client queen of Pontus, the Bosporan Kingdom, Cilicia, and Cappadocia. Polemon I died in 8 BC, and Pythodorida became the sole Queen of Pontus until her death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythodoros_abdera', 'Pythodoros', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythodoros_maroneia', 'Pythodoros', 'An individual who issued coins at the ancient city of Maroneia, 436/435-411/410 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythogenes_abydus', 'Pythogenes', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Pythogenes (4); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 784 s. v. ΠΥΘΟΓΕΝΗΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythokles_abdera', 'Pythokles', 'An individual who issued coins at the ancient city of Abdera, 365/360-350/345 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythokles_athens', 'Pythokles', 'Third magistrate attested in Athens in 128/127 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 425-427 / issue 37 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 12439; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 387 s. v. Pythokles, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 784 s. v. Pythokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/python_abdera', 'Python', 'An individual who issued coins at the ancient city of Abdera, 411/410-386/385 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/python_dardanus', 'Python', 'Magistrate attested in dardanos c. 375-325 BC. AR coin in Paris. Not in LGPN V; not in Leschhorn LAGM.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythonikos_maroneia', 'Pythonikos', 'An individual who issued coins at the ancient city of Maroneia, 240/239-200 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pythoni_athens', 'Pythonikos', 'Third magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 453-454, 456-457, 460 / issue 39 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 12459; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 388 s. v. Pythonikos, no. 6; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 785 s. v. Pythonikos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/pytho_byzantium', 'Pytho…', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 146, nos. 1249-1250.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/p_priene', 'P…', 'An individual who issued coins at the ancient city of Priene c. 230-190 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. -.', 'http://xmlns.com/foaf/0.1/Person'),
