('http://nomisma.org/id/qa\'itybay', 'Qa\'itybay', 'Al-Ashraf Sayf ad-Din Qa\'it Bay (Arabic: قايتباي‎) was the eighteenth Burji Mamluk Sultan of Egypt from 872-901 A.H. (AD 1468-1496).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qala\'un', 'Qala\'un', 'Saif ad-Dīn Qalawun aṣ-Ṣāliḥī (also Qalāʾūn or Kalavun) (Arabic: قلاوون الصالحي‎) (epithet: al-Malik al-Manṣūr Saif ad-Dīn Qalāʾūn al-Alfi as-Ṣālihī an-Najmī al-ʿAlāʾī (Arabic: الملك المنصور سيف الدين قلاوون الألفى الصالحى النجمى العلاءى)) was the seventh Mamluk sultan of Egypt. He was in the Baḥrī line and ruled Egypt from 1279 to 1290.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qansuh_al-ghuri', 'Qansuh al-Ghuri', 'Al-Ashraf Qansuh al-Ghawri (Arabic: الأشرف قانصوه الغوري‎) was the second-to-last of the Mamluk Sultans. One of the last of the Burji dynasty, he reigned from 1501 to 1516.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/queen_victoria', 'Queen Victoria (1837-1901)', 'Victoria (Alexandrina Victoria; 24 May 1819 – 22 January 1901) was Queen of the United Kingdom of Great Britain and Ireland from 20 June 1837 until her death. From 1 May 1876, she used the additional title of Empress of India.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/queen_wilhelmina', 'Queen Wilhelmina (1890-1962)', 'Wilhelmina (Wilhelmina Helena Pauline Maria; 31 August 1880 – 28 November 1962) was Queen of the Kingdom of the Netherlands from 1890 to 1948. She reigned for nearly 58 years, longer than any other Dutch monarch.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quietus', 'Quietus', 'Usurper during the reign of the Emperor Gallienus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintillus', 'Quintillus', 'Quintillus (Latin: Marcus Aurelius Claudius Quintillus Augustus; c. 220 – April 270), commonly known as Quintillus, was Roman Emperor for less than a year in 270.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintus_caecilius_secundus_servilianus_pirc82', 'Quintus Caecilius Secundus Servilianus', 'Legatus Augusti pro praetore in Thrace in the later years of Commodus\' reign. His name appears on coins of Anchialus, Nikopolis, Philippopolis, and Pautalia. In latter case always as Hegemon. He also appears on coins of the Thracian city Hadrianopolis with title of Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 168 no. 39; ibid. I Addenda (2011) 22:039; PIR² C 82.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintus_julius_gallienus', 'Quintus Julius Gallienus', 'The youngest son of the Roman emperor, Gallienus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintus_sicinius_clarus_po_pirs699', 'Quintus Sicinius Clarus Po(ntianus?)', 'Legatus Augusti pro praetore in Thrace in AD 202. His name appears on coins of Hadrianopolis, Augusta Traiana, and Pautalia. In latter case always with title of Hegemon. The reconstruction of his name as Po(ntianus) is according to PIR² not correct. Lit.: E. Schönert-Geiss, Die Münzprägung von Augusta Traiana und Traianopolis (1991) 10; B. E. Thomasson, Laterculi Praesidum I (1984) 170 no. 45; ibid., I Addenda (2011) 22:45; PIR² S 699.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintus_tineius_rufus_pirt227', 'Quintus Tineius Rufus', 'Legatus Augusti pro praetore in Thrace AD 124-128. His name appears on coins of Bizye with titles of Presbeutes and Antistrategos. Lit.: Y. Youroukova, Die Münzprägung von Bizye (1981) 9-10; B. E. Thomasson, Laterculi Praesidum I (1984) 164 no. 13; ibid., Addenda (2011) 22:013; PIR² T 227.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/quintus_tullius_maximus_pirt386', 'Quintus Tullius Maximus', 'Legatus Augusti pro praetore in Thrace post AD 162 n. Chr. His name appears with title of Hegemon on coins. Lit.: E. Schönert-Geiss, Die Münzprägung von Augusta Traiana und Traianopolis (1991) 7; B. E. Thomasson, Laterculi Praesidum (1984) 166 no. 30; ibid., I Addenda (2011) 22:030; PIR² T 386.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qutb_al-din_ighazi', 'Qutb al-Din Ighazi', 'Qutb al-Din Ighazi (572-580/1176-1184) was a ruler of the Hisn Kayfa and Amid branch of the Artuqids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qutb_al-din_mawdud_ibn_zengi', 'Qutb al-Din Mawdud ibn Zengi', 'Qutb ad-Din Mawdud was the Zengid Emir of Mosul from 1149 to 1170.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qutb_al-din_muhammad_ibn_zengi', 'Qutb al-Din Muhammad ibn Zengi', 'Qutb ad-Din Muhammad was the Zengid Emir of Sinjar 1197–1219.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qutb_al-din_sukman_ii', 'Qutb al-Din Sukman II', 'Qutb al-Din Sukman II (581-597/1185-1201) was a ruler of the Hisn Kayfa and Amid branch of the Artuqids.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/qutuz', 'Qutuz', 'Saif ad-Din Qutuz, also spelled Kutuz or Koetoez, (Arabic: سيف الدين قطز‎; epithet: al-Malik al-Muzaffar Saif ad-Din Qutuz (Arabic: الملك المظفر سيف الدين قطز) was the third of the Mamluk Sultans of Egypt in the Turkic line from 1259 until his death in 1260.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rabbel_ii_nabataea', 'Rabel II Soter of Nabataea', 'Rabel II Soter (ar-Rabil) was the last ruler of the Nabataean Kingdom, ruling from 70 to 106.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rajuvula_mathura', 'Rajuvula', 'Rajuvula was an Indo-Scythian Great Satrap (Mahakshatrapa), one of the \"Northern Satraps\" who ruled in the area of Mathura in the northern Indian Subcontinent in the years around 10 A.D. The Mathura lion capital was consecrated under the reign of Rajuvula.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/regalianus', 'Regalianus', 'Briefly claimed the office of Emperor in 260.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/reiner_budels_deutz', 'Reiner Budels', 'Appointed Mintmaster in Deutz, Germany, in May 1572 (even though he seemed to have been working in this position somewhat earlier), but on 8 October 1578 Budels was arrested and charged for producing under-weight coins. He lost his position soon after. In 1579 Budels was shown as working in collaboration with the Warden Jost. Reiner Budels was the son of the late Lütterich Mintmaster who died during the Lower Rhine - Westaflen Circle Assay Commission of 1566 in Cologne. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 47, 66.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/reiner_gronwalt_colonia_claudia_ara_agrippinensium', 'Reiner Gronwalt', 'Mintmaster in Cologne (City), Germany, from 1602 to 1605, he died in office sometime soon before 25 April 1605. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 39, 47.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhadamasades_bosporus', 'Rhadamasades', 'Tiberius Julius Rhadamsades, sometimes known as Rhadamsades was a prince and Roman Client King of the Bosporan Kingdom. Around 308/309, Rhadamsades succeeded his father when he died. Rhadamsades became co-ruler with his older brother Rhescuporis VI. Rhadamsades ruled as Bosporan King with Rhescuporis VI from around 309 until his death in 323.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhaescuporis_i_sapaean_thrace', 'Rhaescuporis I of Thrace', 'Rhescuporis I was the Sapaean king of Thrace in 48-41 BC. He was the son of Cotys I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhaescuporis_ii_sapaean_thrace', 'Rhaescuporis II of Thrace', 'Rhescuporis II was king of half of the Odrysian kingdom of Thrace from 12 to 18, in succession to his brother Rhoemetalces I, and briefly ruler of the entire realm thereafter, usurping the other half from nephew Cotys VIII. He was a son of the earlier Thracian king Cotys VI and the younger brother of kings Cotys VII and Rhoemetalces I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_i_bosporus', 'Rhescuporis I', 'Tiberius Julius Rhescuporis I Philocaesar Philoromaios Eusebes, also known as Rhescuporis I (died A.D. 90) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_ii_bosporus', 'Rhescuporis II', 'Tiberius Julius Rhescuporis II Philocaesar Philoromaios Eusebes, also known as Rhescuporis II (died 227) was a prince and Roman Client King of the Bosporan Kingdom. He co-ruled with his son, Rhescuporis III, until they died in 227.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_iii_bosporus', 'Rhescuporis III', 'Tiberius Julius Rhescuporis III Philocaesar Philoromaios Eusebes, also known as Rhescuporis III was a prince and Roman Client King of the Bosporan Kingdom. In 210/211 the paternal grandfather of Rhescuporis III, King Sauromates II died, Rhescuporis III succeeded with his father Rhescuporis II. Rhescuporis III co-ruled with his father as Bosporan Kings until their deaths in 227.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_iv_bosporus', 'Rhescuporis IV', 'Tiberius Julius Rhescuporis IV, also known as Rhescuporis IV (died 235) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_v_bosporus', 'Rhescuporis V', 'Tiberius Julius Rhescuporis V Philocaesar Philoromaios Eusebes, also known as Rhescuporis V (died 276) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhescuporis_vi_bosporus', 'Rhescuporis VI', 'Tiberius Julius Rhescuporis VI (died 342) was the last ruler of the Bosporan Kingdom, a client realm of the Roman Empire. He ruled from 303 until his death in 342, and was a contemporary to the Tetrarchy and the Constantinian dynasty in Rome.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoemetalces_i_sapaean_thrace', 'Rhoemetalces I of Thrace', 'Rhoemetalces I (Ancient Greek: Ῥοιμητάλκης) was king of the Odrysian kingdom of Thrace from 12 BC to 12 AD, in succession to his nephew Rhescuporis I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoemetalces_ii_sapaean_thrace', 'Rhoemetalces II of Thrace', 'Rhoemetalces II was a Client Ruler in association with his mother Antonia Tryphaena of the Odrysian kingdom of Thrace under the Romans from 18 to 38. On coinage his royal title is in Greek: ΒΑΣΙΛΕΥΣ ΡΟΙΜΗΤΑΛΚΑΣ or of King Rhoemetalces.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoemetalces_iii_sapaean_thrace', 'Rhoemetalces III of Thrace', 'Rhoemetalces III (Greek: Ῥoιμητάλκης) was a King of the Thracians. He was the son of the Monarch Rhescuporis II. He in association with his cousin-wife Pythodoris II were client rulers of the Odrysian kingdom of Thrace under the Romans from AD 38 to 46, in succession to Pythodoris’ mother Tryphaena and her brother Rhoemetalces II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoigos_odrysian_thrace', 'Rhoigos of Thrace', 'Rhoigos was a ruler in Thrace from c. 297 BC to c. 295 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoecus_amathus', 'Rhoikos of Amathus', 'Rhoecus (Rhoikos) was a king of Amathus, Cyprus in the mid 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rhoimetalces_bosporus', 'Rhoimetalces', 'Tiberius Julius Rhoemetalces Philocaesar Philoromaios Eusebes, also known as Rhoemetalces or Rhoimetalces (died 153) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/roger_ii_sicily', 'Roger II (494-548/1101-1154)', 'Roger II (22 December 1095[1] – 26 February 1154) was King of Sicily, son of Roger I of Sicily and successor to his brother Simon. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/romanus_i', 'Romanos I Lekapenos', 'The Byzantine emperor Romanos I Lekapenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/romanus_ii', 'Romanos II', 'The Byzantine emperor Romanos II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/romanus_iii', 'Romanos III Argyros', 'The Byzantine emperor Romanos III Argyros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/romanus_iv', 'Romanos IV Diogenes', 'The Byzantine emperor Romanos IV Diogenes.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/romulus_augustulus', 'Romulus Augustulus', 'The Roman emperor Romulus Augustulus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rudravarma_vemaka', 'Rudravarma', 'Rudravarma was a king of the Vemaka tribe of northern India. Only a handful of coins are known to exist. An electrotype of one coin found in IGCH 1871 is in the British Museum collection.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rukn_al-din_qilij_arslan_iv', 'Rukn al-Din Qilij Arslan IV', 'Kilij Arslan IV (Old Anatolian Turkish: قِلِج اَرسلان, Persian: رکن الدین قلج ارسلان بن کیخسرو‎ Rukn ad-Dīn Qilij Arslān bin Kaykhusraw) was Seljuq Sultan of Rûm after the death of his father Kaykhusraw II in 1246.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rukn_al-din_sulayman_ii', 'Rukn al-Din Sulayman II', 'Suleiman II, also known as Rukn ad-Din Suleiman Shah (Persian: رکن الدین سلیمان شاه‎), was the Seljuk Sultan of Rûm between 1196 and 1204.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/rutiger_kluppener_colonia_claudia_ara_agrippinensium', 'Rutiger Kluppener', 'Die cutter in Cologne a city in Germany, in 1481, 1482, 1489, 1491 and 1502, and most likely all the years in between. Kluppener seems to have been employed in all four Mints: Stadt Cologne, Trier, Cologne Archbishopric and Jülich, following a ten year coinage treaty established on 16 March 1481 (and later partly extended). Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) pp. 253, 256, 258, 259, 262; Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926) pp. 47-49.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/s_fv_rrc', 'S. Furius', 'Roman Republican Moneyer, c. 189 - 180 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sa\'id_pasha', 'Sa\'id Pasha', 'Muhammad Sa\'id Pasha (Arabic: محمد سعيد باشا‎, Turkish: Mehmed Said Paşa) was the Wāli of Egypt and Sudan from 1854 until 1863, officially owing fealty to the Ottoman Sultan but in practice exercising virtual independence.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sabaces_satrap', 'Sabaces', 'Sabaces (name variants: Sabakes, Sauaces; Sataces; Diodorus Siculus calls him Tasiaces; Aramaic: SWYK, died in 333 BC) was an Achaemenid satrap of the Achaemenid Thirty-first Dynasty of Egypt during the reign of king Darius III of Persia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sabina', 'Sabina', 'Vibia Sabina (83–136/137) was a Roman Empress, wife and second cousin, once removed, to Roman Emperor Hadrian. She was the daughter to Salonina Matidia (niece of Roman Emperor Trajan), and Lucius Vibius Sabinus. In 128, she was awarded the title of Augusta. She died before Hadrian, some time in 136 or early 137, and was deified.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sabinia_tranquillina', 'Sabinia Tranquillina', 'Wife of the Emperor Gordian III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sabinius_modestus_pirs5', 'Sabinius Modestus', 'Legatus Augusti pro praetore Moesiae inferioris. His name appears on coins in Nicopolis ad Istrum, not before AD 241. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 144 no. 133 (c. AD 241-244); PIR² S 5 (SAB[INIVS more probable than SAB[VCIVS] MODESTVS); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 693 s. v. Modestos (c. AD 238-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abu_mansur_sebuktigin', 'Sabuktigin', 'Abu Mansur Sabuktigin (Persian: ابو منصور سبکتگین‎) also spelled as Sabuktagin, Sabuktakin, Sebüktegin and Sebük Tigin, was the founder of the Ghaznavid dynasty, ruling from 977 to 997.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sadales_sapaean_thrace', 'Sadales of Thrace', 'The son of Cotys I, king of Sapaean Thrace, was sent by his father to the assistance of Pompey, and fought on his side against Caesar, in B. C. 48. In conjunction with Scipio, he defeated L. Cassius Longinus, one of Caesar\'s legates. He was pardoned by Caesar after the battle of Pharsalia, and appears to have succeeded his father in the sovereignty about this time. He died in B. C. 42, leaving his dominions to the Romans', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/safra_rrc', 'Safra', 'Roman Republican Moneyer, c. 150 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salah_al-din_yusuf_ibn_ayyub', 'Saladin', 'Ṣalāḥ ad-Dīn Yūsuf ibn Ayyūb (Kurdish: سەلاحەدینی ئەییووبی/Selahedînê Eyûbî; Arabic: صلاح الدين يوسف بن أيوب‎; Turkish: Selahaddin Eyyûbî), better known in the Western world as Saladin, was the first Sultan of Egypt and Syria and the founder of the Ayyubid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salah_al-din_muhammad', 'Salah al-Din Muhammad', 'Salah al-Din Muhammad (762-764/1361-1363) was a Mamluk sultan during the Bahri period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salah_al-din_salih', 'Salah al-Din Salih', 'Al-Malik as-Salih Najm al-Din Ayyub (Arabic: الملك الصالح نجم الدين ايوب‎) (Nickname: Abu al-Futuh أبو الفتوح ), also known as al-Malik al-Salih was the KurdishAyyubid ruler of Egypt from 1240 to 1249.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salah_al-din_yusuf_ii', 'Salah al-Din Yusuf II', 'An-Nasir Yusuf (Arabic: الناصر يوسف ) (Royal Name: al-Malik al-Nasir Salah al-Din Yusuf (Arabic: الملك الناصر صلاح الدين يوسف ) was the Ayyubid ruler of most of Syria, including Aleppo (1236–1260) and Damascus (1250–1260).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_abbasids', 'Salih', 'An official whose name appears on Abbasid glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_ibn_ali', 'Salih ibn Ali', 'Magistrate named on Islamic glassware.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_ibn_mirdas', 'Salih ibn Mirdas', 'Asad al-Dawla Salih ibn Mirdas (died 1029) was the first Mirdasid emir of Aleppo, from 1024 until his death. He established a dynasty that would more or less continuously rule Aleppo for more than five decades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_ibn_muhammad_al-kasadi', 'Salih ibn Muhammad al-Kasadi', 'Salih ibn Muhammad al-Kasadi is the sixth ruler of the al-Kasadi dynasy, from 1851 to 11 May 1873.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_ibn_muslim', 'Salih ibn Muslim', 'Abbasid ruler from 787-804', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salih_ibn_salim_al-kasadi', 'Salih ibn Salim al-Kasadi', 'Salih ibn Salim al-Kasadi was the third ruler of the al-Kasadi dynasty, from 1770 to 1800.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/salim_ibn_ahmad_al-kasadi', 'Salim ibn Ahmad al-Kasadi', 'Salim ibn Ahmad al-Kasadi was the second ruler of the al-Kasadi dynasty, from 1740 - 1770.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sallustia_orbiana', 'Sallustia Orbiana', 'Wife of the Emperor Severus Alexander.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/alexandra_judaea', 'Salome Alexandra', 'Salome Alexandra or Alexandra of Jerusalem (141–67 BCE), was one of only two women to rule over Judea (the other being Athaliah). The wife of Aristobulus I, and afterward of Alexander Jannaeus, she was the last queen of Judea, and the last ruler of ancient Judea to die as the ruler of an independent kingdom from 76 to 67 BCE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saloninus', 'Saloninus', 'Publius Licinius Cornelius Saloninus Valerianus (c. 242 – 260) was Roman Emperor in 259 or 260.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sames_commagene', 'Sames II of Commagene', 'Sames or Samos II Theosebes Dikaios was the second king of Commagene from 130-109 B.C. Of Armenian descent, he was the son and successor of Ptolemaeus of Commagene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/samma-_thrace', 'Samma . . (?)', 'Dynast of uncertain place in the Thraco-Macedonian region, known only from coins', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sanjar_mu\'izz_al-din_abu_al-harith', 'Sanjar, Mu\'izz al-Din Abu al-Harith', 'Ahmad Sanjar (Turkish: Ahmed Sencer, Persian: احمد سنجر; full name: Muizz ad-Dunya wa ad-Din Adud ad-Dawlah Abul-Harith Ahmad Sanjar ibn Malik-Shah) was the Seljuq ruler of Khorasanfrom 1097 until in 1118[1] when he became the Sultan of the Seljuq Empire, which he ruled as until his death in 1153', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sarapi_athens', 'Sarapion', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 399-400 / issue 34 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 12557; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 393 s. v. Sarapion, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 798 s. v. Sarapi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saratocus_thrace', 'Saratocus', 'Dynast of uncertain place in the Thraco-Macedonian region, known only from coins', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sari_maroneia', 'Sari(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 147, n. 339.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sariaces_scythia', 'Sariakes of Scythia', 'King of Scythia, c. 188-167 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sasmas_marium', 'Sasmas of Marium', 'King of Marium, in the second quarter of the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sati_beg', 'Sati Beg', 'Al-sultana al-radila Sati Beg Khan Khallad Allah Mulkaha (fl. 1316-1345) was a claimant to the throne of the Ilkhanate during the fragmentation of Persia in the mid-14th century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/satorneinos_priene', 'Satorneinos', 'An individual who issued coins at the ancient city of Priene c. AD 253-260. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 799.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saturninus', 'Saturninus', 'The Roman usurper Saturninus (pretender against Probus in 281).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sat_athens', 'Satyros', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 705 / issue 54 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 394 s. v. Satyros, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 799 s. v. Sat-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saty_athens', 'Satyros', 'Third magistrate attested in Athens in 121/120 BC [issue 43]. Again attested as third magistrate in 120/119 BC [issue 45]. Maybe from Leukonoe: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 512-515, 523 and nos. 548, 550-551 / issues 43 and 45, commentary on p. 580; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 [issue 43] and 120/119 BC [issue 45]); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 394 s. v. Satyros, no. 17 (listed under Athens in general, no speicific deme); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 799 s. v. Satyros (121/120 BC [issue 43]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/satyrus_heracleia_pontica', 'Satyrus of Heracleia', 'Satyrus was the brother of Clearchos I of Heracleia and reigned as guardian for Clearchus\' sons, Timotheus and Dionysius', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saty_priene', 'Saty…', 'An individual who issued coins at the ancient city of Priene c. 270-240 BC. Regling completed: Satyros. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 799.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/saumacus_scythia', 'Saumacus of Scythia', 'Saumacus was the Scythian adoptive son of Paerisades V of the Kingdom of Bosporus. He led an uprising in 107 B.C. that was soon put down, bringing Bosporus under the control of the Kingdom of Pontus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sauromates_i_bosporus', 'Sauromates I', 'Tiberius Julius Sauromates I Philocaesar Philoromaios Eusebes, also known as Sauromates I (died 123) was a prince and Roman client king of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sauromates_ii_bosporus', 'Sauromates II', 'Tiberius Julius Sauromates II Philocaesar Philoromaios Eusebes, also known as Sauromates II (r. 173/174 - 210/211 AD), was a prince regnant and the Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sauromates_iii_bosporus', 'Sauromates III', 'Tiberius Julius Sauromates III, sometimes known as Sauromates III (died 232) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sauromates_iv_bosporus', 'Sauromates IV', 'Tiberius Julius Sauromates IV, also known as Sauromates IV (died 276) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sayf_al-dawlah', 'Sayf al-Dawlah', 'Ali ibn Abu\'l-Hayja \'Abdallah ibn Hamdan ibn al-Harith Sayf al-Dawla al-Taghlibi (Arabic: سيف الدولة أبو الحسن ابن حمدان‎), more commonly known simply by his laqab (honorific epithet) of Sayf al-Dawla (\"Sword of the Dynasty\"), was the founder of the Emirate of Aleppo.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sayf_al-din_begtimur', 'Sayf al-Din Begtimur', 'Sayf al-Din Begtimur (579-589/1183-1193) was a ruling member of the Berteginid dynasty, the name of a dynasty in Arbela (Irbil), founded by Zain al-Dīn ʿAlī Küčük b. Begtegīn.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sayf_al-din_ghazi_ii_ibn_mawdud', 'Sayf al-Din Ghazi II ibn Mawdud', 'Saif ud-Din Ghazi II (Arabic: سيف الدين غازي بن مودود; full name: Saif ad-Din Ghazi II Bin Mawdud Bin Imad ad-Din Atabeg Zengi; died 1180) was a Zangid emir of Mosul.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/schiess_johannes', 'Schiess, Johannes', 'Johannes Schiess (1837-1910) was a 1869 private doctor in Egypt, from 1872 physician at government hospital in Alexandria, from 1880 promoter of cholera and tuberculosis research, 1885-90 hospital director.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/scilurus_scythia', 'Scilurus of Scythia', 'Skilurus or Scylurus was the best known king of Scythia in the 2nd century BC. He was the son of a king and the father of a king, but the relation of his dynasty to the previous one is disputed. His realm included the lower reaches of the Borysthenes and Hypanis, as well as the northern part of Crimea, where his capital, Scythian Neapolis, was situated.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sebastian_scherdinger_stuttgart', 'Sebastian Scherding(er)', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany from 1544 to 1556. Died 1571/72. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 41, 74, 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sebastianus', 'Sebastianus', 'The Roman emperor Sebastianus.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/seleucus_i', 'Seleucus I Nicator', 'Seleucus I Nicator (\"the Victor\") (satrap, 321–305 BC; king, 305–281 BC) was the founder of the Seleucid Empire. He had served as an infantry commander under Alexander the Great and became chiliarch (i.e. vizier) to Perdiccas at the Settlement of Babylon (323 BC). In 321 BC, after the death of Perdiccas he was appointed satrap (governor) of Babylonia. He was driven out by Antigonus Monophthalmus in 315 BC, but managed to return and hold the satrapy in 312. Seleucus I assumed the royal title in 305 BC and embarked upon a great eastern campaign that created a Seleucid Empire stretching from Babylonia and Syria to the borders of India. He played a pivotal role in the defeat and death of Antigonus at the Battle of Ipsus (301 BC). Seleucus I expanded his empire into Asia Minor after defeating and killing Lysimachus, the king of Thrace who had claimed Antigonus\' territories in Asia Minor, at the Battle of Corupedium (281 BC). Seleucus I was assassinated later in 281 BC as he advanced to take possession of Thrace.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seleucus_ii', 'Seleucus II Callinicus', 'Seleucus II Callinicus (\"Nobly Victorious\"), nicknamed Pogon (\"the Beard\") was the fourth king of the Seleucid Empire. He succeeded his father, Antiochus II in 246 BC and reigned until 225 BC. His reign saw many challenges to the territorial integrity of the empire. The king was ineffective in opposing Ptolemy III during the Third Syrian War (246-241 BC) and suffered invasion and the loss of possessions in Syria, Asia Minor, and Thrace. These problems were compounded by his brother, Antiochus Hierax, who established an independent kingdom in Asia Minor and whom Seleucus II was unable to evict during the disastrous War of the Brothers (c. 241-236 BC). Turning from his failures in the West, in 230-227 BC, Seleucus II marched East to oppose the invading Arsacid Parthians and restore Seleucid authority in the rogue satrapy (province) of Bactria. What limited successes he enjoyed in this endeavor were fleeting. In 225 BC he was thrown from his horse and died from his injuries.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seleucus_iii', 'Seleucus III Ceraunus', 'Seleucus III Soter (\"the Savior\"), nicknamed Ceraunus (\"the Thunderbolt\") was the fifth king of the Seleucid Empire. He was named Alexander at birth but assumed the dynastic name Seleucus when he succeeded his father Seleucus II in 225 BC. He was assassinated in 233 BC while campaigning to regain Asia Minor from Attalus I of Pergamum.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seleucus_iv', 'Seleucus IV Philopator', 'Seleucus IV Philopator (\"Father-loving\") was the eldest son of Antiochus III and succeeded him as the seventh king of the Seleucid Empire. He reigned from 187 to 175 BC, during which time he formed alliances in Asia Minor and Macedon in order to restore Seleucid influence curtailed by the Peace of Apamea. He was assassinated by his chief minister, Heliodorus, in 175 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seleucus_v', 'Seleucus V Philometor', 'The Seleucid king Seleucus V Philometor, ruler of the Hellenistic Seleucid kingdom, was the eldest son of Demetrius II Nicator and Cleopatra Thea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seleucus_vi', 'Seleucus VI Epiphanes', 'Seleucus VI Epiphanes Nicator (\"God Manifest, Victor\") was the eighteenth king of the Seleucid Empire, ruling from 96 to 94 BC. In 96 BC, Seleucus VI defeated and killed his uncle, Antiochus IX, in battle, but managed to hold Antioch and Syria only briefly before he was driven out by Antiochus X, the son of Antiochus IX, in the following year. Seleucus VI fled to Mopsuestia where he attempted to raise a new army, but his financial exactions sparked rebellion in the city and he was burned alive by the mob in 94 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/selim_i_yavuz', 'Selim I Yavuz', 'Selim I (Ottoman Turkish: سليم اوّل, Modern Turkish: I.Selim or Yavuz Sultan Selim), nicknamed Yavuz (traditionally translated as \"grim,\" but closer to \"stern\" or \"implacable\" in meaning), was the Sultan of the Ottoman Empire from 1512 to 1520.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/selim_ii_sari', 'Selim II Sari', 'Selim II (Ottoman Turkish: سليم ثانى Selīm-i sānī, Turkish:II.Selim), also known as \"Selim the Sot (Mest)\" in west and as \"Sarı Selim\" (Selim the Blond) in east, was the Sultanof the Ottoman Empire from 1566 until his death in 1574.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/selim_iii', 'Selim III', 'Selim III (Ottoman Turkish: سليم ثالث Selīm-i sālis) was the reform-minded Sultan of the Ottoman Empire from 1789 to 1807.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/septimius_pontikos_cyzicus', 'Septimius Pontikos', 'Strategos in Cyzicus/Mysia during the reign of Claudius Gothicus. His name appears on coins from the last working-period of the civic mint under Claudius Gothicus in combination with his title of Strategos: A. Markl, Das Provinzialcourant unter Kaiser Claudius II. Gothicus, Numismatische Zeitschrift 32, 1900, pp. 155-156 nos. 1-2; SNG France Mysie nos. 893-894. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 769 s. v. Pontikos (AD 268-270); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 374 s. v. Pontikos (no. 9) (AD 268-270).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/septimius_severus', 'Septimius Severus', 'Roman emperor from 14 April 193 – 4 February 211.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ser_svlp_rrc', 'Ser. Sulpicius', 'Roman Republican Moneyer, c. 51 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sergius_titianus_pirs534', 'Sergius Titianus', 'Legatus Augusti pro praetore in Moesia inferior. His name appears on coins in Marcianopolis/Moesia inferior under elagabalus, c. AD 218-222. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 141 no. 118 (under Elagabalus); PIR² S 534; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 848 s. v. Titianus (AD 218-222).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seuthes_i_odrysian_thrace', 'Seuthes I of Thrace', 'Seuthes I (Ancient Greek: Σεύθης, Seuthēs) was king of the Odrysian Thracians from 424 BC until ?410 (407) BC. He was the nephew of Sitalces. After he became king, Seuthes increased the tribute of the Hellenic cities on the coast. In 411 BC Seuthes led a campaign against Athens. Seuthes died in ?410 (407) BC after a serious illness. Amadocus succeeded him as ruler of the Odrysian kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seuthes_ii_odrysian_thrace', 'Seuthes II of Thrace', 'Seuthes II (Ancient Greek: Σεύθης) was a king of the Odrysian kingdom of Thrace from about 405 to 391 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/seuthes_iii_odrysian_thrace', 'Seuthes III of Thrace', 'Seuthes III (Ancient Greek: Σεύθης) was ruler of the Odrysian kingdom of Thrace from c. 331 BC to c. 300 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/severin_von_myle_colonia_claudia_ara_agrippinensium', 'Severin von Myle', 'Mint Warden in Cologne (City), Germany, in 1502, he died in office in 1518. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 46, 48, 52.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/severus_alexander', 'Severus Alexander', 'Roman Emperor from 222 to 235.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/severus_ii', 'Severus II', 'The Roman emperor Severus II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sex_nonius_quinctilianus', 'Sex. Nonius Quinctilianus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sex_ivli_caisar_rrc', 'Sextus Iulius Caesar', 'Roman Republican Moneyer, c. 129 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sex_pom_rrc', 'Sextus Pompeius', 'Roman Republican Moneyer, c. 137 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sextus_pompey', 'Sextus Pompey', 'Sextus Pompeius Magnus Pius, in English Sextus Pompey (67 BC – 35 BC), was a Roman general of the late Republic He was the son of Gnaeus Pompeius Magnus (Pompey the Great) and brother of Pompey the Younger.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sx_q_rrc', 'Sextus Q[uinctilius]', 'Roman Republican Moneyer, c. 189 - 180 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sha\'ban_i', 'Sha\'ban I', 'Sha\'ban I (746-747/1345-1346) was a Mamluk sultan during the Bahri period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sha\'ban_ii', 'Sha\'ban II', 'Al-Ashraf Sha\'ban (Epithet: Al-Ashraf Zein al-Din Abu al-Ma\'ali ibn Shaban), also Shaban II, was a Mamluk ruler of the Bahri dynasty from 1363 to 1377.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_abbas_iii', 'Shah Abbas III', 'Abbas III (Persian: شاه عباس سوم‎) reigned 1732–1736.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_alam_ii', 'Shah Alam II', 'Ali Gauhar, historically known as Shah Alam II, the eighteenth Mughal Emperor, was the son of Alamgir II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_jahan', 'Shah Jahan', 'Shahabuddin Muhammad Shah Jahan  was the fifth Mughal Emperor of India. He is also known as Shah Jahan I. He ruled from 1628 until 1658.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_rukh', 'Shah Rukh', 'Shāhrukh Mīrzā (Persian: شاهرخ میرزا‎ Šāhrokh Mīrzā) was the Timurid ruler of the eastern portion of the empire established by his father, Central Asian warlord Timur (Tamerlane) who founded the Timurid dynasty, governing most of Persia and Transoxiana between 1405 and 1447.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_shuja', 'Shah Shuja', 'Shah Shuja (Persian: شاه شجاع‎), was the ruler of the Muzaffarid dynasty from 1358 to 1384. He was the son and successor of Mubariz al-Din Muhammad.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_sulayman', 'Shah Sulayman', 'Safi II  (Persian: شاه صفی‎), better known by his second dynastic name of Suleiman I (Persian: شاه سلیمان‎), was a Safavid shah of Persia who reigned between 1666 and 1694.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_sultan_husayn', 'Shah Sultan Husayn', 'Sultan Husayn (also known as Soltan Hosayn and Soltan Hosein), (Persian: شاه سلطان حسین‎) reigned 1694–1722; was a Safavid Shah of Iran (Persia).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shah_tahmasp', 'Shah Tahmasp', 'Tahmasp I (Persian: شاه تهماسب یکم‎) was an influential Shah of Iran, who enjoyed the longest reign of any member of the Safavid dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shahr_hilal_qataban', 'Shahr Hilal of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shahr_yagul_qataban', 'Shahr Yagul of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shammar_yuhanam_himyar', 'Shammar Yuhan\'am of Himyar', 'Ruler of the Himyarite kingdom in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shamnar_yuhanim_himyarites', 'Shamnar Yuhan\'im of Arabia', 'Second century AD king of the Himyarites.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shapur_persia', 'Shapur I', 'Shapur I also known as Shapur the Great, was the second Sasanian King of Kings of Iran. The dating of his reign is disputed, but it is generally agreed that he ruled from 240 to 270, with his father Ardashir I as co-regent till the death of the latter in 242.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shaqilath_ii_nabataea', 'Shaqilath II, Queen of Nabataea', 'Shaqilath II (also spelled Shaqilat, Shaqeela, Shaqeelah, Šagīlat) was the daughter of Aretas IV of the Nabataeans. She ruled jointly with her husband Malichus II (40-70). After his death she was regent for her son Rabel II. Copper and silver coins where she is depicted with her husband, and coins of her with her son, have been recovered. Some of these coins are dated with regnal years to the left of the queen.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shaqilath_nabataea', 'Shaqilath, Queen of Nabataea', 'Shaqilath (also spelled Shaqilat, Shaqeela, Shaqeelah, Šagīlat) was a queen of the Nabataeans, who co-ruled with her husband, Aretas IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sharaf_al-dawlah_abu_al-fawaris', 'Sharaf al-Dawlah Abu al-Fawaris', 'Shirdil Abu\'l-Fawaris ) was the Buyid amir of Kerman and Fars (983-988/9), as well as Iraq (987-988/9).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shaykh_hasan_buzurg', 'Shaykh Hasan Buzurg', 'Shaikh Hasan, called \"Buzurg\" (\"The Great\"), was the first of several de facto independent Jalayirid rulers of Iraq and central Iran.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/shihab_al-din_ahmad', 'Shihab al-Din Ahmad', 'Shihab ad-Din Ahmad (Arabic: شهاب الدين أحمد) royal name: al-Malik al-Nasir Shihab ad-Din Ahmad (Arabic: الملك الناصر شهاب الدين أحمد)) was a Mamluk Sultan of Egypt in 1342.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/si_abdera', 'Si(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sidareia_lycia', 'Sidareia\'', 'Dynast in the ancient region of Lycia from approximately 460–420 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M246', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sidqmilk_lapethus', 'Sidqmilk of Lapethus', 'Sidqmilk was a king of Lapethus in Cyprus in the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sigmund_scholz_nuremberg', 'Sigmund Scholz', 'Mint Warden in Nürnberg (Nuremberg), Franconia, Germany from 1760 to before 1771, His initials are S or SS. Lit.: Hans-Jörg Kellner, Die Münzen der Freien Reichsstadt Nürnberg (1957), p. 171', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/silbannacus', 'Silbannacus', 'Usurper active during the reign of Philip I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sile(-)_dionysopolis_thrace', 'Sile(…)', 'Magistrate attested on the Alexander coinage of Dionysopolis\', c. 225-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 948', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/silon_byzantium', 'Silon', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 135, nos. 1003-1005.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/simi_athens', 'Simias', 'Third magistrate attested in Athens in 122/121 BC. Councillor in 135/134 BC (H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 498-499 / issue 42 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (123/122 BC); Prosopographia Attica 12667; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 398 s. v. Simias, no. 8; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 809 s. v. Simias (122/121 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/simon_abydus', 'Simon', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Simon (24); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 809 s. v. ΣΙΜΩΝ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/simon_athens', 'Simon', 'Third magistrate attested in Athens in 88/87 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) p. 367 no. 1130 (drachm) / her issue 75 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (88/87 BC, his issue 77); Prosopographia Attica 12693; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 399 s. v. Simon, no. 24; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 809 s. v. Simon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/simon_maccabaeus_judaea', 'Simon Maccabaeus', 'Simon Thassi was the second son of Mattathias and thus a member of the Hasmonean family. The name \"Thassi\" has a connotation of \"the Wise\". Simon took a prominent part in the Jewish revolt against the Seleucid Empire led by his brothers, Judas Maccabaeus and Jonathan Apphus. He was the first Prince of the Hasmonean Dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/simon_bar_kokhba_judaea', 'Simon bar Kokhba', 'Simon ben Kosevah, known to posterity as Bar Kokhba (Hebrew: שמעון בן כוסבה; died 135 CE), was a Jewish military leader who led the Bar Kokhba revolt against the Roman Empire in 132 CE. He reigned as an independent king for three years until the Romans regained Judaea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sinatruces_i_parthia', 'Sinatruces I of Parthia', 'Sinatruces (also spelled Sinatrukes or Sanatruces) was king of the Parthian Empire from ca. 78/7 (or 75/4) to 70/69 BC. He was presumably a son of the Parthian ruler Mithridates I. Sinatruces was succeeded by his son Phraates III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sinatruces_ii_parthia', 'Sinatruces II of Parthia', 'Sanatruces II of Parthia, the son of Mithridates IV, was a pretender to the throne of the Parthian Empire during the disputed reign of his uncle Osroes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/siromos_paphus', 'Siromos of Paphos', 'Fifith century king of Paphos in Cyprus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sisenna', 'Sisenna', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/skymnos_athens', 'Skymnos', 'Third magistrate attested in Athens in 131/130 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 397, 402-403 / issue 34 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (131/130 BC); Prosopographia Attica 12738; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 400 s. v. Skymnos, no. 1; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 812 s. v. Skymnos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/smikyth_athens', 'Smikythos', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 643-644 / issue 50 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 813 s. v. Smikythos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/smith_sir_sidney', 'Smith, Sir Sidney (d.1840)', 'Admiral Sir William Sidney Smith, KCB, GCTE, FRS (21 June 1764 – 26 May 1840) was a British naval officer. Serving in the American and French revolutionary wars, he later rose to the rank of admiral.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/smor_abdera', 'Smor(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/smordotormos-kal_abdera', 'SmordotormosKal(…)', 'An individual who issued coins at the ancient city of Abdera, 473/470-449/448 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sohaemus_armenia', 'Sohaemus', 'Gaius Julius Sohaemus, also known as Sohaemus of Armenia and Sohaemo was an Emesene Prince and Aristocrat from Syria who served as a Roman Client King of Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sokrates_athens', 'Sokrates', 'First magistrate attested in Athens in 116/115 BC [issue 49]. Additionally several times (prevously and later on) attested as third magistrate in Athens, in 130/129 BC [issue 35], in 123/122 BC [issue 41], in 121/120 BC [issue 43], in 120/119 BC [issue 45], and in 110/109 BC [issue 55]. Most probably all these magistracies were held by the same person, but a close familiar binding is also possible (father-and-son-relationship) (Thompson 1961, p. 580-581). Maybe from Oion, Epimeletes of Delos in 117/116 BC (Habicht 1991, p. 9; H. B. Mattingly, NC 157, 1997, p. 259): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 407-408, 483-485, 503, 509-512, 548-550, 611-628, 717-721 / issues 35, 41, 43, 45, 49 and 55 (pp. 580-581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 9 (130/129, 124/123, 122/121, 120/119, 116/115 and 110/109 BC); Prosopographia Attica 13089 and 13090; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 412 s. v. Sokrates, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) pp. 824-825 s. v. Sokrates (123/122 [issue 41] and 121/120 BC [issue 45]).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sokrates_cyzicus', 'Sokrates', 'Magistrate and Strategos in Cyzicus/Mysia, c. AD 253-260. His name appears on coins issued during the joint reign of Valerian I and Gallienus both with his title of Strategos and without: e.g. SNG Cop. no. 137. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 825 s. v. Sokrates (AD 253-260); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 417 s. v. Sokrates (no. 98) (AD 253-260).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sol_athens', 'Sol…', 'Third magistrate attested in Athens in 100/99 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 863, 867-869, 873-876 / issue 65 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (100/99 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 813 s. v. Sol-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/somenos_abydus', 'Somenos', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Somenos (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 825 s. v. ΣΩΜΕΝΟΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sopha_athens', 'Sophanes', 'Third magistrate attested in Athens in 135/134 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 351, 356 / issue 30 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (135/134 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 422 s. v. Sophanes, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 831 s. v. Sofa-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sophytes_bactria', 'Sophytes', 'Sophytes, or Sopeites, Saubhuti was the name of a king in Punjab in the northwestern Indian subcontinent during the time of the Alexander\'s invasion. Sophytes surrendered to Alexander and was allowed to retain his kingdom. Probably another Sophytes, who was satrap in the eastern territories conquered by Alexander the Great, minted his own coins in the Greek style circa 300 BCE. Little is known about him and hypotheses are numerous: Sophytes may have been a Hellenistic satrap who replaced Stasanor in Bactria-Sogdiana, or may have ruled in a neighboring area; he may also have been a Satrap of Arachosia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosandros_athens', 'Sosandros', 'Second magistrate attested in Athens in 126/125 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 441-460 / issue 39 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (126/125 BC); Prosopographia Attica 13160; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 414 s. v. Sosandros, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 826 s. v. Sosandros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosibios_athens', 'Sosibios', 'Third magistrate attested in Athens in 128/127 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 425-427 / issue 37 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (128/127 BC); Prosopographia Attica 13184; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 415 s. v. Sosibios, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 827 s. v. Sosibios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosibi_priene', 'Sosibi…', 'An individual who issued coins at the ancient city of Priene c. 320-270 BC. Regling completed: Sosibios. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 827.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosige_athens', 'Sosigenes', 'Third magistrate attested in Athens in 134/133 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 362-363, 369, 375 / issue 31 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (134/133 BC); Prosopographia Attica 13199; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 415 s. v. Sosigenes, no. 15; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 827 s. v. Sosige-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosikrates_athens', 'Sosikrates', 'Second magistrate attested in Athens in 109/108 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 719-734 / issue 56 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (109/108 BC); Prosopographia Attica 13245; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 416 s. v. Sosikrates, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 828 s. v. Sosikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosikr_athens', 'Sosikrates', 'Third magistrate attested in Athens in 105/104 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 786-793 / issue 60 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (105/104 BC); Prosopographia Attica 13246; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 416 s. v. Sosikrates, no. 8; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 828 s. v. Sosikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosikra_athens', 'Sosikrates', 'Third magistrate attested in Athens in 93/92 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1055-1060 / issue 72 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (93/92 BC); Prosopographia Attica 13247; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 416 s. v. Sosikrates, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 828 s. v. Sosikrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sosippos_priene', 'Sosippos', 'An individual who issued coins at the ancient city of Priene c. 330-300 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 829.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/scostocos_i_thrace', 'Sostocos I of Thrace', 'Scostocos king in Thrace who issued coins of the Lysimachus type, c. 285/1-273/2 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/scostocos_ii_thrace', 'Sostocos II of Thrace', 'Scostocos king in Thrace who issued coins, c. 250-245 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sostratos_cos', 'Sostratos', 'Magistrate attested on the Alexander coinage of Cos, c. 185-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2505', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sostratos_athens', 'Sostratos', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 702 / issue 54 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 13333; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 419 s. v. Sostratos, no. 30; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 829 s. v. Sostratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sostra_athens', 'Sostratos', 'Third magistrate attested in Athens in 89/88 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1122-1125 / her issue 74 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (89/88 BC, his issue 76); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 419 s. v. Sostratos, no. 33; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 829 s. v. Sostratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sotades_athens', 'Sotades', 'First magistrate attested in Athens in 78/77 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1222-1226 / her issue 85 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 (78/77 BC, his issue 87); Prosopographia Attica 13376; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 420 s. v. Sotades, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 830 s. v. Sotades.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sotas_priene', 'Sotas', 'An individual who issued coins at the ancient city of Priene c. 270-240 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 830.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sotas_i_athens', 'Sotas', 'Second magistrate attested in Athens in 130/129 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 401, 404-412 / issue 35 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (130/129 BC); Prosopographia Attica 13382; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 420 s. v. Sotas, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 830 s. v. Sotas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sotas_ii_athens', 'Sotas', 'Third magistrate attested in Athens in 106/105 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 761-768 / issue 59 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (106/105 BC); Prosopographia Attica 13383; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 420 s. v. Sotas, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 830 s. v. Sotas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sparadocus_odrysian_thrace', 'Sparatocos', 'Sparatocos (Ancient Greek, Σπαράδοκος) was a king of the Odrysian kingdom of Thrace from ca. 450 BC to before 431 BC, succeeding his father, Teres I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spartocus_i_bosporus', 'Spartocus I', 'Spartocus I was the founder and first ruler of the Spartocid dynasty in the Bosporan Kingdom. He usurped the former rulers of the Bosporus, the Archaeanactids, after being a mercenary under their command sometime in 438 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spartocus_ii_bosporus', 'Spartocus II', 'Spartocus II was a Spartocid king of the Bosporan Kingdom, rulling from 349 - 344 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spartocus_iii_bosporus', 'Spartocus III', 'Spartocus III was king of the Bosporan Kingdom from 304 to 284 BC, after the untimely death of his father Eumelos in 304 BC after a reign of 5 years.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spartocus_iv_bosporus', 'Spartocus IV', 'Spartocus IV was a Spartocid king of the Bosporan Kingdom from 245 to 240 BC. Spartocus IV was a son of Paerisades II and is known for an inscription in coinage after the death of his father that shows him calling himself king whilst displaying Pan.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spartocus_odrysian_thrace', 'Spartocus of Thrace', 'Spartocus was a king in the beginning of the 3rd c. BC in Kabyle.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sphodrias_byzantium', 'Sphodria(s)', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 135, n0s. 1006-1013.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spithridates_satrap', 'Spithridates', 'Spithridates (Greek: Σπιθριδάτης; fl. 365–334 BC) was a Persian satrap of Lydia and Ionia under the high king Darius III Codomannus. He was one of the Persian commanders at the Battle of the Granicus, in 334 BC. In this engagement, while he was aiming a blow from behind at Alexander the Great, his arm was cut off by Cleitus the Black and he subsequently died.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/spoces_thrace', 'Spoces', 'Dynast of uncertain place in the Thraco-Macedonian region, known only from coins', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sponsianus', 'Sponsianus', 'Issuer of coins known only from barbarous aurei that may not be genuine. Inclusion in nomisma is warranted by the presence of the name in RIC 4.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sppntaza_lycia', 'Sppntaza', 'Dynast in the ancient region of Lycia from approximately 440–430 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M247', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stasandrus_paphus', 'Stasandros of Paphos', 'Stasandrus was a 5th century B.C. king of Paphus (Paphos) in Cyprus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stasicyprus_idalium', 'Stasicyprus of Idalium', 'Stasicyprus was a king of Lapethus in Cyprus in the mid 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stasioecus_i_marium', 'Stasioikos I of Marium', 'King of Marium, in the second half of the 5th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stasioecus_ii_marium', 'Stasioikos II of Marium', 'King of Marium, in the late 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stasion_rhodes', 'Stasion', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2517', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/statilius_taurus', 'Statilius Taurus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stauriakos', 'Staurakios', 'The Byzantine emperor Staurakios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stefan_schoen_stuttgart', 'Stefan Schön', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany 1561. Died in 1601. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 74, 87', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stellos_cyzicus', 'Stellos', 'Strategos in Cyzicus/Mysia during the reigns of Valerian I and Gallienus. His name appears on coins bearing the portrait of Gallienus and in combination with his title of Strategos. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 817 s. v. Stellos (AD 253-268); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 410 s. v. Stellos (no. 1) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stephanus_son_of_romanus_i', 'Stephen Lekapenos', 'The Byzantine emperor Stephen Lekapenos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/stratios_athens', 'Stratios', 'Third magistrate attested in Athens in 111/110 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 705-709 / issue 54 (p. 580); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (111/110 BC); Prosopographia Attica 12914; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 405 s. v. Stratios, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 818 s. v. Stratios.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/strato_i_bactria', 'Strato I of Bactria', 'Strato I was an Indo-Greek king who was the son of the Indo-Greek queen Agathokleia, who presumably acted as his regent during his early years after Strato\'s father, another Indo-Greek king, was killed.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/strato_ii_bactria', 'Strato II of Bactria', 'Strato II \"Soter\" was an Indo-Greek king. He ruled c. 25 BCE to 10 CE in the Eastern Punjab, probably retaining the capital of Sagala (modern Sialkot, Pakistan), or possibly to the city of Bucephala.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/strato_iii_bactria', 'Strato III of Bactria', 'Strato III often called \"Philopator\" (\"the Father-loving\") was an Indo-Greek king who ruled c. 25 BCE to 10 CE in the Eastern Punjab. He is only known through the joint coins with his father Strato II. He may have been supplanted, in conjunction with his father or later as an independent king, by the Indo-Scythian Northern Satraps, particularly Rajuvula and Bhadayasa, whose coins were often copied on those of the last Indo-Greek kings.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/strop(-)_miletus', 'Strop(…)', 'Magistrate attested on the Alexander coinage of Miletus, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2208A', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/suellius_marcianus_pirs690', 'Suellius Marcianus', '(Titus?) Suellius Marcianus. Legatus augusti pro praetore provinciae Thraciae under Commodus. (Titus?) Suellius Marcianus. His name appears on coins of Nikopolis ad Istrum (?), Hadrianopolis and Philippopolis. Lit.: PIR² S 690; B. E. Thomasson, Laterculi Praesidum I (1984) p. 167 no. 36; ibid. Addenda I (2011) no. 22:036.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sulayman', 'Sulayman', 'uleiman Khan (also known as Solayman Khan or Sulaiman Khan) was a Chobanid puppet for the throne of the Ilkhanate during the breakdown of central authority in Persia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sulayman_shah_ibn_muhammad', 'Sulayman Shah ibn Muhammad', 'Sulayman Shah ibn Muhammad (555-556/1160-1161) was one of the Seljuqs of Hamadhan who were the rulers of western Persia and who maintained a very loose grip on the Abbasids of Baghdad.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sulayman_al-musta\'in_billah', 'Sulayman al-Musta\'in billah', 'Sulayman II ibn al-Hakam (or Sulayman al-Musta\'in) (died 1016) was the fifth Umayyad Caliph of Córdoba, ruling from 1009 to 1010, and from 1013 to 1016 in the Al-Andalus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sulayman_ibn_muhammad', 'Sulayman ibn Muhammad', 'Mulay Slimane or Suleiman (Arabic: مولاي سليمان‎) was the Sultan of Morocco from 1792 to 1822.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/suleyman_i_kanuni', 'Suleiman the Magnificent', 'Suleiman I (Ottoman Turkish: سلطان سليمان اول‎, Turkish: I. Süleyman or Kanunî Sultan Süleyman), known as “the Magnificent” in the West and “Kanuni” (the Lawgiver) in the East, was the tenth and longest-reigning Sultan of the Ottoman Empire, from 1520 to his death.in 1566.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/suleyman_celebi', 'Suleyman Celebi', 'Süleyman Çelebi (pronounced Chalabi) was an Ottoman prince (Turkish: şehzade) and a co-ruler of the empire for several years during the Ottoman Interregnum.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/suleyman_ii', 'Suleyman II', 'Suleiman II (Ottoman Turkish: سليمان ثانى Süleymān-i sānī) was the Sultan of the Ottoman Empire from 1687 to 1691.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sulla', 'Sulla', 'Lucius Cornelius Sulla Felix (c. 138 BC – 78 BC), known commonly as Sulla, was a Roman general and statesman. He was consul in 88 BC and 80 BC reviving the dictatorship and appointed in 82/1 Bc as dictator legibus faciendis et reipublicae constituendae causa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sultan_ahmad_ibn_uways', 'Sultan Ahmad ibn Uways', 'Sultan Ahmad was a Jalayirid ruler (1382–1410). He was the son of Shaikh Awais Jalayir.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sultan_husayn_kamil', 'Sultan Husayn Kamil', 'Sultan Hussein Kamel (Arabic: السلطان حسين كامل‎, Turkish: Sultan Hüseyin Kamil Paşa; November 1853 – 9 October 1917) was the Sultan of Egypt from 19 December 1914 to 9 October 1917, during the British protectorate over Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sultan_husayn_mirza_in_khurasan', 'Sultan Husayn Mirza in Khurasan', 'Sultan Husayn Mirza Bayqara (Persian: حسین بایقرا‎ / Husayn Bāyqarā) was the Timurid ruler of Herat from 1469 till May 4, 1506, with a brief interruption in 1470.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sultan_sa\'id_ali', 'Sultan Sa\'id Ali', 'Said Ali bin Said Omar was a ruler in the Comoros Islands.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sybert_von_eykenich_colonia_claudia_ara_agrippinensium', 'Sybert von Eykenich', 'Appointed Mintmaster in Cologne (City), Germany, in 1479, Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), p. 16, 47.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/syllaeus_nabataea', 'Syllaeus of Nabataea', 'Syllaeus was the chief minister of Obodas III. Following the death of Obodas, he was brought to Rome and thrown from the Tarpeian Rock as Aretas IV inherited the throne of Nabataea.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/sym_abdera', 'Sym...', 'Magistrate attested on the Coinage of Abdera in Thrace c. 475-450 BC. See W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) 820.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/constantine_symbatius', 'Symbatius', 'The Byzantine co-emperor Constantine Symbatius, son of Leo V.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/syphax_masaesyli', 'Syphax', 'Syphax was a king of the ancient Numidian tribe Masaesyli of western Numidia during the last quarter of the 3rd century BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_aelius_eteoneus_cyzicus', 'T. Aelius Eteoneus', 'Archon in Cyzicus/Mysia c. AD 192. His name appears on coins issued under Commodus in combination with the title of Archon: RPC IV,2 (online) Temp. nos. 724, 3010 and 9440 (c. AD 192). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 495 s. v. Eteoneus (AD 177-192); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 172 s. v. Eteoneus (no. 4) (AD 177-192).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/an_rvf_rrc', 'T. Annius Rufus', 'Roman Republican Moneyer, c. 144 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_ar_paulos_cyzicus', 'T. Ar… Paulus', 'Strategos in Cyzicus/Mysia. His name appears on coins with the portrait of Gallienus and in combination with his title of Strategos. A reading of ΤΑΡ as ΤΑΡ[ΠΕΙΟC] is discussed theoretically, see W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 834 with notes 2-3 s. v. Tarpeios. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 749 s. v. Paulos (AD 253-268); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 362 s. v. Paulos (no. 55) (AD 253-268).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_carisivs_iii_vir_rrc', 'T. Carisius', 'Roman Republican Moneyer, c. 46 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_clovli_rrc', 'T. Cloelius', 'Roman Republican Moneyer, c. 128 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_clovli_q_rrc', 'T. Cloelius', 'Roman Republican Moneyer, c. 98 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_deidi_rrc', 'T. Didius', 'Roman Republican Moneyer, c. 113 - 112 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_flavius_novius_rufus_pirn190', 'T. Flavius Novius Rufus', 'Legatus Augusti pro praetore Moesiae inferioris under Elagabalus AD 218-222. His name appears on coins issued in Nikopolis. Lit.: PIR² N 190.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_mal_rrc', 'T. Mal.', 'Roman Republican Moneyer, c. 111 - 110 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_manl_rrc', 'T. Manlius Mancinus', 'Roman Republican Moneyer, c. 111 - 110 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_numi_seleukos_cyzicus', 'T. Numi(sius) Seleukos', 'Strategos in Cyzicus/Mysia during the reign of Gordian III. His name appears on coins in combination with his title of Strategos: RPC VII-1 pp. 107, 109 nos. 9-10, 11,1-11,2. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 718 s. v. Noumisios and p. 802 s. v. Seleukos (AD 238-244); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 401 s. v. Seleukos (no. 28) (AD 238-244); RPC VII-1 p. 107 (AD 238-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_quinctius_crispinus_sulpicianus', 'T. Quinctius Crispinus Sulpicianus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_q_rrc', 'T. Quinctius Flamininus', 'Roman Republican Moneyer, c. 126 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_vettivs_sabinvs_rrc', 'T. Vettius Sabinus', 'Roman Republican Moneyer, c. 70 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tacitus', 'Tacitus', 'The Roman emperor Tacitus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tancred', 'Tancred (d.1112)', 'Tancred (1075 – December 5 or December 12, 1112) was a Norman leader of the First Crusade who later became Prince of Galilee and regent of the Principality of Antioch.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tanousas_scythia', 'Tanousas of Scythia', 'King of Scythia, c. 218-210 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tarcondimotus_cilicia', 'Tarcondimotus I of Cilicia', 'Tarcondimotus I (died 31 BC) was a Roman client king of Cilicia, who played a role in the Roman civil wars of the late Roman Republic.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tauriskos_priene', 'Tauriskos', 'An individual who issued coins at the ancient city of Priene c. 330-320 BC. Lit.: K. Regling, Die Münzen von Priene (1927) p. 159; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 835.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/te_lycia', 'Te...', 'Dynast in the ancient region of Lycia from approximately 480–450 BC. See N. Vismara, Monetazione Arcaica Della Lycia Monetazione arcaica della Lycia. 3. Le prime emissioni del Wedri : le serie di Tha, delle città di Thibãnuwã (Simena), di Zagaba (Lagbe), di Zẽmuri (Limyra) e di Prl (Aperlai) e le emissioni federali di Ite e di Te (Milano, 1996), Type XXXVII', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teiranes_bosporus', 'Teiranes', 'Tiberius Julius Teiranes, possibly known as Gaius Julius Teiranes or Teiranes was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teisiphonus_perae', 'Teisiphonus of Pherae', 'Tyrant of Pherae; one of the brothers of Thebe, the wife of Alexander of Pherae, who usurped the tyranny after Alexander’s assassination.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teisylos_rhodes', 'Teisylos', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2520', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teis_athens', 'Teis…', 'Third magistrate attested in Athens in 103/102 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 809, 812, 814-815 / issue 62 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (103/102 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 836 s. v. Teis-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tele_abdera', 'Tele(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/telemachos_abdera', 'Telemachos', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/telephus_bactria', 'Telephus of Bactria', 'Telephos Euergetes was a late Indo-Greek king who seems to have been one of the weak and brief successors of Maues. Bopearachchi dates Telephos between 75–70 B.C. and places him in Gandhara.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ten_abdera', 'Ten(…)', 'An individual who issued coins at the ancient city of Abdera, 492-473/470 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tenagure_lycia', 'Tenagure', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M252-4', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tennes_sidon', 'Tennes, King of Sidon', 'Tennes (Tabnit in Phoenician) was a king of Sidon under the Achaemenid Empire in the 4th century B.C. His predecessor was Abdashtart I (in Greek, Straton I).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teres_ii_odrysian_thrace', 'Teres II of Thrace', 'Teres II (Ancient Greek: Τήρης) was a king of the Odrysians in middle Thrace from 351 BC to 342 BC, succeeding his father, Amatokos II. His rule lasted until the region was taken over by the Macedonian king Philip II', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teres_iii_odrysian_thrace', 'Teres III of Thrace', 'Teres III (Ancient Greek: Τήρης) was a king of the Odrysians in Thrace in ca. 149 BC, the son of Cotys IV.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/teththiweibi_lycia', 'Teththiweibi', 'Dynast in the ancient region of Lycia from approximately 440–430 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M255', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tetricus_i', 'Tetricus I', 'Gaius Pius Esuvius Tetricus was Emperor of the Gallic Empire (Imperium Galliarum) from 271 to 274, following the murder of Victorinus. Tetricus, who ruled with his son, Tetricus II, was the last of the Gallic emperors following his surrender to the Roman emperor Aurelian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tetricus_ii', 'Tetricus II', 'Caius Pius Esuvius Tetricus (also seen as Gaius Pius Esuvius Tetricus but better known in English as Tetricus II) was the son of Tetricus I, Emperor of the Gallic Empire (270-274).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tharan_yaub_yuhanim_himyar', 'Tha\'ran Ya\'ub Yuhan\'im of Himyar', 'Ruler of the Himyarite kingdom in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thap_lycia', 'Thap...', 'Dynast in the ancient region of Lycia from approximately 480–450 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M266', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tharin_yaib_yuhanim_himyarites', 'Tharin Ya\'ib Yuhan\'im', 'Late second, early third century king of the Himyarites.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thecla_sister_of_michael_iii', 'Thecla', 'The sister of the Byzantine emperor Michael III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thiess_von_speyer_colonia_claudia_ara_agrippinensium', 'Theiss von Speyer', 'The Goldsmith and Banker (Ma)theis von Speyer (Speier) was Mintmaster in Cologne (City), Germany, from 1474 to 1475. Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 3, 47-49; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 553, p. 424.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/themistocles_athens', 'Themistocles', 'Themistocles (Greek: Θεμιστοκλῆς Greek pronunciation: [tʰemistoklɛ̂ːs] Themistoklẽs; \"Glory of the Law\"; c. 524–459 BC) was an Athenian politician and general. He was one of a new breed of non-aristocratic politicians who rose to prominence in the early years of the Athenian democracy. After the Persian Wars Themistocles fled from Greece. Alexander I of Macedon (r. 498–454 BC) temporarily gave him sanctuary at Pydna before he traveled to Asia Minor, where he entered the service of the Persian king Artaxerxes I (reigned 465–424 BC). He was made governor of Magnesia, and lived there for the rest of his life.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/themistokles_i_athens', 'Themistokles', 'First magistrate in Athens in 117/116 BC [issue 48]. Before three times attested as third magistrate: in 133/132 BC [issue 32], in 124/123 BC [issue 44], and in 118/117 BC [issue 47]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 378-379, 381 (ΘΕΜΙΣΤΟΚΛΗ), nos. 528-529 (ΘΕΜΙ), nos. 585-589 (ΘΕΜΙΣΤΟ), and nos. 596-610 (ΘΕΜΙΣΤΟ) / issues 32, 44, 47 and 48 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (133/132, 121/120, 118/117 and 117/116 BC); Prosopographia Attica 6651; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 212 s. v. Themistokles, no. 2; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 545 s. v. Themistokles (issue 44 in 124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/themistokles_ii_athens', 'Themistokles', 'Second magistrate attested in Athens in 78/77 BC [Thompson issue 85]. Again attested as second magistrate in 75/74 BC [Thompson issue 88]. From Hagnous. Belongs to the same family as his colleague Theophratos [issue 88], he is probabaly his son (Habicht 1991, p. 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1222-1226, 1230 / her issues 85 and 88 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13-14 (78/77 and 75/74 BC, his issues 87 and 90); Prosopographia Attica 6652; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 212 s. v. Themistokles, no. 16; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 545 s. v. Themistokles.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodora', 'Theodora', 'The second wife of the Roman emperor Constantius I Chlorus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodora_wife_of_justinian_i', 'Theodora', 'The wife of the Byzantine emperor Justinian I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodora_wife_of_theophilus', 'Theodora', 'The wife of the Byzantine emperor Theophilos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodora_iii', 'Theodora III', 'The Byzantine empress Theodora III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodora_trapezunt', 'Theodora of Trebizond', 'The empress of Trebizond Theodore.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodorus_i', 'Theodore I Laskaris', 'The first emperor of Nicaea Theodore I Laskaris.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodorus_ii', 'Theodore II Laskaris', 'The emperor of Nicaea Theodore II Laskaris.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodorus_thessalonica', 'Theodore Komnenos Doukas', 'The emperor of Thessalonica Theodore Komnenos Doukas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodorus_mankaphas', 'Theodore Mangaphas', 'The Byzantine emperor Theodore Mangaphas.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodoros_athens', 'Theodoros', 'Four times attested as third magistrate in Athens, in 117/116 BC [issue 48], in 111/110 BC [issue 54], in 110/109 BC [issue 55], and in the following year 109/108 BC [issue 56]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 598, 600-602 (ΘΕΟΔΩΡ), nos. 702, 705 (ΘΕΟΔΩ[ΡΟΣ]), nos. 709, 712-714 (ΘΕΟΔΩ), and nos. 727-728 (ΘΕΟΔΩΡ) / issues 48, 54, 55 and 56 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116, 111/110, 110/109 and 109/108 BC); Prosopographia Attica 6834 and 6835; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 216 s. v. Theodoros, no. 41; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 548 s. v. Theodoros.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodosius_son_of_mauricius', 'Theodosius', 'The son of the Byzantine emperor Maurice.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodosius_i', 'Theodosius I', 'The Roman emperor Theodosius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodosius_ii', 'Theodosius II', 'The Roman emperor Theodosius II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodosius_iii', 'Theodosius III', 'The Byzantine emperor Theodosius III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodotos_maroneia', 'Theodotos', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodotos_cyme', 'Theodotos', 'Magistrate attested on the Alexander coinage of Cyme, c.188-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 1637', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theodotos_athens', 'Theodotos', 'Three times attested as third magistrate in Athens, in 129/128 BC [issue 36], in 125/124 BC [issue 40], and in 106/105 BC [issue 59]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 417-418, nos. 461-466, and nos. 759-776 / issues 36, 40 and 59 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (129/128, 125/124 and 106/105 BC); Prosopographia Attica 6779 and 6780; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 214 s. v. Theodotos, no. 18; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 547 s. v. Theodotos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theogen_athens', 'Theogenes', 'Third magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 600-603 / issue 48 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 213 s. v. Theogenes, no. 9; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 546 s. v. Theogen-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theondes_samothrace', 'Theondes', 'Magistrate attested on the Alexander coinage of Samothrace, c.172-168 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 663', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theonneses_i_characene', 'Theonneses I of Characene', 'Theonnesius I was a King of Characene, a vassal state of the Parthian empire and important trading port on the Persian Gulf. His rule was from 25/24BC to 19/18 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theonneses_ii_characene', 'Theonneses II of Characene', 'Theonnesius II of Characene was a 1st century king of the kingdom of Characene. He ruled for only a few months in AD 46/47.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theonesses_iii_characene', 'Theonneses III of Characene', 'Theonnesius III was a king of Characene who ruled from approximately AD 52.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theonneses_iv_characene', 'Theonneses IV of Characene', 'Theonneses IV was a king of Characene who ruled around 110 - 113.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophra_athens', 'Theoph[ra]...', 'Magistrate in Athens in 130/129 BC (issue 35). Second magistrate in 137/136 BC (issue 28). Third magistrate in 135/134 BC (issue 30). Hails from Kephisia. Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issues 28, 30, and 35; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 7; Prosopographia Attica no. 7167.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophilus', 'Theophilos', 'The Byzantine emperor Theophilos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophilus_bactria', 'Theophilus of Bactria', 'Theophilos was a minor Indo-Greek king who ruled for a short time in the Paropamisadae around 90 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophi_athens', 'Theophi…', 'Third magistrate attested in Athens in 115/114 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 640, 642-643 / issue 50 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (115/114 BC); Prosopographia Attica 7110; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 222 s. v. Theophilos, no. 27; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 551 s. v. Theophi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophrastos_athens', 'Theophrastos', 'First magistrate attested in Athens in 75/74 BC. From Hagnous. Belongs to the same family as his colleague Themistokles, he is probably his father (Habicht 1991, p. 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1230 / her issue 88 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 f. (75/74 BC, his issue 90); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 223 s. v. Theophrastos, no. 21; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 552 s. v. Theophrastos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theophylacus', 'Theophylact', 'The Byzantine emperor Theophylact.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theoph_athens', 'Theoph…', 'Third magistrate attested in Athens in 103/102 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 814, 816-820 / issue 62 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (103/102 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 551 s. v. Theoph-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theopompos_chios', 'Theopompos', 'Magistrate attested on the Alexander coinage of Chios, c.190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2432', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theopompos_athens', 'Theopompos', 'Second magistrate attested in Athens in 117/116 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 596-610 / issue 48; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (117/116 BC); Prosopographia Attica 7020; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 220 s. v. Theopompos, no. 23; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 550 s. v. Theopompos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theothorses_bosporus', 'Theothorses', 'Tiberius Julius Theothorses, also known as Thothorses or Fophors (died 309) was a prince and Roman Client King of the Bosporan Kingdom.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theoume(-)_odessus', 'Theoume(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 125-70 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1209-1210', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theoxenides_athens', 'Theoxenides', 'Second magistrate attested in Athens in 80/79 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1196-1204 / her issue 83 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 6 and 13 (80/79 BC, his issue 85); Prosopographia Attica 6979; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 219 s. v. Theoxenides, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 550 s. v. Theoxenides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theoxen_athens', 'Theoxen…', 'Third magistrate attested in Athens in 121/120 BC [issue 53]. Again attested as third magistrate in 110/109 BC [issue 55]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 691-692, 694-695 and nos. 716-719 / issues 53 and 55 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 and 110/109 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 219 s. v. Theoxenos, no. 5; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 550 s. v. Theoxen-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/theo_athens', 'Theo…', 'Third magistrate attested in Athens in 98/97 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 961, 963-970 / issue 68 (p. 568); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (97/96 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 545 s. v. Theo- (98/97 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thespis_abydus', 'Thespis', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Thespis (1); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 553 s. v. ΘΕΣΠΙΣ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thespis_i_abydus', 'Thespis (I)', 'Magistrate attested in Abydos in c. 375-325 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thibanuwa_lycia', 'Thibanuwa', 'Dynast in the ancient region of Lycia from approximately 480–450 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M269-70', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thoinos_athens', 'Thoinos', 'Third magistrate attested in Athens in 114/113 BC [issue 51]. In the following year attested as second magistrate in 113/112 BC [issue 52]. The name is rare in Athens, common only in Ankyle and Atene. Probably brother or nephew of Limenios, who had written and composed a hymnus to Apollo for the Pythais in 128/127 BC (Habicht 1991, pp. 21-22): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 661-664, 666 and nos. 669-673, 685 / issues 51 and 52 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 21 (114/113 and 113/112 BC); Prosopographia Attica 7245; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 226 s. v. Thoinos, no. 3; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 557 s. v. Thoinos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrason_bactria', 'Thrason of Bactria', 'Thraso, latinized as Thrason, was an Indo-Greek king in Central and Western Punjab, unknown until the 1982 discovery of one of his coins by R. C. Senior in the Surana hoard. The coin is in a style similar to those of Menander I, has the same type of Athena, and shares one of Menander\'s mint marks, dating ca. 95-80 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrasonk_byzantium', 'Thrasonk…', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 140, nos. 1131-1134.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrasyb_priene', 'Thrasyb…', 'An individual who issued coins at the ancient city of Priene c. 320-270 BC. Regling completed: Thrasybulos. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 557.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrasymmagos_byzantium', 'Thrasymmag(os)', 'An individual who issued coins at the ancient city of Byzantium, 300-220/219 BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 133, n. 996.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrasys_abdera', 'Thrasys', 'An individual who issued coins at the ancient city of Abdera, 439/437-411/410 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thrasy_athens', 'Thrasy…', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 545 / issue 45 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 557 s. v. Thrasy-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/thra_athens', 'Thra…', 'Third magistrate attested in Athens in 99/98 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 941-951, 962 / issue 67 (p. 569); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (98/97 BC); H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 557 s. v. Thra- (99/98 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_claudius_hagnias_cyzicus', 'Ti. Claudius Hagnias', 'Strategos in Cyzicus/Mysia during the reign of Domitianus. His name appears on coins in combination with his title of Strategos. See RPC II nos. 883-886; F. Jodin, Revue Numismatique 154, 1999, p. 140 no. 20; Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 283. 605. 842 s. v. Hagnias (AD 81-96); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 6 s. v. Hagnias (no. 5) (AD 83-96).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_claudius_severus_cyzicus', 'Ti. Claudius Severus', 'Strategos in Cyzicus/Mysia c. AD 169-175, possibly as late as AD 180. His name and title (ΤΙ ΚΛ CΕΒΗΡΟC) appear on coins issued during the later half of the reign of Marcus Aurelius, c. AD 169-175 AD, maybe up to AD 180: RPC IV,2 Temp. nos. 710, 712, 751, 10163, and 11213. He may be identical with the Strategos Camurius (?) Severus of RPC IV,2 Temp. nos. 713, 9692, and 11203 (\"Camurius\"). See here under Camurius (?) Severus. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 605 s. v. Klaudios and p. 800 s. v. Seberos und 842 s. v. Tiberios (2nd Century AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_q_rrc', 'Ti. Q[uinctius?]', 'Roman Republican Moneyer, c. 112 - 111 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_sempronivs_graccvs_rrc', 'Ti. Sempronius Gracchus', 'Roman Republican Moneyer, c. 40 BC or later', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_sempronius_graccus', 'Ti. Sempronius Graccus', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_son_of_constans_ii', 'Tiberios', 'The Byzantine emperor Tiberios, son of Constans II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_iii', 'Tiberios III', 'The Byzantine emperor Tiberios III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_son_of_justinian_ii', 'Tiberius', 'The Byzantine emperor Tiberius, son of Justinian II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius', 'Tiberius', 'The Roman emperor Tiberius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_son_of_mauricius', 'Tiberius', 'The son of the Byzantine emperor Maurice.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_claudius_attalus_paterclianus_pirc795', 'Tiberius Claudius Attalus Paterclianus', 'Legatus Augusti pro praetore in Thrace during the reign of the Emperor Commodus (middle 180ies AD). His name appears on the coins of Nikopolis and Pautalia, always as Hegemon. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) 169 no. 40; ibid., I Addenda (2011) 22:040; PIR² C 795.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_clavd_ti_f_ap_n_rrc', 'Tiberius Claudius Nero', 'Roman Republican Moneyer, c. 79 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_gemellus', 'Tiberius Gemellus', 'Tiberius Julius Caesar Nero Gemellus was a member of the Julio-Claudian dynasty. He was born as the son of Drusus the Younger and Livilla. He was a grandson of the Roman emperor Tiberius.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_i', 'Tiberius II Constantine', 'The Byzantine emperor Tiberius II Constantine.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiberius_iulius_festus_piri308', 'Tiberius Iulius Festus', 'Legatus Augusti pro praetore Moesiae inferioris. His name appears on coins in Marcianopolis under Severus Alexander, c. AD 222-226 (with the portraits of Severus Alexander and Iulia Maesa on the obverse). Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 143 no. 126 (c. AD 222-226); PIR² I 308; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 865 s. v. Festus (c. AD 222-235).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_minvci_c_f_avgvrini_rrc', 'Tiberius Minucius', 'Roman Republican Moneyer, c. 134 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ti_vetvr_rrc', 'Tiberius Veturius', 'Roman Republican Moneyer, c. 137 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigraios_elymais', 'Tigraios of Elymais', 'Tigraios was a usurper of the Kingdom of Elymais in Susa between 138-132 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_i_armenia', 'Tigranes I of Armenia', 'Tigranes I of Armenia reigned as King of Armenia from 115 BC to 95 BC. Artavasdes I did not leave any heir; his brother Tigranes ascended to the throne of the Artaxiads. According to Appian, Tigranes II was not the son of Artavasdes, but of Tigranes I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_ii_armenia', 'Tigranes II of Armenia', 'Tigranes II, more commonly known as Tigranes the Great was King of Armenia under whom the country became, for a short time, the strongest state to Rome\'s east. He was a member of the Artaxiad Royal House. Under his reign, the Armenian kingdom expanded beyond its traditional boundaries, allowing Tigranes to claim the title Great King, and involving Armenia in many battles against opponents such as the Parthian and Seleucid empires, and the Roman Republic.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_iii_armenia', 'Tigranes III of Armenia', 'Tigranes III (50s BC–8 BC) was a Prince of the Kingdom of Armenia and member of the Artaxiad Dynasty who served as a Roman Client King of Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_iv_armenia', 'Tigranes IV of Armenia', 'Tigranes IV (30s BC–1) was a Prince of the Kingdom of Armenia and member of the Artaxiad Dynasty who served as a Roman Client King of Armenia from 8 BC until 5 BC and 2 BC until 1 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_v_armenia', 'Tigranes V of Armenia', 'Tigranes V, also known as Tigran V (Greek: Τιγράνης, Armenian: Տիգրան, 16 BC–36) was a Herodian Prince who served as a Roman Client King of Armenia from the years 6 to 12.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_vi_armenia', 'Tigranes VI of Armenia', 'Tigranes VI, also known as Tigran VI or by his Roman name Gaius Julius Tigranes (Greek: Γαίος Ιούλιος Τιγράνης, Armenian:Տիգրան Զ, before 25 – after 68) was a Herodian Prince and served as a Roman Client King of Armenia in the 1st century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tigranes_the_younger_sophene', 'Tigranes the Younger of Sophene', 'Tigranes the Younger was the son and heir of the Artaxiad king of Armenia, Tigranes the Elder (r. 95–55 BC). His mother was Cleopatra of Pontus, a daughter of Mithridates VI Eupator (r. 120–63 BC), the king of Pontus. In c. 66 BC, Tigranes the Younger fell out with his father and fled to the court of the Parthian monarch Phraates III (r. 69–57 BC). Phraates, together with Tigranes the Younger, led an expedition into Armenia. Ultimately, Tigranes the Younger was defeated by his father, however, leading him to join Pompey instead. Tigranes the Elder soon surrendered to Pompey, who chose to allow him to retain his crown. Instead, Tigranes the Younger was made the ruler of Sophene.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tilman_wickerath_deutz', 'Tilman Wickerath', 'Goldsmith in Cologne, Germany, in 1553. Tilman Wickerath was appointed Warden of the Cologne Archbishopric on 7 August 1565. He was appointed General Warden early in 1567 following the death of Lorenz Faust, and also Special Warden in Deutz. Wickerath died in office in March 1595. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 33, 47, 92; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 782 p. 446.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timaios_rhodes', 'Timaios', 'Magistrate attested on the Alexander coinage of Rhodes, c. 201-190 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2526', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timarchides_athens', 'Timarchides', 'Second magistrate attested in Athens in 149/148 BC. The monogram is most probably to be read as ΤΙΜΑΡΧΙΔΗΣ. From Thorikos. Belonging to the same family as his colleague Polykles (first magistrate of this issue) – either his brother (Thompson 1961, p. 579) or his cousin (Habicht 1991, p. 7) – he was member of a family of famous Athenian sculptors. Hieropoios in 150 BC (Habicht 1991, p. 7 with further references): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 101X-110 / issue 16 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 7 (149/148 BC); Prosopographia Attica 13619; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 428 s. v. Timarchides, no. 10; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 844 s. v. Timarchides.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timarchos_athens', 'Timarchos', 'First magistrate in Athens in 134/133 BC (issue 31). Lit.: M. Thompson, The New Style Silver Coinage of Athens (1961) issue 31; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5; Prosopographia Attica no. 13628.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timarchus', 'Timarchus', 'Timarchus was appointed satrap (governor) of Media by Antiochus IV in c. 175 BC. When the king died in 164 BC, he became a virtually independent ruler in his satrapy. Timarchus actively opposed Demetrius I and in 162 BC proclaimed himself as a rival king with the recognition of Rome. Although he managed to expand his kingdom into Babylonia, Timarchus was defeated and killed by Demetrius I in 161 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timar_athens', 'Timar…', 'Third magistrate attested in Athens in 105/104 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 777-780 / issue 60 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (105/104 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 428 s. v. Timarchos, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 844 s. v. Timar-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timocharis_marium', 'Timocharis of Marium', 'King of Marium, in the early 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timodamas_chios', 'Timodamas', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2433', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timokrates_chios', 'Timokrates', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2431', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timokrates_ii_athens', 'Timokrates', 'Second magistrate attested in Athens in 69/68 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1241-1244 / her issue 94 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (69/68 BC, his issue 96); Prosopographia Attica 13755; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 431 s. v. Timokrates, no. 25; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 846 s. v. Timokrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timokrates_i_athens', 'Timokrates', 'Third magistrate attested in Athens in 113/112 BC [issue 52]. Again attested as third magistrate in 111/110 BC [issue 54]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 673, 678-680 and nos. 697-702 / issues 52 and 54 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (113/112 and 111/110 BC); Prosopographia Attica 13756; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 431 s. v. Timokrates, no. 22; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 846 s. v. Timokrates.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timoleon', 'Timoleon', 'Timoleon (Greek: Τιμολέων), son of Timodemus, of Corinth (c. 411–337 BC) was a Greek statesman and general. As a brilliant general, a champion of Greece against Carthage, and a fighter against despotism, he is closely connected with the history of Sicily, especially Syracuse.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timon_chios', 'Timon', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2411', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timon_athens', 'Timon', 'Three times attested as third magistrate in Athens, in 125/124 BC [issue 40], in 119/118 BC [issue 46], and in 109/108 BC [issue 56]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 469-471, nos. 569-572 and nos. 729-732 / issues 40, 46 and 56 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (125/124, 119/118 and 109/108 BC); Prosopographia Attica 13838; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 433 s. v. Timon, no. 7; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 848 s. v. Timon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timonax_dardanus', 'Timonax', 'Magistrate attested in Dardanos c. 375-325 BC. AR coin in Turin. Not in LGPN V; not in Leschhorn LAGM.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timostratos_athens', 'Timostratos', 'First magistrate attested in Athens in 102/101 BC. From Phaleron. Brother of his colleague Poses (Habicht 1991, p. 10): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 823-839 / issue 63 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, pp. 5 and 10 (102/101 BC); Prosopographia Attica 13825; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 433 s. v. Timostratos, no. 26; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 847 s. v. Timostratos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timotheus_heracleia_pontica', 'Timotheus of Heracleia', 'Timotheus (in Greek Tιμoθεoς, Timotheos; died 338 BC) was son of Clearchus I, the tyrant of Heracleia on the Euxine (Black Sea). After the death of his father in 353 BC, he succeeded to the sovereignty, under the guardianship, at first, of his uncle Satyrus, and held the rule for fifteen years.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timo_athens', 'Timo…', 'Third magistrate attested in Athens in 124/123 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 524-526, 542 / issue 44 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (121/120 BC); Prosopographia Attica 13754; H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 845 s. v. Timo- (Datierung auf 124/123 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/timur', 'Timur', 'Timur (Persian: تیمور‎ Timūr, Chagatai: Temür, Uzbek: Temur), historically known as Tamerlane[1] (Persian: تيمور لنگ‎ Timūr(-e) Lang, \"Timur the Lame\"), was a Turko-Mongol conqueror and the founder of the Timurid dynasty in Central Asia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiraeus_i_characene', 'Tiraeus I of Characene', 'Tiraeus I was a king from 95/94 BC to 90/89 BC of Characene, a vassal state of the Parthians.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiraeus_ii_characene', 'Tiraeus II of Characene', 'Tiraeus II was a king who ruled from about 79/78 to 49/48 BC the state of Characene, a vassal state of the Parthians.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiribazus_satrap', 'Tiribazus', 'Tiribazus, Tiribazos or Teribazus (c.440 BC-370 BC) was a Persian general and Persian satrap of Western Armenia and later satrap of Lydia in western Anatolia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiridates_i_parthia', 'Tiridates I of Parthia', 'Tiridates I of Parthia was a usurper against Phraates IV in about 29 BC, but was expelled when Phraates returned with the help of the Scythians. Tiridates fled to Syria, where Augustus allowed him to stay, but refused to support him.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiridates_ii_armenia', 'Tiridates II of Armenia', 'Tiridates II (Armenian: Տրդատ Բ, flourished second half of the 2nd century - died ca. 253) was an Armenian Parthian Prince who served as a Roman Client King of Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiridates_ii_parthia', 'Tiridates II of Parthia', 'Tiridates II of Parthia ruled the Parthian Empire briefly in 35–36. He was the grandson of Phraates IV. He was sent to Rome as a hostage and was educated there. Tiridates III may also be known as Tiridates II in earlier literature.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tiridates_iii_parthia', 'Tiridates III of Parthia', 'Tiridates III was probably the last king of Parthia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tissaphernes_satrap', 'Tissaphernes', 'Tissaphernes (Ancient Greek: Τισσαφέρνης; Old Persian Čiθrafarnah > Mod. Persian Čehrfar) (445 BC – 395 BC) was a Persian soldier and statesman, Satrap of Lydia. He was a grandson of Hydarnes, one of the six conspirators who had supported the rise of Darius the Great.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/titus', 'Titus', 'Titus (Latin: Titus Flāvius Caesar Vespasiānus Augustus; 30 December 39 AD – 13 September 81 AD) was Roman emperor from 79 to 81. A member of the Flavian dynasty, Titus succeeded his father Vespasian upon his death, thus becoming the first Roman Emperor to come to the throne after his own biological father.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/t_pomponius_bassus_pirp530', 'Titus Pomponius Bassus', 'Legatus Augusti pro praetore in Cappadokia and Galatia from autumn AD 94 to mid AD 100. Consul suffectus in AD 94. On provincial coins he sometimes bears the Greek titles of Antistrategos and Presbeutes. Lit.: PIR² P 530; G. R. Stumpf, Numismatische Studien zur Chronologie der römischen Statthalter in Kleinasien (122 v. Chr.-163 n. Chr.) (1991) pp. 239-258.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/flamininus', 'Titus Quinctius Flamininus', 'Titus Quinctius Flamininus (c. 229 BC – c. 174 BC) was a Roman politician and general instrumental in the Roman conquest of Greece. Consul 198 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/titus_statilius_barbarus_pirs819', 'Titus Statilius Barbarus', 'Legatus Augusti pro praetore in Thrace from AD 196 to 198. Appears on coins of Anchialus, Bizye, Hadrianopolis, Philippopolis, Serdika, Augusta Traiana, Traianopolis, and Pautalia. In Pautalia, Serdika, and Bizye always as Hegemon. Lit.: E. Schönert-Geiss, Die Münzprägung von Augusta Traiana und Traianopolis (1991) 8-9; Y. Youroukova, Die Münzprägung von Bizye (1981) 11. 55; D. Boteva, Lower Moesia and Thrace in the Roman Imperial System (1997) 259 (A); AE 1998, 1166 (B); B.; E. Thomasson, Laterculi Praesidum (1984) 169 no. 43; ibid., I Addenda (2011) 22:043; PIR² S 819.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tnnemi_lycia', 'Tnnemi', 'Dynast in the ancient region of Lycia from approximately 460–440 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M273', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tod_rrc', 'Todus', 'Roman Republican Moneyer, c. 189 - 180 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/trajan', 'Trajan', 'Trajan (Latin: Imperator Caesar Nerva Traianus Divi Nervae filius Augustus; 18 September 53 – 8 August 117 AD) was Roman emperor from 98 to 117 AD.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/trajan_decius', 'Trajan Decius', 'Trajan Decius (Latin: Gaius Messius Quintus Decius Augustus; ca. 201 – June 251), was Roman Emperor from 249 to 251. In the last year of his reign, he co-ruled with his son Herennius Etruscus until they were both killed in the Battle of Abrittus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/trbbenimi_lycia', 'Trbbenimi', 'Dynast in the ancient region of Lycia from approximately 390–370 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M275', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/trebonianus_gallus', 'Trebonianus Gallus', 'Trebonianus Gallus (Latin: Gaius Vibius Afinius Trebonianus Gallus Augustus; 206 – August 253), also known as Gallus, was Roman Emperor from 251 to 253, in a joint rule with his son Volusianus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tryphon_athens', 'Tryphon', 'First magistrate attested in Athens in 57/56 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) no. 1268 / her issue 106 (p. 581); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (57/56 BC, his issue 108); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 435 s. v. Tryphon, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 851 s. v. Tryphon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tryphon', 'Tryphon', 'Tryphon (\"Magnificent\") was the pseudonym taken by the Seleucid commander Diodotus after he calimed the kingship at the death of Antiochus VI (c. 142 BC). He ruled in opposition to both Demetrius II and Antiochus VII between c. 142 and 138 BC. His authority was not recognized in Babylon, but he held Antioch and Apamea in Syria, as well as much of Phoenicia and Coele Syria. In 143/2. He struck heavy blows against both the Jews of Judaea and the generals of Demetrius II. However, in 138 BC, Antiochus VII drove him out of Syria and hounded him through Phoenicia. Tryphon was besieged first at Dora and then at Apamea before he was captured and killed in 138/7 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tugha_timur', 'Tugha Timur', 'Jahan Temür was a Jalayirid candidate for the throne of the Ilkhanate in the late 1330s. He was the son of Ala-Fireng and the grandson of the Ilkhan Gaykhatu.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tughril_beg_rukh_al-din_abu_talib', 'Tughril Beg, Rukh al-Din Abu Talib', 'Tughril (Turkish: Tuğrul, Turkmen: Togrul beg, Persian: رکن‌الدین طغرل‌بک بن سلجوق; full name: Rukn al-Dunya wa al-Din Abu Talib Muhammad Toghrul-Beg ibn Mikail) also spelled Toghrul I, Tugril, Toghril, Tugrul or Toghrïl Beg) was the founder of the Seljuk Empire, ruling from 1037 to 1063.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tullius_menophilos_pirt387', 'Tullius Menophilos', 'Legatus Augusti pro praetore Moesiae inferioris. Known through epigraphic and numismatic sources. He dedicated a statue to the emperor Gordianus III, and his name appears on coins in Marcianopolis with the portrait of Gordianus III on the obverse, but not with those of Tranquillina. Therefor his term in office seems to have terminated before the Imperial marriage in AD 241. Additionally at some point before AD 238 he is recorded as consul suffectus. Lit.: B. E. Thomasson, Laterculi Praesidum I (1984) p. 144 no. 131 (c. AD 239-240); PIR² T 387; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 682 s. v. Menophilos (c. AD 238-244).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tumanbay', 'Tumanbay', 'l-Adil Sayf ad-Din Tuman bay (السلطان الملك العادل أبو النصر طومان باى الأشرفى قايتباى) was the twenty fifth Mamluk Sultan of Egypt from the Burji dynasty. He ruled for about one hundred days in 1501.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/turanshah_ibn_qawurd', 'Turanshah ibn Qawurd', 'Turanshah ibn Qawurd (477-490/1048-1073) was the second ruler of the Kerman was a province in southern Persia which between 1053 and 1154, the territory also included Umman.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/tymnes_termera', 'Tymnes of Termera', 'Tymnes was tyrant of the Termera in Caria in the 5th century BC', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/ubayd_allah_al-mahdi', 'Ubayd Allah al-Mahdi', 'Abu Muhammad Abdallah al-Mahdi Billah (Arabic: أبو محمد عبيد الله المهدي بالله‎), was the founder of the Fatimid Caliphate, the only major Shi\'a caliphate in Islam, and established Fatimid rule throughout much of North Africa.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ubayd_allah_ibn_al-habhab', 'Ubayd Allah ibn al-Habhab', 'Obeid Allah ibn al-Habhab al-Mawsili was an important Umayyad official in Egypt from 724 to 734, and subsequently Umayyad governor of Kairouan, Ifriqiya from 734 to 741', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/uele_lycia', 'Uele', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M233', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ukhssepddimi_lycia', 'Ukhssepddimi', 'Dynast in the ancient region of Lycia from approximately 400–380 BC. See K. Konuk, ‘On Some New Lycian Coin Types’ Philia: International Journal of Ancient Mediterranean Studies 2 (2016), pp. 20-7, Figs. 1-3', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/uljaytu', 'Uljaytu', 'Öljeitü, Oljeitu, Olcayto or Uljeitu, Öljaitu, Ölziit (Mongolian: ᠦᠯᠵᠡᠢᠲᠦ ᠺᠬᠠᠨ, Өлзийт хаан), also known as Muhammad Khodabandeh (Persian محمد خدابنده - اولجایتو, khodābandeh from Persian meaning the \"man of God\" or \"servant of God\"), was the eighth Ilkhanid dynasty ruler in Tabriz, Iran from 1304 to 1316.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ulpia_severina', 'Ulpia Severina', 'Wife of the Emperor Aurelian.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ulrich_bosswyl_stuttgart', 'Ulrich Bosswyl', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1513 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 41', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ulrich_gloegler_stuttgart', 'Ulrich Gloegler (Gloekler)', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany in ca. 1518. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 41', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ulrich_von_wernberg_deutz', 'Ulrich von Wernberg', 'The Cologne goldsmith Ulrich von Wernberg was appointed Warden in Deutz, Germany, in May 1600. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 94.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/umar_mamluks', 'Umar', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/umar_ibn_abd_al-aziz', 'Umar ibn Abd al-Aziz', 'Umar ibn Abd al-Aziz (280-283/893-896) was a member of the Dulafid or Dolafid dynasty which was an Arab dynasty that served as governors of Jibal for the Abbasid caliphs in the 9th century.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/umar_ibn_awadh_al_qu\'aiti', 'Umar ibn Awadh al Qu\'aiti', 'Umar ibn Awadh al Qu\'aiti (1275-1301/1858-1882) was a ruler of the Qu\'aiti (Arabic: القعيطي‎ al-Qu‘ayṭī), officially the Qu\'aiti State in Hadhramaut (Arabic: الدولة القعيطية الحضرمية‎) or the Qu\'aiti Sultanate of Shihr and Mukalla (Arabic: سلطنة الشحر والمكلاا‎ al-Salṭanah al-Qu‘ayṭīyah fī ash-Shiḥr wal-Mukallā), which was a sultanate in the Hadhramaut region of the southern Arabian Peninsula.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/umar_ibn_yahya', 'Umar ibn Yahya', 'Umar ibn Yahya (c. 152 - 157/769 - 774) was an Abbasid official in Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/unknown_king_i_persis', 'Unknown King I of Persis', 'Unknown ruler of Persis under the Seleucids', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/unknown_king_ii_persis', 'Unknown King II of Persis', 'Unknown King II ruler of Persis under Parthia in the late 1st century BC to early 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/unknown_king_iii_persis', 'Unknown King III of Persis', 'Unknown King III ruler of Persis under Parthia in the 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/unna_lycia', 'Unna', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See SNG von Aulock 4111', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ura_lycia', 'Ura', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See W. Müseler, Lykische Münzen in Europäischen Privatsammlungen (İstanbul, 2016), III, 15', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/uranius_antoninus', 'Uranius Antoninus', 'Uranius is the name of a Roman usurper cited by Zosimus, and active during the reigns of Elagabalus or Alexander Severus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/urban_felgenhauer_marsberg', 'Urban Felgenhauer', 'Mintmaster at Marsberg, a city in Germany, in 1630, with monogram VFH, Felgenhauer was Mintmaster at the Corvey Imperial Abbey (now within the territory of the City of Höxter) in 1655 and again in 1661. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 129, 145, 173.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/urimilk_byblus', 'Urimilk of Byblus', 'Ruler of Byblos in the 4th century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/usamah_ibn_zayd', 'Usamah ibn Zayd', 'Magistrate known from glassware.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vabalathus', 'Vabalathus', 'The Roman emperor Vabalathus. Son of Septimius Odaenathus and Zenobia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vadfradad_i_persis', 'Vadfradad I of Persis', 'Vadfradad I Frataraka ruler of Persis', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vadfradad_ii_persis', 'Vadfradad II of Persis', 'Vadfradad II ruler of Persis under the Seleucids', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vadfradad_iii_persis', 'Vadfradad III of Persis', 'Vadfradad III ruler of of Persis in the late 2nd century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vadfradad_iv_persis', 'Vadfradad IV of Persis', 'Vadfradad IV ruler of Persis under Parthia in the 1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vadfradad_v_persis', 'Vadfradad V of Persis', 'Vadfradad V was ruler of Persis under Parthia in the late 1st to early 2nd century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vahbarz_persis', 'Vahbaz of Persis', 'Wahbarz (also spelled Vahbarz), known in Greek sources as Oborzos, was a dynast (frataraka) of Persis in the 1st half of 2nd century BC, ruling from possibly c. 205 to 164 BC.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vashuvar', 'Vahshuvar, satrap of Parthia', 'Vashuvar, satrap of Parthia under the Seleucids in the late 4th-3rd early 3rd century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/val_rrc', 'Val[erius]', 'Roman Republican Moneyer, c. 169 - 158 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valens', 'Valens', 'The Roman emperor Valens.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valens_thessalonicus', 'Valens Thessalonicus', 'Usurper during the reign of the Emperor Gallienus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valentin_johann_moser_stuttgart', 'Valentin Johann Moser', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany 1622. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 127', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valentin_riemer_detmold', 'Valentin Riemer', 'Appointed as Mintmaster at Detmold, a city in Germany, in 1618, along with the Mint Director, Jacob Pfahler, before that in Stadtberge (in Marsberg), where both Riemer and Pfahler lived. As they were moving to Detmold, Riemer was charged and arrested in connection with substandard minting. On 13 July 1621, Riemer was appointed Mintmaster for the Cologne Archbishopric, but the location is not known. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) pp. 127, 129, 152.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valentinian_i', 'Valentinian I', 'Valentinian I (Latin: Flavius Valentinianus Augustus; 321 – 17 November 375), also known as Valentinian the Great, was Roman emperor from 364 to 375.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valentinian_ii', 'Valentinian II', 'The Roman emperor Valentinian II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valentinian_iii', 'Valentinian III', 'The Roman emperor Valentinian III.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerian', 'Valerian', 'Valerian (Latin: Publius Licinius Valerianus Augustus; 193/195/200 – 260 or 264), also known as Valerian the Elder, was Roman Emperor from 253 to 260. He was taken captive by Persian king Shapur I after the Battle of Edessa, becoming the only Roman Emperor who was captured as a prisoner of war, causing instability in the Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerian_ii', 'Valerian II', 'Publius Licinius Cornelius Valerianus (died 257 or 258), also known as Valerian II, was the eldest son of Roman Emperor Gallienus and Augusta Cornelia Salonina who was of Greek origin and grandson of the Emperor Valerian who was of a noble and traditional senatorial family.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerio_silvestro', 'Valerio, Silvestro (1694-1700)', 'Silvestro Valiero or Valier (Venice, 28 March 1630 – Venice, 7 July 1700) was the 109th Doge of Venice, reigning from his election on 25 February 1694 until his death six years later.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerius_gratus', 'Valerius Gratus', 'Valerius Gratus was the Roman Prefect of Iudaea province under Tiberius from 15 to 26 AD. He succeeded Annius Rufus and was replaced by Pontius Pilate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerius_romulus', 'Valerius Romulus', 'Son of the Roman emperor Maxentius. Died in 309.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/valerius_valens', 'Valerius Valens', 'The Roman emperor Valerius Valens. Made Augustus by Licinius I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vardanes_i_parthia', 'Vardanes I of Parthia', 'Vardanes I of Parthia was a Prince of Iranian and Greek ancestry. He ruled the Parthian Empire as King from about 40 until 45 CE. He succeeded his father Artabanus II of Parthia, but had to continually fight against his brother Gotarzes II, a rival claimant to the throne.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vardanes_ii_parthia', 'Vardanes II of Parthia', 'Vardanes II of Parthia was the son of Vologases I and briefly ruler of part of the Parthian Empire. He rebelled against his father from about 55 to 58 CE and must have occupied Ecbatana, since he issued coins from the mint there, bearing the likeness of a young beardless king wearing a diadem with five pendants.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/varius_phoibos_cyzicus', 'Varius Phoibos', 'Strategos in Cyzicus/Mysia during the reign of Macrinus. His name (SNG Aulock no. 1279: ΟΥΑΡ... ΦΟΙΒΟΥ) appears on coins in combination with his title of Strategos. Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 734 s. v. Ouarios and p. 882 s. v. Phoibos (AD 217-218); Th. Corsten (ed.), Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 457 s. v. Phoibos (no. 28) (AD 217-218).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/varro_pro_q_rrc', 'Varro', 'Roman Republican Moneyer, c. 49 BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vashir_persis', 'Vashir of Persis', 'Vashir ruler of Persis under Parthia in the late 1st century BC to early 1st century AD', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vasudeva_i_kushan_empire', 'Vasudeva I', 'Vasudeva I was a Kushan emperor, last of the \"Great Kushans.\" Named inscriptions dating from year 64 to 98 of Kanishka\'s era suggest his reign extended from at least 191 to 232 CE. He ruled in northern India, and still minted in coins in Balkh (Bactria).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/venir_francesco', 'Venir, Francesco (1554-1556)', 'Francesco Donato was the Doge of Venice from 1545 to 1553. He was married to Giovanna Da Mula and Alicia Giustiniani.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vermina_masaesyli', 'Vermina', 'Vermina was the son of king Syphax, king of Masaesylian Berbers of Western Numidia ca. 200 B.C. before the Masaesyli were assimiliated into the Kingdom of Numidia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vespasian', 'Vespasian', 'Vespasian (Latin: Titus Flāvius Caesar Vespasiānus Augustus; 17 November AD 9 – 23 June AD 79) was Roman emperor from AD 69 to AD 79. Vespasian founded the Flavian dynasty that ruled the Empire for twenty-seven years.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vetranio', 'Vetranio', 'The Roman emperor Vetranio.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/victor_adramyteum', 'Victor', 'Magistrate in Adramyteum (Mysia). His name appears on coins issued under Gallienus. See J. Stauber, Die Bucht von Adramytteion, Inschriften griechischer Städte aus Kleinasien 51 (1996) pp. 188, 190, 238 nos. 273-275; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 408 s. v. Biktor; Th. Corsten, Lexicon of Greek Personal Names V A. Coastal Asia Minor (2010) p. 351 s. v. Ouiktor (no. 3).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/victor_emmanuel_ii', 'Victor Emmanuel II', 'Victor Emanuel II (Vittorio Emanuele Maria Alberto Eugenio Ferdinando Tommaso; 14 March 1820 – 9 January 1878) was king of Sardinia from 1849 until, on 17 March 1861, he assumed the title King of Italy to become the first king of a united Italy since the 6th century, a title he held until his death in 1878.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/victor_emmanuel_iii', 'Victor Emmanuel III (1900-1947)', 'Victor Emmanuel III (Italian: Vittorio Emanuele III; 11 November 1869 – 28 December 1947) was King of Italy (29 July 1900 – 9 May 1946). In addition, he claimed the thrones of Ethiopia and Albania as Emperor of Ethiopia (1936–41) and King of the Albanians (1939–43), which were not recognised by all great powers.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/victorinus', 'Victorinus', 'Marcus Piavonius Victorinus was emperor of the secessionist Gallic Empire from 269 to 271, following the brief reign of Marius. He was murdered by a jealous husband whose wife he tried to seduce.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/daughter_of_vitellius', 'Vitellia', 'The young daughter of the emperor Vitellius, depicted on issues of Vitellius alongside her young brother.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vitellius', 'Vitellius', 'Vitellius (Latin: Aulus Vitellius Germanicus Augustus; 24 September AD 15 – 22 December AD 69) was Roman Emperor for eight months, from 16 April to 22 December AD 69. Vitellius was proclaimed emperor following the quick succession of the previous emperors Galba and Otho, in a year of civil war known as the Year of the Four Emperors.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_i_parthia', 'Vologases I of Parthia', 'Vologases I of Parthia sometimes called Vologaeses or Vologeses or following Parthian usage, Walagash was king of the Parthian Empire from about 51 until his death in 78.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_ii_parthia', 'Vologases II of Parthia', 'Vologases II was a Parthian prince who competed against his brother Pacorus II (r. 78–110) for the Parthian crown from 78, until his defeat in 80.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_iii_parthia', 'Vologases III of Parthia', 'Vologases III was king of the Parthian Empire from 110 to 147. He was the son and successor of Pacorus II (r. 78–110).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_iv_parthia', 'Vologases IV of Parthia', 'Vologases IV was the ruler of the Parthian Empire from 147 to 191. He was the son of Mithridates V (129–140).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_v_parthia', 'Vologases V of Parthia', 'Vologases V was king of the Parthian Empire from 191 to 208. As king of Armenia (r. 180–191), he is known as Vologases II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vologases_vi_parthia', 'Vologases VI of Parthia', 'Vologases VI was the uncontested king of the Parthian Empire from 208 to 213, but afterwards fell into a dynastic struggle with his brother Artabanus IV, who by 216 was in control of most of the empire, even being acknowledged as the supreme ruler by the Roman Empire. His coins appear to have been issued from Mesopotamian mints as late as 228.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/volusian', 'Volusian', 'Volusianus (Gaius Vibius Volusianus Augustus; died August 253), also known as Volusian, was a Roman Emperor from 251 to 253.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/volusus_valerius_messalla', 'Volusus Valerius Messalla', 'Roman moneyer operating under the authority of Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/voney_c-f_chasseboeuf', 'Voney, C.-F. Chasseboeuf (d. 1820)', 'Constantin François de Chassebœuf, comte de Volney (3 February 1757 – 25 April 1820) was a French philosopher, abolitionist, historian, orientalist, and politician.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vonones_i_parthia', 'Vonones I of Parthia', 'Vonones I ruled the Parthian Empire from about 8 to 12 AD. He was the eldest son of Phraates IV (r. 37–2 BC) and was sent to Rome as a hostage in the 20s BC as surety for a treaty his father made with Augustus.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/vonones_ii_parthia', 'Vonones II of Parthia', 'Vonones II of Parthia was a Parthian prince who served as a King of Media Atropatene and briefly as King of the Parthian Empire.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wakhsebllimi_lycia', 'Wakhsebllimi', 'Dynast in the ancient region of Lycia from approximately 450–430 BC. See K. Konuk, ‘On Some New Lycian Coin Types’ Philia: International Journal of Ancient Mediterranean Studies 2 (2016), pp. 20-7, Fig. 12', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wakhssebe_lycia', 'Wakhssebe', 'Dynast in the ancient region of Lycia from approximately 420–380 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M279', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wakhssepddimi_lycia', 'Wakhssepddimi', 'Dynast in the ancient region of Lycia from approximately 400–380 BC. See K. Konuk, ‘On Some New Lycian Coin Types’ Philia: International Journal of Ancient Mediterranean Studies 2 (2016), pp. 20-7, Figs. 4-6', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/warawil_ghaylan_qataban', 'Waraw\'il Ghaylan of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wekhssere_i_lycia', 'Wekhssere I', 'Dynast in the ancient region of Lycia from approximately 440–430 BC. See N. Vismara and O. Carruba, Monetazione Arcaica Della Lycia 1. Il dinasta Wekhssere I (Milano, 1989)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wekhssere_ii_lycia', 'Wekhssere II', 'Dynast in the ancient region of Lycia from approximately 400–380 BC. See N. Olçay and O. Mørkholm, ‘The Coin Hoard From Podalia’, Numismatic Chronicle7 11 (1971), pp. 1-29, 1-2', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wete_lycia', 'Wete', 'Dynast in the ancient region of Lycia from approximately 480–460 BC. See C. Hoff, Identität Und Politik: Kollektive Kulturelle Und Politische Identität Der Lykier Bis Zur Mitte Des 4. Jahrhunderts V. Chr. (Wiesbaden, 2017), M235', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wilhelm_gross_stuttgart', 'Wilhelm Gross', 'Die cutter in Stuttgart, Baden-Wuerttemberg, Germany from 1605/06 to ?. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wilhelm_schmitz_neuss', 'Wilhelm Schmitz', 'Mint Warden in Neuss, Germany from 1568 to ? Lit.: Alfred Noss, Die Münzen der Städte Köln und Neuss: 1474-1794 (1926), pp. 47-49', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wilhelm_tarden_bonn', 'Wilhelm Tarden', 'Warden in Bonn, a city in Germany, in 1748, and appointed Assay Master on 16 September 1760, a position he held until 1789. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Köln 1547-1794 (1925) p. 428; Wolfgang Scheffler, Goldschmiede Rheinland-Westfalens - Aachen - Köln (1973) n. 21 p. 92.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/william_i_sicly', 'William I (548-561/1154-1166)', 'William I (1131 – May 7, 1166), called the Bad or the Wicked, was the second King of Sicily, ruling from his father\'s death in 1154 to his own in 1166.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/william_ii_sicily', 'William II (561-585/1166-1189)', 'William II (1155 – 11 November 1189), called the Good, was king of Sicily from 1166 to 1189. William\'s character is very indistinct. Lacking in military enterprise, secluded and pleasure-loving, he seldom emerged from his palace life at Palermo', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wirich_streitken_attendorn', 'Wirich Streitken von Haaselt', 'Wirich Streitken von Haaselt was appointed Mintmaster in the Attendorn Mint of the Archbishopric Cologne on 1 March 1376. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 334.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wolf_mayer_stuttgart', 'Wolf Mayer (Maier)', 'Mint Warden in http://nomisma.org/id/stuttgart, Baden-Wuerttemberg, Germany from 1597(?) to ? and 1606 to 1615. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wolfgang_eberhardt_deutz', 'Wolfgang Eberhardt', 'Appointed Mintmaster in the Deutz Mint of the Archbishopric Cologne on 30 September 1505. Lit.: Alfred Noss, Die Münzen der Erzbischöfe von Cöln 1306-1547 (1913) p. 270.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wolfgang_maier_stuttgart', 'Wolfgang Maier (Mayer)', 'Mint Warden in Stuttgart, Baden-Wuerttemberg, Germany 1579 ?, 1606-1615. Died in 1615. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 87, 109.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/wolfgang_ulrich_fischer_stuttgart', 'Wolfgang Ulrich Fischer', 'Mintmaster in Stuttgart, Baden-Wuerttemberg, Germany from 1620. previously Mint master in Christophstal around 1605 to 1608. Lit.: U. Klein and A. Raff, Die Württembergischen Münzen von 1373 - 1693 (1993), p. 109, 126.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xanthippos_i_abydus', 'Xanthippos (I)', 'Magistrate attested in Abydos in c. 375-325 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Xanthippos (5); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 720 s. v. ΞΑΝΘΙΠΠΟΣ. For chronology, cf. G. Le Rider, Deux Trésors de monnaies grecques de la Propontide (IVe siècle avant J.-C.). Paris 1963, pp. 51-53.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xanthippos_ii_abydus', 'Xanthippos (II)', 'Magistrate attested in Abydos in c. 75-65 BC.  For chronology cf. F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xeno(-)_odessus', 'Xeno(…)', 'Magistrate attested on the Alexander coinage of Odessus, c. 125-70 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), nos. 1200-1203', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenokles_athens', 'Xenokles', 'Three times attested as first magistrate in Athens, in 95/94 BC [Thompson issue 70], in 92/91 BC [Thompson issue 73], and again in 90/89 BC [also Thompson issue 73]. Previously attested as third magistrate in 99/98 BC [Thompson issue 67]: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 944-945, 948-952, nos. 1013-1014, 1016-1031, nos. 1066-1109 and nos. 1110-1124 / her issues 67, 70 and double issue 73 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (98/97, 95/94, 92/91 and 90/89 BC, his issues 67, 70, 73 and 75); Prosopographia Attica 11216; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 345 s. v. Xenokles, no. 25. H. B. Mattingly, NC 157, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 722 s. v. Xenokles (99/98 BC, issue 67).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenokra_athens', 'Xenokrates', 'Third magistrate attested in Athens in 121/120 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 517-521 / issue 43 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (122/121 BC); Prosopographia Attica 11238; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 346 s. v. Xenokrates, no. 8; H. B. Mattingly, NC 258, 1997, p. 258 and W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 722 s. v. Xenokra- (121/120 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenon_byzantium', 'Xenon', 'An individual who issued coins at the ancient city of Byzantium, 3rd cent. BC. See E. Schönert-Geiß, Die Münzprägung von Byzantion I. Autonome Prägung (Berlin, 1970), p. 141, nos. 1144-1147.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenon_chios', 'Xenon', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2418', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenon_athens', 'Xenon', 'Second magistrate attested in Athens in 70/69 BC. From Melite. Belongs to the same family as his colleague Epigenes (first magistrate of this issue), he is probably his brother (Thompson 1961, pp. 563 and 577). Maybe he and Epigenes are identical with the brothers of the same name, who were known as ephebes in 80/79 BC – in this case they would have held the magistracy in their younger days (Habicht 1991, p. 14): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 1237-1240 / her issue 93 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 6 (70/69 BC, his issue 95); Prosopographia Attica 11333; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 348 s. v. Xenon, no. 33; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 724 s. v. Xenon.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenophantos_cyzicus', 'Xenophantos', 'A magistrate, possibly in Cyzicus/Mysia, c. AD 14-37. The name [ ]ΕΝΟΦΑΝ[ ] ΚΑΡΑ Κ[ ] appears on coins issued under Tiberius. The reading of the name as well as the mint\'s identiy are not clear. See the commentary in RPC I p. 720 no. 5453; F. Jodin, Revue Numismatique 154, 1999, p. 139 no. 8 (obv. Drusus). Lit.: W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 723 s. v. Xenophantos (AD 14-37), RPC I p. 720 (under Tiberius).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xenophon_abydus', 'Xenophon', 'Magistrate attested in Abydos in c. 75-65 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Xenophon (9); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 724 s. v. ΞΕΝΟΦΩΝ. Chronology: LGPN VA (c.100-70BC); F. de Callataÿ, Abydos sur Aesillas, in: E. Kypraiou (ed.), Χαρακτήρ: Aφιέρωμα στη Mάντω Oικoνoμίδoυ. Athens 1996, p. 83 (c. 75-65 BC).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xerxes_i_persia', 'Xerxes I of Persia', 'Xerxes I (Old Persian: ??????? Xšayaṛša (Khshāyarsha) \"ruling over heroes\", Greek Ξέρξης Xérxēs; 519–465 BC), called Xerxes the Great, was the fifth king of kings of the Achaemenid dynasty of Persia. Like his father and predecessor Darius I, he ruled the empire at its territorial apex. He ruled from 486 BC until his assassination in 465 BC at the hands of Artabanus, the commander of the royal bodyguard.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xerxes_ii_persia', 'Xerxes II of Persia', 'Xerxes II (/ˈzɜːrksiːz/; Old Persian: ??????? Xšayaṛša (Khshāyarsha (help·info)) \"ruling over heroes\", Greek Ξέρξης Xérxēs [ksérksɛːs]; 519–424 BC), was a Persian king and the son and successor of Artaxerxes I. After a reign of forty-five days, he was assassinated in 424 BC by his brother Sogdianus, who in turn was murdered by Darius II.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xerxes_armenia', 'Xerxes of Armenia', 'Xerxes was king of Sophene and Commagene from 228 BC to 212 BC. He was the son and successor of Arsames I.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xouthos_i_chios', 'Xouthos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2425', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/xouthos_ii_chios', 'Xouthos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2438', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ya\'qub_mamluks', 'Ya\'qub', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yadab_dhubyan_yuhurgib_qataban', 'Yad\'ab Dhubyan Yuhurgib of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yadab_yanaf_qataban', 'Yad\'ab Yanaf of Qataban', 'Ruler of the Qatabanian kingdom in the 2nd-1st century BC', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yahya_al-mutawakkil', 'Yahya al-Mutawakkil', 'Yahya Muhammad Hamid ed-Din (or Imam Yahya) (18 June 1869 — 17 February 1948)[1] became Imam of the Zaydis in 1904 and Imam of Yemen in 1918.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yaqub_beg_ataliq_ghazi', 'Yaqub Beg Ataliq Ghazi', 'Muhammad Yaqub Bek (Tajiki: Яъқуб-бек) (1820 – 30  May 1877) was a Tajik adventurer who became head of the kingdom of Kashgaria.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yazid_ibn_abi_yazid', 'Yazid ibn Abi Yazid', 'Yazid ibn Abi Yazid (116-127/734-745; 127-128/745) was an Umayyad official whose name was found on Islamic glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yazid_ibn_hatim', 'Yazid ibn Hatim', 'Yazid ibn Hatim al-Muhallabi (Arabic: يزيد بن حاتم المهلبي‎) was a member of the Muhallabid family who served as the governor of Adharbayjan, Egypt (762–769) and Ifriqiya (771–787) for the Abbasid Caliphate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yd_maroneia', 'Yd(…)', 'An individual who issued coins at the ancient city of Maroneia, 398/397-386/385 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), p. 146, n. 332.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/young_antiochus_epiphanes', 'Young Antiochus Epiphanes', 'The young Antiochus Epiphanes (\"God Manifest\") was an obscure Seleucid child-king who appears on Antioch coins struck in 128 B.C. It is unclear whether coins with his portrait were intended to represent an exceptionally juvenile Antiochus VIII or another ephemeral king.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yusif_b_ali', 'Yusif b. Ali', 'Yusif b. Ali (416-433/1025-1042) was a member of the Kara-Khanid Khanate (Persian: قَراخانيان‎, Qarākhānīyān or خاقانيه‎, Khakānīya, Chinese: 黑汗, 桃花石) which was a Turkic dynasty that ruled in Transoxania in Central Asia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/yusuf_b_al-hasan', 'Yusuf b. al-Hasan', 'ultan Yusef ben Hassan (Arabic: السلطان يوسف بن الحسن‎) ruled Morocco from 1912 until his death in 1927.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/za_abdera', 'Za(…)', 'An individual who issued coins at the ancient city of Abdera, 520/515-492 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zariadres_sophene', 'Zariadres of Sophene', 'Zariadres was a King of Sophene. Following the defeat of Antiochus III by the Romans at the Battle of Magnesia in 190 BC, Zariadres and Artaxias revolted and with Roman consent began to reign as kings under the terms of the Treaty of Apamea in 188 BC—Zariadres over Sophene and Artaxias over Armenia.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zaydan_ibn_ahmad', 'Zaydan ibn Ahmad', 'Mawlay Zidan el Nasir was the sultan of Morocco from 1603 to 1627.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zayn_al-din_kitburgha', 'Zayn al-Din Kitburgha', 'Kitbugha (Arabic: كتبغا ) (Royal name: al-Malik al-Adil Zayn-ad-Din Kitbugha Ben Abd-Allah al-Mansuri al-Turki al-Mughli ( Arabic: الملك العادل زين الدين كتبغا بن عبد الله المنصورى التركى المغلى)), was the 10th MamlukSultan of Egypt from December 1294 to November 1296.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenis_dardanus', 'Zenis', 'Satrap in Dardanus in 412-399 BC. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Zenis (8)', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zeno', 'Zeno', 'The Roman emperor Zeno.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenobia', 'Zenobia', 'Queen of Palmyra. Self proclaimed Augusta AD 272.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenodorus_chalcis', 'Zenodorus of Chalcis', 'Zenodorus was the ruler of small principality of Chalcis in the vicinity of Damascus described by Josephus as the \"house of Lysanias\", 23-20 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenodotos_chios', 'Zenodotos', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2427', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenon_abdera', 'Zenon', 'An individual who issued coins at the ancient city of Abdera, 386/385-375 BC. See J. May, The Coinage of Abdera (540-345 B.C.) (London, 1966), pp. 44-48.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zenon_maroneia', 'Zenon', 'An individual who issued coins at the ancient city of Maroneia, 386/385-348/347 BC. See E. Schönert-Geiss, Die Münzprägung von Maroneia (Berlin, 1987), pp. 44-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zeuxi_athens', 'Zeuxippos', 'Third magistrate attested in Athens in 119/118 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 564-567 / issue 46 (p. 566); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (119/118 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 192 s. v. Zeuxippos, no. 2; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 517 s. v. Zeuxi-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ziaelas_bithynia', 'Ziaelas of Bithynia', 'Ziaelas was the third king of Bithynia, a son of Nicomedes I', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/ziyadat_allah_abu_muhammad', 'Ziyadat Allah, Abu Muhammad', 'Ziyadat Allah I (Arabic: زيادة الله الأول‎) was the third Aghlabid Emir in Ifriqiya from 817 until his death in 838.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoe_wife_of_leo_vi', 'Zoe Karbonopsina', 'The fourth wife of the Byzantine emperor Leo VI.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoe_daughter_of_constantine_viii', 'Zoe Porphyrogenita', 'The Byzantine empress Zoe Porphyrogenita.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilo_priene', 'Zoilos', 'An individual who issued coins at the ancient city of Priene c. 320-300 BC. Regling completed: Zoilos. Lit.: K. Regling, Die Münzen von Priene (1927) p. 158; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 523.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilos_abydus', 'Zoilos', 'Archon and asiarch in Abydos in c. 161-192 AD. See Th. Corsten, A Lexicon of Greek Personal Names VA Coastal Asia Minor: Pontos to Ionia (2010) s. v. Zoilos (109), (161-192 AD); W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 523 s. v. ΖΩΙΛΟΣ; RPC IV, temp. no. 1470; SNG von Aulock 1456; 7542; SNG Tübingen 2525; NC 1971, pp. 129-30 (coin); Campanile, Sacerdoti 35 (Αἴλ. Ζωΐλος).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilos_i_athens', 'Zoilos', 'First magistrate attested in Athens in 110/109 BC [issue 55]. Previously attested as third magistrate in 116/115 BC [issue 49]. Probably son of Zoilos from Sphettos (Thompson 1961, p. 566). Starting only in the third month of the year 110/109 BC, he held the magistracy together with Euandros. Probably secretary of the council in 121/120 (?) BC (IG II 2. ed. 1015, 1): See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 613-617, 709, 713-722 / issues 49 and 55, commentary on p. 566; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (116/115 and 110/109 BC); Prosopographia Attica 6234 (?) and 6233; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 194 s. v. Zoilos, no. 11; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 523 s. v. Zoilos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilos_ii_athens', 'Zoilos', 'Third magistrate attested in Athens in 110/109 BC. Maybe son of Zoilos, the first magistrate of the same issue: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 714, 716, 718 / issue 55, commentary on p. 566; C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (110/109 BC); Prosopographia Attica 6234; P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 194 s. v. Zoilos, no. 12; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 523 s. v. Zoilos.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilus_i_bactria', 'Zoilus I of Bactria', 'Zoilus I Dikaios was an Indo-Greek king who ruled in Afghanistan and Pakistan and occupied the areas of the Paropamisade and Arachosia previously held by Menander I, around 130-120 B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zoilus_ii_bactria', 'Zoilus II of Bactria', 'Zoilos II Soter was an Indo-Greek king who ruled in eastern Punjab. Bopearachchi dates his reign to c. 55–35 BCE, a date approximately supported by R. C. Senior.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zopy_athens', 'Zopyros', 'Third magistrate attested in Athens in 120/119 BC: See M. Thompson, The New Style Silver Coinage of Athens (1961) nos. 544-550 / issue 45 (p. 577); C. Habicht, Zu den Münzmagistraten der Silberprägung des Neuen Stils, Chiron 21, 1991, p. 5 (120/119 BC); P. M. Fraser – E. Matthews, A Lexicon of Greek Personal Names II Attica (1994) p. 195 s. v. Zopyros, no. 4; W. Leschhorn, Lexikon der Aufschriften auf griechischen Münzen II (2009) p. 524 s. v. Zopy-.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zotimos_amathus', 'Zotimos of Amathus', 'Zotimos was king at Amathus, Cyprus in the 4th century B.C.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/zowalios_paphus', 'Zowalios of Paphos', 'Fifith century king of Paphos in Cyprus', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/-des_cos', '[…]des', 'Magistrate attested on the Alexander coinage of Cos, c. 185-170 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2506', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/-dokles_chios', '[…]dokles', 'Magistrate attested on the Alexander coinage of Chios, c. 190-165 BC. See M. J. Price, Coinage in the Name of Alexander the Great and Philip Arrhidaeus (London/Zurich, 1994), no. 2408', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/abd_al-rabb_ibn_salih_al-kasadi', '`Abd al-Rabb ibn Salih al-Kasadi', '`Abd al-Rabb ibn Salih al-Kasadi was the four ruler of the al-Kasadi dynasty, from 1800 to August 1842.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/umar_ibn_salih_al-kasadi', '`Umar ibn Salih al-Kasadi', '`Umar ibn Salih al-Kasadi is the seventh and final ruler of the al-Kasadi dynasty, ruling from 1873 to 10 November 1881.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'adil_badr_al-din_salamish', 'al-\'Adil Badr al-Din Salamish', 'Badr al-Din Solamish[1] (d. 1291; Arabic: بدر الدين سُلامش‎, royal name: al-Malik al-Adil Badr al-Din Solamish (Arabic: الملك العادل بدر الدين سُلامش‎)) was a Sultan of Egypt in 1279.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'adil_sayf_al-din_abu_bakr_i_ibn_ayyub', 'al-\'Adil Sayf al-Din Abu Bakr I ibn Ayyub', 'Al-Adil I (Arabic: العادل‎, in full al-Malik al-Adil Sayf ad-Din Abu-Bakr ibn Ayyub, Arabic: الملك العادل سيف الدين أبو بكر بن أيوب‎) was an Ayyubid Sultan of Egypt and Syria of Kurdish descent.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'adil_sayf_al-din_abu_bakr_ii', 'al-\'Adil Sayf al-Din Abu Bakr II', 'if ad-Dīn al-Malik al-ʿĀdil Abū Bakr b. Nāṣir ad-Dīn Muḥammad (Arabic: ‏سيف الدين الملك العادل أبو بكر بن ناصر الدين محمد‎, known simply as al-Adil II) was the Ayyubid sultan of Egypt from 1238 to 1240.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'aziz_\'_\'uthman_ibn_yusuf', 'al-\'Aziz \' \'Uthman ibn Yusuf', 'Al-Malik Al-Aziz Osman bin Salahadin Yusuf was a Kurdish ruler and the second Ayyubid Sultan of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'aziz_giyath_al-din_abu_al-muzaffar_muhammad', 'al-\'Aziz Giyath al-Din Abu al-Muzaffar Muhammad', 'Az-Zahir Ghazi (or al-Malik az-Zahir Ghazi; 1172 – 8 October 1216) was a Kurdish governor and then ruler of Aleppo from 1186 to 1216', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'aziz_jamal_al-din_abu_al-mahasin_yusuf', 'al-\'Aziz Jamal al-Din Abu al-Mahasin Yusuf', 'al-\'Aziz Jamal al-Din Abu al-Mahasin Yusuf (841-842/1438) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-\'aziz_billah', 'al-\'Aziz billah', 'Abu Mansur Nizar al-Aziz Billah, commonly known as al-Aziz  (Arabic: أبومنصور نزار العزيز بالله‎) was the fifth Caliph of the Fatimid Caliphate (975–996).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-adid_li-din_allah', 'al-Adid Li-Din Allah', 'Abū Muḥammad ʿAbd Allāh ibn Yūsuf ibn al-Ḥāfiẓ , better known by his regnal name al-ʿĀḍid li-Dīn Allāh (Arabic: العاضد لدين الله‎, \"Support of God\'s Faith\"), also known as al-Azid and al-Athid, was the fourteenth and last Caliph of the Fatimid dynasty, reigning from 1160 to 1171.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-amin', 'al-Amin', 'Muhammad ibn Harun al-Rashid, better known by his regnal name of al-Amin (Arabic: محمد الأمين بن هارون الرشيد‎), was the sixth Abbasid Caliph.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-amir_bi-ahkam_allah', 'al-Amir bi-Ahkam Allah', 'Manṣūr al-Āmir bi\'Aḥkāmi’l-Lāh (Arabic: منصور الآمر بأحكام الله ‎) was the tenth Fatimid Caliph (1101–1130).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-ashraf_muzaffar_al-din_abu_al-fath_musa', 'al-Ashraf Muzaffar al-Din Abu al-Fath Musa', 'Al-Ashraf Musa Abu\'l-Fath al-Muzaffar ad-Din, called Al-Ashraf (died 27 August 1237) was a ruler of the Ayyubid dynasty in Diayr Bakr (Mayyaafariqin and Jabal Sinjar) unitl the the Mongol conquest of 1231.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-awhad_najm_al-din_ayyub_ibn_al-\'adil_i', 'al-Awhad Najm al-Din Ayyub ibn al-\'Adil I', 'Al-Malik Al-Awhad ibn al-Adil Najm ad-Din Ayyub ibn al-Adil Abi Bakr ibn Ayyub (d. 1210) was the third Ayyubid ruler (emir) of the Diyarbakir principality centered in Mayyafariqin between 1200-1210 CE.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hadi', 'al-Hadi', 'Abu Muhammad Musa ibn Mahdi al-Hadi (Arabic: أبو محمد موسى بن المهدي الهادي‎) was the fourth Abbasid caliph who succeeded his father Al-Mahdi and ruled from 169 AH (785 AD) until his death in 170 AH (786 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hafiz_b_al-hasan', 'al-Hafiz b. al-Hasan', 'Abdelhafid of Morocco (or Mulai Abdelhafid) (Arabic: عبد الحفيظ‎) was the Sultan of Morocco from 1908 to 1912.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hafiz_li-din_allah', 'al-Hafiz li-Din Allah', 'Al-Ḥāfīz (Arabic: الحافظ‎ ) was the eleventh Caliph of the Fāṭimids (r. 1130–1149).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hakam_i', 'al-Hakam I', 'Al-Hakam Ibn Hisham Ibn Abd-ar-Rahman I (Arabic: الحكم بن هشام‎) was Umayyad Emir of Cordoba from 796 until 822 in the Al-Andalus (Moorish Iberia).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hakam_ii_al-mustansir_billah', 'al-Hakam II al-Mustansir billah', 'Al-Hakam II (al-Ḥakam II ibn ʿAbd al-Raḥmān III; Arabic: الحكم الثاني ابن عبد الرحمن‎) was the second Caliph of Córdoba and son of Abd-ar-Rahman III (al-Nasir). He ruled from 961 to 976.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hakim_bi-amr_allah', 'al-Hakim bi-Amr Allah', 'Abu ‘Ali Mansur Tāriqu al-Ḥākim (985 – 13 February 1021), also known as Al-Hakim bi Amr Allāh (Arabic: الحاكم بأمر الله‎; literally \"Ruler by God\'s Command\"), was the sixth Fatimid caliph[1] and 16th Ismaili imam (996–1021).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hasan_i', 'al-Hasan I', 'Hassan I of Morocco (Arabic: الحسن الأول‎) was Sultan of Morocco from 1873 to 1894.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hasan_al-a\'sam_ibn_ahmad', 'al-Hasan al-A\'sam ibn Ahmad', 'al-\'Aziz Jamal al-Din Abu al-Mahasin Yusuf (841-842/1438) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-hassan_al-\'awdi', 'al-Hassan al-\'Awdi', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-jamali_mamluks', 'al-Jamali', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-kamil_muhammad_i_ibn_al-\'adil_i', 'al-Kamil Muhammad I ibn al-\'Adil I', 'Al-Kamil (Arabic: الكامل‎) (full name: al-Malik al-Kamil Naser ad-Din Abu al-Ma\'ali Muhammad) was a Kurdish ruler, the fourth Ayyubid sultan of Egypt.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-ma\'mun', 'al-Ma\'mun', 'Abū Jaʿfar Abdullāh al-Maʾmūn ibn Harūn (also spelled Almamon, Al-Maymun, Al-Ma’moon, and el-Mâmoûn (Arabic: ابوجعفر عبدالله المأمون‎, Persian: ابوجعفر عبدالله مامون‎) was an Abbasidcaliph who reigned from 813 until his death in 833.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mahdi', 'al-Mahdi', 'Abu Abdallah Muhammad ibn Abdallah al-Mansur (Arabic: أبو عبد الله محمد بن عبد الله المنصور‎), better known by his regnal name al-Mahdi bi-\'llah (المهدي بالله, \"He who is guided by God\"), was the thirdAbbasid Caliph who reigned from 775 to his death in 785.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mahdi_muhammad_i_bin_idris', 'al-Mahdi Muhammad I bin Idris', 'al-Mahdi Muhammad I bin Idris (438-446/1047-1055) was one of the ruling members of the Hammudid dynasty of Malaga during the Muluk al-Tawa\'if/Petty Kings period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-malik_mamluks', 'al-Malik', 'An official whose name appears on Mamluk glass weights.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-malik_al-mansur_\'umar_b_ali', 'al-Malik al-Mansur \'Umar b. Ali', 'al-Malik al-Mansur \'Umar b. Ali (626-647/1229-1250) was the of the Rasulids (بنو رسول, Banū Rasūl) who were a Sunni[1] Muslim dynasty that ruled Yemen from 1229 to 1454.', 'http://xmlns.com/foaf/0.1/Person');
INSERT INTO `coin_people` (`link`, `Label`, `Description`, `idk`) VALUES
('http://nomisma.org/id/al-mansur', 'al-Mansur', 'Al-Mansur or Abu Ja\'far Abdallah ibn Muhammad al-Mansur (Arabic: أبو جعفر عبدالله بن محمد المنصور‎) was the second Abbasid Caliph from 136 AH to 158 AH (754 AD – 775 AD).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mansur_fakhr_al-din_\'uthman', 'al-Mansur Fakhr al-Din \'Uthman', 'Al-Malik al-Mansur Fakhr ad-Din Uthman ibn Jàqmaq, more simply known as Al-Mansur Uthman (in Arabic الملك المنصور فخر الدين عثمان بن جقمق, al-Malik al-Mansur Fahr ad-Dīn ʿ Uthman ibn Jaqmaq) was Sultan of Cairo\'s Mamluk dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mansur_muhammad_ibn_al-\'aziz_\'uthman', 'al-Mansur Muhammad ibn al-\'Aziz \'Uthman', 'Al-Mansur Nasir al-Din Muhammad (Arabic: ‏المنصور ناصر الدين محمد بن العزيز‎) was Kurdish and the third Sultan of Egypt of the Ayyubid Dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mansur_nur_al-din_ali', 'al-Mansur Nur al-Din Ali', 'Al-Mansur Ali (Arabic: المنصور على ) (epithet: Al-Malik Al-Mansur Nour al-Din Ali Ben al-Malik al-Mu\'izz Aybak (Arabic: الملك المنصور نور الدين على بن الملك المعز أيبك ) was the second of the Mamluk Sultans of Egypt in the Turkic, or Bahri, line.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mansur_sayf_al-din_abu_bakr', 'al-Mansur Sayf al-Din Abu Bakr', 'Saif ad-Din Abu-Bakr (Arabic: سيف الدين أبو بكر, royal name: al-Malik al-Mansur Saif ad-Din Abu Bakr (Arabic: الملك المنصور سيف الدين أبو بكر) was a Mamluk sultan of Egypt in 1341.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mansur_billah', 'al-Mansur billah', 'Abu Tahir Ismail al-Mansur Billah  (Arabic: المنصور بالله الفاطمي‎) was the third Caliph of the Fatimid Caliphate in Ifriqiya (r. 946-953).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'ayyad_abu_al-fath_ahmad', 'al-Mu\'ayyad Abu al-Fath Ahmad', 'al-Mu\'ayyad Abu al-Fath Ahmad (865/1461) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'ayyad_shaykh', 'al-Mu\'ayyad Shaykh', 'al-Mu\'ayyad Shaykh (815-824/1412-1421) was a Mamluk sultan during the Burji (Circassian) period.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'azzam_ghiyath_al-din_turanshah_iv_ibn_ayyub', 'al-Mu\'azzam Ghiyath al-Din Turanshah IV ibn Ayyub', 'Turanshah, also Turan Shah (Arabic: توران شاه‎), (epithet: al-Malik al-Muazzam Ghayath al-Din Turanshah (Arabic: الملك المعظم غياث الدين توران شاه‎)) was a Kurdish ruler, a son of Sultan As-Salih Ayyub. A member of Ayyubid Dynasty, he became Sultan of Egypt for a brief period in 1249–50.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'izz_li-din_allah', 'al-Mu\'izz li-Din Allah', 'Abu Tamim Ma\'ad al-Mu\'izz Li-Dinillah (Arabic: معد المعز لدين الله‎ \"Fortifier of the religion of God\"), also spelled as al-Moezz, was the fourth Fatimid Caliph and 14th Ismaili imam, and reigned from 953 to 975.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'tadid_billah', 'al-Mu\'tadid billah', 'Abu\'l-Abbas Ahmad ibn Talha al-Muwaffaq), better known by his regnal name al-Mu\'tadid bi-llah (Arabic: المعتضد بالله‎, \"Seeking Support in God\") was the Abbasid Caliph in Baghdad from 892 until his death in 902.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'tamid_\'ala_allah', 'al-Mu\'tamid \'ala Allah', 'Al-Mu\'tamid (المعتمد al-Muʿtamid) was the Abbasid Caliph in Baghdad from 870 to 892 and eldest surviving son of al-Mutawakkil. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'tasim_billah', 'al-Mu\'tasim billah', 'Abū Isḥāq Muḥammad ibn Hārūn al-Rashīd (Arabic: أبو إسحاق عباس بن هارون الرشيد‎), better known by his regnal name al-Muʿtaṣim bi’llāh (المعتصم بالله, \"he who seeks refuge in God\"), was the eighthAbbasid caliph, ruling from 833 to his death in 842.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mu\'tazz_billah', 'al-Mu\'tazz billah', 'Al-Mu\'tazz (Arabic: المعتز‎) was the title of the Abbasid Caliph in Baghdad from 866 to 869, during the \"Anarchy at Samarra\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-muhtadi_billah', 'al-Muhtadi billah', 'Al-Muhtadi  (Arabic: المهتدي‎) was the Abbasid Caliph in Baghdad from 869 to 870, during the \"Anarchy at Samarra\".', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-muktafi_billah', 'al-Muktafi billah', 'Abû Ahmad ʿAlî ibn Ahmad al-Muʿtamid (Arabic: أبو أحمد علي بن أحمد المعتمد‎), better known by his regnal name al-Muktafi bi-Allah (Arabic: المكتفي بالله‎, \"Content with God Alone\"[1]), was the AbbasidCaliph in Baghdad from 902 to 908.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-muntazar_bi-amr_allah', 'al-Muntazar bi-Amr Allah', 'Interregnum rule by Fatimid caliph al-Hafiz as regent but not yet as caliph with coins in the name of al-Muntazar, the Expected Ones.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-muqtadir_billah', 'al-Muqtadir billah', 'Abu \'l-Fadl Ja\'far ibn Ahmad al-Mu\'tadid (Arabic: أبو الفضل جعفر بن أحمد المعتضد‎), better known by his regnal name al-Muqtadir bi-Allah (Arabic: المقتدر بالله‎, \"Mighty in God\"), was the AbbasidCaliph in Baghdad from 908 to 932 CE (295-320 AH).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-musta\'in_billah', 'al-Musta\'in billah', 'Ahmad ibn Muhammad (Arabic: أحمد بن محمد‎;), better known by his regnal name (المستعين بال, \"He who looks for help to God\") was the Abbasid Caliph from 862 to 866, during the \"Anarchy at Samarra\". ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-musta\'in_billah_abu_al-fadl_al-\'abbas', 'al-Musta\'in billah, Abu al-Fadl al-\'Abbas', 'Al-Musta\'in Billah (Arabic: المستعين بالله‎) was the tenth Abbasid \"shadow\" caliph of Cairo, reigning under the tutelage of the Mamluk sultans from 1406 to 1414.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-musta\'li_billah', 'al-Musta\'li billah', 'Abū’l-Qāsim ʿAhmad al-Mustā‘lī b’il-Lāh, (Arabic: أبو القاسم أحمد المستعلي بالله‎) was the ninth Fatimid Caliph, and believed by the Mustaali Ismaili sect to be the 19th imam.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mustadi', 'al-Mustadi', 'Hassan al-Mustadi Ibn Yusuf al-Mustanjid  (Arabic: المستضيء بأمر الله‎) was the Abbasid Caliph in Baghdad from 1170 to 1180.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mustansir_billah', 'al-Mustansir billah', 'Abū Tamīm Ma\'add al-Mustanṣir bi-llāh was the eighth caliph of the Fatimid Caliphate from 1036 until 1094.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mustansir_baghdad', 'al-Mustansir billah', 'Al-Mustansir Billah, was born in Baghdad on 1192. On his father\'s death in 1226 he has succeeded his father Az-Zahiras the thirty-sixth Abbasid caliph.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-mutawakkil_ala_allah', 'al-Mutawakkil ala Allah', 'Jaʿfar ibn Muhammad al-Muʿtasim bi\'llah (Arabic: جعفر بن محمد المعتصم بالله‎), better known by his regnal name al-Mutawakkil ʿala Allah (المتوكل على الله, \"He who relies on God\") was anAbbasid caliph who reigned in Samarra from 847 until 861.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-muttaqi_lillah', 'al-Muttaqi lillah', 'Al-Muttaqi (Arabic: المتقي‎) was the Abbasid caliph in Baghdad from 940 to 944.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-nasir_muhammad', 'al-Nasir Muhammad', 'Al-Nasir Muhammad (Arabic :الناصر محمد‎ Epithet: al-Malik al-Nasir Nasir al-Din Muhammad ben Qalawun)( Arabic: الملك الناصر ناصر الدين محمد بن قلاوون) ( Nickname: Abu al-Ma\'ali (أبو المعالى ‎) was the ninth Mamluksultan of Egypt who was inaugurated three times, from December 1293 to December 1294, from 1299 to 1309 and from 1309 till his death in 1341.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-nasir_li-din_allah', 'al-Nasir li-Din Allah', 'Al-Nasir li-Din Allah (1158 – 2/6 October 1225) (Arabic: الناصر لدين الله‎) was the 34th Abbasid Caliph in Baghdad from 1180 until his death.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-qa\'im_bi-amr_allah', 'al-Qa\'im bi-Amr Allah', 'Abu\'l-Qasim Muhammad ibn al-Mahdi (Arabic: أبو القاسم محمد بن المهدي القائم بأمر الله‎), better known by his regnal name al-Qa\'im bi-Amr Allah or bi-Amri \'llah (القائم بأمر الله, \"He who carries out God\'s orders\"), was the second caliph of the Fatimid Caliphate in Ifriqiya and ruled from 934 to 946.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-qahir_billah', 'al-Qahir billah', 'Abu Mansur Muhammad al-Qahir bi\'llah (Arabic: أبو منصور محمد القاهر بالله‎), usually known simply by his regnal title al-Qahir bi\'llah (Arabic: القاهر بالله‎, \"Victorious by the will of God\"), was the 19th Abbasid Caliph in Baghdadfrom 932 to 934. ', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-qasim_ibn_\'ubayd_allah', 'al-Qasim ibn \'Ubayd Allah', 'Abu \'l-Husayn al-Qasim ibn Ubayd Allah was a senior official of the Abbasid Caliphate who served as vizier from April 901 until his own death in October 904.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-radi_billah', 'al-Radi billah', 'Abu \'l-Abbas Muhammad ibn Ja\'far al-Muqtadir (Arabic: أبو العباس محمد بن جعفر المقتدر‎), usually simply known by his regnal name al-Radi bi-llah (Arabic: الراضي بالله‎, \"Content with God\", was theAbbasid Caliph in Baghdad from 934 to his death at the age of thirty-three in 940.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-saffah', 'al-Saffah', 'Abu al-`Abbās `Abdu\'llāh ibn Muhammad as-Saffāḥ, or Abul `Abbas al-Saffaḥ (Arabic: \'‎أبو العباس عبد الله بن محمد السفاح) (reigned 749–754 AD) was the first caliph of the Abbasid caliphate.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-salih_\'imad_al-din_isma\'il', 'al-Salih \'Imad al-Din Isma\'il', 'Imad ad-Din al-Malik as-Salih Ismail bin Saif ad-Din Ahmad better known as as-Salih Ismail (Arabic: الصالح إسماعيل‎) was a Kurdish ruler, the Ayyubid sultan based in Damascus. He reigned twice, once in 1237 and then again from 1239-45.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-salih_isma\'il_ibn_mahmud', 'al-Salih Isma\'il ibn Mahmud', 'As-Salih Ismail al-Malik who died in 1181 was an emir of Damascus in 1174, the son of Nur ad-Din Zangi.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-wathiq_billah', 'al-Wathiq billah', 'Abu Ja\'far Harun ibn Muhammad al-Mu\'tasim (Arabic: أبو جعفر هارون بن محمد المعتصم‎), better known by his regnal name al-Wathiq bi\'llah (واثق بالل, \"He who trusts in God\"), was an Abbasid caliph who reigned from 842 until 847 AD (227–232 AH in the Islamic calendar).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-yazid_ibn_muhammad', 'al-Yazid ibn Muhammad', 'Yazid (Arabic: اليزيد بن محمد‎) was Sultan of Morocco from 1790 to 1792, and was a member of the Alaouite dynasty.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-zahir_ghiyath_al-din_ghazi', 'al-Zahir Ghiyath al-Din Ghazi', 'Az-Zahir Ghazi (or al-Malik az-Zahir Ghazi) was a Kurdish governor and then ruler of Aleppo from 1186 to 1216.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-zahir_bi-amr_allah', 'al-Zahir bi-Amr Allah', 'Az-Zahir or Al-Dhahir (Arabic: الظاهر بأمر الله Aẓ-Ẓāhir bi-Amr Allāh‎ | in full: أبو النصر محمد الظاهر بأمر الله بن أحمد الناصر) was the Abbasid Caliph in Baghdad from 1225 to 1226.', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/al-zahir_li-a\'zaz_din_allah', 'al-Zahir li-A\'zaz Din Allah', 'ʻAlī az-Zāhir (20 June 1005 – 13 June 1036) (Arabic: الظاهر بالله‎) was the Seventh Caliph of the Fātimids (1021–1036).', 'http://xmlns.com/foaf/0.1/Person'),
('http://nomisma.org/id/de_ponte_nicolo', 'de Ponte, Nicolo (1578-1585)', 'Nicolò da Ponte (15 January 1491 - 30 July 1585) was the eighty seventh Doge of Venice. He reigned in a fairly quiet period.', 'http://xmlns.com/foaf/0.1/Person');
